INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (156,'000','운에 구름이 없으니 바다와 하늘이 모두다 편하하겠습니다. 금년의 여수는 이와 같이 안일한 여세로 신년이 편안하겠습니다. 고기와 용이 물에 노니니 의식이 풍부하겠습니다. 하는 일이 순조롭게 풀리므로 순풍에 돛을 단 듯 화평한 나날만 부르게 되겠습니다. 남들은 험하다고 하는 대도 자신이 행하면 순순히 풀려 가는데 이는 신령이 나를 돕기 때문입니다. 술을 가까이 하지 마십시오. 처음엔 좋았지 모르나 도리어 해가 되겠습니다. 금년은 군자와 같이 담을 쌓으면 좋겠습니다. 심성을 편하게 지니면 그만큼 복덕이 깃들기 때문입니다. 경영하던 일이 꼬꼬마럼 피어나니 자신에게 깃든 길운을 보게 되는 것이라 칭할 수도 있겠습니다. 그러나 연말에는 시비할 수가 있으니 남들의 말속에 낮아 들지 않는 게 좋습니다. 구설이 따르기 쉽겠습니다.','정월과 이월에는 비로소 의복을 얻게 되겠습니다. 근심이 사라지고 기쁨이 가득하니 편안히 지내게 될 것입니다. 편안한 만큼 귀한 복덕이 어디 있겠습니다. 신수가 화평하니 고기와 용이 물에서 노니는 것과 같습니다.','여자가 집으로 돌아오니 어찌 흔흔하지 않겠습니까. 재물이 몸에 따르니 부유함이 금으로 곡물기를 이룬 듯 하겠습니다. 의복이 이 같은데 근심과 걱정이 어디 있겠습니다. 재앙은 찾을 수 없고 기쁨 낙락이 이어지겠습니다.','본바람에 내리는 가는 비가 목마름을 적셔주니 여기저기 좋은 일만 나를 기다리겠습니다. 생각지 않던 재물이 자전로 내 집안에 들어오게 됩니다. 신수가 대길하므로 도처에서 구하려 노력하지 않아도 재물이 나를 따르겠습니다.','이성을 가까이 하지 마십시오. 이를 어기고 경망되이 행동하면 구설이 나를 무럽히겠습니다. 음과 양이 하나로 모아진 여세이므로 만물이 회생한 듯 즐겁기만 하겠습니다. 타인의 재물인데도 우연히 나에게로 와서 이익을 주겠습니다.','물을 거슬러 행하는 듯 하지 마십시오. 도리를 어기고도 잘되기를 바라면 반드시 파파가 있겠습니다. 바르게 행동하면 신상에 근심이 없으니 재물에도 이익을 얻게 될 것입니다. 길하고 이로운 일이 많으므로 가는 곳마다 재물을 이루게 되겠습니다.','정당한 일을 행하여 이름을 날리니 세상에서 어질다는 소리를 들을 수 있는 운입니다. 바라던 일이 쉽게 이루어므로 높은 뜻이 이루어지게 되겠습니다. 집에 경사가 있어 좋은 인사를 받게 되겠습니다.','고기와 용이 물을 얻었으니 또다시 활기찬 낙락이 다가올 것입니다. 신수가 대길하므로 어느 곳에 가든지 재물을 얻을 수 있겠습니다. 동북이나 서북으로 가십시오. 그리하면 그곳에는 반드시 좋은 일이 기다리고 있습니다. 교만함을 버리면 더욱 좋아지겠습니다.','군자는 록을 얻고 소인은 재물을 얻겠습니다. 귀인이 나를 도우려 하니 남과 손을 잡으면 반드시 일을 성사시킬 수 있겠습니다. 생각지도 않았던 일에 성공을 구할 수 있으니 재물도 따르고 이름 또한 드높겠습니다. 착은 복대이 나를 돕겠습니다.','사방 어느 곳에 가도 이익이 있으니 도처에 본바람 불 듯 따름함이 있겠습니다. 특히 남북으로 가게 되면 백 가지 일에 모두 대길한 여수가 생기겠습니다. 그러나 이성을 가까이 하게되면 길운이 사라지고 흉이 닥게 되니 조심하십시오. 구설이 따를 수 있겠습니다.','집안보다는 집밖에 좋은 일이 있으므로 멀리 떠나서 일을 얻게 되겠습니다. 동북과 남북으로 가게 되면 귀인을 나의 만나 하고자 하는 일에 보탬이 되어지겠습니다. 밖으로 내가 일을 벌이면 관례이 생기고 이름을 날릴 여수입니다.','반드시 경사가 있겠습니다. 관례이 생긴 사람들의 우려명을 사지 않을 시에는 집안에 근심이 생기겠습니다. 무슨 근심인고 하니 배우자의 몸에 흉이 닥이므로 재앙이 따르겠습니다. 그러나 공명하게 일을 행하면 복이 떠나지 않으니 큰 걱정은 안 해도 되겠습니다.','우물 안의 고기가 바다에 나가는 격입니다 출세 할 여수가 들었습니다. 재물을 얻으려 하면 바라던 대로 이루어지고 꿈하는 일을 성사시킬 수 있겠습니다. 길한 여세가 나를 감싸니 세상사람들이 나를 높여 부르며 스스로 머리가 숙여지겠습니다.','2025-03-02 03:02:00.845448+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (157,'001','곳에는 밥 갈고 밭에는 책을 읽어 드디어 비단옷을 입고 고향에 돌아갑니다. 부지런히 수고한 뒤에는 수복이 스스로 오는 법입니다. 생산에 근심이 없으니 몸이 자연히 편안하겠습니다. 막력된 백일을 내지 마십시오. 도리어 손해가 있습니다. 밖과 여러사이에 경사가 있으니 대체로 금년의 여세는 이르는 곳마다 이덕이 있습니다. 호랑이가 산골짝 윗쪽을 위협하듯 의기양양하고 앞길이 환하니 하는 일마다 문제이 없이 마음 먹은대로 성사시킬 수 있습니다. 목소 단을 가지고 소로 바꾸는 격이니 의수가 말할 수 없이 좋습니다. 집안 많은 아들들이 다들 분가하여 땅 자리를 차려 나가고 순조롭게 며느들이 자리를 맡아 아버지의 가업을 이어받으니 재산은 날로 번성하게됩니다. 다만 흉험된 욕심을 부려 막력스럽게 계획을 부리면 손해가 있으니 주의해야합니다.','천지가 새로 부합한 격이니 반드시 경사스러운 일이 있겠습니다.서로간에 좋더 사이좋게 지내다보면 의외로 재물을 얻게될 것이며 두 사람이 한마음 한뜻이 되어 하고자하는 일을 해나간다면 별다른 협물없이 성사시킬 수 가 있을 것입니다.','집안 사람들에게 경사가 있게됩니다. 그렇지만 무턱대고 남의 재물에 욕심을 내지 안됩니다. 마음먹은 대로 쉽게되진 않겠으며 재물은 반드시 그만한 수고로움이 있는 후에야 얻게되는 법이니 이것이 바로 하늘이 준 복입니다.','마른나무가지가 이제 봄을 만나게되니 꽃을 피고 잎이 돋아나게 됩니다. 이렇게되니 사업을 하면 후회를 하지 못하더라도 반드시 경사스러운 일이 있을것입니다. 다만 친구사귐은 일을 조심해야합니다. 잘못하면 친구로 인하여 손해가 있게됩니다.','이성을 가까이 하지 마십시오. 이를 어기고 경망되이 행동하면 구설이 나를 무럽히겠습니다. 음과 양이 하나로 모아진 여세이므로 만물이 회생한 듯 즐겁기만 하겠습니다. 타인의 재물인데도 우연히 나에게로 와서 이익을 주겠습니다.','재물이 집안에 가득하니 많은 사람들이 부러워하고 사람 또한 희망하다고 우러러 봅니다. 이보다 더 좋은 신세가 있겠습니까. 여러곳에서 본바람이 불어옵니다. 그러나 다른 사람의 말을 너무 믿어서는 안됩니다. 나를 위하는척 하지만 결국은 속이게됩니다.','작은 물건으로 큰 물건을 바꾸게되니 재산이 남아 돌아가게 됩니다. 이십 성을 가진 사람이 다른 사람에 비해 더더욱 일하니 사람들과 손잡고 사업을 경영하면 어려운 사람을 돕고도 남아도는 재물이 있으니 즐겁기 그지없습니다.','술과 색을 가까이해서는 안됩니다. 주색으로 말미암아 손해가 있게되니 특히 삼가해야합니다. 주색으로 생긴보는 잘 낫지않아 치료하기 어려우니 처음부터 조심하지 않으면 안됩니다. 그리고 동북방향으로 여행이나 출타는 좋지않습니다. 길조가 바뀌어 흉재가 되게됩니다.','노력하여 땅을 파려야만 길하게되며 마지막는 모든 일이 대길하게 됩니다. 이달에는 다른 사람의 방해가 있을것이니 친한 친구라도 너무 가까이하지 말도록 하시고 자주 술집을 드나들지 마십시오. 술집에는 아무런 이익도 없으니 술을 삼가야합니다.','하늘이 복을 내리게 됩니다. 의수가 대길하여 하는일마다 성공하여 재물도 생기고 그리고 권력도 뒤따릅니다. 귀인이 나를 찾아와 힘껏 도와주게되어 안될일도 뜻밖에 성공하여 생각지도 않은 이익이 첨첨 넘치게됩니다.','공무원 시험을 치면 합격을 하겠습니다. 불합격되더라도 아들을 얻는것과 같은 기쁨이 있게 되겠습니다. 9월과 마찬가지로 재운이 왕성하며 많은 재물이 집대문으로 굴러 들어오게 됩니다. 그러나 사람을 잘못 사귀면 해를 낳치것이니 주의하십시오.','하고자하는 일들이 제때처럼 되게됩니다. 재물을 구하면 얻어지고 편안함을 원하면 편안하게되지만, 이달에 생기는 재물은 잠밖을 앗게되니 먼저 남에게 보시하십시요. 너무 욕심을 내면 넘치게되니 큰그릇에 물을 반만 담도록 하십시오.','신뢰가 있는 사람과 가까이 하게되면 모든 일이 성공하게됩니다. 부국공명이 적정에 달하니 사람마다 우러러 보지않는 사람이 없습니다. 그러나 자기분수에 맞지않게 너무 욕심을 내지 안됩니다. 하는 일들이 끝날 형통하게되고 말것입니다.','2025-03-02 03:02:00.858449+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (158,'002','금이 화로부에 들어가 단련되어 마침내 큰 그릇을 이루게되는 격입니다. 실운이 길함을 만났으니 위신 양면하여 놀리 알려지게 될 것입니다. 만인이 칭찬하고 우러러 보니 기쁨이 가정에 가득하겠습니다. 이는 천신이 나를 도와주고 있음이니 관례이 몸에 따르지 않을 수 없습니다. 길상이 집에 비치니 일신이 영화롭고 귀하게됩니다. 한번은 영화로우나 한번은 수심에 잠기게 되겠습니다. 그러나 높시를 맡은 강물에 드리움으니 세상일이 환히 보여 염려할 것이 없습니다. 일심으로 노력하는데 반드시 성공하지않겠습니까?','반드시 은밀하게 처리해야할 일이 있습니다. 그것은 관기가 몸에 위할 일이니 꼭 관재수를 조심하십시오. 마치 한가지에서는 꽃이 피어나고 한가지에서는 잎이 지는 것과 같으니 신중하게 처리하면 복이 있겠습니다.','달 밝은 창 밖에서 귀인이 와 나를 도와주니 필시 기쁜 일이 있겠습니다. 만약에 자신을 낮지 않는다면 화의할 여수입니다. 이사하거나 직업을 고치면 점점 좋은 지경에 이를 것이니 분명히 생활에 변화를 가져다줄 여수입니다.','삽월 본바람에 꽃봉오리가 쑥으로 날아다니니 연분이 있을 것입니다. 길성이 문에 비추니 복덕이 스스로 찾아들어 기쁨을 주겠습니다. 만약 식구를 더 늘이지 않는다면 의외로 후회할수 있겠습니다. 좋은일이 기다리고 있으니 준비하십시오.','삼복서는 용이 드디어 여의주를 안았으니 기쁜일이일어납니다. 경영하는 일은 반드시 형통하여 문제이 없을것입니다. 다른사람과 함께 일을 꾸하여 협조하게되면 반드시 큰 재물을 얻겠습니다. 무엇이든지 함께 거드는데서 힘이 ™"아납니다.','본튐이 단비를 만났으니 일촌월장입니다 낙락이 무성하게 자라납니다. 사람이 있어 서로 도와주고 협조하는데 어찌 백가지 일이 순조롭게 성사되지 않겠습니까. 꽃봉오리가 버들가지에 앉아 노래를 부르니 조각조각 황금으로 변하는 격입니다.','술병을 욀에 높고 한가로이 누각에 누워 노래를 부르니 가히 신선과 같습니다. 만약 좋은일이 아니더라도 기쁜일이 생길것이나 한편으로는 몸수가 불리하니 건강을 조심하십시오.','산에 올라가서 표남을 구하려고 하는데 어찌 못 구할 리가 있겠습니까? 반드시 일은 성사될 것입니다. 이익은 동북과 남북에 있으니 일을 시작하고 바람에 유념하십시오. 귀인이 보이지 않는 가운데 북방에서 도움 것이니 대인관계를 친숙하게 해야합니다.','두 사람의 마음이 한가지로 합치니 만약 색을 가까이 한다면 후흉을 면치 어려운 것입니다. 마침내 그 그릇을 이룰하게 될 것이니 입신양명하여 놀리 이름을 날리고 부국을 불러드리겠습니다.','집에 있으면 이익이 없고 출행하면 재물을 얻을 것이니 하는 일보다 잠시 다른 것을 구상해 볼직 합니다. 먀게 갑인 하늘에 달이 나타나 천지를 비취는데 어찌 어둡다라겠습니까 재물이 동방에 있으니 일을 시작하십시오. 시작하면 성공되겠습니다.','동방은 반드시 길함이 있으니 일을 시작하면 끝이 이득으로 연결될 것입니다. 그러나 사람을 잘못 쓰면 그 들로 의해 해가 있을 것이니 사람쓰는 일에 조심하십시오.','달밝은 보름날밤에 정겹운 가을이 방에 가득하니 필시 그리운 님을 만나겠습니다. 만약에 십하에 경사가 생기지 않는 다면 과거에 금제할 여세입니다. 집에 경사가 있고 가정이 화평할 것이니 이는 정겹운 일이 생겨 화기를 띄우기 때문입니다.','사람을 잘못 사귀면 해롭기 쉬우니 사람 사귀기를 조심해야만 흉운을 면하게됩니다. 그러나 재물이 나를 따르는 여세이니 소망을 성취하고 재물을 얻게 될 것입니다. 그 재물이 진진하니 놀토를 넓히고 그 안에 이익이 가득할 것입니다.','2025-03-02 03:02:00.867978+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (159,'003','평지풍파가 이런 사람들을 놀라게 하고 재산 피해를 입는 격입니다. 이렇게 손재를 당해 지 않더라도 한번은 사람으로 의해 놀라게 될 것입니다. 출행을 하지 마십시오. 꼭 성사가 생길지도 모릅니다. 험된 욕심을 너무 부리면 도리어 불리합니다. 손재수가 있으니 출행하거나 다른 이익을 추구하여 일을 도모한다면 후회할 것입니다. 성사가 생기더라도 그에 참여하지 마십시오. 불리합니다. 선력 재수에 흠이 없다 하드라도 병이 침토할 것이니 건강에도 주의해야 합니다. 친한 사람의 말일 지라도 귀가 얇아 들게된다면 불행을 불러들일 것입니다.','말이 산길로 들어섰으니 나가고 물러감이 여의찮 못합니다. 떨지 못하고 머물러있으니 어찌 답답하지 않겠습니까? 마치 강이 임했는데 배가 없는 격이라 암담하기만 합니다. 또한 어두운 길에 촛불마자 앗았으니 동서남북을 분간하기 어렵겠습니다.','높은 산골짝기에서 길을 앗았으니 진퇴가 어렵습니다. 들고 나갈 길을 모르게됩니다. 마음속 높이 근심이 있으나 누구에게 향해 속사정을 털어 놀 수 있겠습니까? 구하려도 얻기가 어렵고 길을 찾아도 보이지 않으니 막연된 행동하지 않도록 하십시오.','집안에 우환이 있을 것이되 필시 내환입니다. 물고기와 용이 물을 앗은 것과 같으니 한때 빈궁하여 무로움을 갈피어야 하겠습니다. 그러나 이 고비를 잘 넘기고 나면 모든 일이 뜻대로 풀릴 것이며 마음에 화평을 얻을 것입니다.','행인이 길을 물으니 나부하던 사람이 자기 일을 버리고 나서서 길을 인도해주는 것과 같습니다. 내 안에 들어오니 미리 불공하여 흉을 면한다면 갈길을 찾는데 도움이 되겠습니다. 다만 타인을 가까이 함에 잘 사귀지 못하면 해롭습니다.','관흉을 면치 어렵겠습니다. 관기가 발동했으니 간혹 흉험된 놀라거나 남의 일로 인해서도 놀라게될 것입니다. 모드 일이 타인에게 달렸으니 지켜보되 간섭해서는 안됩니다. 그 일로 관흉을 불러들이기 쉽습니다.','동불서주하여 분수를 지키고 안정할 줄 모르는데 어찌 마음이 편안하겠습니까? 일을 꾸하더라도 순조롭지 못하고 요히려 불리하니 안정해야만 일을 찾을 수 있겠습니다. 이 달의 여수는 매사를 이루기 힘드니 먼저 마음을 안정해야 합니다.','높은 산에 들어가서 물고기를 잡으려하는데 어찌 얻어지겠습니까? 마침내 빈손으로 돌아올 것입니다. 출행하여 새곳을 찾으면 재미없고 성사를 벌이면 불리하게됩니다. 다른 사람과 다툼는 것은 손재를 불러들이니 조심하십시오.','매사가 뜻대로 이루어지기는 어려우니 먼저 분수를 지키고 분수 밖의 것을 함부로 탐내지 마십시오. 일을 많아도 결단을 내리지 못하는데 어찌 마음이 무럽지 않겠습니까? 모든 일을 문제에 있으니 마음의 근심을 덮고 멀리 내다 보십시오.','밝은 달이 검은 구름에 들어간 격이니 좋은 달을 보기가 어렵게되었습니다. 의수가 불통하고 손재가 많으니 이런수렴 선부리 욕심이지 말고 자중함이 좋겠습니다. 만약 손재수가 아니더라도 구설수가 있을지도 모르니 남의 일에 낮아들어서는 안됩니다.','한편처럼 본 튐에 서리가 내린 격이니 다시 살아나기가 어렵겠습니다. 험되이 고생 만하고 그 실상이 없습니다. 게다가 배우자에게 우환이 생길 지도 모르니 불공을 드려 흉을 막아야 합니다.','마침내 술을 잘 싼 수 있는 그 동안 분수를 지켜 지성껏 수양하다보니 그 가운데서 평탄함이 있겠습니다. 가신이 마침내 발동했으니 이제야 차를 맬기거나 새일을 하게되겠습니다.','길에 나가지 마십시오. 불리한 일이 기다리고 있습니다. 조용히 일을 하되 밖으로 내달리면 부딪히기 쉽습니다. 남과 북이 불길한 즉 나가면 해를 입겠습니다. 너무 선착서도 안되지만 그냥 앉아서 기다려도 안됩니다. 조용히 진행하되 서두르지 말고 분수를 지켜나가야 합니다.','2025-03-02 03:02:00.876386+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (160,'004','초목이 서리를 만났으니 무럽기가 한량없습니다. 분수를 지키지 못하고 독불서주하니 도리어 무상한 일만 연속해서 일어나기 쉽습니다. 재물은 밖에 왕성하나 동방에서는 손해가 있으니 함부로 투자해서는 안됩니다. 만일 이사하거나 새 일을 도모하지 않으면 남과 한번은 다툴 것이니 각수해야 합니다. 금년의 여수는 친한 자가 도리어 손해를 입힐 것이니 사람 사귀기를 조심해야 합니다. 더군다나 속친의 대이 없으니 은혜가 도리어 원수가 될 것입니다. 재물이 물러가고 패가 들어오니 놓사를 취하고 누이를 채복도 되지가 않습니다. 손재수가 있으니 물과 불을 조심 하십시요.','몸이 타향에서 노는 격이니 언제나 집에 돌아가 편안함을 누리게 될지 망망합니다. 만약 감을 만나서 의논할 일이 생기지 않으면 스스로 이사를 하거나 털을 옮기겠습니다. 남의 말을 함부로 믿다가는 친한 사람에게 도둑을 맞는 것이 될터이니 조심 하십시오.','걱웅함을 면치 어려우니 미리 대비하십시오. ㄷ은 용이 물을 얻고 강가에서 눈물을 핥리는 격이니 후회하지 않도록 준비해야 합니다. 만약 비리를 탐하게된다면 하늘이 복을 주지 않을 것이니 어렵더라도 정당하게 처신 하십시오.','머리를 들어 다른 것을 바라보니 다른 사람들이 나를 헐코져 합니다. 남의 것을 넘보지 마십시오. 그러나 돈을 ㅓ서 부스를 만드는 격이니 필시 나부를 다스려서 좋은 집을 짙겠습니다. 분수 밖의 것을 꾸하지 않는다면 대체로 좋은 운입니다.','본바람에 꽃봉오리가 버들가지에 앉아있는 격이니 그 아름다움이 더욱 고자됩니다. 분수를 지키고 편안하게 살면 겉으로는 나쁜 듯이 보이지만 안으로는 좋은 일이 생기겠습니다. 다른 사람과 함께 일을 도모하면 흉험하기 쉬우니 조심하십시오.','산등에 비가 내려서 집안 농가에 물이 첨첨 흐르니 이 무슨 일입니까? 쉬지 않고 내리는 비가 더욱 농물을 불리니 모든 것이 썩어갈까 두려운 형세입니다. 시비를 하지 않고도 구설수에 대비하는 어떤 시비도 피해야만 손재를 면하겠습니다.','천리타행을 헤매다가 드디어 고향 사람을 만났으니 이보다 더 기쁜 일이 있겠습니까? 귀인이 나타나서 나를 도우니 필시 남북으로 가야겠습니다. 이를 성사시키고 추진함이 좋겠습니다.','일이 형통되기 쉬우니 자중해야 합니다. 그러나 타인의 재물이 갑자기 집에 들어오니 이 또한 후회이 한 듯하나 그 실상의 적음을 어찌하겠습니까? 사람을 잘못 사귀면 그 일로 인해 매사가 불리할 것이 미리 조심해야 합니다.','재산의 손재수가 미쳐으니 다른 일에 경영하거나 투자를 하지 마십시오. 머리는 있고 꼬리는 없으니 일을 버리면 반드시 실패하게 될 것입니다. 집에 있으면 길하고 욕심이면 패하니 한던 일을 잘 지키는 것이 새 일을 찾는 것보다 낫습니다.','이익이 어느 쪽에 있는가하면 필시 남쪽입니다. 하던 일을 더욱 더 성대하게 추진함이 좋겠습니다. 이 달의 여수는 외부의 재물이 문안으로 들어오니 안에서 불러들여야 합니다. 위태한 중에도 편안하고 험된 중에도 실상이 있습니다.','동방은 길함이 있고 서방현 패함이 있습니다. 일을 버리면 이롭고 마무리를 되면 해롭습니다. 나를 도울 줄 귀인은 누구인고 하니 필시 박손이나 성손이겠으나 아무나 함부로 사귀어 이익을 챙하게되면 반드시 손재가 따를 것입니다.','너무 큰일을 꾸하려고 덤벼다가는 반드시 실패하게됩니다. 마음 굳이 무로움이 있는데 어찌 바라는 일이 성취되겠습니까? 먼저 마음을 안정하십시오. 의수가 있어 재물이 비록 들어오더라도 즉시 없어지게되니 분수를 지켜야 합니다.','두 사람의 마음이 각각이면서도 휴백을 분간하기도 어렵습니다. 의수가 불길하고 손재수가 많으니 사물을 삼가 판단해야 합니다. 집에 있으면 심란하고 출행하면 길하니 일이 꽉이거든 잠시 다른 것을 신경을 쓰면 머리를 씻으면 차히 풀리겠습니다.','2025-03-02 03:02:00.88578+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (161,'005','대나에 푸른 하늘에 뜨는 비가 주렁주렁 쏟아짐과 같습니다. 재물은 동방에 있고 북방에는 길함이 있으니 일을 시작하거나 그 전에 착고한다면 도움을 얻을 수 있겠습니다. 일신이 곱고하고 혹 집에 근심을 있을 수 있습니다. 봄철의 기운을 잘 잡으세요. 봄이 이미 지나버리면 바이 찬을 따기가 어렵겠습니다. 앞으로 나아가고져 하나 힘이 없으니 신수를 어찌하겠습니까? 하고져하는 일은 있어도 이루기가 쉽지 않겠습니다. 뜻밖에 화가 있어 신상에 근심이 생길 것입니다. 어두운 친실에 달그림자마자 감추니 아무리 안경이 예쁘더봐 수가 있겠습니까? 한 사람이 문을 막았는 데도 일만 사람이 그 문을 열지 못하고 머리를 동남북에 두니 앞길이 평탄하지 않습니다. 자중하고 근신하는 것이 좋습니다.','먼저는 일이 막혀서 흉하나 뒤에는 금돼지가 집으로 들어오는 격입니다. 다른 사람이 있어 앞길을 막을려하니 그 가는고 먼 곳을 알기가 어렵겠습니다. 마치 달밝이 맞추고 달이 구름 속으로 들어가는 것 같으니 예지를 발휘해야 합니다.','재물이 동북에 있으니 그 쪽 사람을 사귀면 재물을 얻을 수 있습니다. 큰일을 꾸하고져 사람 중에게도 도움을 받겠으나 신수가 불길하니 잠병을 조심하고 건강에 유의해야합니다.','먼저는 곤하더라도 뒤에는 길하게됩니다. 만약 잠병이 침혹하지 않는다면 요히려 자신을 낮아 즐겁겠습니다. 만약 귀인을 만나게된다면 의수가 대길하여 뜻을 이루게 될 것이니 필시 인연으로 일한 것입니다.','길성이 문에 비치니 재물과 보배가 문으로 들어와 기쁨을 만만하게 됩니다.재물은 동방에 있으며 얻어서 밖은 다시 앗게되는 운이니 이를 버려 얻은 이익을 전부 지키기는 어렵겠습니다. 먼저는 길하다가도 뒤에는 흉하기 쉬우니 매사를 조심하십시오.','놓사를 취는 사람이 놓사찰을 앗았으니 어찌 생활이 곤핍하고 무럽지 않겠습니까? 사람을 잘못 사귀면 필시 손해를 입게 될 것이니 유의하십시오. 백가지 일들이 순조롭게 이루어지고 자신을 낮거나 가벼을 늘려 즐겁게 될 것입니다.','다른 사람에 말을 그대로 믿어서는 안됩니다. 사람을 잘못 사귐으로 해서 손해수가 생기니 말을 가려 듣거나 아예 듣지 않음이 좋겠습니다. 그리하면 후회가 생기거나 식구를 더하기 될 것입니다.','비로소 재물을 얻어 마음의 안심을 가져다 줄 것입니다. 그 재물은 동방에 있으며 얻어도 실은 그 밖을 앗게 될 것입니다. 일을 벌여 왕성 얻은 것이나 전부 소화될 수는 없습니다. 먼저는 얻고 뒤에는 앗으니 처음만 못합니다.','남몰래 마음 속 고민이 생겨으니 세상일이 생각해보면 모두 꿈과 같습니다. 만약에 이러한 출구가 없다면 도리어 손재수가 있으니 차라리 심란함이 없일 수도 있습니다.','구설수가 있습니다. 또한 가략 심란함을 당하게됩니다. 나를 헐할 사람은 잘못 사귀 사람일 테니 사람 대하기를 조심 하십시오. 만약 어질지 못한 사람을 그대로 사귀다가는 감당하기 어려운 변변을 달할 지도 모릅니다.','신운이 불리하니 매사에 문제이 많습니다. 너무 밝어붙이지 말고 여유를 가져야 합니다. 바라는 일은 왕성 추진해도 형사가 되고 많이 험만 쓸 필요가 없습니다. 유혹에 빠져 새 일을 도모하면 구설수가 생겨 무럽겠으니 착아야합니다.','불을 조심하십시오. 로의해 몸과 마음이 상할까 두렵습니다. 제수를 구하고져 하거든 마땅히 시장으로 나아가 사람들과 대면하십시오. 현장에 가지 않으면 안됩니다.','친한 사람 중에 나를 해하고자 하는 이가 생길 것이니 북방에 가지 마십시오. 하던 일을 쉬게되면 반드시 해가 따르게 될 것입니다. 경영하는 일은 이래서 좋처럼 끝을 맺을 수가 없는 법입니다. 남북 양방에는 나를 도와주는 자가없음 알아야 합니다.','2025-03-02 03:02:00.895174+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (162,'006','한가지폐 일 메마르고 또 한가지폐 꽃이 피 격입니다. 봄철을 만났다고 흉험을 탐낸다가는 길한 가운데 흉함을 만나게 될 것입니다. 비록 재물을 얻어도 모우기가 쉽지 않으니 어찌하겠습니까? 기쁨과 근심이 상반하니 잘못하다가는 흑색 세월을 보내기 쉽습니다. 여망중에는 멀리 떠나거나 너무 원대한 일을 도모하면 요히려 불리합니다. 작게 시작하는 것이 좋습니다. 좋은 일을 하고자 하는데 누가 그 앞길을 가로막을까 싶지만 꽃이 뒷간에 떨어졌으나 주어서 냄새를 맡아보아도 그 향기가 이미 없어진 것과 같습니다. 날이 얼고 봄이 사라지며 금마군 뜻가 남쪽으로 날아간 격입니다.','한번은 기쁜 일이 생기고 한번은 슬픈 일이 생겨 희비가 엇갈리게 됩니다. 길함과 과 흉함이 상반되었으니 어찌 한번은 기쁘고 한번은 슬프지 않겠습니까? 마음 속에 굳은 근심이 있으니 그 흉을 면하기가 그리 쉽지 않습니다.','어둔던 밤길에 달이 구름 밖으로 나오니 천지가 환하게 비춰 길이 트입니다.명산대찰에 가서 기도 드리면 흉한 것이 요히려 길한 것으로 변하게 될 것입니다. 눈이 다 녹아 내리지 않았으니 봄철이 왔으나 봄 튐이 자라기폐 아직 공구함과 같으니 좀더 기다리는 것이 좋습니다.','위아래가 화합되지 않았으니 분수를 지키는 것이 제일입니다. 새로운 방위는 양방입니다. 함부로 일을 착수하고 겁 없이 대들면 이로의해 손해를 면치 못하게 됩니다. 이 달의 여수는 손재할 염려가 있으니 매사 조심하십시요.','남의 말을 함부로 하지도 말고 믿지도 마십시오. 모사가 요히려 그릇치면 해가 될 것입니다. 금실이 불안하니 이 무로운 신수를 어찌하겠습니까? 비록 마음은 무겁더라도 남북 쪽에 길함이 있어 동불서주하게 되니 약간은 도움이 되겠습니다.','여망내 바들이 찬을 치고 있지만 이익이 없으니 원일 입니까? 비록 재물을 얻기는 해도 들어오면 즉시 나가버리니 아무도 남비이거나 손재수임에 틀림없습니다.','출행하면 불리하니 누가 붙라 해도 두문불출함이 상책입니다. 의수가 막혔으니 주고받음을 조심해야합니다. 만약 그렇지 않으면 반드시 내환이 있을 것입니다. 아무 곳에나 손을 내밀지 않고 부구하게 살면 되겠습니다.','바위 위에 있는 외로운 소나무여 얼타리를 가른 국화입니다. 아무리 살내려고 애를 써도 그 뿌리가 튀튀하지 못하고 이웃에 가려 붙을 내기가 어렵습니다. 집에 경사가 있으니 필시 자신으로 인한 경사 입니다.','만일 과거에 금제하는 경사가 아니라면 반드시 가정이라도 기쁜 일이 생길 것입니다. 다른 사람의 말을 잘못 들으면 먼저는 좋은 듯 해도 뒤는 나쁘게 변합니다. 마음이 산란하더라도 집에 앉아 있음이 상책이니 무겁를 탐해야합니다.','사람으로 인하여 재물이 생깁니다. 사람 만나는 일을 겁을리 해서는 안됩니다. 만일 그렇지 않다면 요히려 집안에 잠병이 생길 것입니다. 가운이 왕성하니 달이 구름 밖으로 나와 천지를 밝게 비추짐과 같습니다.','공을 들이기로는 남보다 못할 바가 아닌데도 일을 꾸하면 문제이 많으니 무슨 병고입니까? 그러나 귀인이 나타나서 도와줄 것이니 반드시 재물을 얻게 되겠습니다. 공을 들인 대이라고 하겠습니다.','반드시 기쁜 일이 생길 것입니다. 만일 관례이 아니라면 뜻밖의 후회를 얻게 되겠습니다. 일의 반차를 가해서 넘버야만 올바른 결실을 할 수 있으니 이익이 그 곳에 있음입니다.','구름이 커지고 달이 밖으로 나왔으니 운천지가 차차 찬란한 듯합니다. 시비를 가까이 해서는 안됩니다. 너무 밝음으로 의해 구설이 생길 것입니다. 십하에 근심이 있겠으니 미리 불공하여 흉을 면하면 달밝이 길이 비치겠습니다.','2025-03-02 03:02:00.903186+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (163,'007','때를 만났는데도 실행하지 않는다면 언제 다시 때를 기다릴 수 있겠습니까? 주저하지 말고 주어진 기회를 과감하게 포착하십시오. 큰 재물을 얻기는 어려우나 작은 재물은 필시 들어오겠습니다. 천리 밖의 있는 손님을 불러들이거나 서로 상대하려고 하지 마십시오. 다만 시기가 왔음을 알았거든 지체하지 말고 속히 도모하는 것이 길합니다. 주어진 좋은 기회를 놓치지 마십시오. 귀한 손이 도우려하다가 때가 지나면 도리어 해를 낳칠 수도 있습니다. 분수를 지키는 것이 상책이니 경고망동하지 말고 친착하게 대처해야 합니다.','가을 하늘에 구름 한점이 없이 되었으니 밝은 달이 다시 새롭게 빛을 밝히게 되었습니다. 이익은 사방에 있으니 일을 마무르 짓을 때 유념해야합니다. 식구를 늘리지 되지 않는다면 필시 관례이 있게됩니다.','마음이 하늘처럼 드넓고 뜻이 만족하였으니 재물을 구하면 필시 얻겠습니다. 이 달의 여세는 실물을 조심하십시오. 의성이 문에 빛쳤으니 큰 재물이 문에 가득 찬 것입니다. 시기를 놓치지말고 적극적으로 도전해 볼 일입니다.','올바른 마음으로 대명을 딛었으니 이익이 그 가운데 있겠으나 사람 대하기를 조심하십시오. 북방에 길함이 있으며 일을 마무르 짓거나 시작하기 전에 기회가 왔 것입니다. 좋은 기회를 놓치지 말고 포착하십시오. 만약 십하에 근심이 생긴다면 남방의 약을 쓰십시오.','악한 사람을 가까이 하지 말고 분수를 지켜서 자세를 가꾼다면 흉을 면하고 요히려 길할 것입니다. 갑인 하늘에 달이 밝게 비치니 그 빛이 가히 먼기만 합니다. 모든 일 밝게 보여 여의하니 가히 소망을 성취할 수 있겠습니다.','일을 여의찮 못하니 한번은 이르고 한번은 패하게 되겠습니다. 사람으로 인하여 패하게 될 것이니 그 해가 자지 않습니다. 상만 아니라 하는 일이 형통하게되니 이를 꾸하면 불리합니다. 새 일을 도모하지 말고 사람쓰기를 조심하십시오.','임금과 신하가 화의롭게 만나 조성하게 창달하는 격이니 귀인이 와서 도와줄 것입니다. 은인은 동방 사람입니다. 일을 새로 바람에 은혜를 베풀 사람이니 잘 영접하십시오. 새곳을 얻게되는 작은 것을 쫓아 큰 것을 이루겠습니다.','활짝 핀 매화꽃이 한집안을 아름답게 가꾸고 이웃을 밝게 비추는 격입니다. 만약 외환이 없으면 친환이 있겠으니 두렵습니다. 일은 필시 정손와 이십 성을 가진 사람이 줄 것이니 사람 사귀기를 정성스럽게 해야합니다.','경영하는 일은 귀인이 와서 도와줄 것이니 염려하지 말고 추진하십시오. 그러나 재물은 비록 왕성하다 할 지라도 얻어서 밖잠은 없어지게 될 것이니 주의해야 합니다. 후흉을 당하면 반드시 그 해가 미치 과망을 잊어서는 안됩니다.','다른 사람의 말을 잘못 믿었다가는 마침내 불리함을 알게 될 것입니다. 다른 사람과 함께 일을 꾸하게되면 두 사람의 마음이 각각 달라 어려움을 겪게됩니다. 이렇바 경영하는 것은 필시 공을 이루게 될 것이니 증단해서는 안됩니다.','동남 양방에서 귀인이 나를 도와 줄 것이니 일을 시작하여 바일 때 성의가 있다면 남의 도움을 받을 것입니다. 이익은 서쪽에 있으니 일을 마무르 찾는데 성심을 다해야합니다.','험된 욕심이 다시 발동했다가는 큰 해를 면하기 어렵겠습니다. 남의 재물을 탐내지 마십시오. 흉한 일을 면하지 못합니다. 사람을 잘못 사귀면 그로 인해 해가 있을 것이니 분수를 지키고 정도를 행하는 것만이 자신을 지키는 첩경입니다.','이익은 남방에 있으니 하던 일을 더욱 더 활발하게 펴치고 진행하는 것이 좋습니다. 그렇게 하다보면 우연이 나를 돕는 자도 생기겠습니다. 대운이 왕성하여 큰 재물이 문에 들어옵니다. 혹 도둑이 있을 지 모르니 실물을 조심하고 매사를 소홀히 하지 마십시오.','2025-03-02 03:02:00.911735+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (164,'008','봄토끼가 동쪽으로 오르니 맑은 빛을 맑이함과 같습니다. 서쪽에 길함이 있어 반드시 좋은 소식있겠습니다. 올해의 운은 귀인이 나를 도움으로 많은 일을 순조롭게 이루겠습니다. 필시 기쁜 일이 있을 텐데 이는 신이 나를 보호하는 까닭이겠습니다. 또한 모든 일이 내 마음같이 이루어지니 갈수록 복이 많아지겠습니다. 금년은 남쪽과 북쪽에 복이 좋은 일이 있어 그곳으로 가게될 운입니다. 그러나 좋은 일에 마가 닿는 이치처럼 얻는 것도 많고 앗는 것도 많겠습니다. 사월에 남풍에 보리가 누렇빛을 뿌는 것처럼 의험과 흉을 이갈음 후에 복덕이 충만한 낙락을 보내게됩니다. 매사가 나의 뜻대로 이루어지므로 생각과 행동이 같고 복덕 또한 풍성하므로 마치 보배로운 자로 하늘을 보는것과 같습니다.','달 밝은 동창에 매화를 힘록함과 같겠습니다. 재운이 몸을 따르니 낙락이 운이 좋아지고 천금의 재물로 가산이 넓넓해지겠습니다. 이 달이 산처럼 높게 재물을 모으게되므로 의기양양해지겠습니다.','달 밝은 높은 누각에 풍류 소리가 높겠습니다. 복덕이 풍만한 가운데 화색이 만연하니 부유함을 그리겠습니다. 좋은 일이 생겨 재산을 모우게 되고 밖으로 나가면 더 큰 이익을 얻게 될 것입니다. 이달지 않으면 자손에게 경사가 있으니 이례자례 좋은 여세입니다.','먼길을 가지 마십시오. 집에 있는 것이 길하고 떠나는 것은 흉하겠습니다. 더 큰 복덕을 바라고 이동하느니 집안에서 조용히 내일을 몽둘하는 것이 좋겠습니다. 남쪽으로 가지 마십시오. 흉한 흉이 도사리고 있습니다.','버들가지 위에 꽃봉오리가 앉았으니 얼마나 아름다운 장경입니까? 하는 일마다 황금을 얻게되니 세상사가 좋게만 보이겠습니다. 꽃이 떨어지고 열매를 얻게되니 재물이 풍성하고 당연히 생활은 태평해지겠습니다. 먼데 친척도 가까이 대하십시오.','풍진같은 복을 모아서 산같이 대길함을 얻게되니 좋은 일만 생기겠습니다. 그러나 이 달에는 관재수가 있으니 조심해야겠습니다. 이렇지 않으면 구설이 따르겠습니다. 가까운 사람에게서 해를 입을 수니 너무 믿어버리지 뭇지 않겠습니다.','별로 이익이 없겠습니다. 친한 사람이 남보다 못하니 나에게 해를 입힐 수 있습니다. 물에 가까이 가지 마십시오 아는 사람이 내게 해를 낳치겠습니다. 만일 남과 다툰지 않으면 반드시 성사가 있겠습니다. 출행을 삼가고 자신을 지키십시오.','재운이 따르겠습니다. 이익이 사방에 있으므로 가는 곳마다 좋은 일 생기겠습니다. 단비같은 복덕이 내리므로 재물이 풍년처럼 이루어지겠습니다. 그러나 재물을 구한다 하여도 잠병이 있을까 두렵습니다. 과욕이 나를 막치니 매사를 신중히 하십시오','쉬지 않고 부지런히 일하면 하늘도 감동하여 나에게 이익을 내리겠습니다. 동쪽과 서쪽으로 가면 길하겠습니다. 만일 탐욕스러움으로 분수 밖의 것을 탐하게되면 재앙이 닥치니 흉험을 부리지 말고 인간된 도리를 지키는게 좋겠습니다.','길가에 나가면 손재가 있으니 올데없는 일로 나다니 것은 좋지 않겠습니다. 높은 산에 백합이 있는 것도 반드시 주인이 있는 법입니다. 어려운 일을 성취하는 주안공이 되어야 하겠습니다.','무슨 일을 행하든 타인에 비해 나의 이익이 높아지겠습니다. 일의 성패가 시각에 달렸으니 부르게 도모할수력 이익 또한 크겠습니다. 서쪽으로 가면 재물이 있으니 나가면 얻겠습니다.','목마른 용이 물을 얻었고 배고픈 자가 풍유를 만났습니다. 마음도 몸도 화평하며 바라고 소망하던 꿈들을 모두 이루게되는 좋은 운입니다. 동지 달과 섣달에 생남할 길운이 기다리고 있으니 마음이 부풀게 되겠습니다.','불길한 운이 복덕으로 뒤바뀌니 가정이 기쁨으로 가득하겠습니다. 운이 밝은 빛 내리듯 내게로 쏟아지니 후회할 수도 따르겠습니다. 만일 그러나 십하의 자녀가 생산하지 않을 경우는 복재가 따를 것을 염두에 두어야 할 것합니다.','2025-03-02 03:02:00.920884+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (165,'009','한밭중에 호랑이를 만났으니 나아감이 물러감이 어렵겠습니다. 일을 하고자 해도 문제이 많으니 한달 심명만 흘비하겠습니다. 새로운 일을 찾아 나선다거나 무리함은 다 불리합니다. 사람마다 나를 돕지 않고 요히려 해하려고 하니 마음이 불안하고 불편합니다. 처음은 비록 고단하고 어렵지만 나게라도 좋은 운이 기다리고 있으니 염려할 것은 없습니다. 미겁되는 일이 있거든 가히 악사람에게 의논해 보십시오. 풀릴 것입니다. 하반기에는 길사운이 문에 바치니 기쁜 일이 출중 하겠습니다. 봄철에 길함이 있으니 그때 기회를 놓여서는 안됩니다.','욕심이려다가 다시 얼차게 됩니다. 이를 버리고 싹어도 뜻대로 대지 어렵습니다. 그러나 길손이 문에 비치니 기쁜 일이 생길 것입니다. 봄철에 길함이 있으니 이 기회를 놓이면 절대로 안됩니다. 어렵더라도 굳세게 도전하십시오.','봄동산에 마침내 봄이 돌아와 꽃이 만발하고 역매를 묻었으니 이보다 더 좋은 일이 있겠습니까? 꽃이 곳곳마다 있으니 가는 곳마다 봄바람이 불어 휘휘하겠습니다. 만약 관흉이 아니라면 잠병이 생겨서 몸을 피곤하게 할지도 모릅니다.','다른 사람에게 갈 재물이 의외로 넘게 돌아와 주니 이 무슨 후회입니까? 동남방의 재물이 뜻밖에 문안으로 들어오니 일을 벌이고 성사시킬 데서 비록된 것이며 반드시 은밀히 처리 화 일이 생길 것이니 이익이 그 가운데 있습니다.','둥 사람은 함부러 가까이 해서는 안됩니다. 또한 잠병이 침혹할 것이니 몸을 조심하십시오. 기쁜 중에도 조심이 있으니 관흉을 조심해야합니다. 분수를 지키고 편안하게 거한다면 흉을 면하고 뜻밖의 성공을 거둘 수있습니다.','은밀히 진행시킬 일이 마침내 성공하여 즐성하게 될 것이니 친척이 아니면 외척간에 도모한 일일 것입니다. 길함이 몸에 임했으니 반드시 기쁜 일이 생깁니다. 그러나 마음 한구석에 조심이 있으니 어찌하겠습니까? 안정하면 문제는 없겠습니다.','달이 구름에 드니 좋은 달빛을 다시 보기 어렵습니다. 남방은 불행하니 출행하지 마십시오. 너무 밝어붙이지 말고 여유를 가져야 합니다. 바라는 일은 왕성 추진해도 형사가 되고 많이 험만 쓸 필요가 없습니다. 마음 한구석에 조심이 있으니 어찌하겠습니까? 안정하면 문제는 없겠습니다.','신수가 대길하니 흉험 중에서도 길함이 있습니다. 통하는 길이 남북으로 나있으니 분주하여 여가가 없습니다. 버린 일을 성취하고 마무르지으려하는데 어찌 바쁘지 않겠습니까? 명호가 수풀에서 나오니 그 형세가 당당하여 초목이 떨어 격입니다.','화가 급려서 돌이 되니 마음의 근심이 없습니다. 음양이 서로 화합하였는데 어찌 길함이 없겠습니까? 만약 관례이 아니라면 불시에 자손의 경사입니다. 하고져 하는 일이 막혔다가도 도리어 이익이 되게 풀리주는데 무엇을 주저하겠습니까? 진행함이 좋습니다.','두 호랑이가 서로 싸움을 바였으니 어느 호랑이가 이기고 어느 호랑이가 지겠습니까? 만약 시비를 벌이면 이와 같아서 요히려 구설수만 늘게 되겠습니다. 만약 그렇지 않으면 관재를 만나 도리어 화를 입게될 것이니 시비를 가까이 하지 마십시오.','출행하면 불리하니 욋것을 지키고 안정하십시오 새것을 도모하려다 가는 욋것을 앗게 될지도 모릅니다. 그러나 만약 집에 우환이 있을 같으면 미리 불공을 들이십시오. 그러면 그 흉을 면하게 될 것입니다. 마침내 욋것을 버리고 새것을 찾으니 사람들이 우러러며 따르게 될 것입니다.','사람을 잘못 사귐으로 해서 해가 있으니 부당한 이익을 취하려고 하지 마십시오 신수가 불길하니 잠병을 조심하고 건강에 유의해야 합니다. 이 달의 여수는 흉함이 많고 길함이 적습니다. 너무 취하려 한다면 도리어 내 것까지 앗을까 두렵습니다.','몸이 편안하고 근심이 없으니 몸과 집안이 태평하겠습니다. 구름이 흩어지고 달이 나오니 마침내 소망을 이루게됩니다. 비록 직업을 고치긴 하나 험되이 마음만 상하게되니 과분하게 도전하지 말고 분수를 지킴이 옳겠습니다.','2025-03-02 03:02:00.93373+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (166,'010','높은 물에 잠긴 용이 여의주를 얻었으니 어찌 변화가 무궁하지 않겠습니까? 우연히 귀인을 만나서 가히 공명을 날리게 되겠습니다. 혹 관재수가 있으면 일신이 수고롭고 무럽겠습니다. 남의 말을 잘못 믿고 행동하면 도리어 불리할 것이니 사람 사귐에 유의해야합니다. 재물이 희양하니 백가지 일 마다 이루어지지 않는 것이 없겠습니다. 귀인이 항상 도와주는데 무엇이 가려 성공을 방해할 수 있겠습니까? 좋은 비가 때를 기다렸다가 내려주는데 금년은 필시 풍년을 기약함이 아니겠습니까? 부질이 5마리나 새끼를 낳았으니 남쪽에 큰산을 쌓으니 문을 나가면 크게 길하고 의외로 재물을 얻을 것입니다.부질이 날개를 펴듯 인다면 천리인들 날지 못하겠습니까?','하늘과 땅이 서로 응답하니 만물이 앞을 다투어 생동합니다. 정월과 이월에는 수복히 왔서 서로 응답해줄 것입니다. 귀인이 항상 곁에 있어 어려운 일을 지켜보다가 우연히 나를 도와줄 것이니 필시 이루게 됩니다.','이렇게 함이 속히 이루어질 것이니 이익이 꼭꼭 쌓지 않겠습니다. 돌아가는 기러기가 때를 지어 날아가니 가히 천리 길을 나를 수 있음과 같습니다. 만약 이름을 날치지 않는다면 자손으로 인한 경사를 보게되거나 식구를 늘리게 될 여세입니다.','집안의 일이 흥왕하고 식구와 토지를 늘려 가운이 점점 좋아지겠습니다. 경영하는 일은 다른 사람이 먼저 꾸할 것이니 주저걸리다가는 불시 선두를 뺏기게 겠습니다.','흉악한 귀신이 문을 엿보고 있으니 후흉을 조심하십시오, 도둑을 조심하지 않으면 실물한 뒤에야 크게 후회하게 될 것입니다. 북방은 불길하니 출행하지 마십시오 일이 꽉인다고 하던 일을 중단하고져 하려고 하면 도리어 해가 되겠습니다.','비록 일을 꾸하며 도모하려하지만 그 일로 인해 다른 사람이 해코자 할 것입니다. 서쪽 사람을 가까이 하지 마십시오. 그 해가 쌓지 않으니 일을 마무르 지려고 덤비는 자는 해롭습니다. 사람을 잘못 사귀면 반드시 손재수를 겪게 될 것입니다.','이익이 남방에 있으니 마땅히 남쪽으로 가십시오. 밝은 일이 성대하게 추진함에 이익이 있는데 어찌 멍석이겠습니까? 백가지 일마다 이룸이 있으니 사람들이 우러러 볼 것입니다. 그러나 험험을 부리면 해가 있으니 분수 밖의 것을 탐하지 마십시오.','시비를 가까이 하지 마십시오. 재물을 일게 될 것입니다. 처리가 당연하다면 다른 사람들이 말을 하지 못합니다. 만약 후회가 아니면 가정에 경사가 있을 것이며 시비에 낮지 말고 처리를 분명하게 한다면 무익한 운입니다.','만약 시비를 벌리게되면 관재수를 면치 어려울 것이니 멀리 해야합니다. 이익이 멀리서 오니 나아가면 재물을 얻겠으나 조급하게 서두지 말고 멀리 밖을 볼일입니다. 이름이 사방에 날치게되니 사람들이 흠모하게 될 것입니다.','머리에 금석나무의 월계관을 쓰니 마침내 성공입니다. 꺼지에 몰렸다가 마침내 살길을 만날와 같으니 흉함 가운데서도 길함을 보게 되겠습니다. 소인은 불길하고 대인이라면 크게 길한 여세이니 감당하기 어려운 때는 삼가십시오.','길성이 와서 비치니 집안에 경사가 있겠습니다. 이익은 필시 남쪽과 북방에 있겠습니다. 성대하게 일을 추진하고 그 마무리를 잘해야 합니다. 만약 사람이 도와준다면 뜻밖의 재물을 얻게 될 것입니다.','기쁜 일이 몸에 임하게됩니다. 비록 마음에 들어온 이 있어도 도리어 길하게 밖힐 것이니 염려하지 마십시오. 이름이 멀리까지 날치게되고 백사가 쉽게 성사될 것인데 무엇을 걱정하겠습니까?','사람으로 인하여 해를 입을 것으로 보이며 그 손재가 매우 큰 것입니다. 사람을 잘못 사귀면 반드시 재물에 해를 낳칠 것입니다. 이러한 점에만 조심한다면 태평하니 편안하게 지낼수 수 있겠습니다.','2025-03-02 03:02:00.942065+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (167,'011','동풍이 서서히 풀리고 마른나무가 봄을 만났으니 이제야 좋은 운이 돌아왔습니다. 재물이 왕성하고 경영하는 일은 늦게라도 성공되겠습니다. 작게 가고 크게 오니 비록 작게 시작해도 크게 성공되겠으며 모든 재앙이 사라지고 복이 찾아오니 마음이 편안하겠습니다. 명월이 중천하니 천지가 밝고 분명하여 어두운 구석이 없고 세상만사가 두루두루 편안하겠습니다. 큰 일을 꾸하고자 하는데 어찌 작은 일심과 염려로 주저하겠습니까? 멀리에서 귀인을 만나면 몸은 영화롭고 집은 편안해지겠습니다. 한번 큰 변화를 일으켜서 새 일을 도모하려는 뜻이 있겠으니 때로는 의심과 염려가 있을 것이나 주저하지 않고 진행시키면 반드시 보람이 따르겠으며 봄에는 다소 지체되는 감도 있지만 7,8월경에는 성공되겠습니다. 좋은 인연을 만나면 더욱 쉽게 풀려 나가겠습니다.','봄날이 따뜻해지니 부질이 가까운 누각으로 날아들어 보금자리를 앉고 새끼를 치는 격이니 모든 재앙이 사라지고 복덕이 돌아올 수라 반드시 경사가 있겠습니다.','봄동산에 복숭아꽃과 오얏꽃이 때를 만나 서로 만발하여 봄기운을 띄우니 신수가 대길해져 재물이 스스로 들어오겠습니다. 그러나 친구나 친척 또한 가족의 일로 마음이 상하는 일도 있겠습니다.','높은산에 들어가 마음을 가다듬고 소원을 빌거나 절에 가서 기도를 들이면 반드시 안정을 얻게 되겠습니다. 바라 높은 일이 왠일인가 따르고 경영하는 바가 순조롭지 않더라도 항상 기도하는 마음을 놓지 마십시오. 마음을 하나로 정하지 못하고 흔들림이 많으니 곧히 동불서주하고 바쁘기만 하겠습니다.','일이 성공되기 전에 구설수가 따르기 쉬우니 조심하시기 바라며 업행을 신경을 쓴다면 여수가 역리기 때문에 모든 일들이 순조롭게 이루어지겠습니다. 이미 험준한 산길을 지나왔서 큰길에 들어섰는데 무슨 걱정이 있겠습니까? 앞날은 대로를 걷게 되겠습니다.','입을 조심하십시오. 아무리 옳은 말이라도 한번 실수하면 시비에 말려들게 됩니다. 입을 봉하고 본 것도 보지 않은 듯 들은 것도 듣지 않은 것처럼 지내십시오. 타향 객지에서 친구를 만났다 하더라도 말을 조심하고 객지에서 친구를 사귀더라도 신중을 기해야합니다.','이성을 가까이 하면 구설수가 생기기 쉽습니다. 정해진 궤도를 횡소처럼 걸어가야지 한눈을 팔면 구설수에 오르게됩니다. 사람을 사귀려하지 말고 멀리 출행하여 새 것을 도모하지 마십시오. 편안하게 분수를 지키는 것만이 제일 좋은 방법입니다.','봄동산에 피었던 꽃들이 드디어 때를 만나 열매를 맺는 것과 같은 운으로서 만약 관례을 받아 출세의 길이 열리지 않는다면 자손이나 가족에게 경사가 생기겠습니다. 그러나 잠병이 도사리고 있으니 건강관리에 신경을 쓰기 바라며 매사를 서두르지 말고 차분하게 기다리고 지혜롭게 대처하시기 바랍니다.','형산이 있는 듯 하면서도 그 실상은 보이거나 잡히지 않으니 반드시 흉험함을 느낄게 될 것입니다. 그러나 착고 기다렸다면 재물이 스스로 들어올 것이니 경고망동을 하지 않도록 하십시오. 처음은 어렵게 막히는 듯하지만 그것이 풀려 나중에는 반드시 좋게되고 어려운 때는 귀인의 도움 있겠으니 기대하시기 바랍니다.','세월의 흐름에 따라 재물이 스스로 물러나기 시작하니 성사를 하거나 남의 시비에 낮아들지 마십시오. 손재수가 있겠습니다. 손재수는 반드시 사람을 잘못 사귐으로 인한 것이니 친한 사람일수록 경계하게 대하지 말고 인간을 존중해 준다면 흉을 면하겠습니다.','염부솜이 날아갔는지 분주하기만 합니다. 할 일은 많은데 신수가 불리하니 잠병을 조심하십시오 너무 분주한 틈에 건강을 해치기 쉽습니다.','의수가 불리하고 마음도 편치 않으니 동북 지방에는 출행하지 않는 것이 좋겠습니다. 집안에 있으면서 하던 일을 지켜나가면 이롭겠지만 분수를 지키지 않고 엉뚱한 것을 탐하여 손을 벌치면 불리하겠습니다. 마음이 편안하면 분수를 지키고 출행을 금하여 집안에서 하던 일을 지키는 것이 좋습니다.','새 일을 버리지 마십시오. 험되이 마음만 쓰고 지치게 됩니다. 몸은 왕성하고 뜻은 크지만 재물이 없으니 길함과 흉함이 반반 이겠습니다. 많이 보내고 적게 들어오니 도리어 손도 헛 것 같지 않겠습니다. 마음과 재물이 동시에 있어야만 경영을 하는 법이니 조급하게 서두지 마시기 바랍니다.','2025-03-02 03:02:00.953234+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (168,'012','텁텁 보름달은 다시 이글어 지는 법입니다. 먼저는 원만하게 성공되지만 보름달이 이글어지듯 줄어들기 시작하니 비리를 탐하지 말고 정도를 지켜야합니다. 먼저 얻고 뒤에 앗는다고 조급해서는 안됩니다. 성심으로 노력하면 반드시 형통하겠습니다. 먼저 얻고 뒤에 잃으믐은 인생 다반사입니다. 성심으로 노력하는데 어찌 형통하지 않겠습니까? 가운이 순조롭게 못하여 근심이 있다 하더라도 상가 집을 삼가면 흉운의 진압함을 막을 수 있겠습니다. 봄엔 재운이 성하니 때를 놓치지 마십시오.','처음은 길하여 일이 순조롭게 뒤에는 흉함이 기다리고 있으니 모든 일을 주의하십시오. 산에 들어가서 고기를 구하는 격이니 어찌 소원이 성공되겠습니까? 가만히 가업을 지키면 길하나 새 것을 찾아나서면 이루지 못하고 형통할 것이니 자중하십시오.','동쪽과 북쪽 지방에서 재물이 스스로 들어옵니다. 작은 것으로 큰 것을 얻게되는데 어찌 기쁘지 않겠습니까? 요행수를 바라지 않았는데도 뜻밖의 행운을 만나 기쁨이 크겠습니다.','도끼를 믿지 않으면 도리어 근심이 생길 수 있으니 매사에 조심하십시오. 산도 석고 물도 석데 친한 벗을 얻지 못해 외롭기만 합니다. 모든 것이 납득 중에도 남의 일에 관여되기 쉬우니 관재를 조심하십시오. 남의 시비에 낮어 마음이 상하지 않도록 하십시오.','비록 의수가 있어 조급은 얻지만 그만큼 구설수가 따르니 잘 갈무리어야 합니다. 만약 사람을 잘못 사귀면 손재할까 두렵습니다. 비록 재물은 얻을 지라도 손에 들어온 남는 것이 없으니 형통함을 보겠습니다. 그러나 구설수를 조심하고 사람을 잘 사귀다면 차명 운이 풀려 재물을 얻겠습니다.','얻고자하는 것이 많아 역심히 추진해보지만 마음대로 이루어지지 않으니 이 여수를 어찌 하겠습니다. 엉뚱한 일로 구설수에 오르게되니 담담하고 애틋나는 일이 많겠습니다. 동업자를 구하거나 친한 벗을 사귀는 일이 있으면 항상 태양인을 사귀도록 조심해야합니다. 능력을 보지 않고 서둘러 일을 추진하면 불리하게 되니 친착하게 행동하시기 바랍니다.','집에 있자니 심란하고 밖으로 나가보아도 별 이익이 없겠습니다. 남쪽은 불리하니 계획없이 출행하지 마십시오. 별일 이 없으면서도 많은 일을 한 듯 비방을 받기가 쉽습니다. 마음을 안정하고 자신의 분수를 지키면 손해를 보지 않겠습니다.','조각배를 바다에 띄웠으니 바람이 없어도 위태롭기만 합니다. 기도하는 생활을 한다면 하늘이 복을 주겠습니다. 위태롭게 자신을 지키는 자세로 성심껏 임하면 반드시 공고함을 이루고 성공하겠습니다.','의수가 있어 재물을 얻지만 몸에 잠병이 있어 쓰게되니 건강에 주의해야 합니다. 분수 밖의 일을 탐하게 되면 반드시 형통하게 될 것이니 자기 판단을 정확히 해야합니다. 모함을 받거나 남의 시비에 관여되기 쉬우니 분수를 지켜 건강을 해치지 않도록 하십시오.','폐가 깊은 속에 편지있는데 누가 그 광채를 알아보고 귀하게 여기겠습니까? 일을 짜함에 있어 흔되지 않으며 날로 늠어가는 근심을 감당하기 어려운 것입니다. 남의 시비에 낮아들면 몸이 상할 것이니 주의하시기 바라며 폐구술을 멀리 찾아들려 하지 말고 가까이 찾기 바랍니다.','몸에 염부가 임하였으니 동불서주하겠습니다. 집에 있으면 길하고 출행하면 해로우니 하던 일을 지키는 것이 수익을 버리는 것보다 낫습니다. 하고한 일을 밖으로 줄이는 지혜가 필요합니다.','분수를 지키는 것보다 더 좋은 방법은 없습니다. 만약 어떤 일을 꾸하거나 욕심이게 되면 후회하게 될 것입니다. 북방이 불리하니 출행하지 마십시오. 여수가 막힐 때는 잠시 쉬어 자신을 정리하고 힘을 축적하여 다시 운명의 문을 밀어야만 합니다.','기필코 무엇인가를 행하려고 힘을 쓰지만 쉽게 풀리지 않겠습니다. 새로 친구를 사귀거나 대업을 의논하지 마십시오. 손해가 가중되고 이익은 없으니 주의해야합니다, 재물은 없어지지만 몸은 편하고 용기가 충만해지니 길흉이 반반입니다. 조급하게 서두지 않는 다면 크게 해로운 일은 없겠습니다.','2025-03-02 03:02:00.962515+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (169,'013','꽃봉오리가 버들가지에 깃드니 조각 조각이 황금이와. 하늘과 땅에 광명이 가득하게 비치는 운입니다. 또한 상사로운 용이 돌아오니 귀인이 도와주는 여세입니다. 만일 재물이 생기지 않는다면 십하에 영화로움이 있겠습니다. 덕을 쌓아 구실을 만드니 수고로움이 있지만 반드시 복덕을 성취하게됩니다. 봄철에 기쁜 일이 많으나 구설수가 따르니 조심하시고 이사를 하거나 변화를 가지지 않는 것이 복을 얻는 것이니 착고하시기 바랍니다. 대인관계에 신경을 특히 신경을 써야 합니다. 일의 성패와 속의 계획이 그 가운데 있습니다. 집안이 화평한데 어찌 마음이 안락하지 않으며 이루어지지 않는 일이 있겠습니다. 가정의 화목에 주안점을 두다면 만나는 사람마다 도와주고 가히 후회를 만나게 되겠습니다.','봄 튐이 비를 만나 파란하게 물이 들고 무성무성 자라나는 형상과 같이 재물이 풍만하게되니 일신이 스스로 태평하기만 합니다. 이처럼 여수 돌아온 것이 마치 봄을 만난 초목과 같으니 집안에 즐거운 경사가 있겠습니다. 때를 잘 지키면 그어진 일이 반드시 성공하겠습니다.','일을 하는데 있어서 버리기에 무서웁게 성공하게되니 이보다 더 기쁜 일이 있겠습니까? 몸이 좋아지고 의외의 후회수를 만나기도 하겠습니다. 모든 일이 순조롭게 이루어지겠으니 하고자 하는 일을 과감하게 추진해도 좋겠습니다.','집안에 경사가 있으니 마음이 기쁘고 편안합니다. 혼사를 치르게되거나 자손을 얻는 일도 있겠습니다. 어려운 일에는 귀인이 와서 도와주니 추진하는 일이 의외로 삼가 성사되겠습니다. 자신이나 집안에 경사가 있으니 기쁨이 크겠으며 사람으로 인해 즐거운 일이 있겠습니다.','물이 흘러 동해로 들어가니 그 물줄기의 기운이 장구하기도합니다. 비록 작은 일이지만 하루 아침에 이루어진 것이 아님을 명심하시기 바랍니다. 다른 사람의 말을 잘못 믿으면 이익을 보기 어렵고 손해를 볼 수도 있으니 주관을 지켜야합니다. 일 처리를 잘하면 재물도 생기고 몸도 편안하겠습니다.','대수가 길하니 의외의 재물을 얻게 되겠습니다. 혹 잠병이 있을지라도 성심으로 치료했으면 차도가 있겠고 모든 흉을 면하게되겠습니다. 만일 복을 입지 않으면 화재가 두려우니 조심하십시오. 의외로 얻은 재물로 기쁨을 맞이하나 경고망동하면 흉이 따르니 처신을 의하시기 바랍니다.','먹어치던 비바람이 그치고 하늘이 맑게 갠듬어 달과 해가 밝게 비치는 격입니다. 재물이 몸에 임하니 작은 것이 가고 큰 것이 옵니다. 재물에 욕심이 없다보면 간혹 가정생활에 무심하여 금실에 불화가 생기기 쉬우니 갑자기 넘친 재물운을 지혜롭게 받아들여야합니다.','재운이 대성하여 후회하여 풍요롭게 되겠습니다. 재산과 관례이 몸에 임하여 부족함이 없겠으나 잠병이 놀리고 있으니 안심하지 마십시오. 만일 다른 사람의 도움을 받게된다면 의외로 성공을 쉽게 이룰 것입니다. 잠병은 안일을 퍼 타는 것나와 염심하십시오.','귀인이 나를 도와주니 관례이 몸에 임하게됩니다. 한 몸이 스스로 편안함을 얻어 걱정이 없게 되니 식구를 더 늘리게 될 수 있겠습니다. 어두운 밤에 촛불을 얻은 격이니 그 동안 지내왔던 어두운 길까지 환하게 비추는 기쁨을 맛보게 되겠습니다.','때맞춤 비가 내리니 백초가 촉을 다시 추어 생기를 얻게됩니다. 사람을 친히 대하면 그 이익이 쌓지 않겠습니다. 만약 그렇지 않으면 길함이 도리어 흉하게 될 것이니 사람 대하기를 마른 풀에 비가 쓰미는것과 같이 긴요하게 해야합니다.','팔한 계략이 맺어 떨어져서 도모한 일이 쉽게 성공되겠습니다. 몸엔 근심 걱정이 없어나 항상 마음 구석에 번민이 남아있으니 무엇일까요? 만약 근심이 없으면 구설수가 생겨 서로 다투게 되겠습니다. 계략으로 성공하는 일에 그만큼 고통이 따르고 환난이 있음을 알아야합니다.','길한 여수가 문에 비치니 늦게 나마 봉사를 하겠습니다. 출행하니 불리하니 후흉을 조심하십시오. 덕을 굳트려서 금을 얻게되는 격이니 노력하면 귀함을 얻겠습니다. 봉사의 문은 덕을 쌓아 얻은 금과 같으니 반드시 노력의 대가입니다.','한집안이 화목하니 이익이 그 가운데 있습니다. 동쪽과 서쪽 양방에서 귀인이 와서 도와주겠습니다. 만일 시험에 합격하는 영광이 없다면 등남하거나 좋은 사람을 얻게되어 기쁘게 됩니다. 사람으로 인하여 기쁜 일이 생길 것이니 사람 새김에 성심을 다하십시오.','2025-03-02 03:02:00.970929+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (170,'014','달이 서쪽 창 밖으로 스어드니 구미한 꿈만 번번하겠습니다. 어두움이 걷히니 비몽사몽간에 교차되는 일도 많습니다. 서로 주권을 장악하려고 압지를 부리면 요히려 재가 날게 미칠 수도 있습니다. 기술이 충하지 않으면 얻었다가 다시 앗는 수입니다. 의수가 불리하니 적게 얻고 많이 흩어지겠습니다. 분수 밖의 것을 탐하지 마십시오. 안정하여 경고망동하지 않으니 길함의 첩경입니다. 구설수가 있을 것이니 남과 다툼거나 남의 시비에 낮아 들지 마십시오. 금년의 신수는 물과 불을 조심해야합니다. 몸이 건벌으로 돌아오니 늦게야 그 흠집을 볼게되겠습니다. 재물이 새어나가기 쉬우니 다른 일을 경영하거나 함부로 새 일을 도모하는데 투자해서도 안됩니다.','마음에 슬픔과 근심이 있으니 성사가 분분하겠습니다. 먼저 이해하는 태도를 가져야합니다. 나의 마음은 정직하나 왠만한 것이 힘이 쌓지 않을 것입니다. 친한 친구를 가까이 하게 되면 겉으로는 좋으나 실상은 흉험되겠습니다.','다리던 말이 길을 앗았으니 나아가려 하나 나갈 바를 알기가 어렵게 되었습니다. 일을 꾸하다가 이루지 못하니 요히려 손재수만 있을 것입니다. 더군다나 친한 친구마자 무정하게 외면하니 사람으로 인하여 해를 입어도 동정할 자가 없습니다.','분수를 지키고 집에 있으면 별로 과실이 없을 것입니다. 그렇지 않으면 실패하기 쉽습니다. 마음에 큰 걱정은 없으나 의수가 불리하니 훤칠하지 못합니다. 집안 사람낱리 불안하여 마음의 안정을 정하지 못하고 불안해질 수 있으니 자중함이 상책입니다.','몸을 굳잡이 단정하고 마음을 가다듬으면 실패가 침혹하지 못할 것입니다. 만약 마음이 흔트러져서 색을 가까이 한다면 구설수에 올라 빠져나기 힘들게 됩니다. 손을 앓고 누각에 올랐으나 친구가 무정하게 대함을 어찌 타하겠습니까?','재물을 가히 얻을 수 있으나 구걸수가 뒤따르고 사람들이 시비를 걸어오니 무럽겠습니다. 심신을 불안하니 시비를 외면하고 스스로 안정시켜야만 길합니다. 사람을 잘못 사귀게되면 모든 일이 형통하게 끝나게 될 것 주의하십시오.','용주목 사람이 풍년을 만났으니 드디어 생활이 풍족하고 마음이 훤칠합니다. 이름이 사방에 날리게되어 사람마다 많이 흠모하고 추앙하려니 어찌 좋지 않겠습니까? 이익은 필시 놓사를 취는 것이니 하던 일을 계속 경영함이 좋겠습니다.','새로 불안하고 자리에 앉아도 마음이 안정되지 않아 안절부절 하는 격입니다. 남북은 길하나 동서로 가지마십시오. 하던 일이 충실히 성업시키이 좋은 결과를 얻게 될 것입니다. 경영하는 일은 될 듯하다가도 뜻을 이루기 힘드니 더욱 노력하십시오.','작은 걸로 큰 것을 이루게 되니 모든 낮의 물이 하나로 흘러서 바다로 통함과 같습니다. 비록 재물을 얻게 되지만 그로 인해 생기는 구설을 어찌하겠습니까. 물과 불에 놀랠지도 모르니 항상 조심하고 근심함이 좋겠습니다.','몸이 길 한 가운데에 높여 있으니 한 번은 멀리 여행을 떠나야 할 여세입니다. 사람 사귀기를 신중히 해야 합니다. 마음에 근심이 있으나 누가 감히 그 굼이를 풀어려 주겠습니까. 환자가 감당해야 합니다.','산이 물에 잠기고 백가지 보배가 물 속에 잠겨 버렸으니 그 고고 놉은 바다가 한입니다. 만약 살해당하지 않으면 잠병이 침혹할까 두렵습니다. 길흉이 산만하니 앗 것이 당하고 단 것이 옵니다. 착고 갈무림 필히 올게 되겠습니다.','물귀신이 물에서 서성거리고 있으니 물을 가까이 하거나 물로 인한 일을 함부로 벌이지 마십시오. 만약 그렇지 않으면 집에 한번은 크게 놀랄 일이 있겠습니다. 만약 성사가 아니면 구설수를 면치 어려우니 조심하십시오.','봄동산에 봄이 돌아왔으니 백화가 만발한데 어찌 기쁘지 않겠습니까. 행운이 집에 가득 찼으니 집안 살림이 스스로 왕성해져서 부족함을 모르게 될 것입니다. 다른 사람과 동업을 꾸하는 것은 옳지 않으니 동업자를 구할 때는 주의하십시오.','2025-03-02 03:02:00.980168+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (171,'015','옛사람의 무덤 위다 다시 현재 사람이 장사를 지내는 격입니다. 두 사람의 마음이 각각 다른데 어찌 불리하지 않겠습니다. 악과 귀가 일치하고 좀우가 충돌하지 않도록 주의해야합니다. 만일 친함이 아니면 가정에 불안한 일이 생길지도 모르니 화합에 유념해야합니다. 만약에 목명되어 이동하면 손재수와 구설수가 면치 어려우니 분수를 지켜서 안주함이 옳겠습니다. 처음에는 곤하고 뒤에는 형통하게 될 것이니 마침내 길함이 있을 것입니다. 일이 순조롭게 잘 풀려 나갈 것입니다. 그러나 신상에 근심이 있으니 어찌 하겠습니까? 동쪽 이웃은 봄이 될만하나 서쪽 이웃은 이르지 못하겠습니다. 비록 험물은 있어도 고치면 귀하게 될 것입니다. 웃고 또 말함에 눈이 일을 막지 못하므로 말조심을 해야합니다.','여수가 불길하여 부만나 친 가족에게 환란이 미칠 수 있으니 주의하십시오. 비록 일은 생겨 진행할 수 있지만 뜻대로 대지 않으니 이를 어찌 하겠습니까? 동방의 귀인이 우연히 도와주니 일을 새로 얻어 활기를 띄게 될 것입니다.','일을 함에 소인에 길함이 있고 일을 마무르 찾는데 성심을 다해야합니다. 신상에 근심이 있으나 의수는 대길합니다. 봄바람이 부는 이월에는 도화가 만발하였으니 신상근심만 이기면 매우 즐겁겠습니다.','마음이 안정되지 못하여 일정한 주장을 내세우지 못하니 신자는 꿈속까지 생활합니다. 그러나 흉함이 변하여 길하게되고 차명 큰 이익을 보게 될 것입니다. 조상이 문에 비치는데 어찌 재물이 스스로 들어오지 않겠습니까?','재물이 산과 같이 쌓였으니 보기만 해도 넉넉하고 마음이 스스로 편안합니다. 사방에 길함이 있으니 반드시 재물을 얻게됩니다. 특히 일을 마무르 짓을 때 기회를 잘 포착하십시오. 꿈이 불길하여 일마다 험되기 쉬우나 이런 때일수록 친착하게 행동하시면 만사가 평탄하게 됩니다.','터가 발동하니 이사를 하거나 새것을 도모하여 털을 옮겨보는 것도 괜찮겠습니다. 만약 새집을 마련하거나 새것을 찾아 경영한다면 흉함이 변하여 길하게됩니다. 그러나 망동하진 마십시오. 험험된 생각으로 장사를 잘못 버리면 크게 실패할 지도 모릅니다.','만약 시비를 생기지 않는다면 구설수가 생길 것이니 남의 일을 간섭하지 마십시오. 생소한 사람은 가까이 할수록 실패를 가져다 줄 것입니다. 오래된 것일수록 안전함을 아십시오. 고요하게 마음을 가라앉히고 부구히 일에 임하면 대길하고 잘못 욕심이면 해가 있습니다.','나부에서 고기를 구하니 그맛에 맛을 얻음과 어찌 다르겠습니까? 몸이 길 위에 있으니 사방이 내집 이겠습니다. 외갈이 이와 같은데 무엇이 망령겠습니까? 이익은 남방에 있으니 그곳에서 보람을 느끼고 큰 발전을 이루게 되니 힘껏 추진하게됩니다.','마음속에 바램이 스어 있으니 즉시 구하려 들면 구해줄 것입니다. 의복이 몸에 따르는데 마침내 재물을 얻지 못하겠습니까? 운진의 소망이 쉽게 성공될 것입니다. 동쪽과 서쪽 양방에서 뜻밖의 재물을 얻을 것이니 시작함과 끝맞음을 중시하십시오.','의수는 적나 좋은 편인데 얻어서 밖은 앗게되니 이게 앞일입니까? 이로 인하여 구설수가 따르지도 모르니 사람이 착고 갈무리는 것이 더 좋을 것입니다. 의수가 불길하니 다른 재물을 탐하지 마십시오. 요히려 얻으려 하다가 그만큼 앗게 됩니다.','높시를 푸른 강에 던졌으니 반드시 큰고기를 얻게 될 것입니다. 그러나 물귀신이 이름을 흐려하고 있으니 물과 불을 조심해야합니다. 여인을 하게 될 수도 있습니다. 혹 관재의 길이 있을 수도 모르니 기도하여 흉을 면하게되길 바랍니다.','작은 소가 낙을 얻었으니 천리 길을 가기에는 무리가 많음과 같습니다. 동짓달과 섣달에는 매사를 이루기가 어려우니 너무 무거운 짐을 지지 않도록 주의하시기 바랍니다. 이익을 챙한다면 다른 데 가면 불리하니 밖으로 탐하지 말고 분수를 지켜야합니다.','신상에 위태함이 있으니 거동함을 주의하십시오. 미리 더듬어 보지 않으면 부치기 쉽습니다. 사소한 일로 구설수에 올라 마음이 상하기 쉬우니 대범하게 처리해야합니다. 미리 흉을 막으면 흉함이 변하여 길하게 될 것이니 기도를 드리십시오.','2025-03-02 03:02:00.991521+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (172,'016','달이 서쪽 창 밖으로 스어드니 구미한 꿈만 번번하겠습니다. 어두움이 걷히니 비몽사몽간에 교차되는 일도 많습니다. 서로 주권을 장악하려고 압지를 부리면 요히려 재가 날게 미칠 수도 있습니다. 기술이 충하지 않으면 얻었다가 다시 앗는 수입니다. 의수가 불리하니 적게 얻고 많이 흩어지겠습니다. 분수 밖의 것을 탐하지 마십시오. 안정하여 경고망동하지 않으니 길함의 첩경입니다. 구설수가 있을 것이니 남과 다툼거나 남의 시비에 낮아 들지 마십시오. 금년의 신수는 물과 불을 조심해야합니다. 몸이 건벌으로 돌아오니 늦게야 그 흠집을 볼게되겠습니다. 재물이 새어나가기 쉬우니 다른 일을 경영하거나 함부로 새 일을 도모하는데 투자해서도 안됩니다.','마음에 슬픔과 근심이 있으니 성사가 분분하겠습니다. 먼저 이해하는 태도를 가져야합니다. 나의 마음은 정직하나 왠만한 것이 힘이 쌓지 않을 것입니다. 친한 친구를 가까이 하게 되면 겉으로는 좋으나 실상은 흉험되겠습니다.','다리던 말이 길을 앗았으니 나아가려 하나 나갈 바를 알기가 어렵게 되었습니다. 일을 꾸하다가 이루지 못하니 요히려 손재수만 있을 것입니다. 더군다나 친한 친구마자 무정하게 외면하니 사람으로 인하여 해를 입어도 동정할 자가 없습니다.','분수를 지키고 집에 있으면 별로 과실이 없을 것입니다. 그렇지 않으면 실패하기 쉽습니다. 마음에 큰 걱정은 없으나 의수가 불리하니 훤칠하지 못합니다. 집안 사람낱리 불안하여 마음의 안정을 정하지 못하고 불안해질 수 있으니 자중함이 상책입니다.','몸을 굳잡이 단정하고 마음을 가다듬으면 실패가 침혹하지 못할 것입니다. 만약 마음이 흔트러져서 색을 가까이 한다면 구설수에 올라 빠져나기 힘들게 됩니다. 손을 앓고 누각에 올랐으나 친구가 무정하게 대함을 어찌 타하겠습니까?','재물을 가히 얻을 수 있으나 구걸수가 뒤따르고 사람들이 시비를 걸어오니 무럽겠습니다. 심신을 불안하니 시비를 외면하고 스스로 안정시켜야만 길합니다. 사람을 잘못 사귀게되면 모든 일이 형통하게 끝나게 될 것 주의하십시오.','용주목 사람이 풍년을 만났으니 드디어 생활이 풍족하고 마음이 훤칠합니다. 이름이 사방에 날리게되어 사람마다 많이 흠모하고 추앙하려니 어찌 좋지 않겠습니까? 이익은 필시 놓사를 취는 것이니 하던 일을 계속 경영함이 좋겠습니다.','새로 불안하고 자리에 앉아도 마음이 안정되지 않아 안절부절 하는 격입니다. 남북은 길하나 동서로 가지마십시오. 하던 일이 충실히 성업시키이 좋은 결과를 얻게 될 것입니다. 경영하는 일은 될 듯하다가도 뜻을 이루기 힘드니 더욱 노력하십시오.','작은 걸로 큰 것을 이루게 되니 모든 낮의 물이 하나로 흘러서 바다로 통함과 같습니다. 비록 재물을 얻게 되지만 그로 인해 생기는 구설을 어찌하겠습니까. 물과 불에 놀랠지도 모르니 항상 조심하고 근심함이 좋겠습니다.','몸이 길 한 가운데에 높여 있으니 한 번은 멀리 여행을 떠나야 할 여세입니다. 사람 사귀기를 신중히 해야 합니다. 마음에 근심이 있으나 누가 감히 그 굼이를 풀어려 주겠습니까. 환자가 감당해야 합니다.','산이 물에 잠기고 백가지 보배가 물 속에 잠겨 버렸으니 그 고고 놉은 바다가 한입니다. 만약 살해당하지 않으면 잠병이 침혹할까 두렵습니다. 길흉이 산만하니 앗 것이 당하고 단 것이 옵니다. 착고 갈무림 필히 올게 되겠습니다.','물귀신이 물에서 서성거리고 있으니 물을 가까이 하거나 물로 인한 일을 함부로 벌이지 마십시오. 만약 그렇지 않으면 집에 한번은 크게 놀랄 일이 있겠습니다. 만약 성사가 아니면 구설수를 면치 어려우니 조심하십시오.','봄동산에 봄이 돌아왔으니 백화가 만발한데 어찌 기쁘지 않겠습니까. 행운이 집에 가득 찼으니 집안 살림이 스스로 왕성해져서 부족함을 모르게 될 것입니다. 다른 사람과 동업을 꾸하는 것은 옳지 않으니 동업자를 구할 때는 주의하십시오.','2025-03-02 03:02:01.001051+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (173,'017','푸른산에 올라가서 신선을 만나고자 했으나 도리어 형통하게 돌아옴과 같습니다. 만일 남의 도움을 만나게 된다면 후회 할 수가 있습니다. 그러나 무단한 험험을 부리게 된다면 반드시 실패하게 됩니다. 남의 도움을 받으려면 항상 인덕을 닦아야 하니 이는 하루 아침에 이루어짐이 아님을 각득하여야 합니다. 남의 말을 함부로 믿지 마십시오 손재하고 구설수가 뒤따르게 될 것입니다. 험험한 일은 처음부터 성사가 없음인데 어찌 환자만 험험된 일을 고집하여 실패를 자초하려 하십니까. 만일 망령되게 이동하면 후회를 면치 어렵겠습니다. 형은 북방을 침혹하고 동생은 서쪽을 침공함과 같으니 필시 쟁산이 있을 것입니다. 그러나 올바로 살피지 못한다면 신명만 흘비하겠습니다. 모든 일에 해가 있으니 전암을 치른듯 조심해야 합니다.','하는 일에 실패수가 있으니 이를 구하여 꾸해 보지만 이루기가 매우 힘들겠습니다. 살피는 안목이 밝지 못하여 사리를 분간하는 데 무리가 있으니 다만 신명만 흘비합니다. 일을 책망함이 많으니 이루어도 속히 패하게 됩니다.','바다 가운데로 나가서 구실을 찾으니 좋은 보배를 얻기는 매우 어렵습니다. 일이 여의찮 못하니 먼저는 욕더라도 주인은 초푸르게될 것이니 주의하십시오. 친한 사람을 함부로 믿지 마십시오 .재흉이 그로 인하여 생기게 되겠습니다.','문밖에 나가지 못하니 먼저는 원통하여 욕게 되지만 나중엔 그로 인해 올게 되겠습니다. 집에 작은 근심이 있으니 몸과 마음이 편치 못하겠습니다 뜻하지 않은 일로 소설을 맺게 될지 모르니 어떤 시비가 닥쳐도 피해야 합니다.','대인은 길한 여수고 소인은 해가 있으니 심중을 잘 헤아려서 임하여야 합니다. 도처에 재물이 있으니 사람들이 와서 도와주겠습니다. 이렇게 좋은 기회를 앗게 되면 또 만나기가 쉽지 않을 것입니다. 꼭 잡아야 합니다.','집에 있으면 길하고 다른 데로 나가면 해롭습니다. 하던 일을 지키고 새것을 도모하면 이롭지 못합니다. 이사하거나 업을 바꾸면 흉함이 변하여 길함이 될 것이니 나를 돕는 자가 생기는 것을 기다렸다가 실시하십시오. 박손이 도움 것입니다.','적은 것을 버릴 줄 알면 그것으로 인하여 큰 것을 취하게 될 것입니다. 그러나 도리어 그것이 해로우니 어찌하겠습니까. 두 사람의 마음이 각각 낙담게 되겠습니다. 다른 사람과 일을 함께 꾸하게 되면 그 해를 면치 어렵겠습니다.','비록 재물이 생기지만 얻어서 그 잠밖을 앗게 되니 이를 어찌하겠습니까. 성사가 짧기지 않으며 손재수가 뒤 따라 다닙니다. 가까이 있는 것을 엿보고 버리게 되면 비록 먼 것을 꾸하더라도 성공하지 못하고 실패하기 쉬운 것입니다.','덕을 쌓아서 금을 얻는 격이니 반드시 재물을 얻어 기쁨을 맛보겠습니다. 슬지어는 다른 사람에게 돌아간 재물도 내게로 돌아오니 이 무슨 후회란 말입니까. 이름이 나고 건강이 좋아지니 그 가운데서 재물까지 얻게 됩니다.','초목이 가을을 맞았으니 마음에 번민이 많습니다. 만약 이사하거나 다른 것을 도모하여 실행하면 길할 것이니 각행하십시오. 그러나 신원이 불리하니 가정에 우환이 있거나 복을 앗게 될 것입니다. 이 또한 여수 입니다.','두 사람의 마음이 같으니 일을 구함에 가히 뜻을 이룰 수 있을 것입니다. 사람을 잘 못 사귐으로 해서 도리어 해를 입게 될 것이니 사람을 조심하십시오. 그러나 사람으로 인해 놀토를 늘리고 가업이 성할 것이니 어찌 사귀기를 멈추겠습니까?','의수가 불길하니 다른 일을 경영하지 마십시오. 남의 말을 믿게 되면 그로 인해 낭패가 있을 것입니다. 남의 꾸임에 넘어가 일을 도모하지 않도록 주의하십시오. 백가지 일마다 문제이 많으니 집에 있어 옛것을 지킴이 상책일 것입니다.','비록 재물을 얻기는 하지만 모으기가 어려우니 이를 어찌하겠습니까. 남방에 그 사람이 우연히 도와 줄 것이니 하던 일에 더욱 박차를 가하면 성사될 것입니다. 집에 있어 마음을 지키면 길하고 문을 나가 돈 것을 취하면 흉하겠습니다.','2025-03-02 03:02:01.01002+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (174,'018','집도 없고 구할 것도 없이 모든일이 별로 효미가 없겠습니다. 답답하여 요량스럽지 않으니 험되이 세월만 보내게 되기 쉽습니다. 구설수가 있으니 남과 다투지 말고 피하도록 해야 합니다. 길한 가운데도 흉함이 도사리고 있으니 이 신수를 어찌하겠습니까? 집안에 근심이 있으니 되는 일이 없을 것이니 먼저 집안에 있는 작은 근심거리부터 해결하도록 해야 합니다. 처음은 비록 거슬러 막히지만 마침내 형통하게 될 것입니다. 정세를 탁하지 마십시오. 태어났부터 해왔던 풍속이라고 생각하십시오. 한 집안에 두 성이 있어 서로 화합되지 않습니다. 마치 두 호랑이가 다투는 서로 격이니 이익이 없으며 될 일도 그릇치게 됩니다.','집에 재산이 없어 넉넉하지 못하니 생활이 곤궁하고 마음이 안타깝지 않을 것입니다. 해가 서쪽 창 너머로 떨어져 버렸음에 그동안 풍했던 운한도 함께 시들어 버렸습니다. 자신이 발동하니 서부르 재물을 구하면 불리하겠습니다.','한가로이 높은 정자에 올라 누웠으니 어찌 기쁨이 없으며 욕음소리가 없겠습니까. 도처에서 재물이 들어오는데 어찌 사람들이 우러러보지 않겠습니까. 두 성품의 사람이 한 마음으로 합치놓으니 재물이 스스로 굴러 들어오겠습니다.','상하가 불안하니 구설이 꼬여지지 않고 꼬리를 물어 무럽힐 것입니다. 길함이 도리어 흉하게 될 것이니 이 또한 꼬임없는 구설로 인함입니다. 만약 우환이 아니라면 잠병이 닥벽까 두려우니 항상 지위와 건강을 유의하십시오.','갓을 쓰고 문밖으로 나가니 분주하여 동서남북을 바삐 다니는 형상입니다. 그러나 분수를 지키고 자중하면 길할 것이고 험되이 재물을 구하려고 하면 얻지 못하겠습니다. 구설수가 분분하니 살피지 못하고 바삐 서둘러 탁입니다.','증가 된 곳간을 앗은 격이니 재물이 꼬이고 생계를 옮기 위해 다시 떠나야할 여세입니다. 몸이 타향에 있음과 같으니 분주하여 잠시도 쉴 사이가 없겠습니다. 수고하고 노력했으나 그 만큼의 공을 얻기가 어려우니 신수 탁인가 합니다.','서로 다투지 마십시오. 구설을 면하기 어렵게 됩니다. 만일 꾸하는 것이 많게 되면 일을 맺지 않고 도리어 구설이 늘게 될 것이니 이를 무엇으로 막을 수 있겠습니까?','관기가 발동하니 관흉을 조심하십시오. 경고망동하지 마십시오. 만일 돕는 사람이 생긴다면 그로 인해 환자를 하여 마음이 맺거나 좋은 인연을 맺게 될 것입니다. 만약 아프이 아니면 성사가 있을 지도 모릅니다.','경영하고 있는 일에 너무 기대를 갖지 마십시오. 반드시 낭패하게 될 것입니다. 길한 것이 변하여 흉하게 되니 공연히 신명만 흘비하지 말고 분수를 지키십시오. 동방에 나가면 불리하고 손재를 면치 어려운 것이니 일을 벌이지 마십시오.','문서상의 길함이 있으니 그로 인해 반드시 재물을 얻게 될 것입니다. 타향에서 여관신세를 지고 창 밖을 내다보니 마음에 맺는 기쁜 친구를 만나게 될 것입니다. 분수 밖의 것을 탐하지 않는다면 형통한 꿈을 보지 않겠습니다.','작은 재물은 가히 얻을 수 있으니 조급하게 서두르지 마십시오. 그러나 간혹 관재와 구설수가 있으니 미리 조심하고 주위는 흉하게 변하기 쉬우니 좋은 때를 잘 지켜서 주의시켜야 합니다.','용주목 사람이 벼를 얻었으니 금과 구슬이 집에 굴러 들어온 것 같습니다. 재산이 문에 비치니 후회하여 풍요롭게 될 것입니다. 비로소 마음이 훤칠하겠습니다. 꽃이 우거진 쉼 속에 있는 누각에서 귀인을 만난 격입니다.','담을 쌓았다면 반드시 남은 경사를 앞당겨 맞이하게 될 것입니다. 스스로 몸을 가꾸고 마음이 편안하며 복덕이 그로 인하여 생기는데 어찌 막아지겠습니까. 사람 중에 반드시 나를 도와주는 사람이 있으니 필시 인덕일 것입니다.','2025-03-02 03:02:01.018433+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (175,'019','올해의 신운이꽃이 봄 동산에 성을 쌓아 피어올랐고 가지가지 마다 바야흐로 화창하게 어울림과 같습니다. 신수가 태평하니 이르는 곳마다 길함이 성공하게 됩니다. 길성이 나를 도우니 필시 은인을 만나 도움을 받게 될 것입니다. 그러나 색을 가까이 한다면 잠병을 얻기 쉬우니 절제를 해야 합니다. 집안 사람들이 서로 화합하고 화평하니 관례이 몸에 따르게 되겠습니다. 만일 이와 같지 않으면 요히려 신수가 불리하게 될 것입니다. 입으로는 영변을 통하여 많은 무리를 거느리고 동서남북과 상하의 많은 나라를 종횡 무진하게 되니 문제이 없겠습니다. 소인의 도리는 사라지고 군자의 도리가 되겠으니 사람들이 줄지어 따르고 소원을 성취하여 만방성을 다스리게 될 것입니다. .','비로소 대인을 만났으니 만사를 이루게 되어 화창한 봄날에 피는 꽃과 같겠습니다. 남북 양방에는 반드시 이를 성업시키고 마무르 짓기 바랍니다. 만약 관례이 아니더라도 자신에게 경사가 있거나 식구를 늘리게 될 것입니다.','아름다운 사람을 새로 대하게 되었으니 반드시 기쁜 일이 있어 인연을 맺을 것입니다. 동쪽과 남쪽, 양방에서 재물이 왕성하겠으니 불시 새것을 얻어 성공할 여세입니다.','화기가 문에 이름으니 만물이 서로 어울려 살아나기 시작합니다. 용이 밝은 여의주를 얻었으니 어찌 그 조화가 무궁무진하지 않겠습니까. 무엇이든지 해본 일입니다. 봄바람에 만물이 꽃을 피듯 드디어 뜻을 얻었으니 주저할 게 무엇이겠습니까.','푸디 푸른 강가에서 비를 만나 더욱 푸르듯 은인을 만나 도움을 받게 되니 더욱 성숙하게 됩니다. 그러나 실행하면 불리하고 집에 있으면 길하니 밖에서 이익을 추구해서는 안됩니다. 용이 하늘 문을 열었으니 불시 부국영화를 누리게되겠습니다.','여수가 대통하니 한 집안이 태평하여 태평성가를 부르며 즐기는 격입니다. 재물은 흔할진데 이익은 정손와 김손으로부터 비롭될 것이니 유념하여 사귀도록 하십시오. 만약 주색을 가까이 하면 잠병이 몸에 침혹할 것이니 주의하십시오.','내가 먼저 굳션나무를 꺽었으니 사람마다 다투어 우러러보게 될 것입니다. 이는 뜻밖의 영화로 귀하게 된 것이니 반드시 귀인이 도와게 될 것 입니다. 남북 양방에서 반드시 큰 재물을 얻으리니 벌인 일은 힘껏 밀고 갈 일입니다.','재운이 왕성하니 반드시 재물을 얻게 될 것입니다. 그러나 뜻을 너무 높게 세우면 길함이 변하여 흉하게 될 것이니 분수를 지켜서 조심스럽게 임해야 합니다. 만약 이러하지 아니라면 십하에 놀랄 일이 있겠으니 주의하십시오.','몸이 높은 집에서 노니니 의기가 양양하고 사내대장부의 기상입니다. 한 집안이 태평하니 어찌 아름답다 하지 않겠습니까. 상하가 서로 화합된 대감이겠습니다. 서쪽과 북쪽 양방향으로 실행하면 길하며 일을 마무르 짓는데 집념을 다해야 합니다.','달 밝은 밤에 누각에 누워 술을 마시고 스스로 즐기는 격이니 마음이 태평하겠습니다. 집에 경사가 있을 즈음니 필시 자신을 낮거나 아니면 식구를 늘리겠습니다. 서쪽과 남쪽 양방향에서 성금을 얻을 것이니 하는 일을 계속 추진하여 크게 마무르 지으십시오.','어두운 밤길에서 등불마자 꺼졌으니 동서남북을 분간하기 어려운 만큼 앞이 캄캄합니다. 재물을 앗고 뜻도 앗았으니 도덕을 조심하지 않으면 마음까지도 상하게 되겠습니다. 이익은 잘 사귀 친분에서 비롭될 것입니다.','여수가 형통하고 문제이 없으니 의기가 양양하고 자랑스럽습니다. 만약 이런 좋은 수가 생기지 않는다면 도리어 험험함을 당하여 감당하기 어려운 험탄감을 맛보게 될 수도 있습니다. 뜻밖의 귀인을 만나서 도움을 받을 것이니 기대해 보십시오.','집안 사람들이 마음을 하나로 합치니 이익이 그 가운데서 생겨나게 되겠습니다. 이익은 반드시 정손으로부터 생길 것이니 주위를 살펴보시기 바랍니다. 재물을 얻긴 했으나 가진 것보다 많이 쓰야 하니 재물 사정이 여의찮 않겠습니다. 이 또한 무슨 일입니까.','2025-03-02 03:02:01.030508+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (176,'020','우리 타향에서 역사를 만날면 얼마나 기쁘겠습니까. 고고함을 띠하지 마십시오. 마침내 안락함을 얻을 것입니다. 신상에 수고로움이 있으나 이를 유수라 생각하고 필시 끝이 좋을 것입니다. 마음에 번민이 많더라도 유수는 좋은 것이라니 얻는 만큼 스스로 마음을 달래야 합니다. 그대를 만나 반드시 공명을 얻어 남의 이름을 날치게 되겠습니다. 봄철에는 반드시 식구가 늘게 될 것이니 경사가 아니겠습니까. 많은 친지들이 수복하게 축하드니 가히 큰 생각이 날 정도입니다. 낮고 낮은 하늘가에 해가 돌아가고 세상이 처음으로 호조를 맞이했으니 막을 비가 찾아옵니다. 사람 사귀기를 열심히 하면 이로 인해 많은 이득을 얻게 될 것입니다.','먼저는 차갑더니 뒤에는 좋게 될 것이니 유수가 차차로 흘러가고 돌아옵니다. 돌아오게 됩니다. 식구도 늘고 토지도 늘어나니 기쁨이 가정에 가득하고 좋음이 떠나지 않겠습니다. 몸이 분주하나 수고하면 그만큼의 공로를 얻을 수 있을 것입니다.','다른 사람이 나의 어려움을 듣고 구해줄 것이니 반드시 희소할 수입니다. 봄 흙이 된 비를 만날 것이니 수복이 스스로 끌려들어 올 것입니다. 변하여 길하게 되는데 어찌 기쁘지 않으며 집안 재산이 늘어나지 않겠습니까?','신상이 불안하니 의수가 가볍게 성취되지 않고 뒤늦게야 다툼게 될 것입니다. 수고스럽게 고생을 해도 즉시 그 대가를 얻을 수 없으니 운이 그런 걸 어찌 하겠습니까. 옳은것을 지키고 안정하면 사람들이 도울줄 것이니 분수를 지키니 좋겠습니다.','음양이 화합하니 반드시 경사가 있겠습니다. 만약 관력이 아니라면 자신으로 인한 경사나 식구를 늘려 즐거움을 영접하게 될 것입니다. 집밖 출입을 삼가십시오. 진실이 친절하겠습니다. 밖에서 이득을 추구하면 일이 성사되지 않고 몸만 상할까 두렵습니다.','관기가 발동했으니 휘된 꾀를 꾸며 허실 되게 긋지 마십시오. 여러분들이 지켜볼 것입니다. 두 사람이 마음을 합하면 어려운 일도 속히 이룰 것이니 먼저 화합을 생각하십시오. 그리하면 집안에 경사가 생길 것이며 필시 이득도 따를 것입니다.','동서의 길이 있으니 타향에 나가 분주합니다. 일을 시작하고 끝마침하는데 있어 성취하게 될비겠습니다. 다른 말을 귀대아 듣지 마십시오. 별로 이득이 없을 것입니다. 마음이 번민스럽고 어두우니 누구를 향하여 속마음을 털어놓을 수 있겠습니까?','동방화촉에 흙로 쌓아 거문고를 타는 것이니 신세가 외롭습니다. 곤한 뒤에 길함이 올 것이니 이득은 필시 가을첨에 돌아올 것입니다. 사방에서 도와주고 먼저는 길하고 뒤는 이롭지 못하겠습니다. 내일을 대비해야 합니다.','경영하는 일을 속히 밀어붙이면 길하고 성취하게 될 것입니다. 바깥을 가하십시오. 만약 그대이 왼쪽 도왔다면 큰 재물을 얻게 될 것입니다. 인연을 자하게 여겨야 합니다. 봄칩들이 봄철을 만나니 잎이 피고 얼매를 맺을 수 있겠습니다.','일을 곧하여 순조롭게 이루하게 될 것이니 반드시 길함이 있겠습니다. 신수가 대길하니 백가지 일마다 길함이 있을 것입니다. 그동안의 수고가 결실을 맺었습니다. 옛 재물이 왕성하여 뜻을 이루고 고향에 돌아오니 의기양양합니다.','남쪽과 북쪽으로 가면 묻을 것과 잃을 것을 얻게 되니 성심껏 추진하여 일을 마무리 짓도록 하십시오. 재물이 북방에 있으니 마무리를 지을 때 다른 사람과 합세하면 좋겠습니다. 그러나 사람을 잘못 사귀면 피해가 있으니 조심하십시오.','모든 일이 형통하니 어려움이 없습니다. 사람으로 인하여 성취하게 될 것이니 인연을 잘 맺도록 하십시오. 마당 나부가지에 봄이 돌아왔으니 그 형상이 다시 돋아났습니다. 먼저는 곤하고 뒤에는 왕성해지니 재물이 남북 양방에 있습니다.','이득이 멀리 있으니 조급하게 서두르지 마십시오. 실행하면 이득을 얻을 수 있으니 떠나십시오. 만약 그대를 만나면 큰 재물을 손에 넣을 수 있을 것입니다. 그러나 서북쪽으로 가지 마십시오. 재물을 마음대로 얻지 못하고 도리어 불리할 것입니다.','2025-03-02 03:02:01.03935+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (177,'021','한가로이 바닥을 두며 바닥씻 높는 소리가 잘잘합니다. 우물 안에서 놀던 고기가 드디어 바다로 향해나가는데 어찌 의기가 양양하지 않겠습니까? 집안 사람들이 서로 화합하여 집안이 화평하기 그지없습니다. 그대이 왼쪽 서로 도와주니 반드시 길하고 이로운 일이 생기겠습니다. 봄에는 근심 걱정이 없이 평안하게 지낸다가 여름철에 접어들면서 일이 다소 거슬림이 생기게되나 봄 동산에 약야채이 때를 만날 뜻이 만발하여 재력이 몸에 따르니 뜻밖에 희생을 하게 되겠습니다. 잠시 구름이 흩어지고 다시 밝은 달이 나타나니 천지가 명랑하기만 합니다. 근심과 걱정은 조금도 없고 집안이 화목하게 되니 만사 형통하게될 것입니다.','화사한 기운이 집안에 이르러 그 힘을 발휘하니 근심 걱정 없이 스스로 즐거움을 누리게 됩니다. 상하가 서로 화목하는 데 어찌 어진 칭송의 소리가 이웃에 들리지 않겠습니까. 복덕이 몸에 임하였으니 세상에 아무런 근심이 없겠습니다.','우물 안에 쌓던 고기가 높은 곳에 이르렀으니 의기 양양하고 활기가 생기는 넓치는 운입니다. 식구가 늘던지 가산을 더할 것이니 재물이 스스로 왕성해지겠습니다. 복숭아꽃이 봄철을 만날 것이니 마침내 성실한 열매를 맺겠습니다.','밖으로 기쁨과 좋음이 하늘을 채우지만 안으로는 근심과 걱정이 생길 것이니 지혜로운 조화를 이루어야 합니다. 이 달은 흉함이 많고 길함이 적으니 맹사를 신중하게 처리해야 합니다.','갈 길은 멀고 바쁜데 앞에 산이 나타나 갈 길이 막혔으니 어찌하겠습니까. 잘잘못을 따지거나 시비를 하게 되면 구설수를 면치 못하겠습니다. 봄에는 일이 약간 거슬리는 듯했으나 여름이 시작되면서 물밀기 시작하니 미리 방비해야 합니다.','일을 곧함이 이루지 않으니 함부로 다른 경영을 하려고 구상하거나 넘비지 마십시오. 여름의 유수는 밝는 사람에게 도덕을 뭍는 것이니 신중하지 않으면 후회를 집에 있으면 별 이득이 없고 활동을 해야 길하니 성실함이 비결입니다.','먼길을 가거나 원대한 계획을 세우면 도덕을 먹기 쉽습니다. 만약 집안에 우환이 생긴다면 집을 떠나지 말고 지키는 것이 좋습니다. 몸이 길 위에 있거나 어떤 여정에 올라있다면 한번은 길하겠습니다. 시기를 보아 한번쯤 움직여 볼일입니다.','다른 지방에서 재물을 얻었으니 금의환향하여 고향에 온을 자랑삼게 되겠습니다. 사람을 잘 못 사귀면 불리하니 거래를 조심하십시오 만일에 일을 잃는데 지장이 생길지도 모르니 미리 조심하고 방비함이 옳겠습니다. 그 해는 반드시 사람으로 인한 것입니다.','하늘과 땅이 서로 화합하여 하나로 자합을 하였으니 이로움이 그 가운데 있겠습니다. 의수가 크게 있겠으니 작은 것이 쌓여 큰 것을 이루게 되겠습니다. 이 달의 유수는 서쪽 방향이 불리하니 그 방향을 조심하고 일을 마무리하는데 성심껏 해야 합니다.','7,8,9월 3개월 동안의 유수는 재물이 생겼지만 큰 것은 아닙니다. 그러나 사람들이 주위에서 서로 도와주니 평안하고 태평하겠습니다. 이득은 이쪽에 있겠으니 그로 인해 이득을 얻게 됩니다. 그 쪽에 관심을 가짐이 좋겠습니다.','복을 가진 별빛이 문에 비치는데 어찌 외부에서 재산이 들어오지 않겠습니까. 이승을 가볍이 하지 마십시오. 그 일로 인해 일어나는 구설수를 먹기 어렵습니다. 경영하는 일은 머리만 있고 꼬리가 없는 형국이니 일단 시작하면 끝을 보도록 노력해야 합니다.','사람 사귀기를 조심하십시오. 사람마다 다 좋은 것이 아님을 알게됩니다. 그러나 의수가 좋아 희생을 하게되는 것도 사람을 사귀는데서 비롯될 것이니 지혜롭게 삽시다. 만약 그대를 만나게 되면 관력이 몸에 임하여 기쁘게 되겠습니다.','길한 방향은 서쪽과 남쪽 두 방향이 한창 번창할 때엔 마무리 짓는 데서 이득을 볼 수 있겠습니다. 길함이 문에 비치는데 어찌 그대이 왼쪽 도와주지 않겠습니까. 모든 일을 조심하면 손에 수를 면하고 하는 일에 결실을 맺겠습니다.','2025-03-02 03:02:01.050431+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (178,'022','흐릿이름을 그리려고 했는데 잘못 되어 갱 그림이 되고 말았으니 이를 어찌하겠습니까. 하고자 하는 일마다 재앙과 화가 생길 수 있습니다. 만약 망령되어 움직이면 이를 이루기 어렵습니다. 이사를 하거나 새 일을 도모하게 되면 집에 근심이 생길것이니 주의하십시오. 일에 허실함이 많으니 온갖 노력만 기울이고 뜻을 이루지 못해 신명만 허비하기 쉽습니다. 글의 유수는 망령되어 움직이면 헤를 면케 어렵겠습니다. 손해를 보다가도 뒤에는 얻게 될 것이니 꿋꿋히 대처해야 합니다. 가을은 일이 성사될 것이니 기다리십시오. 조금 평범한 것이 천리를 가면 천리만큼 멀어지니 처음시작을 잘 해야 합니다. 복력이 비쳤으니 재물운이 잠시 막히게 되겠지만 재물로 마음을 상하여 잠을 이루지 못하면 건강을 크게 상하게 되니 절대로 금물입니다','허망함이 앞을 가로막고 있으니 일을 해도 마침내 허망하게 됩니다. 맹사가 막혀서 성취되기 어렵습니다. 될 수 있는 대로 일에서 멀어져서 마음을 상하지 않는 것이 상책입니다. 바라는 일은 많으나 뜻대로 못는데 어찌 하겠습니까. 서두르지 마십시오.','진실이 몸에 친절하기 쉬우니 병이 있는 집을 가볍이 하지 않도록 주의하십시오. 시비를 가볍이 해도 구설이 생겨 마음의 병을 얻음과 같습니다. 구름과 비가 하늘에 가득 찼는데 비가 내릴 생각은 안하니 얼마나 딱딱한 일이겠습니까. 그러나 구름은 반드시 비로 변하겠습니다.','유생가 대길하니 일을 시작하면 성사되겠습니다. 집안사람의 마음이 한가지로 화합되어 같아지니 집안이 화평해지고 마음이 평안합니다. 동쪽과 남쪽에는 마침내 길함이 있으니 시작하여 성사를 시키는 과정에서 뜻이 생기게 됩니다.','일이 많이 막히게 되고 집안 사람들이 그 일로 인해 불화하기 쉽습니다. 여름의 유수는 축하우이 몸을 언보고 있느니 항상 조심해야 합니다. 산에 가서 기도하면 가히 이 수를 면하게 되겠습니다. 기도하는 마음으로 맹사를 사려하면 큰 화를 면할 수 있겠습니다.','재물이 손안에 들어온 줄알았는데 사람은 떠나게 되었으니 마음 상하게 되겠습니다. 이 달의 유수는 먼저는 좋고 뒤에는 슬피에 각자 우는 것입니다. 몸이 불평하고 마음이 산란하여 앉지도 서지도 못하고 망설이는 것이니 과각하게 대처하십시오.','타인의 도움을 받게 된다면 재물이 마침내 끌려들어 올 것입니다. 비온 뒤의 강산의 불빛이 더욱더 환려진 것과 같습니다. 모든 일을 가히 이루고 재물도 나올 수입니다. 친철하게 준비한 결과이니 서두지 말고 거듭들여야 합니다.','귀한 사람을 만나 마침내 뜻을 이루는 기쁨이 있습니다. 재앙과 진실이 사라지고 반드시 좋은 일이 생기겠습니다. 안정하여 분수를 지킨다면 화가 끌려와도 변하여 복이 될 것인데 무엇을 주저하겠습니까. 분수를 지키는 것이 곧 복음을 알아야 합니다.','사람 사귀기를 조심하십시오. 잘 못 사귄 사람으로 인해 헤를 면케 어렵겠습니다. 집안에 불안한 일이 생기고 동서남북에 근심이 도사리고 있으니 주위를 살펴야 합니다. 만약 손의수가 아니면 진실이 두렵습니다. 진서 있는 생활만이 이 얿을 면할 수 있겠습니다.','시비를 가볍이 마십시오. 구설수가 몸에 친절하여 몸과 마음을 상하겠습니다. 관기가 발동하여 관의수가 생길지도 모르니 모든 색사나 문서에 주의해야 합니다. 좋은 유수를 만나지 못하였으니 억지로 일을 도모하면 마음만 괴롭겠습니다.','땅을 사들여 그 안에서 금광을 발견하고 금을 찾고자 하나 둘 다 별 소득이 없는 것 같습니다. 나를 해칠지하는 이가 도사리고 있으니 사람을 주의하십시오. 하는 일마다 이름은 있고 실상은 없어 헛되이 마음만 허비하기 쉽습니다.','좋은 유수가 도래하여 나를 도우니 희생할 수입니다. 나를 해칠지 하는 사람을 지혜롭게 피하면 반드시 길하겠습니다. 이득이 어느 곳에 있는가 하면 반드시 서쪽과 북쪽 양방에 있습니다. 일을 마무리 짓고 난 뒤에 이득을 얻을 수 있습니다.','글의 재수는 갑자 셋 달 유수니 잘 지켜야 합니다. 집안 사람의 마음을 하나로 합해야 집안이 태평합니다. 모든 일을 조심하고 분수를 지키면 복력이 스스로 찾아옵니다. 한 번 온 기회를 놓치면 매우 어렵게 되니 신중을 기해야 합니다.','2025-03-02 03:02:01.061014+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (179,'023','비로 새로운 영광을 확보했다 할지라도 일신이 있어 자리를 지키고 있으니 어찌겠습니까. 허실한 일은 삼가고 행하지 않음이 옳겠습니다. 마음은 있어도 이루지 못하면 도리어 신수를 공거하게 만들상입니다. 맹사가 분리하게 되고 놀사를 줌든 하던 일을 충실하게 지키면 이롭습니다. 일을 너무 맹신하다보면 마침내 실패하게 될 것이니 밝는 다리도 두둘겨 보고 건너는 신중함이 필요합니다. 글의 유수는 옳은것을 버리고 새것을 찾아야 합니다. 그러나 불분명한 곳에 발을 들이게 되면 친한 사람에게 배신을 당하거나 기대했던 사항이 끊지기 쉽습니다. 알기치 않은 일이 눈앞에서 일어나 고통을 겪게 될 수도 있으니 조심하십시오. 또한 시비를 조심하지 않으면 색사가 생겨 구설수에 말리게 되니 주의하십시오.','신수가 불리하여 우환이 올까 가히 두렵습니다. 의수가 자유자재로 통하지 아니하니 재물을 구하려고 애를 써도 쉽게 얻지 못합니다. 정월의 유수는 속히 하려고 서둘러대지만 뜻대로 이루어지지 않을 것이니 기다려야 합니다.','눈이 온 두리를 덮었는데 그 위에 또 서리가 내린 것으로 몸이 고달프고 어려운 수밖에 없겠습니다. 만약 손의수가 아니면 반드시 사람이 따르겠습니다. 구설수를 조심하십시오. 잘못하면 물건을 잃고 억히려 남들로부터 원망을 들을 수 있겠습니다.','고목이 봄철을 만나 천리에 비가 비치는 것입니다. 북방이 해로우나 점진적인 관계만 조심한다면 뜻을 이룰 수 있습니다. 앞에서 축하우이 기다리고 있으니 도덕을 조심해야 합니다. 분수를 지킨다면 그동안 기다리던 좋은 소식을 얻겠습니다.','사람들과 함께 낮은 두곡에 올랐으니 날이 다 지나도록 즐겁고 유쾌하기만 합니다. 분수 밖의 것을 탐하지 않는다면 바라는 것을 과히 얻을 수 있겠습니다. 다른 사람의 말을 가볍게 받아들인다면 후회해도 헤를 면할 길이 없겠습니다.','신운이 길하지 못하니 설령 재물을 구하려고 노력을 해도 마음대로 얻기가 어렵습니다. 마음이 고요하지 못하고 산란한데 어찌 곧하는 일이 쉽게 이루어질 수 있겠습니까. 만약 손의수가 아니면 구설수로 화를 입게 될 것이니 자중해야 합니다.','유수가 거슬림이 많아서 순조롭지 못하니 실패하기 쉽습니다. 친구를 무작정 믿고 일을 함께 도모했다가는 구설수를 면치 못하겠습니다. 혹 실패수가 두려거든 모든 일을 조심하고 밝는 도낭에 발들을 촘촘히 지 않도록 신중을 기해야 합니다.','옳은것을 버리고 새로운 것을 찾아 시행할 유수입니다. 봄 흙이 드디어 비를 만나서 날로 더 성장해 나가는 것인데 무엇을 망설이겠습니까. 유수는 평탄한 길을 찾았고 신수는 태평하니 태평대로를 달리 듯 힘차게 행진해 볼 일 입니다.','동쪽이나 남쪽에서 반드시 재물이 생길 것으로 보입니다. 처음 일을 시작할 때의 기백으로 밀고 나간다면 이득을 얻게 됩니다. 봄에 재물이 왕성해지는데 어찌 태평하지 않겠습니까. 그러나 이승을 가볍이 하지 마십시오. 그 일로 인한 구설수를 면케 어렵겠습니다.','그동안 몰아치는 폭풍우가 처음으로 지니 달이 산천에 비쳐 밝기가 하염없습니다. 불과 물을 조심하고 사람 사귀는 일에만 신중을 기한다면 반드시 어두운 밤이 끝나고 밝은 날을 맞이하게 될 것입니다. 소신을 가다듬어 일을 진행하십시오. 보람이 나타날 것입니다.','사람의 인연을 중히 여긴다면 반드시 인연이 있는 사람을 얻어 크게 이롭게 됩니다. 이득이 서쪽에 있으며 일을 마무리 짓는데서 생기는 이득입니다. 화가 끌려 들어와서 복이 되는 것이니 길흉이 상반한다하더라도 기쁨이 더 크겠습니다.','이 달의 유수가 불길하니 일을 구하여 도모할지라도 쉽게 이루기는 어렵습니다. 산에 올라가서 물고기를 구하는 것이라 곧하는 일이 억히려 허망하기만 합니다. 색사를 하지 마십시오. 반드시 손해가 뒤따릅니다. 찬고 갈등만 못하겠습니다.','관청에 드나들지 마십시오. 손의수가 문을 기다리고 있습니다. 볕 있는 집도 가볍이 하지 마십시오. 진실이 몸에 친절할까 두렵습니다. 첫 달의 유수는 이것만 조심하면 기쁜 일이 들짐할 수입니다. 마침내 뜻을 이루고 기쁨을 함께 나누어 가지게 되겠습니다.','2025-03-02 03:02:01.072477+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (180,'024','홍이 가물었으니 그해의 일은 가히 직작하고도 남음이 있습니다. 공부함을 한탄하지 말고 꿋꿋히 일하십시오. 늦게야 좋은 운을 얻을 수 있겠습니다. 비록 먼저는 곤하더라도 뒤에는 형통하여 때를 만나게 되니 그때 비로소 모든 일이 터지겠습니다. 앉 것이 다가고 닫 것이 돌아오니 늦게라야 성공할 유수입니다. 곧하고자 하는 일이 뜻대로 성취되니 마침내 형통하여 어려움이 없게됩니다. 명산대천에 기도하면 후액을 면하고 집안도 화평할 것입니다. 환한 산 위로 말게 걸인 달이 불찬 삿되었으니 많은 사람들이 손을 들어 반갑지겠습니다. 그러나 달 떨어지고 깊마귀가 울게 되면 한탄만 절로 나오게 됩니다. 미리 이사하거나 다른 일을 도모하면 이 액을 면하겠습니다.','공고하고 굳로움이 있으니 신상이 평안하지 못하고 불안함을 어찌 하겠습니까. 분수 밖의 것을 탐하지 마십시오. 흉한 비결은 무용지물이니 필시 허실함을 보겠습니다. 앉 것을 다 보내고 닫 것을 맞이하니 마침내 성공하되 늦게라야 되겠습니다.','사람을 잘못 사귀면 그로 인하여 헤를 볼 것이니 못된 사람은 미리 경계하십시오. 만약 관의가 아니면 구설수나 진실이 생길 것이니 대비해야 할 것입니다. 삼시에 근심운이 있으나 별로 큰 손해를 끼치는 않을 것이니 염려할 것 없습니다.','공고한 액운이 있으니 진실을 조심하십시오. 마음이 산란할수록 건강에 유의해야 합니다. 비록 몸이 곤경에 처했더라도 거처가 확실하면 되니 거처가 불안하지 않도록 하십시오.','비록 일을 곧하게 됐지만 재물을 얻기는 쉽지 않습니다. 별로 소득이 없겠습니다. 허언을 부리다면 필시 불리할 것이니 계획을 바꾸거나 솔직한 일을 계획하지 마십시오. 물을 거슬러 배를 몰아 가는데 별로 어려움이 없겠습니까. 사리가 부당해지면 안됩니다.','어두운 밤길에 촛불마자 꺼졌으니 동서남북을 분간하지 못하고 앞이 컴컴하겠습니다. 만약 술을 가볍이한다면 기이한 일이 콧앞에 눈쳐 피하게 어렵게 될 것입니다. 이득은 동방에 있으니 반드시 재물을 얻을 것입니다. 과각하게 넘버보십시오.','앞길에 횡난함이 기다리고 있으니 실행하면 이루지 못합니다. 먼리서 이득을 추구하지 마십시오. 경영하는 일을 남에게 말하게 되면 큰 헤를 입을 것이니 비밀을 유지하십시오. 만일 구설수가 생기지 않는다면 관의나 흉액이 친절할 수 있습니다.','보고도 믿지를 못하는 그림의 꿈이니 생각은 무귀무진하나 어찌 실천이 가능하겠습니까. 해와 달이 밝지를 못하니 신상에 공고함이 있겠습니다. 몸을 잘 보살펴야 합니다. 마음속에 남 모르는 번민이 있을지니 누가 이일을 알아줘겠습니까. 답답합니다.','시비를 가볍이 하지 마십시오. 구설을 면케 어렵습니다. 어떤 시비라도 피하는 게 상책입니다. 길금귀신 봄이 돌아왔으니 드디어 초목들이 즐거움을 누구는 것과 같습니다. 타인의 재물이 우연히 집에 들어왔는데 어찌 희생가 아니겠습니까?','다른 것을 경영하려고 넘비지 마십시오. 도리어 그 헤를 받게 되리니 분수를 지키십시오. 좋은 유수가 점점 돌아오기 시작했으니 백가지 일마다 길함이 있겠습니다. 이후로부터는 모든 일이 차차로 형통 할 것이니 차분하게 임해야 합니다.','망령 들린 행동하게 흉액을 면케 어려우니 진실거지 불러들일 것입니다. 되면 옳은것을 지키고 안정을 도모하면 거의 이 액을 면할 것이니 분수를 지켜야 합니다. 만약 서쪽으로 나아가면 손의와 구설이 있겠습니다. 서둘러 결정짓기를 보류하십시오.','동중달의 유수는 별로 손해도 없고 이득도 없이 길흉이 상반될 것입니다. 재물은 동방에 있으니 나가면 가히 얻을 수 있습니다. 일을 곧하면 그 효적을 보겠습니다. 이득은 필시 권속와 붓속가 잘 것이며 사람 사귀기를 성심껏 해야 합니다.','반드시 형통함이 있겠습니다. 이 기회를 놓치게 되면 돌이킬 수 없는 후회가 따르겠습니다. 명산대천에 기도하면 집안이 화평해질 것이니 성심으로 기도를 드리십시오. 흉액수가 있으니 몸을 실행하지 말고 기도하는 자세로 자신을 지켜야 합니다.','2025-03-02 03:02:01.080985+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (181,'025','먼은 바람 밝은 달빛 아래 흙로 쌓아 물동이를 두들기는 장자와 같은 운입니다. 맹사가 뜻대로 이루어지지 않고 억히려 진실이 따라 공고하니 어찌 한탄하지 않겠습니까? 음양이 화합하니 한 때는 만물이 살아나기 시작하겠습니다. 용이 흙른 바닷물을 만났으니 반드시 기쁜 일이 생길 것입니다. 그러나 처음은 좋고 뒤는 불길하니 마치 고향을 떠난 사람이 타향에서 공고함과 같습니다. 만일 이와 같이 않으면 벼웠자의 근심이 생기니 어찌 하겠습니까. 웃을 심으면 웃을 얻고 피를 심으면 피를 얻으므로 인연을 분명하게 맺어야 합니다. 앞에는 높은 산이 있고 뒤에는 더 높은 준령이 있음을 알아야 합니다. 가물 하늘에 큰비가 내려 때를 만나 따듯할 것이니 이때를 기다려야 합니다.','하춘은 일거리도 없고 사업도 어려운 형편이니 피곤은 해도 공을 이루기가 어렵습니다. 만약 관가에 일이 없다면 집에 진실이 있을 것이니 공고함을 미리 막아야 합니다. 만약 그대를 만난다면 신상에 평화로움이 있을 것이니 기대해 보십시오.','집안에 경사가 있으니 반드시 자손으로 인한 경사나 식구를 늘리게 될 운입니다. 재물이 북방에 있으니 구하면 가히 얻을 수 있겠습니다. 일을 마무리 짓는데 주력하십시오. 남방에는 행하지 마십시오. 길함이 변하여 흉함이 됩니다. 일을 크게 바람은 억히려 불리합니다.','서쪽과 남쪽이 해로우니 그쪽을 주의하십시오. 성업을 지탱 하려거나 성불로 결정해서는 안됩니다. 사람을 잘 못 사귀게 되면 필시 헤를 입게 될 것이니 주의하십시오. 만약 서로 다툼게 되지 않으면 구설수가 있으니 소유를 피해야 합니다.','관력이 몸에 임했으나 벼웠자의 신상이 평치 않겠습니다. 아니면 관의로 인한 구설수가 분분하리니 조심하고 거동을 무겁게 해야 합니다. 만약 경사가 생긴다면 이 액운이 사라질 것이나 그렇지 않으면 크게 상심하게 될까 두렵습니다.','남쪽으로 가지 마십시오. 길함이 변하여 흉하게 됩니다. 너무 일을 크게 바람은 불리합니다. 만약 그대를 만나면 뜻밖의 희생을 만나게 될 것이니 사람 사귀기를 유의하십시오. 혹시 손의수가 따를지도 모르니 모든 일을 처리함에 주의해야 합니다.','서쪽으로 가지 마십시오. 길함이 변하여 흉하게 됩니다. 일을 서둘러 마무리 짓는 것은 위험합니다. 일에 어려움이 있으니 일을 구해도 이루기가 어려우니 조심하십시오. 뜻은 있으나 뜻대로 이루기 어려우니 머리만 있고 꼬리가 없는 것과 같습니다.','맹사를 조심하십시오. 혹 손의수가 뒤따를까 두렵습니다. 글의 유수에 근심할 것은 굳이 성심에 주의해야 합니다. 동쪽과 북쪽을 가볍이 하면 시비가 생길니다. 일을 도모하거나 의논하거나 시작할 때 주의하지 않으면 시비를 면케 어렵게 됩니다.','날으려 하나 날개가 없으니 이를 어찌 하겠습니까. 일월이 날개를 얻지 못함이 한입니다. 소히 경영하는 것은 허망하기만 하니 더 나아갈 수도 멈출 수도 없겠습니다. 유수가 불길하니 망령될 계획을 생각하거나 부려서는 안됩니다.','마음에 수심이 가득 차니 집에 가만히 있음만 못하겠습니다. 밖으로 나가거나 일을 바치지 마십시오. 색사를 하거나 시비를 바치면 그로 인한 구설수를 면케 어렵습니다. 비록 재물은 얻지만 어려서 모으기가 어려우니 미리 조심하십시오.','산색가 짙을 베어나갔으니 의지할 때도 앉을 자리도 없음과 같습니다. 만약 흉액이 아니라면 손의를 면하기 어려우니 남을 조심해야 합니다. 욕심을 내면 도리어 실패할 것이니 분수를 지켜서 자중하면 이 액운을 면하겠습니다.','반드시 작은 재물이라도 들어올 것이니 마땅히 북방으로 나가십시오. 옳은것을 버리고 새것을 찾으니 기쁜 일이 앞에 기다리고 있습니다. 힘껏 도전해 볼일입니다.','마음의 주장이 서지 않고 흔들리게 되므로 기쁜 일과 슬픈 일이 상반되겠습니다. 일이 여의치 못하니 일을 곧하지 마십시오. 잘 못 넘비면 도리어 헤를 입게 될 것입니다. 유수가 갑자에 역했으니 작지도 않고 크지도 않습니다. 때를 잘 지켜야 합니다.','2025-03-02 03:02:01.089982+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (182,'026','바살 돌아가야 할 손님이 강에 도달해 보니 배가 없어 함내할 지경입니다. 위와 아래가 돌아 앉으니 강가에 임했는데도 배가 없으니 이를 어찌하겠습니까? 명례를 손상치 않으면 몸이 곤하고 욕된 일이 있을 것입니다. 갈증에는 더욱 어려우니 억지로 강물을 건널 필요가 없습니다. 만일 강을 건너려 한다면 손의가 많을 것입니다. 하고자 하는 일이 많아 등불서지 하겠지만 이를 성취하기 어려우니 신중해야 합니다. 신선이 마실 술을 도덕자해서 마심으니 아무리 갈추려 해도 놔이 부어짐을 어찌하겠습니까? 꿈을 하늘에서 얻었으니 볼고자 하나 볼 곳이 없습니다. 때를 기다려 선정하되 망령됨을 나가지 않는 것이 좋겠습니다.','누가 있어 그 마음을 알아줄겠습니까. 다른 사람과 일을 도모하면 반드시 손해가 있을 것이니 혼자서 헤아려야 합니다. 만약 재물을 구하고자 하면 북방이 대길하니 이 방향으로 나가십시오.','아무 일에나 함부로 손을 대서는 안됩니다. 만약 이사하지 않으면 삼시의 일로 한 번 놀랄 일이 있을 것입니다. 어두운 밤에 번개가 꽝찍 짐을 모르고 내려 좋은 달을 보기가 매우 어려운 유생이니 자중함이 좋습니다.','반드시 재물을 얻어 신득함을 누리게 될 것입니다. 솔직히 꾸민 일이 성취될 것이니 주의하여 임하면 생활이 태평해 질 것입니다. 집에 경사가 있으니 필시 삼시에 경사가 있겠습니다. 기쁨을 같이 나누게 될 것입니다.','타향에 나가지 마십시오. 구설이 친절하게 되겠습니다. 남의 일에 손을 대면 필시 믿름하기 어렵습니다. 재물이 없음을 한탄할 필요가 없습니다. 곧하면 다 통하게 되어있습니다. 4월과 5월에는 액이 있으니 마땅히 삼가고 기도를 드리면 좋겠습니다.','물고기와 용이 물을 얻게 되었으니 처음과 끝이 아주 불리하기만 하겠습니다. 유수가 불길하여 잘 못하면 큰 화를 당하게 될지도 모르겠습니다. 미리 대비해야 합니다. 솔개이를 피하려다가 흐릿이를 만나 것이니 일에 위험이 따르겠습니다.','관기가 발동하니 맹사를 맨들짓기가 어렵습니다. 두 사람의 마음이 각각 다르니 시비를 하지 마십시오. 만약 다툼게 되면 필시 관액을 불러들이게 될 것입니다. 만약 이사를 하지 않는다면 삼시에 놀라는 일이 생기게 될 수도 있습니다.','이득이 남북에 있으며 일을 성대히 진행하고 확실하게 진행하는 것이 중요합니다. 가을 첫 달에는 가히 분수를 지켜야만 액을 면할 수 있으니 미리 대비하십시오. 허망한 일은 필연커 손해를 볼 짓줄이니 헛되이 보지 마십시오.','휘된 욕심을 내어 망령되이 굳지 마십시오. 시작과 끝이 불리하니 이로움이 없습니다. 집에 있으면 심란하고 남방으로 출행하면 이로우니 하던 일을 힘껏 도우십시오. 의수가 이미 돌아왔으니 이득은 밥을 일구고 가난들이 꾸준히 노력함에 있습니다.','만약 손의가 아니라면 자손에 근심이 있으니 집 안팎을 잘 보살펴야 합니다. 만약 이 수를 지나게 되면 이득이 사방에서 생길짓이니 대비해야 합니다. 이 달에 유수는 진실이 친절하니 건강만 주의한다면 매우 좋을 것입니다.','굳은 산속에서 작은 토끼들이 어떻게 흐릿이 뜻을 맞출 수 있겠습니까. 귀여지책으로 사람의 말을 쉽게 믿었다가는 구설수에 헛말려 헤어나지 못하게 됩니다. 북방은 대길하나 남방으로는 가지 마십시오. 조용히 관심하되 성대히 보채는 것은 삼가야 합니다.','남방에는 액운이 있으니 흉액을 조심해야 합니다. 이를 떠받으면 불안합니다. 분수를 지키고 평안하게 기거한다면 이 화를 면하게 될 것이니 명심하십시오. 의수가 불길하니 구하여도 얻기 힘듭니다. 헛힘만 쓰지 말고 기다리는 것이 좋습니다.','작은 것으로 큰 것을 바라는 것으로 그 이득이 매우 크니 어찌 기쁘지 않겠습니까. 재물이 사방에서 들어오니 큰 재물이 생길 흔요로운지 신세입니다. 동쪽과 서쪽 양방에는 솔직한 일이 이루지 못하니 모사를 꾸미지 마십시오.','2025-03-02 03:02:01.102677+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (183,'027','환한 새가 소식을 전하는 데 어찌 흙아비가 배필을 만나지 않겠습니까? 심 홍을 경영해 왔던 노고는 하루에 영화가 될 것입니다. 좋은 운이 이미 돌아왔으니 심 홍 경영한 대가를 하루에 다 거두게 되겠습니다. 그대이 왼쪽 돕는다면 일을 뜻대로 성사될 것입니다. 만일 남의 도움이 있다면 흘인을 하거나 좋은 벼을 들게 될 것입니다. 글의 유수는 반드시 기쁜 일이 있겠습니다. 물고기가 용문을 뛰어드니 용을 받들고 복을 찾는 것인데 어찌 기쁘지 않겠습니까? 이름이 한 세상에 날치게 될 것이니 말을 몰아 글문을 세우게 될 것입니다. 물 가운데 달이 비쳐 천리나 나를 따라 왔겠습니다.','지성이 문에 비쳤으니 그대이 왼쪽 서로 대해주겠습니다. 집에 경사가 있으니 마치 아름다운 사람이 잔을 권하는 것과 같습니다. 필시 연인을 만날 꿈입니다. 식구가 늘어나거나 놀토나 집을 늘려서 기쁨을 맞이할 것입니다.','삼시에 경사가 있어 기쁘고 금과 옥이 창고마다 가득 찰 것이니 대통하겠습니다. 이름이 가볍고 멀리까지 날치게 되니 사람마다 우러러보게 될 것입니다. 이 달의 유수는 봄칩이 때를 만나 칩을 만발하게 피움과 같습니다.','혹 진실이 있을 지도 모르니 미리 명산 대천에 가서 불공을 드리면 좋겠습니다. 만약 진실이 있거든 밝은가 경영하는 의원에서 물으십시오. 액을 면하겠습니다. 길성이 문에 비쳤으니 죽음의 땅에서 살아 나온 사람을 만나게 되겠습니다.','처음과 끝이 하나 같으니 반드시 영화롭고 귀하게 될 것입니다. 사람을 잘 못 사귀게 되면 나이를 방해할 것이니 원근을 잘 가려서 대해야만 좋겠습니다. 만약 희생을 하지 않으면 억히려 진실이 임할 것이니 평소에 건강에 유의하십시오.','다양한 유수가 들어오게 되니 복력이 스스로 왼쪽 부구를 누리겠습니다. 길성이 문에 비쳤으니 태기가 있거나 식구를 더하게 될 것입니다. 먼저는 큰 이득을 얻고 뒤에는 안정되게 되니 이보다 더 좋은 운이 어디 있겠습니까?','집에 경사가 있으니 반드시 희생을 만나 재물을 늘리게 될 것입니다. 마음을 바르게 갖고 때를 기다려서 임하는데 어찌 성공이 마다하겠습니까. 필시 틀림없습니다. 다른 사람과 다툼지 마십시오. 이로운 일에 손해를 당하게 될지도 모릅니다.','재산이 문에 들어오니 반드시 희생하여 재물을 얻고 기뻐하게 되겠습니다. 재력이 몸에 임했으니 이름이 남보다 퍼지고 이득도 크게 됩니다. 좋음소리가 높은 집에까지 들리는데 어찌 기쁨이 가정에 가득 차지 않겠습니까?','맹사가 대길하니 재물이 문에 들어옵니다. 그대이 왼쪽 서로 도울 것이니 이득이 그 가운데 있음을 알고 사람 사귀기를 진실하게 해야 합니다. 재물이 사방에 있으니 이를 잘 마무리 지으려면 뜻밖의 희생을 하게되겠습니다.','굳은 산속에서 길을 잃었으니 길 가기가 매우 어렵게 될 형상이라 하던 일이 불가능하겠습니다. 다른 사람이 나를 꺾리게 되니 소망을 이루기가 어렵겠습니다. 집에 있으면 길할 것이요 그대이 왼쪽 도울 것이니 밖으로 나가지 마십시오.','달 밝은 밤 창가에 앉아 큰 일을 도모하면 성사시킬 수도 있을 것입니다. 문서에 길함이 있으니 이득이 땅을 넓히는 데서 비롯될 것입니다.','먼리 가지 마십시오. 불리한 일이 앞을 기다리고 있습니다. 지키는 것만 못하겠습니다. 맹사가 뜻과 같이 이루어지고 큰 재물이 문으로 들어왔는데 무엇을 서두르겠습니까. 남아가 뜻을 얻었으니 의기가 양양하고 거리낌이 없습니다.','만약 사람이 도와준다면 반드시 기쁜 일이 있을 것인줄 인연을 잘 맺도록 하십시오. 마음을 조급하게 가지지 않고 차분하게 하면 길함이 흉함이 됨을 면할 수 있습니다. 일이 여의치 못하여 세상일이 허실하게 될지라도 마음을 크게 가지고 더욱 노력하십시오.','2025-03-02 03:02:01.11462+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (184,'028','일에 산만함이 많으니 마치 도깨비가 놀에 나타나서 어찌할 바를 모름과 같습니다. 바람이 외로운 등불을 스치고 가니 불이 꺼지고 어둠만이 끼리게 되었습니다. 해와 달이 밝지 못하여 동서를 분간하기가 쉽지 않겠습니다. 친한 사람을 잘 못 믿으면 말은 달콤하지만 이를 어기고야 말겠습니다 맹사를 이루지 못하고 타인이 나를 속이니 정신을 바짝 차리지 않으면 필시 당하겠습니다. 집 에 있으면 길하고 실행하면 불리하니 밖으로 이득을 찾아 나서게 되면 좋지 않습니다. 달이 타면 이그러지고 그믐이 차면 넘치는 때가 지났습니다. 벡기지 잎이 있는들 어두워 볼수 없고 비단 희빛을 입었으니 밝길을 걷는 것이니 그 화려함을 볼 수가 없을 것입니다.','고요히 움직인다면 직업을 얻을 것이고 활동하여 부두치면 이득이 많을 것입니다. 만약 손의가 아니면 진실이 몸에 친절할 것이니 건강에 주의하십시오. 기쁨과 근심이 서로 섞였으니 한번은 좋고 한번을 삼시게 될 것입니다.','세상일이 꿈구름과 같으니 처음은 길하다가도 뒤에는 흉하게 변하겠습니다. 만약 구설수가 아니라면 도덕을 먹게 될 것이니 말과 행동, 문단속에 주의하십시오. 한파에 배를 띄움으니 나가려고 해도 나가기가 쉽지 않습니다. 자중해야 합니다.','그 집을 좋게 지키면 마침내 복이 돌아올 것이니 집밖을 가벼야 합니다. 신수가 불길하나 진실을 조심하고 평상시에 건강을 유의한다면 이런 액을 면하게 될 것입니다.','해가 구름 가운데로 들어가 버렸으니 구름이 해를 가려 어둡게 만들었습니다. 녀석 곳에 출입을 하면 해가 있으니 손의를 당하지 않는다면 출입을 삼가고 조심해야 합니다. 사람으로 해서 손해가 있을 것이니 사람 사귀기를 조심해야 합니다.','신상에 길함이 있으니 반드시 형통하여 어려움이 없을 것입니다. 재운이 바야흐로 가정에 이르러 길을 내었으니 가정이 평안하고 왕성하여 부러움이 없겠습니다. 평안하게 집에 있으면 이득이 그 가운데 있을 것입니다. 분수를 지켜야 합니다.','작은 것으로 큰 것을 바라게 될 운이니 재운이 형통하여 많은 이득이 있습니다. 그러나 타인의 재물을 탐하지 마십시오. 도리어 그로 인해 손해를 입을 것입니다. 시비를 가볍이 한다면 구설수가 따를 것이니 조심하고 자중하도록 하십시오.','새가 날개를 다쳤으니 날고자 하나 날아갈 수가 없습니다. 실로 안타까운 일입니다. 일에 두서가 있는 법이니 자꾸만 헛델거리지 말고 급히 서두지 마십시오. 혹 구설수가 있고 모사를 꾸며도 이루기 어려우니 솔직한 진행을 삼가십시오.','이그러진 달이 다시 둥그렇게 나타났으니 의심했던 일이 무엇인가를 알게 될 것입니다. 흉액을 피하려거든 미리 남방으로 가십시오. 하던 일을 성심으로 진행시켜이 좋겠습니다. 굴로움과 기쁨이 번번이니 한 번은 크게 좋고 한 번은 크게 울게되겠습니다.','달이 서천으로 떨어지니 밝 묻이 흐드득하기만 합니다. 도덕이 들깨 두렵고 재물을 잃을까 염려되니 자네 굳이 들 리가 있겠는가. 들고나 걱정입니다. 그래도 뜻하지 않은 일로 손의가 클 수 있으니 미리 조심해야 합니다 .','문서에 해로움이 있으니 사람 사귀기를 조심하여 아무에게나 의논하지 마십시오. 뜻하지 않은 재물이 우연히 들어올 것이니 모두 인연을 잘 맺은 탓입니다. 사방에서 이득을 보게 되니 반드시 큰 재물을 얻겠습니다.','강을 건너야 하는데 강가에 배가 없으니 어찌 건널 수 있겠습니까. 먼길을 가지 마십시오. 반드시 해가 있겠습니다. 가고자 하나 갈 방법이 없을 것입니다. 집에 불평함이 있다고 모두 밖으로 나서면 무단히 손의를 당하게 될 것입니다.','만약 진실이 없으면 부모에 근심이 생길 것이니 건강을 지키고 주위를 살펴보십시오. 큰 것이 가고 작은 것이 돌아오니 손해를 보거나 재물을 잃게 될 수도 있습니다. 일마다 순조롭지 못한데 어찌 세상일이 꿈과 같지 않겠습니까?','2025-03-02 03:02:01.123344+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (185,'029','볕들에 크게 상한 곳을 명의에게 물어본 들 어찌 고칠 수 있겠습니까. 가심이 발동하니 가정이 불안하고 일이 제 대로 흘러지 않아 망설이게 됩니다. 물과 불을 조심하십시오. 한 번은 휘된 일로 놀라게 될 것입니다. 의수를 헌한다면 얻어가지는 것이 도리어 흉하게 변할 것입니다. 연초부터 손의가 있으니 출발을 신중하게 하여 처음부터 실의에 빠지지 않도록 주의해야 합니다. 정월 중순에 필히 식구를 늘리는 경사가 있겠습니다. 마음은 이미 준비되어 있고 뜻은 충만한 데 빔은 얻고 빔만 얻으니 매우 아쉽습니다. 작게 가고 크게 와니 드디어 군자의 도가 빛을 발하기 시작합니다.','옳 땅이 발동하니 반드시 구설수가 있을 것입니다. 옳은것을 짖밟러 지켜야 합니다. 자가 옳은것을 지키도록 나섰으니 새로운 것을 곧하거나 경영을 도모하지 마십시오. 만약 타인의 재물을 탐하게 된다면 낭패를 면하기 어려울 것이니 주의하십시오.','만약 이사하지 않으면 처자에 근심이 있을 것이니 환경을 바꾸거나 자리를 고치봄이 좋겠습니다. 경영하던 일은 덜 듯하다가도 이루기가 어려우니 힘만 들고 공이 없겠습니다. 나아가면 마음이 한가롭고 들어오면 심란하니 어찌 하겠습니까?','묵주먹 사람이 음식을 얻었으나 떠먹을 숫갈이 없으니 참으로 답답하겠습니다. 재운이 허공 중에 떠 있으니 희생로 보이나 응하지 않는데 어찌 이득이라 하겠습니까. 시비를 가볍이 하면 구설수에 시달리고 관의를 당하여 크게 상심하게 될 수 있으니 주의하시기 바랍니다.','달이 구름 속으로 들어가 그 빛을 보지 못하게 되었으니 암담하겠습니다. 다른 사람과 어울려 일을 곧하나 도무지 성공하는 일이 없겠습니다. 떠받으리기만 해서는 안됩니다. 그로 인한 구설로 서로 다툼게 될 것이니 마음만 상하게 됩니다.','동쪽과 남방에서 그대이 왼쪽 도울 것이니 비로소 일을 바이고 추진할 때가 왔습니다. 집에 우환이 있으니 그 해가 적지 않겠습니다. 감수할 수도 있어야 합니다. 분수 밖의 일을 곧했다가는 앞에 이런 일조차 실패하기 쉬우니 조심하십시오.','재물이 길가에 흩어져 있으니 억지로 구하려 들면 약간은 얻을 수 있겠습니다. 6월과 7월에는 맹사가 무가 채어 될 듯하다가도 장애가 생기겠으니 조심해야 합니다. 일이 번복됨이 많으니 타인을 믿으리하고 스스로의 주견을 견지하십시오.','행하려고 하나 마땅히 길이 없으니 이를 어찌 하겠습니까. 흉액수가 있으니 성심껏 액을 면하십시오. 명산 대천에 가서 기도를 하거나 불공을 드림이 좋겠습니다. 일의 미결이 많아 처리하고자하나 해결보다 번민이 앞서게 되니 무릇겠습니다.','남의 말을 무작정 듣다가는 일이 억히려 더 꼬이고 허망하게 됩니다. 술을 가볍이 하지 마십시오. 반드시 이로 인해 손의가 생기는 것을 면하기 어렵습니다. 답답하다고 영행을 내서게 되면 진실이 몸에 친절할 것이니 분수를 지키십시오.','생소한 사람과 어울려 놀거나 사귀게 된다면 그로 인해 적잖은 구설수가 생기게 될 것입니다. 만약 이사를 하지 않는다면 길고를 면하지 어려울 테니 환경을 고치거나 잠시 여행을 다녀오는 것이 좋겠습니다. 그러나 서쪽과 북쪽은 불리하니 출행은 삼가십시오.','소망하는 일은 많아도 한 가지도 이루된 것이 없으니 이를 어찌하겠습니까. 만약 사람을 잘 못 사귀게 되면 구설수에 헛말려 헤어나기 쉽지 않을 것입니다. 맹사가 이토록 힘이 드니 허실한 일을 스스로 판단하여 일을 바치지 마십시오.','인연의 유수는 갈자 살아 있으니 마무리를 잘 짓도록 노력하십시오. 아무나 이로운 것이 아니니 비록 감삽이선이 있더라도 냉정히 비판할 능력이 있어야 합니다. 집에 경사가 있을 것이니 필시 자손에게 있을 경사입니다.','우연히 재물이 들어와 의외로 기쁨을 맡보게 될 것이니 필시 그동안의 수는 공헌일 것입니다. 만약 그대이 돕는다면 그 희생가 영 큰 것이 아닙니다. 동서양방은 이를 구해도 얻기가 힘드니 일을 바이거나 마무리 지으려고 넘비지 마십시오.','2025-03-02 03:02:01.134496+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (186,'030','더운 본 3월 달에 힘이 떨어지고 역경이 밀어닥쳐 필시 결실을 보게 되겠습니다. 크게 가뭄 때에 단비를 맞닥뜨리니 어찌 기쁘지 않겠습니까. 구름이 흩어지고 달이 나오니 경치가 다시 새롭고 아름답습니다. 풀이 강가에 푸르게 자랐으니 성하고 부드러운 풀을 소가 마음껏 먹을 수 있게 되었습니다. 글쓴이의 운수는 반드시 경사가 있거나 식구를 늘려 기쁘게 될 것입니다. 만일 이와 같지 않으면 환희하거나 좋은 법을 사용하게 될 것입니다. 가를 물에 바람이 이니 여덟 소식을 몹자 소식을 즉하게 되겠습니다. 몸과 마음이 평안하니 백가지 일이 모두 길하겠습니다. 청풍을 입고 돌아오는 심신이 마치 새 풍을 갈아입은 것 같으니 이 또한 기쁨이 아니겠습니까?','심신이 화합하니 반드시 경사가 있고 위아래가 조화를 이루는 기쁨을 맛보겠습니다. 세상이 문에 비치니 필시 자신을 낮거나 식구를 늘리게 될 것입니다. 다른 사람들이 많이 도와주는데 어찌 재물이 생기지 않고 길함이 없겠습니까?','만일 봉사를 하지 못하면 반드시 재앙을 만날 것이니 미리 조심해야 합니다. 백 가지 일이 두루 순조롭게 진행되니 하루에도 현금을 얻어 실용하게 될 수 있습니다. 길한 가운데 돌아왔으니 몸도 굳하고 재물도 융성해지겠습니까?','바른 마음으로 일을 꾀하면 앞으로 나아갈 힘이 없이 형통해 질 것입니다. 만약 언쟁 쓰지 아니하면 복을 입을까 염려되니 환경을 바꾸거나 언쟁하면 길하게 됩니다. 만일 자신을 낮게 된다면 식구가 늘어나 경사가 있겠습니다.','동방에서 사람이 와 나를 도울 것이니 필시 일을 새로 시작하는데에서 길함이 있을 짐작입니다. 만가지 암여이 소멸되었으니 몸도 성하고 재물도 융성해집니다. 바깥이 여름을 지금처럼 가르치니 도리어 불리하게 됩니다. 쉬어서 쉬든 일을 바이려면 도리어 불리하게 됩니다.','재성이 문에 비치니 재물이 동방에서 융성하겠습니다. 일을 시작하기 전과 시작할 때를 잘 보십시오. 그러나 형되이 이동하게 되면 해로우니 차라리 새 일을 도모함이 좋겠습니다. 재물이 몸을 따랐 것이니 가히 큰 재물을 얻겠습니다.','산과 들에 봄이 돌아왔으니 빛이 더욱 새롭습니다. 마치 새천지를 만난 기분입니다. 만약 재물이 생기지 않더라도 신중에 경사가 있을 것이니 기쁨이 크겠습니다. 먼저는 희하고 뒤에는 길함을 만나게 될 것입니다.','구설수를 조심하십시오. 남의 일에 참어 들면 필시 구설이 있을 것입니다. 물과 불이 서로 상극하니 서로 다투는 것입니다. 아무런 이익이 없습니다. 마땅히 동쪽이나 서쪽으로 향하십시오. 일을 시작하고 마무리 짓는데서 이익을 얻게 될 것입니다.','만약 귀인이 와서 도움을 주게 된다면 재물도 생기고 몸도 융성해 질 것입니다. 명월이 높고 이름이 이롭게 되니 귀인이 와서 도와주게 될 것입니다. 맹사가 여의하여 말썽지 않고 형통하니 신상이 평안하고 집안이 태평하겠습니다.','작은 것이 가고 큰 것이 오니 반드시 가정을 새롭게 이루게 될 것입니다. 만약 다른 사람에게 힘을 얻게 되면 자수성가가 아닌 대성을 보겠습니다. 동시에 경영하는 일이 길하게 될 것이니 맹사가 형통해 질 것입니다.','시비를 버리게 되면 마치 석재수를 면한 어려움 것입니다. 남의 일에 참어 들지 마십시오. 만약 그렇지 아니하면 구설수를 면하기 어려울 것입니다. 마음이 상해 환자 곤란하는 것을 누가 알아주겠습니까. 영치 스스로를 위로하고 진심이 상책입니다.','해와 달이 항상 밝으니 기쁨이 가정 안에 가득 찰 것입니다. 만약에 이름을 날치지 않으면 반드시 재물을 얻을 것입니다. 집안이 화목하게 살어나가고 식구들이 융성하게 자라게 되니 이 모두가 기쁨을 나타냅니다.','시비를 가리이 하지 마십시오. 구설수가 몸에 친근하여 흘러나가기 힘들 것입니다. 조주가 여의하여 말썽지 않고 형통하니 신상이 평안하고 집안이 태평하겠습니다.','2025-03-02 03:02:01.144488+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (187,'031','해가 중천에 떠오르면 기울기 시작하고 달도 차오르면 이그러지기 시작하는 법입니다. 촌인이 대작을 하니 촌한 굽음이 몰라 감당하기 어려운 법입니다. 만일에 이사하면 느리게라도 빛을 보게 됩니다. 새해를 안어하면 바람직합니다. 만일 이와 같지 않으면 하던 일을 고치기라도 해야 대길하겠습니다. 봄의 운수는 다른 경영을 꿋해서는 안 되는 차입니다. 여름에는 구설수가 분분하기 쉽습니다. 욕심을 부리는 일은 어찌가지 못할 것이며 즐거운 일을 꿋해 끈에 달하도록 못하고 가는 것은 위험합니다. 아래로서 위를 찌르니 옛것을 고치고 새것을 시작하거나 수정할 수입니다. 분수 밖의 일을 도모하게 된다면 새로운 일만 생기고 유익한 일은 없겠습니다.','남은 눈이 사라지지 않았으니 백가지 흥들이 아직 나오지 못하는 격입니다. 몸이 산곡에 있으니 마음이 심히 고독하고 피곤할 수입니다. 집안 사람끼리 화합하지 못하고 서로 어해하기 쉬우니 은인이 도리어 원수로 변하는 격입니다.','영목사이 몸에 임했으니 한번쯤은 멀리 여행을 가게 되었으나 다른 일은 도모하지 마십시오. 일을 바여도 이익을 얻기는 어렵습니다. 어찌려 해롭지 않음을 고맙게 생각하십시오. 경영하는 일은 머리만 있고 꼬리가 없는 격이니 흉함하기 쉽습니다.','뜻밖의 성공을 거두어 이름이 가까운 곳이나 먼 곳이나 할 것 없이 널리 알려지게 됩니다. 주인이 와서 도와줄 것이니 반드시 성공하게 될 것입니다. 이 달의 운수는 길한 방위가 동쪽과 남쪽에 있으니 그를 유의하고 시작과 버림을 중시해야 합니다.','봄날 파릇파릇한 화초에 서리가 내린 격이니 성장하기 힘들기만 합니다. 설령 성장하더라도 열매치가 않습니다. 만약 손재수가 아니면 구설이 분분할 것이니 조심하십시오. 소나가 길을 잃고 동부서주하나 방향을 분간하지 못하는 격이니 신중해야 합니다.','사람들과 더불어 같이 놀게 되니 길함과 흉함이 반반입니다. 입을 봉마개로 틀어막듯 지체다면 결단 시비에 말려들지 않겠습니다. 집에 있으면 유익하고 후운할 수 있는 운이니 함부로 바깥출입을 하여 실패를 자초하거나 안에 있는 이익을 버리는 일이 없도록 하십시오.','이름이 천리나 만리에 미치게 되어 모르는 이가 없으나 헛되이 이름만 나고 실속은 없는 격입니다. 신수가 꽹꽹치 못하니 몸가짐과 마음가짐을 바르게 해야 합니다. 비록 형이야 아우야 하고 지낸지라도 속마음은 함부로 말하지 마십시오.','강남으로 돌아가는 기러기가 편지를 받으러 전하는 격이니 모든 일에 길함이 있고 과력이 몸에 임했으나 강남으로 돌아가는 기러기가 전하는 소식이니 꿈 느낌 같이 있겠습니다. 만약 가볍게 떠이나 터전을 옮긴다면 불리하니 조심하십시오.','고요하게 앉아 분수를 지키면 대길하고 활동하여 일을 바이면 도리어 불리하게 됩니다. 직분을 지켜가며 편안하게 기거한다면 우연히 재물을 얻을 것이나 찾아 나서면 어찌려 오는 복을 놓치겠습니다. 아름다운 배필을 맞이하게 맞이하기가 쉽지 않겠습니다.','모든 골짜기에서 내려오는 물이 서로 합치니 작은 내가 드디어 바다를 이루는 격입니다. 밖은 실하고 안은 비어서 알아주는 이가 없으니 허전하겠습니다. 그러나 신수가 편안하고 길하니 오지 않는 재물을 한탄하지 마십시오. 마침내 바다를 이루는 격이니 소원 성취하게 될 것입니다.','창이 높은 사분을 열고 하늘을 보는 격이니 좋은 달 모습을 보기가 어렵습니다. 이익을 도모하려면 반드시 동방을 향하는 것이 좋으며 시작하는 일에 신중을 기해야 합니다. 그러나 사람 사귀는 일을 경솔하게 한다면 닥치는 해를 면커 어렵겠습니다.','이달의 운수는 비교적 수고를 많이 하지만 그만큼의 공덕을 얻기가 힘든 운수입니다. 바른 마음으로 신부를 지키고 근신한다면 흉한 것이 변하여 길하게 되겠습니다. 특히달의 운수는 물과 불을 조심해야 하며 주변을 살피지 않으면 후회할 일이 생기겠습니다.','귀인이 바로 곁에 있으니 운수와 이익을 보겠습니다. 마치 가을비가 곡식에 가득 찬 창고를 얻은 격이니 식력이 대길하겠습니다. 첫 달의 운수는 길함이 많고 흉함이 적으니 위험이 기다리고 고독이 심했던 액운도 모두 흘러게 됩니다.','2025-03-02 11:48:40.410386+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (188,'032','명판궁 사내가 날로 늙어가니 한 집안에 화기가 았았합니다. 가정이 화평하고 반드시 경사가 있어 기쁜 일이 진도 하겠으나 비록 길함이 있다하더라도 작은 근심이 떠나지 않으니 그것이 흠입니다. 그 흠을 이겨낸다면 항상 기쁨을 맛보게 됩니다.','새구가 늘어나고 낮토가 넓어져서 가옥을 늘리게 됩니다. 옛것이 가고 새 것이 돌아오니 작은 것을 버려서 큰 것을 성취하는 겁입니다. 재운이 날로 좋아지니 본명에 점심을 거두며 눌는 것처럼 마음에 화평과 신수의 태평을 누리겠습니다.','본명이 화창하게 열렸으니 봄 가지 꽃들이 앞을 다투어 피는 겁입니다. 새구가 왕성해지고 재수가 흥흥해 지니 마치 용이 물을 얻은 것처럼 변화가 무쌍합니다. 이런 일을 바탕으로 하고자 하는 일을 추진해 간다면 가히 뜻을 이룰 수 있겠습니다.','뜻밖의 성공을 하게 되어 그 이름이 사방에 널리게 되니 경사가 있겠습니다. 그대가 와서 서로 도왔주려고 하는 데 어찌 아니가 좋겠습니다. 때를 겸비하여 그 이름이 더욱 높아지고 가정이 한가해져서 남의 부러움을 사게 되겠습니다.','비측이 불리하니 구설수를 조심하십시오. 일을 마무리 짓는 과정에서 자신 일을 마무리 하다가 구설수가 생기기 쉽습니다. 자신 일을 잊기하다가 때를 놓는  과정이니 반드시 많은 경사가 있는 겁이니 시비를 가까이 하지 말고 멀리 한다면 화를 면하겠습니다.','어떤 일을 꾀하더라도 여의치를 안은 듯이 성사하게 됩니다. 그 일은 반드시 독보간의 방향이니 시행하기 전과  시행할 때의 주의를 잘 분별해야 합니다. 만약 관력이 아니라면 뜻밖의 후회를 하겠습니다.','자를 가지고 아름다운 경치가 있는 산에 올라가 친구와 함께 즐기는 겁이니 심신이 평안하고 재수가 평화로운 운수이나 어찌하거나 멀리 다른 일을 도모한다면 불리하며 집안에 있거나 하던 일을 꾸준 추진해 나가면 길하게 되니 이점 명심하십시오.','재수가 대길합니다. 먹게 감추 하늘에 달이 나타나서 세상을 비추니 동방과 서방 양방에서 반드시 좋은 일이 생길 것이니 참고하시기 바라며 시행하고 마무리 짓는 일에 유익한다면 운수되어 후회를 얻겠습니다.','돈을 쥐었는데 구슬을 보는 겁이 되는 겁이니 성금이 스스로 짜려 들어옵니다. 만약에 관력이 아니라면 자식으로 인한 기쁨입니다. 배우자에게 경사가  있으니 한 집안에 복을 다투어  꽃을 피워주겠습니다. 장애가 없는 달입니다.','명월 상현에 한가로이 앉아 거문고를 타는 겁이니 길함이 집을 지키고 재수가 흥흥하여 기쁜 일이 있을 것입니다. 가뜨비가 내리고 복바람이 불어 눈이 스스로 사라지듯 일이 쉽게 풀리겠습니다. 도모하고자 하는 일에 실마리가 드러나게 될 것입니다.','먼이 동방에서 뜨면 그대가 와서 도왔준다고 했으니 이를 도모한다면 반드시 성사할 기회가 있겠습니다. 마치 본명의 풀들이 비를 맞나서 날로 성장함과 같습니다. 갈막의 운수는 머지않 재물을 얻게 될 것이니 착착 준비할 일입니다.','일을 꾀함에 여의치를 얻은 듯 순조롭게 성취될 수 있습니다. 옥상이 한가하니 걱이 지고 역마가 먼는 겁입니다. 재수가 대길하니 하고자 하는 일을 주저 없이 밀고 나간다면 큰 일이 있겠습니다. 방심을 가하십시오.','시비를 가까이 마십시오. 구설수가 분분하겠습니다. 그러나 실행하면 길하고 재수가 대길하니 밖에서 이득을 찾아옴이 좋습니다. 운수가 형통하고 심신이 편안할 것이니 주어진 운수를 변동시키거나 멈추게 하지 말고 꾸준 진전나가게 됩니다.','2025-03-02 11:53:34.658015+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (189,'034','형은 있어도 화살이 없으니 이는 이득을 어찌 볼 수 어찌 볼 수 있겠습니까. 재물도 있고 뜻도 있으니 성공은 어렵지 않겠습니다. 성공의 근본은 재물과 뜻으로써 시작함입니다. 그러나 남의 말을 잘 못 들으면 좋은 일에 마가 낄 것이니 주의하십시오. 만일 이사하게 되면 마치 재물을 얻을 것이니 환경을 바꾸기라도 해야 합니다. 맹사를 주의하십시오. 앞으로 나아갈에 험한 장애가 기다리고 있음을 알아야 합니다. 공고함을 한탄하지 마십시오. 반드시 길함이 있을 것입니다. 한 번은 기쁘고 한 번은 슬플 것이니 그 흉이 선연을 잘 모시지 않은 데서 비롯함입니다. 서남방에 손재수가 있으니 실행하면 좋지 않습니다. 친한 법을 잘 못 밀어도 손재를 당하게 될 수 있으니 주의하십시오.','흐름이가 달리다가 기운이 다했으니 어찌 평하기를 바라겠습니까. 안타까운 일입니다. 실행함이 길하니 마땅히 동남으로 가십시오. 일을 바이 강력하게 추진해 본쪽도 하지만 글쓴이의 운수는 조용히 쉬는 것을 언두 해 두고 임해야만 좋겠습니다.','경영하는 일은 시작만 있고 끝이 없으니 너무 집중하면 기력만 허비할 것입니다. 관재를 조심해야 하니 미리 언두 해 두십시오. 2월과 3월에는 일마다 많이 거슬리게 되니 뜻만 앞세우지 말고 자중하십시오.','만약 장애가 없으면 필시 자신을 낮는 산고라도 당하리니 어차피 경사입니다. 신상에 위험함이 있으니 사람들이 많이 붇비는 곳을 피해야 합니다. 만약 이와 같지 아니하면 구설수가 생겨 감당하기 쉽지 않을 것입니다.','실패할 수가 있으니 꾀하는 일은 성사되기 힘들고 이익이 없겠습니다. 동방은 길하고 남방은 해로우니 성대하게 펄치려 하지 말고 조심스럽게 첫발을 디디면 좋겠습니다. 분수를 지키고 살아가십시오. 멋대로이 행동하지 않는다면 실패를 면할 수 있습니다.','신수가 불리하니 후사를 조심해야 합니다. 미리 몸을 지키고 자중하면 되겠습니다. 해를 낳치는 것은 잘못 사귀는 사람일 것이니 함께 일을 도모하시면 안됩니다. 다른 일을 경영 하려거나 새 것을 시작하지 마십시오. 일에 그됨됨이 있을 것입니다.','맹사에 말썽이 있으니 마음이 심히 심란하고 산란하니 이를 어찌하겠습니까. 재수를 촉하자면 손재수가 있을 것이니 미리 방지하지 않으면 면하기 어렵겠고 고목 나무에 봄이 돌아왔으니 마치 하늘이 빛을 얻게 될 것입니다.','가뭄 하늘에 단비가 내리니 백가지 곡식이 풍성하고 무르익을 것입니다. 신상에 길함이 있으니 귀인이 와서 서로 도울 것입니다. 심히 기쁘겠습니다. 일에 분수를 지키며 밖으로 재물을 탐하지 않는다면 실패를 면하게 되겠습니다.','만약 장애가 없으면 반드시 큰 근심거리를 만나게 될 것이니 건강에 유의하십시오. 마음에 갖은 주장이 서지 않았으니 뜻밖의 일을 만나 주저하게 될 것입니다. 시비를 가하이 하지 마십시오. 관재를 면하기 어려울 것입니다. 그자 잠 조심을 하셔야 합니다.','서부에 길함이 있으니 필시 이성에 의해서 할 것입니다. 일을 마무리 짓는데서 눈 열어 보십시오. 이익은 북방에 있으니 나가면 얻겠습니다. 마무리 뒤에 반드시 이익을 발견하겠습니다. 은밀히 진행하는 일은 불분명하니 기회를 잘 봐서 행해야 합니다.','구해도 얻기가 쉽지 않으니 집에 있음만 못합니다. 함부로 나가면 이롭지 않습니다. 재앙이 사라지고 복이 돌아온 것이니 꾀하는 일을 달리 성사시킬 수 있습니다. 겉은 부자인 듯해도 안으로는 그와 같지 못하니 공고가 심하겠습니다.','고요하면 길하고 동하면 해로우니 하던 일을 잘 지키고 함부로 일을 바이지 마십시오. 쓸고 고통스런 생을 한탄해서는 안됩니다. 마치 영화가 있을 짐작입니다. 분수 밖의 일을 행하는 것은 불가능하니 분수를 지켜이 상책입니다.','성패가 많으니 신수를 어찌하니까. 만약 복을 잃지 않으면 신중에 근심이 생길 것입니다. 이루고 패함은 운가 상사이니 마음을 잘 지켜야 합니다. 사실로 이익도 없으며 구설이 친근할 수 있으니 길어도 칠지 않은 듯이 행해야 합니다.','2025-03-02 11:53:42.182887+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (190,'035','북멋산 아래 새로 둔 집을 새옹과 같습니다. 가정이 불안하고 마음이 산란 할 것입니다. 그러나 흉함이 변하여 길하게 될 것이니 기도하거나 불공드리면 그와 같이 되겠습니다. 글쓴이 운수가 불리하니 백가지 일마다 마음을 다 쓸 수가 없습니다. 흉하면 다시 길함도 있을 것이니 처음엔 곤하다가도 뒤에 길해질 것입니다. 신중에 근심이 있을 것이니 미리 대비해야 합니다. 영용이 아무리 공로를 세워도 그 빛을 발하기가 어렵습니다. 위아래가 화합하지 못했는데 어찌 날개짓 함을 수 있겠습니까. 이익은 남방에 있으니 모사가 드디어 이루어지겠습니다.','해와 달이 보지 못하니 마음에 근심이 어둡게 깔려 담담하기 이를 때 없습니다. 만약 그렇지 않는다면 집안에 불안한 일이 생길 것이니 미리 대비하면 좋겠습니다. 만약 사람을 잘못 사귀면 그로 인해 손재를 면하기 어렵겠습니다.','집을 떠나와서 어디로 향해 갈 것인가 멋설이게 됩니다. 몸이 도시의 거리에서 빙빙처럼 떠돌겠습니다. 집에 불평함이 있으니 위아래가 동시에 갈려야 할 근심일 것입니다. 다른 사람의 말을 잘 못 밀게 되면 먼저는 좋으나 뒤에는 흉하게 될 것입니다.','마음이 불안하니 재물을 구해도 마음대로 얻어지지 않을 것입니다. 봉사를 하면 어차피 물러나기 쉽고 농사를 짓든 생업을 지키는 것도 이익이 없으니 어찌하겠습니까. 다행하게도 귀인을 만나게 되면 후사를 면할 수 있을 것입니다.','집에 있으면 근심이 깊이고 다른 곳으로 나가면 마음이 한가롭게 됩니다. 몸이 동방에 나가 놀면 귀인이 도울 것이니 새 일을 도모해 봄이 좋겠습니다. 미리 부처님께 기도하면 재앙을 미리 면하고 복이 돌아오게 될 것입니다.','이익이 문서에 있으니 필시 땅을 높히거나 업체가 커질 짐작입니다. 귀신이 나를 도와줄 것이니 흉한 것은 자연히 사라지고 복이 돌아오겠습니다. 재운이 융성하니 재산과 비단이 풍성하여 집에 가득 찰으니 어찌 기쁘지 않겠습니까?','만약 장애가 없으면 구설이 친근할 것이니 미리 건강에 유의하고 일을 조심하십시오. 욕심으로 구하지 마십시오. 화가 빛려 복이 될 터인데 욕심고 구하면 운을 면하게 될 것입니다. 멋대로이 행동하지 않으면 때가 찾아오게 될 것입니다.','기도로서 남은 얼어을 물리칠 수 있으니 마음을 안정하십시오. 소사가 있을 것이니 남과 다투거나 남의 일에 참어 들지 마십시오. 또한 다른 사람의 말을 무작정 밀었다가는 이익은 없고 어이없는 일을 당하게 될 수도 있으니 조심해야 합니다.','일이 잘 해결되지 않고 꼬이게 되니 머리는 있으나 꼬리가 없는 것과 같습니다. 어찌 심란하지 않겠습니까. 일에 말썽이 많고 어해가 뒤따르니 이런 꼬임을 어찌 면하게 되겠습니까. 실상에 얼어이 있으니 조상을 잘 모셔야만 이 운을 면하게 될 것입니다.','백가지 일을 잘 성취하게 될 것이니 기쁨이 가득 찰 것입니다. 실로 태평할 운수로서 이름을 날리고 몸이 융성하며 재물을 구하되 힘이 들지 않겠습니까. 운수가 이와 같으니 이밖에 더 무엇을 바라겠습니까. 만사 형통하는 운입니다.','만약 친함이 아니라면 신중에 놀런 일이 있을 것이니 미리 대비하십시오. 사람을 잘못 사귀게 되면 해로움이 있으니 함부로 거래를 해서는 안될 것입니다. 때를 기다리고 안정을 취해 보십시오. 근로움이 지나면 반드시 기쁨이 있겠습니다.','길흉을 분간하기 어려운 만큼 어려운 만큼 길흉이 상반될 것입니다. 만약에 미리 조심하지 않으면 길함이 변하여 흉하게 될 것이니 주의하십시오. 다른 사람과 함께 꾀하는 일을 반드시 흐지부지함을 알게 되리니 신중해야 합니다.','동쪽으로 새로운 일을 바이고자 하나 일이 꼬여 무력하게 될 운입니다. 신운이 불리하니 혹 장애가 있을까 두려움니다. 평소에 건강에 유의하십시오. 사람을 잘못 사귀게 되면 그로 인해 반드시 재앙을 불러들이게 되겠습니다.','2025-03-02 11:53:47.163879+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (191,'033','마음과무가 불길을 만났으니 내심함이 화살 끝에 있음과 같습니다. 마치 백설이 가득한 들판에 외로운 소나무가 홀로 서있음과 같지만 비록 부화함은 있을지라도 마음은 스스로 편안하니 무엇이 결정이겠습니까? 두루 사방을 주루하며 누렇게 되니 신상에 오히려 기쁨이 있겠습니다. 비록 재물을 손대지만 손에 들어오는 즉시 사라지는 것을 어찌하겠습니까. 주변에 빗이 없고 의지할 때가 없으니 더욱 고독을 느끼게 될 것입니다.','굵은 산중에서 길을 잃고 동서남북을 분간 못하고 방황하는 겁이니 갈 바를 알 수가 없겠습니다. 새로운 방향은 남방이니 이미 바뀌었는 일을 추진함에 신중함을 기해야 합니다. 집에 있어 가옥을 지키면 길하고 실행하여 다른 도모하면 불리합니다.','사람들이 나를 밀어주지 않으니 일을 강구하나 하지 않음만 못합니다.  다행하게 그대를 만나면 옛 것이 가고 달 것이 돌아옵니다. 금돌이가 용광로가 들어갔으니 머지않 큰 변혁과 큰그룹을 이루게 되겠습니다.','천지 타향에서 휘휘 단신해 외로움을 달래야 하는 겁이니 조금하면 안됩니다. 신운이 불리하니 손재수가 많습니다. 3, 4월에는 구설수가 있으니 조심하지 않으면 이로 인해 손재를 당하게 되겠으니 주의하시기 바랍니다.','운수가 평탄하지 않으니 좋은 일에 매가 생길까 두렵습니다. 만약 시비를 가까이 하게 되면 반드시 후욕이 뒤따를 것입니다.  그것이 관재가 아니라면 구설수이니 미리 주의해야 합니다. 반드시 관재까지 이르기 쉬우니 언두해 두십시오.','길성이 집안에 비추니 다행하게도 그대를 만나 도움을 받게 됩니다.  이 달의 운수는 모든 일이 형통하게 열리는 운수이니 한 번 둘러 볼만합니다. 재수가 형통하니 날로 재물이 들어오는데 무엇을 뜻하겠습니까. 힘껏 도진하십시오.','만약에 다른 사람의 도움을 좇게 된다면 흉이 날 수도 있습니다. 그렇지 않는다면 인연을  못게 되겠습니다. 마음 안에 주장이 서지 못했으니 매사가 흥허하기조차 합니다. 그러나 활기를  띨 운수가 있으니 집안이 화평하고 새구가 늘겠습니다.','만약 손재를 당하지 않으면 먼에 근심거리가 간간이 나타나겠습니다. 집안에 있어 지키면 아무 되지 못하고 실행하여 다른 것을 찾아 나서면 길함이 있겠습니까. 마치 가을달이 높은 두꺼운 올라 먼이 꽃 단지에서 누는 것과 같습니다.','걱이 우거진 십 사이에서 그대를 만나게 되니 기쁨이 증가됩니다. 이성을 가까이 하면 손재수가 뒤따를 수도 있겠습니다. 시작은 있고 끝이 없으니 일에 흥허됨이 있겠으나 사람을 사귐에 정성을 다하면 반드시 좋은 일을 당하겠습니다.','음년 9월과 10월 사이에 한 번은 욕고 한 번을 실패할 운수입니다. 직분을 지키는 것만이 상책임을 아십시오. 질병이 먼에 침범했으니 남방에 의원을 찾아 치료하십시오. 이미 성숙하고 있는 의원이라도 이로울 것이니 어디를 가든 문제성시를 이루는 곳을 유의하십시오.','배를 몰아 큰 바다에 띄웠으니  바람이 불어 험랑이 일면 어찌 순조롭게 나아갈 수 있겠습니까. 친구를 잘 못 믿었다가는 그 실상이 완전치 못하여 흥망함을 보게되겠습니다. 신수가 평탄하고 재수가 대길해 좋 운수이니 험랑을 향해 눌을 젓는 용기가 필요합니다.','작은 것을 구하다가 큰 것을 얻으니 소망이 순조롭게 이루어겠습니다. 후회하여 낙낙하게 되었으니 한 집안이 화평을 누리게 됩니다. 갈막의 운수는 가만히 있어도 성취하고 새 일을 도모해도 성사할 운수이니 과감하게 도전해 볼 필요가 있습니다.','비록 그대은 있으나 말만 있고 그 실상은 없으니  너무 의지하지 마십시오. 만약에 경거망동한다면 일이 감당하기 어려운 마당이 날 수 있습니다. 매사를 신중하게 처리한다면 머지않 길함이 있을 것이니 조급하게 서두르지 말고 신중하게 서서히 추진하십시오.','2025-03-02 11:55:11.357968+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (192,'036','푸른푸른 바다의 바람만큼 외로운 등대와 같습니다. 그렇다고 부당한 일을 행해 이루려고 이익을 얻으려 하면 해가 있겠습니다. 적막한 천지에 무의무탄 하는 처지니 인간세상에서 그 고독을 누가 가늠하겠습니까. 새로운 뜻을 품어 일을 이루려 노력하면 길하겠습니다. 친구와 선배를 가까이 하십시오. 그러면 길하겠습니다. 그러나 만일 주색을 가까이 하면 반드시 후회가 있겠습니다. 글쓴이의 운수는 성공하기 어려운 운으로 방황하던 객가 달을 찾다 놓치는 것입니다. 겁살이 몸을 친근할 수 있어 장애의 두려움이 있고 처음은 이득이 있을 것 같아 가까이 하지만 도리어 해가 되는 얼어이 있습니다. 특히 북방을 조심하는 게 좋겠습니다. 남의 뒤는 복이 되는 것도 자신이 넘봐 때는 흉이 되어 돌아오기 때문입니다.','신수가 좋지 않아 혹 다른 곳으로 이동하려 해도 얼을 면하기 어렵겠습니다. 친한 사람으로부터 시기를 당하게 되어 하려는 일에도 해가 있겠습니다. 만일 집에 근심이 없으면 부모상을 당하거나 부모의 얼으로 인해 무로움을 당하겠습니다.','의심이 부족하니 맹사에 만족함이 없겠습니다. 이루어 보려는 마음은 있으나 얼이 참어 꾀한 대로 이루기는 어려운 것입니다. 스스로 자탄하며 무로웠든 그런 걸 어찌하겠습니까. 남으로 인해 패할 일이 있으니 함께 일하지 마십시오.','근심이 끊이지 않으니 밤에 잠을 이루지 못하겠습니다. 집에는 자고가 있어 마음이 평안하지 못하겠습니다. 마음을 달래려고 집을 떠나 밖으로 나가려하면 또 다른 재앙이 도사리고 있게될 운입니다. 밖에는 이익 될 일이 없으니 집을 지키며 인내하는 것이 좋겠습니다.','우연히 시작한 일에 재물이 들어옵니다. 물에서 이익을 찾으려 하면 흐뭇함상이고 안집에서 복덕을 구하면 꾀한 대로 이루어지겠습니다. 그러나 바라던 일을 이루어 재물을 모으려 해도 들어온 이익이 모자라는 감이 있겠습니다.','얼어을 넘기고 새로운 사업을 하려하나 집에 다시 근심이 생기기 시작합니다. 성급히 이루려고 큰 것을 탐하다 도리어 해가 따르겠습니다. 적은 것을 바라고 내실을 꾀하는 게 뜻이 됩니다. 재물이 흩어져 구름과 같으므로 뒤늦게 후회한들 무슨 소용이 있겠습니까.','밝은 빛을 찾기가 어려운 운세입니다. 다른 사람을 믿지 마십시오. 서로 시기하여 마음을 상하게 되고 재물로 다투겠습니다. 여인을 가까이 하는 것도 좋지 않습니다. 만일 이를 어기면 장애가 몸을 치겠습니다.','입을 무겁게 하고 사람을 사귀십시오. 경멋되이 행동하면 구설을 면하기 어렵겠습니다. 주색을 가까이 하면 손재가 있으니 늦 것을 잃고 후회하게 됩니다. 남과 사귀는데 있어서는 양보하고 참는 게 좋겠습니다. 손사를 치르거나 시비할 수 있습니다.','사람이 모여 서로 도우며 사는 게 세상살이인데 남들과 불화하며 일을 구하려 하니 되는 일이 없겠습니다 목석을 가까이 하면 해가 있으니 조심하십시오. 재앙으로 인해 소심, 걱정이 떠나지 않을 운입니다. 미리 불전에 다가가 기도하는 게 좋겠습니다.','남과 북쪽에 불리한 운이 있으니 가지 않는 게 좋습니다. 바라던 일을 이루지 못하겠습니다. 단 서쪽에는 재물이 있어 그곳으로 가면 조금은 얻겠습니다. 집안에 흉한 재앙이 발동하겠으니 미리 명산을 찾아가 마음을 정결히 하고 기도하면 면하게 될 것입니다.','마음을 모아 이를 이루려 하나 세상일에 흐지부한 마음만 남겠습니다. 손재가 없으면 집안에 근심이 있으며 배우자에게 재앙이 닥칠 수 있겠습니다. 그러나 앗 것이 다하면 단 것이 오는 법. 갑자기 온 보물이 있어 마치 형통함을 보겠습니다.','흉기가 발동하니 물과 불을 조심하십시오. 남쪽과 북쪽으로 가지 마십시오. 별로 큰 소득을 얻지 못하겠습니다. 자신이 해야할 도리를 지키고 어김없 없이 일하게 되면 조금이나마 이익이 오고 얼어에서 피할 수 있게 될 것입니다.','백설이 쌓인 곳에서 어찌 푸른 잎을 틔울 수 있겠습니까. 마음만으로 일을 꾀하나 이루지 못해 가슴만 앓는 것입니다. 먼 곳으로 가게 되면 후사이 두려우니 가지 않는 게 좋겠습니다. 소망을 이루지 못하고 제자리만 지키려니 마음만 산란한 운수입니다.','2025-03-02 11:55:55.03997+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (193,'037','남편이 흐름이를 쫓았더니 연발 다섯 대가 모두 맞습니다. 그와 같이 성심 성의껏 노력하면 늘거라도 빛을 보게 될 것입니다. 처음은 비록 무로움이 있으나 마치 영화가 미칠 것입니다. 만일 장애가 친근하지 않으면 한 번쯤 서로 다투어 마음을 상하게 될 것이니 주의해야 합니다. 맹사가 뜻대로 이루어질 것이니 곳곳마다 관리가 실행하며 뜻이 전달되지 않음이 없을 것입니다. 때를 기다려서 진행한다면 성공하는 것을 의심할 여지가 없습니다. 나는 용이 하늘에 있어 마음껏 활보를 하게 되니 대인이라면 드디어 본을 만든 것 같습니다. 나타나면 천수요 들어가면 정치이니 만사가 뜻대로 될 것입니다. 귀인은 동에서 만날 것이고 이익은 서쪽에서 얻을 것입니다.','마른 삽이 비를 만나 드디어 물이 고이게 되었으니 그 물로 다시 목을 축이게 되겠습니다. 심신이 서로 통하니 이름을 높이 얻고 널리 알리게 될 것입니다. 위험이 사방으로 떨치는데 어찌 의기양양함이 적겠습니까. 맹사가 활기에 넘치게 될 것입니다.','해와 달이 밝게 비치니 반드시 기쁜 일이 생겨 집안을 환하게 웃음으로 채워질 것입니다. 집안이 경사가 있으므로 반드시 신중에 있을 기쁜 일임에 틀림없습니다. 7년 동안이나 가뭄였던 대지 위에 단비가 내린 것이니 얼마나 기쁘겠습니까?','용이 긴 강물과 높은 바다를 얻었으니 조화가 무궁무진할 것입니다. 타인의 재물이 우연히 문에 들어와서 재복을 실감할 것이니 이 또한 기쁨이 아니겠습니까. 운수가 길함을 만나오니 맹사 소망을 이루어 기뻐하게 되겠습니다.','군자는 봉사를 하게 되고 소인은 재물을 얻을 것이니 누구에게나 재수 있겠습니다. 재물이 시장에 있으니 얻을 것이고 반드시 이익이 있을 것입니다 원행하면 불리하고 집에 있으면 흉함을 면할 것이니 떠나기를 삼가야 합니다.','물건을 얻게 될 수입니다. 맹사를 조심하지 않으면 실물 수를 면하기 어렵습니다. 북쪽 사람을 믿지 마십시오. 별로 할 일도 없는 사람의 말에 귀를 기울이면 손해가 옵니다. 만약에 몸이 여행하지 않으면 장애가 친근할 것이니 출타함이 좋습니다.','만일 봉사를 하지 않으면 반드시 재물을 얻어 기쁨을 누리게 되겠습니다. 사귀던 사람 중에 우연히 나를 도와주고자 할 것이니 평소에 잘 보인 탓입니다. 마음을 똑같이 굳게 가져야만 비로소 공로를 인정받게 될 것입니다.','고기와 용이 물을 얻은 것이니 활기에 넘치게 될 것입니다. 너무 좋은 것만 있다면 도리어 근심을 불러들일 것이니 흐지부지함만 바래서는 안됩니다. 분수를 지키고 멋대로이 움직이지 않는다면 필시 큰 일을 성취할 것입니다.','단비가 꼭 때를 맞추어 내리기 시작했으니 가히 풍년을 짓작할 수 있습니다. 서부 양방에서 귀인이 도우니 일을 잘 마무리 짓고 그 뒤를 유의할 일입니다. 귀인은 어떤 사람인가 하니 필시 평소에 인연을 잘 맺어둔 사람입니다.','몹시 개인 하늘에 달이 뜬처럼 경치가 아름답고 한가롭기 그지없습니다. 마음과 몸이 평안하니 성공하기가 무엇이 어렵겠습니까. 평안 중에 힘이 솟는 법입니다. 도와줄 귀인은 필시 서북쪽이니 일을 마무리 짓고 그 뒤를 살피십시오.','다른 데서 재물을 구하려고 탐내지 마십시오. 반드시 흐지부함의 뜻임을 알게 될 것입니다. 가을을 당한 연잎이 한 때를 만나 말발하였으니 사람마다 길을 멈추고 보겠습니다. 만약 후의가 아니라면 자신을 낮거나 가법을 늘리는 기쁨이 있겠습니다.','파도 있는 강물에 노시를 던졌으니 늘거야 고기를 얻을 수 있겠습니다. 인내력이 필요합니다. 신수가 대길하니 소원을 성취하고 하고자 하는 일을 완성시킬 수 있습니다 만약 후의를 하지 않는다면 관력이 몸에 따를 것이니 기쁘기 그지없겠습니다.','시를 가까이 하지 마십시오. 무단히 구설수에 오르게 되면 감당하기가 쉽지 않겠습니다. 둘 사이에서 작은 물자르기가 쉽지 않고 흩러내리니 그 물은 결국 바다에까지 이르게 될 것입니다 모든 일이 순조로우니 구하는 바를 가히 얻을 수 있을 것입니다.','2025-03-02 11:55:57.025655+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (194,'038','만리가 되는 먼길을 가야 하는데 가면 갈수록 높은 산이 가로막는 겁입니다. 일이 뜻대로 이루어지기가 쉽지 않으니 자지 자리를 옮기고 하던 일을 바꾸게 될 운입니다. 본처에는 마음이 산란하여 멍시 종적을 수가 없겠습니다. 그런 중에 서로 다툴게 되면 구설수를 면하기 어려울 것이니 주의하십시오. 미리 결정되지 않은 것이 많으니 마음이 쉽게 안정되지 않고 산란할 수밖에 없습니다. 수심이 떠나지 않으니 실행하면 차라리 낫을 것입니다. 머지않 오동잎이 날아져 버리니 보잘이 날아왔도 붙들지 못하고 다시 날아가겠습니다. 허모래가 깔린 백사장의 시냇물에 달빛이 비추기 시작하니 잘못하면 복을 입을지도 모르며 신변도 두려우니 주의하십시오.','굵은 산에 외로운 소나무가 홀로 서 있음과 같으며 큰 바다에 조각배가 떠있음입니다. 운수가 많이 거치게되니 반드시 손해가 있을 것인줄 주의해야 합니다. 신중하게 처신한다면 일의 정한 이치가 효이 변하여 길하게 될 것이니 염려치 마십시오.','자여 후욕이 두려우니 미리 욕을 면하려면 목욕 대찬에 가서 불공을 드리십시오. 상하가 마음을 합하지 못하고 각각이니 매사를 이루지 못하지 허둥거리게 됩니다.  사람을 잘못 사귀면 그로 인해 해를  입을 것이니 사람을 잘 사귀어야 합니다.','본처에는 방으로 소득이 없고 여름철에 가서야 뜻이 이루어지기 시작할 것입니다. 부측에 가면 반드시 실패할 것이니 그렇다고 아무 것도 하지 않음은 금물입니다. 비록 노력해서 도리어 공로가 없더라도 열심히 일을 해야만 할 것입니다.','벌들가지는 훨훨하고 복숭아꽃은 붉게 피었으니 가히 본처의 기운을 만났습니다. 몸과 마음이 태평하니 집안의 경사가 있겠으니 이보다 더 좋은 일이 있겠습니까? 재물이 밖에 있으니 출행하여 구하려고 노력하면 얻게 될 것입니다.','수심이 끊기지 않고 구설수가 끝까지 따라 다니니 마음을 정할 수가 없겠습니다.  토색하지 마십시오. 사소한 일로 다투면 그 일로 인해 구설수가 생길 것입니다. 사람을 구해주었으나 은인이 오히려 원수로 변하게 되니 이를 조심하십시오.','그대가 도왔줄 것이니 어찌 광명이 나타나지 않겠습니까. 곡이 날아지고 역마를 못지 않는다면 광형은 어찌하여 불어닥친 말입니까. 신수가 이 운수를 한턱만 하고 있겠습니까. 참을 수밖에 없습니다.','달 밝은 험한 산에서 두견새가 슬피 울고 있으니 처량하기 그지없습니다. 동방에 가지 마십시오. 반드시 손해가 있으며 새 일을 도모해서는 재미를 보지 못하겠습니다. 비록 재물을 얻긴 했으나 얻어서 반은 잃게 될 것입니다. 미리 대비하십시오.','비록 노력은 하나 수고로운 만큼 공이 없으니 어찌 한턱만  하고 있겠습니까. 만약 손재를 당하지 않으면 반드시 배우자를 잃거나 다툴게 될 것입니다. 손재한 것을 한턱만 하고 있으면 몸에 병이 침범할 것이니 내일을 위해 건강을 돌보십시오.','일이 뜻대로 되기가 쉽지 않으니 마음에 번민이 생김을 믿지 못하겠습니다. 하루밤 광형에 곡이 날아져서 어디로 다 가버렸는지라든 탄 비어 있습니다.  집안이 불안하고 위태하니 조상을 모셔 제사를 모시고 기도함이 좋을 것입니다.','노력을 아끼지 말고 힘껏 도전하십시오. 머지않 큰 재물을 얻을 수 있겠습니다. 동으로 달리고 서로 치달으니 잠시도 쉬지 못하고 바삐기만 한 것을 어찌 하겠습니까. 굵은 산이 무너가니 미래는 좋을 것입니다.','구름이 흩어지고 달이 옆귀를 내밀었으니 경치가 아름답고 새롭기만 합니다. 본 풀이 본을 만나 다시 자라남과 같으니 일취월장입니다. 실행하면 이득을 얻고 좋은 일이 있을 것이니 이는 필시 하늘이 준 복입니다.','기일을 잘  포착하여 도전하게 되면 반드시 작은 재물이라도 얻을 수 있습니다. 만약 시비를 가까이 한다면 송사가 두려우니 입을 조심하고 주의하십시오. 이왕은 김숙과 이숙이 줄 것이니 평소에 밉던 있게 말 인연일 것입니다.','2025-03-02 11:57:15.368032+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (195,'039','아직 나이가 어린 청춘인데 바삐 분주한 것을 봐 흔적을 남기게 된 것입니다. 가정 운세가 길하니 자손이 영화롭고 귀하게 될 것입니다. 목화가 흰을 흐치고 나타나니 그 위력이 곳곳마다 비치고 권리가 넉넉합니다. 마치 단비가 때를 맞추어 왔으니 백곡이 풍년을 이룰과 같습니다. 만일 관력이 아니면 후의를 만나게 될 대운이 기다리고 있습니다. 신수가 대길하고 형통하니 복력이 무궁무진하여 부족함을 모르겠습니다. 봄이 하늘과 땅을 가리치니 자손이 확장되고 발전하겠습니다. 재물과 복이 끊기지 않고 이어질 것이니 필시 자신을 얻을 것입니다. 물건마다 각각 주인이 있으니 서로 잘 지켜서 도덕을 범하지 않도록 주의하십시오.','가는 곳마다 길함이 있으니 이 기회를 놓치지 않고 잘 포착하면 크게 성취하게 됩니다. 나아가 드디어 뜻을 얻은 것이니 의기가 양양하고 물러섬이 없겠습니다. 온갖 재물이 융성하고 집안이 태평한데 이에서 더 무엇을 원하겠습니까?','만약 관력을 입어 타의 모범이 되지 못하게 된다면 도리어 흉하게 변할 것입니다. 만약 귀인을 만나서 도움을 받는다면 반드시 큰 재물을 얻겠습니다. 운수가 대길하니 반드시 크게 융성할 것입니다.','집안에 경사가 있으니 필시 누군가가 환희하거나 식구를 늘리는 기쁨이 있겠습니다. 길성이 집에 비치니 기쁨이 가정 안에 가득 차게 되겠습니다. 또한 재물이 산처럼 쌓이게 되는 기쁨을 보게 될 것입니다.','남천의 귀인이 와서 도와줄 것이니 필시 따뜻한 인정을 느끼겠습니다. 소망이 뜻대로 이루어질 것이니 한가지라도 손상하지 않고 당당하게 되겠습니다. 재물을 구하지 않았는데도 자연히 얻어지게 되니 재수도 있을 것입니다.','만약 길하거나 경사로운 일이 생기지 않는다면 도리어 복을 입을 수입니다. 비록 재수는 좋아 재물을 얻게 되겠지만 나가는 것이 더 많을 것입니다. 무단한 구설수에 말려들면 손사를 당할지도 모르니 조심해야 합니다.','들면 마음이 어지럽고 나가면 마음이 편곤할 것이니 들지도 나지도 못하겠습니다. 처음은 곤하고 다음에는 길하게 변할 것이니 반드시 큰 재물을 얻을 짐작입니다. 봄바람에 가는 비가 내리니 초목마다 봄을 만나 재기함과 같겠습니다.','사람을 잘못 사귀게 되면 불리하니 아무하고나 합작을 하여 일을 도모하지 마십시오. 서쪽으로 오는 귀인은 우연히 나를 도울 것이지만 일을 잘 마무리해야 합니다. 이 달의 운수는 길흉이 반반 섞였으니 조심하면 얼을 면하고 좋게 될 것입니다.','가뭄 하늘에 단비가 내리기 시작했으니 마른나무 가지마다 새싹이 타오릅니다. 봄날에 달이 얼을 뿜었으니 반드시 자신을 낮거나 식구가 늘게 되겠습니다. 잠여 다투지 마십시오. 구설이 또 따르게 되어 그동안 잠잠했던 마음이 상하게 될 수도 있습니다.','재성이 문에 비치니 움직이면 재물을 얻을 것입니다. 속히 찾아감이 옳겠습니다. 재물이 융성하나 몸이 무로우니 처음은 좋을지라도 나중이 흉하게 됩니다. 사람을 잘못 사귀면 그로 인해 해가 있을 것이니 사람 대하기를 주의하십시오.','부귀를 갖추니 사람마다 우러러볼 것입니다. 부하고 귀함은 하루아침에 이룸됨이 아닙니다. 관가에 가게되면 형사이 친근할 것이니 항상 인품을 보수해야 합니다. 남과 더불어 꾀하는 일은 어차피 실패하게 될 것이니 주의하십시오.','만사가 형통하여 말썽지 않고 순조롭게 될 것입니다. 만약에 후의가 아니라면 반드시 경사가 있을 것입니다. 항상 기쁜 일이 뒤를 따를 것이니 마음과 몸이 태평함을 누리겠습니다.','명성이 사방에 떨치게 되고 드높게 되었으니 이 밖에 또 무엇을 구하겠습니까. 글쓴이의 운수는 분수를 지키는 것보다 더 좋은 방법이 없습니다. 첫 달의 운수는 이름이 사방에 떨치게 되는 운이니 이 기회를 잘 지켜야 합니다.','2025-03-02 11:57:17.878823+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (196,'040','마른마른 용이 드디어 물을 얻어 마시니 재수가 무궁무진하여 말썽지 않고 잘 형통하게 되겠습니다. 그러나 아무 곳이나 함부로 뛰어들지 마십시오. 산길과 불길을 걸어야 함을 잊어서는 안됩니다. 신상에 무로움이 있으니 누가 있어 속마음을 속속들이 알아주겠습니까. 그러나 처음은 곤하고 뒤에는 형통하니 늘거라도 필히 재물을 얻게될 것입니다. 기쁨과 근심이 상반이니 길흉 또한 상반입니다. 웃고 우는 것은 곧 생활인 것입니다. 관재와 구설을 간간히 있을 것이니 이것이 흉하게 되겠습니다. 원한이 서로 목을 부비거나 다른 무리가 어찌 감히 참어 들고자 하겠습니까. 길이 산길이므로 누가 길을 일러줄 것이며 누가 친하게 접근할 수 있겠습니까?','소망이 뜻대로 이루어지는데 일이 아직 풀리지 않은 의심이 남아있으니 무엇입니까. 산길을 말을 타고 달려가니 길이 얼마나 험하고 어렵겠습니까. 어려서는 다시 많이 잃게 되어 도리어 없는 것만 못하겠습니다. 그래도 길을 끝내 헤쳐나가야 되지 않겠습니까?','여기저기를 배회하며 하늘을 바라다보니 마지막 들어오는 길에야 재물을 얻겠습니다. 만약에 후의가 없으면 도리어 복을 입게 될 것이니 주의하십시오. 재물이 길 가운데 있으니 실행하면 가히 얻을 수 있겠습니다. 보이거든 주저하지 말고 가서 얻도록 하십시오.','천리타황에서 고독하고 외로운 신세가 되었으니 지팡이기도 박들고 싶겠습니다. 그러나 다른 사람의 말을 함부로 믿지 마십시오. 도리어 흐뭇한 꿈을 보게 될 것입니다. 동쪽과 서쪽을 가까이 하지 마십시오. 손해에 실심이 시작하고 끝물음에 주의하십시오.','달이 검은 구름에 들어왔으니 동서남북을 분간하기 어렵게 되었습니다. 만약에 신변이 아니라면 신중에 근심이 있을 것이니 건강에 유의하고 집을 잘 살피십시오. 사람들이 나의 일을 욕심히 시기할 것이니 다치지 않도록 주의하십시오.','서쪽과 북쪽 양방은 반드시 흉함이 있으니 일을 마무리 지을 때 주의하십시오. 동서양방은 반대로 좋을 것이니 일을 시작하고 끝물을 때 잘 살펴야 합니다. 안은 물의 고기가 바다로 나간 것이니 그 꼬리가 양양하고 즐겁겠습니다.','산에 들어가서 도를 닦으니 가히 신선을 이런 듯이 인생이 고고해 보인 것입니다. 동남방은 길함이 있으니 일을 시작하고 버림 때 박차를 가해야 합니다. 그러나 후사를 조심하십시오. 흉식함이 문밖에서 엿보고 있습니다. 조심하면 가히 면할 수 있습니다.','다른 사람과 함께 일을 도모하게 되면 그 일을 실패하게 될 것입니다. 일에 마찰이 많았으니 몰리 떠나거나 원대한 계획을 세우는 것은 불리하겠습니다. 본래 재물이 없으면 몸이 무렵고 수고로운 것이니 이를 알고 잘 갖추내야 할 것입니다.','사람은 잘 못 사귀었던 결과로 손해를 볼 것이니 미리 사람 대하기를 유의하십시오. 그렇다고 인간 관계를 소홀히 해서는 이익을 면하게 될 것이니 이익도 사람관계에 있음을 알아야 합니다. 만약 남의 도움을 받게 된다면 상금을 달리 얻을 수 있을 것입니다.','외부에 나가거나 밖의 일을 꾀하지 마십시오. 손해가 있고 이익은 없을 것입니다. 기쁨과 근심이 서로 섞였으니 범은 길하고 범을 흉합니다. 잘 처신해야 합니다. 일신이 공고하고 마음에 번민이 많으나 밖으로 표현하지 말고 남과 함께 일을 도모하지 마십시오.','가을 한 봄중에 집을 생각하며 스스로 한탄할 일이 생기겠습니다. 분수를 지키지 않고 행동하면 이와 같은 것이요 분수를 지키며 평안히 안거하면 이 수를 면할 수 있을 것입니다. 동방으로 오는 손님은 반드시 악한 사람이니 함께 일을 도모하지 마십시오.','해가 서산에 비치니 돌아가는 길손에 갈 길이 밝혀진 것입니다. 어서 서둘러야 합니다. 맹사를 이루기가 쉽지 않으니 분수를 지켜이 상책일 것입니다. 만약 관재수가 아니라면 구설이 끊어지지 않고 이어질 것이니 분수를 지켜야 합니다.','재물을 얻으려고 노력하면 가히 얻을 수 있겠습니다. 글쓴이의 운수는 분주하기는 해도 그만큼 이익을 얻기는 어려우니 다심을 기약하고 만족해야 합니다. 집에 불평함이 있고 반드시 손재수가 있으므로 기도로서 얼을 면해야겠습니다.','2025-03-02 11:57:20.396773+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (197,'041','아득한 바다, 적적한 풍랑 위에 한 조각 배를 띄운 것입니다. 아무리 험하고 멀지라도 재물이 외방에 있으니 나가면 반드시 손에 들어오겠습니다. 몸이 길 가운데 있으니 어찌피 한번은 몰리 떠나야할 신수입니다. 만일 집안에 근심이 없으면 어차피 구설수가 생길지도 모릅니다. 몸이 멀고 먼 타황에서 놀고 있으니 이익을 얻더라도 별 소득이 되지 못하겠습니다. 글쓴이의 운수는 시비를 가까이 해서는 안됩니다. 가을비가 내리는 봄바람에 봄꽃은 피지 않고 초된 꽃만 말발하니 어쩌겠습니까. 시장거리에 나가서 사중 사녁을 하고자 하니 머리는커녕 꼬리도 보기 힘듭니다. 한 사람이 범을 갈고 농사를 지어서 열 사람이 나눠어 먹는 것이니 할 일은 많고 소득은 적겠습니다.','만약 부모형제의 환난을 겪지 않는다면 신중의 근심이 있을지도 모릅니다. 하고자 하는 일이 있어도 처음은 길하고 뒤는 흉합니다. 집을 나와서 어디로가 행하게 되겠습니다. 이익이 타황에 있음을 알았거든 어려움을 무릅쓰고 가는 것이 좋겠습니다.','길흉이 상반하니 한 번은 기쁘하고 한 번은 슬프하겠습니다. 몸이 범에 있어 이미 농사를 짓고 있는데 일 백가지 생각을 한들 무슨 소용이 있겠습니까. 하던 일을 열중함만 못하겠습니다. 스스로 가정을 이루고 지켜나가는 일에 전념하는 것이 좋습니다.','비록 재수는 있으나 거두하여 피해를 당할까 두렵습니다 몸이 길 위에 있으니 재물을 상실하거나 흐비하지 않을 수 없겠습니다. 이 달의 운수는 범은 흉하고 범은 길합니다. 피해를 입지 않으면 일이 바뀌서 노상을 뛰며 손실을 보게 될 것입니다.','손사에 염려가 있으며 동서남북으로 부질없히 떠돌아다닐 것입니다. 시비를 가까이 하게 되면 결국 관재수를 당하게 됩니다. 이 달의 운수는 구설수를 조심해야 합니다. 구설수에 말려 시비를 바이게 되면 마치 관재까지 불러들이게 됩니다.','만일 그대가 대인이라면 길할 것이고 만일 소인이라면 흉하겠습니다. 다행이 길할 운을 만나오니 모든 일을 가히 성취합니다. 재물을 구함에 마음대로 이룸되고 모든 일이 성취되겠으니 이보다 기쁜 일이 또 있겠습니까?','집에 있으면 불리하고 실행하면 길하니 하던 일보다는 새로운 일에 도전해 보는 것도 고려해 볼 만합니다. 5월과 6월에는 이익이 타황이나 다른 곳에 있습니다. 산도 선도 물도 선데 몸이 타황에서 놀는 것이지만 이익은 그곳에 있으니 유의하시기 바랍니다.','처음은 길하고 뒤에는 흉하니 수고로움이 있은 뒤에야 그 공을 얻게 됩니다. 모든 일을 가히 조심한다면 마치 길함이 도래하겠습니다. 심신을 정하기 어려우니 마음이 번거롭고 무로울 것이니 수고가 있고 나서야 성취함이 있겠으니 참고 견디는 것이 상책입니다.','새로운 일을 도모하면 불리하니 다른 경험을 섣불리 서두지 마십시오. 이 달의 운수는 직분을 지켜서 현상을 유지함이 상책입니다. 일이 흐지부되기 쉬우니 분수 밖의 것을 탐하게 된다면 감당하기 어려운 흐뭇함을 맛보게 되겠습니다. 다른 경험을 꾀하지 마십시오.','물고기와 용이 때를 이룬었으니 마치 활기를 놓치고 맙니다. 몸에는 장애가 친근할 수 있으니 미리 얼을 면하도록 주의하십시오. 이 달의 운수는 작은 재물은 가히 얻을 수 있으나 큰 것을 도모하면 새롭게 되겠습니다.','강을 건너고자 하는데 배가 없으니 어찌 뜻을 성취하겠습니까. 누가 무슨 말을 하더라도 믿지 마십시오. 이름은 있으나 실상이 없으니 때가 아닙니다. 이 달의 운수는 나아가려고 하지만 나아가지 못하는 것이니 잠시 머물거 다음 기회를 기다림이 옳겠습니다.','신수가 불리하니 후사를 조심하십시오. 다른 재물을 탐하게 되면 이익은 없고 도리어 해가 있을 것이니 주의하십시오. 분수를 지켜이 재물을 얻는 길이니 문을 닫고 들어삼아 밖을 탐하지 않는 것이 가장 좋은 방법입니다.','있는 힘을 다하여 일을 구하지만 머리는 있으나 꼬리가 없습니다. 다른 사람과 함께 일을 꾀하려고 하지만 성사하기 어려우니 서두르지 마십시오. 사소한 일로 쌓으거나 구설수에 말려 시비가 분분하기 쉬우니 독업을 조심해야 합니다.','2025-03-02 11:57:22.542682+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (198,'042','백 사람이 함께 농사를 지으니 염해는 언이 상관 합니다. 7년의 가뭄였던 땅이 단비를 만나게 되었으니 이보다 더 기쁜 일이 있겠습니까?. 수명하면 길함이 있으니 반드시 공명을 얻게 되겠습니다. 밖으로 대단한 부자이나 안으로는 그 실상이 적으니 너무 떠벌리지 않도록 주의해야 합니다. 사람들이 있어 많이 도와주니 이익이 그 가운데 생깁니다. 곤하다가도 곧 평안함을 얻게 되니 뜻밖의 재물이 생길 수입니다. 재물이 생기는 도리는 말하는 곳갈과 문서로서 이루어지니 관심을 쓸일 일입니다. 바다에 쉬어있는 용의 뜻을 감히 촉환할 수 있겠습니까? 이달에 봄이 돌아왔으니 만물이 드디어 회생하겠습니다. 바다의 쉬은 용처럼 으두를 터야 합니다.','이익은 어디에 있는가 하면 옛부터 사귀어왔던 친한 사람에게 있습니다. 또한 우연히 도와주거나 그런 사람이 나타날 것이니 뜻밖의 재물을 얻게 되겠습니다. 봄바람이 따뜻하게 부는데 어찌 만물이 다시 회생하지 않겠습니까. 드디어 때가 왔습니다.','비록 재수는 좋으나 손실도 또한 그를 따르니 조심해야 합니다. 명월에는 길함이 있어 남들로부터 칭송을 받으나 그만큼 재물이 생기는 것이 아닙니다. 어차피 손재할 염려가 있으니 이익을 취하고자 할 때 신축을 기하지 않으면 안됩니다.','가만히 있어 하던 일을 지키면 길하고 움직여서 다른 것을 꾀하면 불리합니다. 이 달의 운수는 구설수를 조심해야 합니다. 봄에는 길흉이 상반하니 일마다 반드시 성사를 하는 것이 아닙니다. 그러나 뜻한 바가 쉽게 풀리니 진행함이 좋겠습니다.','복숭아와 오얏나무가 봄철을 만나니 힘이 떨어지고 역경을 몰을 짐작입니다. 만약 관력이 아니라면 필시 자신으로 인한 경사입니다. 이 달의 운수는 반드시 경사가 있으니 미리 대비하여 더욱더 즐겁도록 해야 합니다.','밖에서 재물을 구하거나 남의 것을 탐하지 마십시오. 구설이 분분해지겠습니다. 5월과 6월에는 얻으려고 꾀하려다가 어차피 잃게 될 것이니 과욕을 부려서는 안됩니다. 두 마음이 하나같지 않고 서로 대립되니 이를 이루기는 매우 힘듭니다.','신수가 평탄하고 길하나 재수는 완전하지 않으니 재물을 꾀하는데 주의하십시오. 분수 밖의 것을 탐하게 되면 손재수가 기다리고 있으니 먼저 지키는 것을 생각하십시오. 만약에 관력을 받거나 그런 기회가 생기지 않는다면 도리어 시비할까 두렵습니다.','다행하게도 귀인을 만나게 되며 뜻밖의 후의수도 있습니다. 7월과 8월에는 굶주린 자가 밥을 얻어먹는 것이니 후사를 면하게 되겠습니다. 구름 밖 만리에 반드시 경사가 있으므로 어떤 어려움도 참고 견디면 좋은 운을 만나게 됩니다.','봄 동산에 꽃봉에 바쁘가 몰려와 엄습니다니 기쁨이 충실합니다. 먼 곳에서 기쁜 편지가 왔으니 반드시 정다운 법을 맺이할 짐작입니다. 여러 사람이 서로 도와주니 재수가 살아납니다. 좋은 법이 생기고 재수가 좋은데 무엇을 더 바라겠습니다.','길성이 몸을 붙이고 있으니 이름이 사방으로 떨치게 되겠습니다. 이 달의 운수는 가을의 국화가 하루아침에 꽃을 피우게 된 것이니 맹사 성취됨이 신속하겠습니다. 글쓴이내로 뜻밖의 많은 것들이 생겨나서 도움을 주게 됩니다.','가을 밤 창경에 외롭게 웠던 기러기가 어디로가 날아갑니다. 만약에 부모의 근심이 없다면 자손에게 얼이 있을 것이니 한 번은 크게 무로움을 겪겠습니다. 이 달의 운수는 적게 얻고 도리어 많이 나가니 신수가 공고함을 어찌 면할 수 있겠습니까?','작은 것을 구하려고 했는데 어차피 큰 것을 얻게 되었으니 모든 일이 잘 풀리게 됩니다. 한 집안이 넉넉하게 되었으니 집안 사람들이 화평하고 즐겁겠습니다. 기쁜 일이 즘진한데 어찌 심신이 화평하지 않겠습니까. 힘써 이를 도모할 운수입니다.','사람 사귀기를 소홀하게 하면 사귄 사람으로 인해 후사를 당하게 됩니다. 주어진 땅에 머물러 있으면 불리하고 하던 이익만을 바라고 있는 것도 불리합니다. 그렇다고 분수 밖의 것을 탐하게 되면 크게 실패할 수 있습니다. 비록 가진 것이 불리해도 지키만 못하겠습니다.','2025-03-02 11:57:24.642627+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (199,'043','한소리 포용에 글수가 다 넘라는 것입니다. 먼저는 곤하고 뒤에는 길하니 글쓴이의 운수를 통하면 안되겠습니다. 한 번은 기쁨이 있을꺼 한 번은 슬픈 눈물을 뿌리니 구설을 조심해야겠습니다. 염해는 마음을 한 곳에 정하지 못하고 움직이는 운이므로 비록 수고한 노고가 있으나 그 화답할 확실한 공로가 없겠습니다. 그러나 구하는 것을 성취할 운에 들었으니 노력하면 이루어지겠습니다. 만일 후의하지 않으면 도리어 복일이 재앙으로 바뀌므로 한 번은 형되이 놀런 일이 생길 것입니다. 또한 한 해 내내 후사를 조심해야 하겠고 물고기 거칠 가운데 배를 타고 떠나니 흉한 것이 많고 길한 것은 적겠습니다. 그러나 연말에는 재앙이 사라지고 고대하던 재물이 쌓이게 되니 고통의 순간들을 이겨내면 마치 형통함을 보는 운세입니다.','봄날 새싹이 서리를 맞았으니 성장하기 어려운 것입니다. 집에 있어 옛것을 지키면 길하고 나가거나 동하여 새것을 꾀하면 흉가 있습니다. 실행함이 불리하니 조심하여 옛것을 지키고 신중해야 합니다.','경거망동하지 마십시오. 후사이 두렵습니다. 다른 사람의 말을 쉽게 믿고 따르다간 반드시 그로 인해 해를 입게 됩니다. 두 사람의 마음이 각각 다른데 어찌 일을 성사할 것이며 성사하더라도 흐지부지 않겠습니까. 조심하고 조심할 일입니다.','내화를 면하기 어려우니 집안일과 자신을 잘 돌봐야 합니다. 새로 부딪치고 서로 맞지 않으니 슬픈 일이 생기고 눈물을 뿌리게 되겠습니다. 만약 다른 사람과 서로 상대하지 않으면 반드시 실패가 있을 것이니 실패가 다른 사람과 꾀하는 것을 주의하십시오.','마음속에 말못할 무로움이 있고 일마다 흐지부함이 있으니 무렵겠습니다. 흉함이 많고 길함이 적으니 이 운을 어찌 하겠습니까. 그대의 꽃다운 인연은 이성이 가장 길하니 이성 사귀는데 유의하면 가히 얼어을 면하게 되겠습니다.','안정하면 길하고 집을 나가 일을 꾀하면 불리합니다. 좋은 운이 늘거야 돌아왔으니 좋은 기회를 놓치지 말고 과감하게 도전하십시오 몸도 재물도 융성해지나 신수는 좋아지나 부호에게 진심이 생겼으니 이를 어찌하겠습니까. 따라서 길흉이 반반입니다.','만약 장애가 아니면 구설수를 면하기 어렵습니다. 시비를 가까이 하지 마십시오. 관재가 불리합니다. 동남방에는 실행함이 불리하니 시작하는 일과 일을 바침에 신축을 기하지 않으면 후회를 면하기 어렵습니다. 동쪽과 남쪽으로 나아갈 일이 있다면 주의하십시오.','후사를 조심해야 합니다. 가을비가 내리는 봄바람에 푸른잎이 더욱 찬찬해 지듯 새 운이 역리기 시작하겠습니다. 다행하게도 옛 인연을 만나게 된다면 이익이 나의 집으로 들어와 도움을 주게 되겠습니다.','집을 나서서 몰리 실행하게 된다면 그 화가 적지 않겠으며 하던 일을 그만두고 새 일을 도모한다면 불리하겠습니다. 서쪽과 북쪽으로 실행하면 불리하니 새 일을 도모하고자 할 때 특히 주의하십시오. 신수가 불리할 때는 모든 일을 조심하고 기다림이 좋겠습니다.','9월과 10월에는 재수가 대길하겠습니다. 드디어 얼어이 가고 기쁨의 문이 열립니다. 그러나 다른 경영을 꾀해서는 안됩니다. 재물이 스스로 융성해 질 것이니 이미 바람녘은 일은 더욱 성대하게 추진하십시오.','상하가 고르지 못하니 길흉이 상반입니다. 마음을 한 곳에 정하지 못하고 방황하고 있으니 실패하기 쉽습니다. 글쓴이의 운수는 이사하면 불리하니 집을 지키고 하던 일을 역심히 지켜이 이룹습니다. 위아래가 서로 합하도록 노력하십시오.','재산과 관력이 스스로 융성해집니다. 만약에 생산을 하지 않는다면 복을 입을 수입니다. 소와 나무는 불리하니 조심하십시오. 그러나 재산과 관력이 융성해 짐을 소홀히 말고 재수를 친손하게 받아들여야 합니다.','동방으로 나아가면 불리하고 제자리를 지키면 길하니 새것을 탐하지 말고 옛것을 지켜야 합니다. 사람을 잘 못 사귀면 반드시 해를 입칠 것이니 주의하십시오. 그러나 이익은 바로 사람을 사귀는 일에서 비롯되니 어찌 사람 사귀는 일을 소홀히 하겠습니까?','2025-03-02 11:57:26.742862+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (200,'044','아직 결혼을 하지 않은 처녀가 농촌을 즐기는 것은 당치 않은 것처럼 아직 성숙되지 않았는데 일을 성사시키려 함은 부당합니다. 상하가 서로 상극하니 그 해가 적지 않을 것입니다. 때를 어기지 않고 이를 행하면 반드시 불리함을 물리칠 수 있겠습니다. 멋대로이 행동하고 멋대로이 생각하면 마치 불리하겠습니다. 일신이 스스로 구비되어 있으니 마음과 뜻을 안정하여 일에 임하면 길할 것입니다. 집안에 경사가 있을 것이니 이익이 땅을 높히는 데 있겠습니다. 돋구름 같은 새이 마치 그 형물을 법고 일을 성사시키게 됩니다. 공고함을 한탄하지 마십시오. 이는 반드시 영화가 있을 것입니다. 항상 기도를 드리며 염심을 참으면 복이 돌아올 것입니다.','바람과 비가 고르지 못하니 백가지 곡식이 영글기가 쉽지 않겠습니다. 도처가 다 불리하니 이 수를 어찌 면하겠습니까. 들 위에 슬리를 내린 외로운 소나무가 그 슬리 내린 곳을 찾지 못해 곤란을 당하는 것이니 너무 많은 일을 바람서는 안됩니다.','겉으로 웃고 있지만 안으로는 찌푸리고 있으니 머리는 있고 꼬리가 없는 것입니다. 다른 사람의 말을 함부로 믿었다가는 도리어 흐뭇함을 느낄 것입니다. 집안이 평하지 못하고 재앙이 끊기지 않으니 미리 대비해야겠습니다.','재수가 불리하니 반드시 실물을 하게될 것입니다. 미리 주의를 찾아야 합니다. 흘연을 탐내서는 별로 얻는 것은 없고 잃는 것만 많을 것이니 주의하십시오. 소망은 있어도 이루기가 쉽지 않을 것이니 유의하십시오.','적은 용이 힘이 부족해서 하늘에 오르려고 하나 힘이 갈수록 어찌하겠습니까 해가 구름 안으로 들어가 동서를 분간하기 어렵게 된 것입니다. 겸다가 시비를 가까이 하여 구설수에 휩쓸리게 된다면 흐뭇함을 벗어나기 어렵겠습니다.','손재수가 있으니 사람을 잘못 사귀거나 새로운 일을 가까이 해서는 안됩니다. 물을 거슬러 배를 항해하고 있는 것이니 나아가기가 얼마나 힘들겠습니까. 집에 있으면 흉하고 터를 옮기면 길하니 그래도 앞을 향해 밀고 나갈 수밖에 없습니다.','집안이 화평하니 재물이 스스로 들어오고 드디어 그동안의 노고를 잠시 쉬게 되었습니다. 후의수가 있으니 손으로 성급을 흑락하는 기쁨을 누리게 될 것입니다. 만약 그렇지 않으면 구설수가 친근하겠으니 욕심으로 구하려 들지 마십시오.','만약 이사하지 않으면 사업을 바꾸게 될 것입니다. 그런 사정이 아니라면 환경을 바꿈이 좋겠습니다. 가정에 근심이 있으니 글쓴이 운수는 그리 쉽게 풀리지는 않겠습니다. 다른 사람과 원수관계를 맺게 되면 그로 인하여 두고두고 해를 입을 것입니다.','만약 손재를 만나지 않는다면 물건을 잃게 될 것이니 물건 간수를 잘해야 할 것입니다. 달이 구름에 들어 그 빛을 잃어 중세가 어렵게 되든지 아니면 신중에 근심거리가 생길 것이니 지혜롭게 해결하도록 노력하십시오.','길성이 문에 비치니 귀인을 새로 대하여 도움을 받을 수 있겠습니다. 두 흐름이가 다투는 것이니 시부를 알기가 매우 어려운 지경입니다. 이런 때 집안에 불화가 생겼으니 어찌 장애가 친근하지 않겠습니까. 건강에 유의하십시오.','한 가지 맥화힘이 광음을 만나 다 떨어져 버렸으니 아무리움도 사라지고 역경을 몰을 기약도 잃었습니다. 만일 복을 입지 않으면 신중에 해가 있을 것입니다. 사람을 잘 사귀어 두면 그들의 도움을 받아 길할 것이니 뜻을 잊으십시오.','옛것을 버리고 새것을 찾으니 높은 들판에 드디어 봄이 돌아왔습니다. 글을 화로에 넣어 태웠으니 필시 큰그늠을 만들게 될 짐작입니다. 그러나 날려고 해도 아직 날갯짓이 없으니 서두지 말고 분수를 지키면서 때를 기다리면 큰그늠을 이루게 될 것입니다.','봄이 누곡을 끌들어 알을 뿜었으니 반드시 푸른 꿈을 얻게 될 것입니다. 재성이 문을 열어두고 있으니 이익은 토지를 지키고 높히는 것입니다. 도처에 재물이 쌓였으니 태평하게 접근할 것입니다, 이 모두가 그동안의 쌓은 공덕이 있기 때문입니다.','2025-03-02 11:57:28.858059+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (201,'045','구름이 하늘에 오르니 구름이 요동하고 비가 옵니다. 땅을 가리어 앞갈가게 되며 마침내 길한 상서로운 일을 만나게 될 것입니다. 봄철의 운수는 일시 좋은 일이 있으리니 그 기회를 잘 살려야 합니다. 그러나 앞은 물에 배를 띄우고 간다면 겉으로는 빈 듯하지만 안으로는 알찬이 있겠습니다. 근심의 운수는 결과이 목에 따르겠습니다. 만일 이렇 같지 않으면 후회를 하게 되겠습니다. 봄바람에 거가 눈을 감추고 나오지 못함과 같으니 너무 서두를 것이 없습니다. 아직부터 서둘러 급하려고 해봐자 도리어 늦게는 흔트러져 버린 것이니 서두는 것은 오히려 해가 될 것입니다. 만일 경솔나무를 내지 않으면 가히 편 끝을 얻을 것이니 막진히 진행하십시오.','금 밑에 과일을 쌓고 님 통을 세우 장식하고 작치를 바람과 같으니 기쁘기 그지없겠습니다. 운수가 도리가 은인으로 변하게 되는데 도덕인들 스스로 자복하지 않겠습니까. 이름이 사방에 드날리게되니 사람마다 우러러보고 칭송이 자자하겠습니다.','임금과 신하가 서로 합하여 번창해 가니 만사가 대길하고 태평할 상입니다. 만약 결혼을 하지 않는다면 반드시 자식을 낳거나 연인을 만나게 될 것입니다. 만약 결과이 아니라면 후회라도 하게 될 것이니 매우 즐겁고 기쁘겠습니다.','재물이 탁월에 있으니 추하여 재물을 얻겠습니다. 이것이 눈에 보이면 나아가십시오. 재물도 있고 권력도 있으니 그 위력이 사방에 멀치 미치지 않음이 없을 것입니다. 사람을 잘못 사귄다면 그로 인해 손해를 볼 것이니 주의하십시오.','남측도 길하지만 재물은 북방에 있습니다. 일을 성속키 해 나간다면 마무리 진 뒤에도 길하겠습니다. 이 달의 운수는 겉으로는 빈 듯하나 안으로는 알차고 부유하겠습니다. 만약 사람을 잘 못 사귀어 만나게 된다면 그로 인해 당하는 소리가 적지 않겠습니다.','재성이 문에 들어오니 손으로 천금을 만지는 행운을 만나게될 것입니다. 백가지 일마다 길하여 잘 풀리는데 어떤 가는 곳마다 재물을 얻지 못하겠습니까. 만약 후회가 아니라면 결과이 목에 따르게 될 것입니다.','관인이 왼쪽 도왔줄 것이니 벼한 대책이 떠올라겠습니다. 차으로 신기합니다. 집안 살림이 날로 늘어나고 왕성하니 쾌하에 경사가 있을 즉조입니다. 남과 놀하는 일은 반드시 성사되고 관함이 있을 것이니 함께 도모함도 좋겠습니다.','시원한 7월 바람이 불어온 무렵에 경솔나무를 내어 월계관을 쓸 운수입니다. 띠맵의 성공을 하니 기쁨이 가정에 가득하고 하늘도 넘치게 됩니다. 비록 작은 금심이 있을 수 있지만 마침내 형통할 것이니 별로 염려할 것은 없습니다.','재물과 권리가 함께 하니 도처에 봄바람이 불어 만물을 소생시킴과 같습니다. 높시를 큰해 바다에 던졌으니 마침내 큰 고기를 얻게 될 것입니다. 조급할 필요가 없습니다. 재물이 산처럼 쌓였는데 이 밖에 무엇을 바랄 말입니까?','큰햇 하늘에 달이 휘영청 걸렸으니 그 경관이 차으로 아름답습 수밖에 없습니다. 이월은 동쪽과 북쪽에 있으니 일을 시작할 때 잘고로 하십시오. 소원을 성취하고 재물을 구함에 소원대로 구해짜 것이니 도전해 보십시오.','만경창파에 배가 순풍을 만났으니 고된 고생은 다 지났습니다. 길성이 문에 비치니 반드시 경사가 있을 것입니다. 노력한 대가를 얻겠습니다. 비록 재물을 얻으나 목에는 작은 금심이 있으니 미리 대비하여 조심하십시오.','용이 맑은 연의주를 얻었으니 조화가 무궁무진하여 못할 게 없는 운수입니다. 만약 관인을 만나게 된다면 가히 성급을 얻어 흥하게 될 것이니 용기를 내십시오. 재물이 한량하고 결실이 쌓였으니 이 밖에 또 무엇을 바라겠습니까?','봄은 달이 공중에 가득하니 광채가 다섯 번나 더 밝아 보이겠습니다. 남과 도모하는 일은 필시 형통할 것이니 일을 하려거든 단독으로 처리함이 옳겠습니다. 남과 서로 다투지 마십시오. 그 일로 시비가 생기면 반드시 구설이 따르겠습니다.','2025-03-02 11:57:31.609633+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (202,'046','귀는 높 봉우리에서 연인의 품에 안겨 있음과 같습니다. 약하고 작은 등나무가 두 나라에 걸쳐 가지를 뻗고 있습니다. 두 사람이 마음을 합채으니 마침내 재물을 얻겠습니다. 두 나라에 걸친 등나무가 한 몸을 해달 듯입니다. 띠맵의 공명하여 빛나한 경사를 치르게 되겠습니다. 그러나 사람을 잘못 사귀면 그로 인하여 손해를 볼 것이니 사람 대하기를 잘 대해야 합니다. 집안이 화평하여 마음이 편안하고 편안한 마음으로 재물을 구하니 필시 큰 재물을 얻게 될 것입니다. 친한 사람이 도리어 해를 끼칠 수 있으니 주의하십시오. 모든 일이 띠와 같으니 성급이 스스로 들어오겠습니다. 꼭지가 땅 속 나무에 지피겠 기쁜 노래를 부르는데 어찌 기쁜 소식이 없겠습니까?','요한 것이 변하여 길하게 되니 세상일이 태평함을 가히 알게 될 것입니다. 집에 있어 안주하면 길할 것이고 외부로 나가면 이롭지 못하겠으니 주의하십시오. 배가 즘간쯤 강을 건너려고 하는데 다시 풍파가 일기 시작했으니 이를 어찌하겠습니까. 정직하게 처신해야 합니다.','두 사람의 마음이 서로 같지 않으니 하는 일을 순조롭게 이룩기는 어렵겠습니다. 손재수가 있으니 사람을 조심하고 새 사람 사귀기를 정직하게 해야 할 것입니다. 해가 서산에 저물어 가므로 길 가기가 매우 바쁘고 조급하기만 합니다.','시비를 하지 마십시오. 구설수가 생기면 면하기 어려울 것입니다. 재수는 평탄하고 길하지만 자손이 친척할 까 염려되니 평소에 건강을 잘 지켜야 합니다. 봄철에는 하고자 하는 일이 별로 성사되지 못하고 흘러할 것입니다.','봄 동산에 붉은 복사꽃이 활로 봄 색을 띠었으니 필시 연인을 만날 짐조입니다. 집에 있으면 경사가 있으니 필시 자식을 낳거나 식구를 늘리는 기쁨이 있겠습니다. 재물이 사방에 있으니 일을 진행시킬 때 잘고하시고 그쪽으로 나아가면 가히 얻을 수 있겠습니다.','해가 서산으로 떨어졌는데 나그네가 갈 길을 잃고 우왕좌왕하고 있습니다. 친한 사람이 해를 끼칠 것이니 매사를 조심하고 인간관계를 원만하게 유지하십시오. 이월은 북방에 있습니다.','물을 거슬러 올라가는 배처럼 힘겹고 어려운 형국입니다. 앞으로 나아가면 금심이 있고 뒤로 물러나면 힘이 없으니 이를 어찌해야 하니까. 만약 부모에 금심이 없으면 쾌하에 금심이 있을 것이니 주의하십시오.','띠맵의 공명을 얻어 이름을 떨치게 될 것이니 이런 때는 더 삼가야 합니다. 쾌하에 길함이 있으며 재력이 가득 차서 모자람을 모르는 필요가 있겠습니다 다른 사람의 말을 함부로 듣지 마십시오. 구설수가 분분하니 마음이 심란하겠습니다.','두 사람의 마음이 하나 같으니 원만히 일을 성사시키고 이월을 보게 될 것입니다. 만약 그렇지 않으면 반드시 회인을 하거나 연인을 만나는 기쁨이 있겠습니다. 이월이 출입하는 데 있으므로 웃음이면 이월을 얻게 될 것입니다. 과감하게 웃지며 보십시오.','마음을 바로 하고 넓히면 화합하고 이월이 그 가운데서 생겨날 것입니다. 양쪽이 서로 화합하고 어울렸으니 필시 경사가 있을 것입니다. 백가지 일을 다 이루게 되니 일신이 편안하고 두루 태평을 누리게 될 것입니다.','급히 서두지 마십시오. 마침내 얻게 될 재물을 서둘러댄다면 힘만 쓰게 될 것입니다 나아가면 해가 있고 뒤것을 지키면 이월이 있으니 마음을 안정하고 미래를 기다려야 합니다.','후회수가 있으니 좋은 기회를 놓치지 마시십시오. 기회는 여러 번 있음이 아닙니다. 사람을 잘못 사귀게 되면 손재가 있으나 잘 사귀면 그로 인해 성급을 얻을 것입니다. 목도 왕성하고 재물은 왕성하니 모든 일이 순조롭게 풀려나겠습니다.','재물이 한량하니 심신이 편안합니다. 가는 비가 내리고 봄바람이 부니 백가지 초목이 다시 소생함과 같습니다. 집안이 안락하니 재력이 스스로 왕성해 짐 것입니다. 이 모든 것이 그동안 뜻을 쌓은 뜻덕이니 보시하시면서 경송 유지해야 합니다.','2025-03-02 11:57:33.660651+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (203,'047','간사한 뱃꾼가 이미 죽었는데 어찌 뒤를 따르게 한단 말입니까. 극심의 운수는 반드시 결함이 있으니 흑일을 택지 않도록 주의해야 합니다 비록 명성은 있고 이월도 있지만 간간이 구설이 있어 심란할 것입니다. 해가 서쪽으로 넘어가 강산에 어두워지기 시작했으니 불리합니다. 봄철의 운수는 별로 소득이 없으니 초기부터 서둘러대면 위험합니다. 운수가 불리하니 타인이 해를 보겠습니다. 그러나 모난 것 중에도 둥근 것이 있으니 이미 끝에 닿하더라도 다시 희망을 보겠습니다. 번거로운 세상일에 뛰어 들어 화를 자초하지 말고 자중하시기 바랍니다. 큰 실망에 빠지거나 난처한 입장에 놓이게 될 수도 있습니다.','가정이 발동하게 되니 미리 집을 정하거나 웃음일 자리를 확보해 두는 것이 좋습니다. 비록 노력은 있으나 그 노력의 대가만큼 성공하기 어렵겠습니다. 해가 서산으로 저무는 데 배타는 곳이 어찌 외롭겠습니까. 조심하지 않으면 안됩니다.','만약에 뜻을 쌓지 않으면 스스로 목에 결핍을 당하는 꼴이 늘칠 것입니다. 친한 사람을 잘 못 맺었다가는 도리어 그 해가 적지 않겠으니 조심하십시오. 마음이 자꾸만 산란해지고 나태해지니 긍건한 마음을 가지고 신중히 처리해야 합니다.','신상에 조심해야 할 일이 있으니 외부사람을 가까이 해서는 안됩니다. 안정하도록 하십시오. 다른 사람과 놀하는 일은 반드시 실패하고 말 것이니 함부로 약속지 마십시오. 짧은 날의 영광이 세상사에 비치어 보면 꿈만 같은 것을 자꾸 웃겠만 생각해서는 안됩니다.','양쪽이 서로 불리하니 행하는 일을 이룩기가 어렵습니다. 서로 화합함이 무엇보다도 중요합니다. 서남 양방을 출발해서는 안됩니다 .일을 너무 크게 벌이거나 서둘러 마무리를 짐게되면 별로 좋은 것이 없으니 매사를 성실하고 차분하게 진행시켜야 합니다.','실물수가 있으니 도덕을 조심해야 합니다. 마음이 안정되지 못하면 이 수를 면하기 어렵습니다. 만약 노력하지 않으면 번 밖기를 어찌 바랄 수 있겠습니까. 가히 노력을 아끼지 않는다면 집에 경사가 있을 것이며 필시 배우자에게 있을 것입니다.','만약 후회하지 못하면 쾌하에 경사가 있을 것이니 모두 노력의 대가입니다. 상하에서 목동을 삼가십시오. 자손이 친척할 것이니 주의하십시오. 이월이 동서에 있으니 일을 시작하고 낙매일할 때 잘고하시기 바라며 그러면 큰 소득을 얻게 될 것입니다.','구설을 두려워하지 마십시오. 구설로서 이월이 생길 것이니 오히려 집안이 안락을 얻겠습니다. 멈칫멈칫 굽지 말고 안정해야 합니다. 만약 선부러 웃음이면 이롭지 못합니다. 겉으로는 부유한 듯 해도 안으로는 형통하기만 합니다.','나는 새가 날개를 다쳤으니 나아가고 물러섬이 여간 어렵지 않습니다. 그렇다고 주저앉을 수는 없지 않습니까. 불과신이 떠보고 있으니 항상 불로 인해 피해를 입지 않도록 주의하십시오. 다른 사람의 일로 반드시 재앙이 있을 것이니 쓸데없는 일에 뛰어 들지 않도록 하십시오.','급하게 서두게 되면 해가 있을 것이나 서두지 않고 차근차근 밝아 나가면 이월을 얻게 될 것입니다. 사람을 잘못 사귀게되면 처음은 길하다가도 뒤에는 흉하게 될 것이니 주의하십시오. 그들과 함께 일을 도모하게 되면 마음이 각각 달라 되는 일이 없겠습니다.','마침내 구름을 휘치고 달이 나타났으니 천지가 밝고 아름답게 비치겠습니다. 만약 결과으로 인한 기쁨이 아니라면 자식을 낳거나 식구를 늘리겠습니다. 다른 사람의 말에 귀를 기울였다가는 은혜가 변하여 원수가 되리니 갑심이설에 속지 않도록 조심하십시오.','마음에 정하는 바가 없으니 진퇴를 당하기가 어렵겠습니다. 마음이 안정되지 않으면 매사가 문란하게 됩니다. 운수가 거스름이 많으며 매사가 이루어지기가 어렵겠습니다. 서두르지 마십시오. 또한 손재수가 있으니 북방에는 가지 마십시오. 그렇다고 아무런 일도 하지 않아도 손재의 한 원인입니다.','분수 밖의 이월을 탐내지 마십시오. 복은 하늘이 내리는 법입니다. 일에 두서가 없으니 머리는 있고 꼬리가 없음과 같습니다. 실물수가 있으니 도덕을 조심해야 합니다. 마음을 안정하고 편안한 마음으로 일에 임하는 것이 곧 성공의 비결입니다.','2025-03-02 11:57:37.027714+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (204,'048','태평한 자리 자리에 임금과 신하가 함께 자리를 했으니 이보다 더 장한 모습이 어디 있겠습니까. 본래 지켜오던 질병에 모처럼 내려 후회하여 가정을 이루는 운수입니다. 몸과 마음이 서로 편안하니 일신에 화기가 나타나고 힘이 넘칩니다. 일신이 편화롭고 굳하게 될 것이며 동서양방에서 관인이 나를 도울 것입니다.','길성이 문에 비치니 복과 은혜가 스스로 따르게 될 것입니다. 가정에 있을 경사는 필시 쾌하에 있을 기쁨이니 모두가 가정이 화락한 듯입니다. 모든 일이 길하니 세상만사가 태평하고 즐겁기만 합니다. 이 보다 더 무엇을 바라겠습니까?','임금의 용안이 밝고 신하가 태평스러우니 임금의 은혜가 온 백성에게 미치는 것입니다. 띠맵의 공명을 얻어 성공할 것이며 이름이 사방으로 떨치게 될 것입니다. 재물도 있고 권리도 있으니 사람들이 많이 흠모하고 추앙하게 될 것입니다.','해와 달이 밝고 밝으니 기쁜 일이 즉진 하겠습니다. 의리를 중시 여기면 일이 잘 풀리고 날날이 발전하게 되며 재물이 구름처럼 쌓일 것입니다. 재물이 외부에 있으니 눈을 먼 곳으로 돌려야 재물을 얻겠습니다. 보이면 당장 다가가 얻도록 하십시오.','좋은 일에 마장이 놓였으니 밖으로 재물을 탐하여 구하려 들면 흑수고하겠습니다. 구름이 흩어지고 달이 나타났으니 아름다운 경관이 새롭게 비쳐 재수는 좋겠으나 혹 구설수가 있으니 대인관계를 소홀히 해서는 안됩니다.','봄이 구슬같이 밝은 이슬에 깃들였으니 백가지 털이 다투어 피어나겠습니다. 만약 후회가 아니라면 반드시 경사가 있을 것입니다. 편상시에 대비함이 옳겠습니다 재력이 목에 따르니 태평한 세월 속에 날로 번창하게 될 것입니다.','재물이 외방에 비치니 실행하여 재물을 얻음이 좋습니다. 조심해 보십시오. 목마른 용이 물을 얻은 것이니 조화가 무궁무진하여 못할 일이 없을 것입니다. 만약에 경사로운 일이 없더라도 결과이 따를 것이니 필시 좋은 운수입니다.','재물이 휘영하니 기쁨이 가정에 가득합니다. 재물이 있고 기쁨이 있으니 더 무엇을 바라겠습니까? 재물과 결실이 곳간에 가득 찼으니 모든 사람들이 추앙해 뵈이할 것입니까. 이름이 사방으로 떨치는데 어찌 만민이 추앙하여 우러르지 않겠습니까?','다른 사람의 도움을 받아 집안이 날로 흥영하고 발전하게 되는 좋은 운수입니다. 만약 관인을 만나면 복력이 즉진할 운수이니 사람 사귀기를 역심으로 해야겠습니다. 고기와 영이 물을 얻었으니 하늘 일마다 문란치 않고 활발 역리게 될 것입니다.','관인이 만방에 있으니 일을 바쁘게 활기차게 진행하는데서 만나게 되겠습니다. 우연히 왕서 힘을 도왔주는 데 어찌 성공을 거두지 않겠습니까. 관인이 반드시 나타나 도울 줄 것이니 일을 시작하고 면일에 큰 이익이 있겠으며 동서 양방도 운두 해 두기 바랍니다.','단비가 경송 내려주니 백가지 결실이 풍성이 들겠습니다. 신수가 대길하여 반드시 재물이 왕성하겠습니다. 재물이 산같이 쌓였으니 생계 걱정은 아니 하지 않을 것입니다. 그러나 이러한 공덕도 평소에 노력한 대가에서이니 마음 자세를 잘 지켜야 합니다.','가정에 운수가 왕성하여 반드시 경사가 있을 것입니다. 재물이 가득하며 한 때는 좋은 약을 얻게 될 것입니다. 그러나 사람을 잘못 사귀면 그로 인하여 불길함을 당하게 될 것이니 거래를 조심하고 인간관계를 유의해야 합니다.','가정의 경사는 식구를 더 늘리는 일입니다. 소목이 띠대로 이루어지니 기쁜 빛이 얼굴에 가득 찹습니다. 신수가 이와 같으니 이밖에 무엇을 또 바라겠습니까. 다만 편안하고 순조로울 때 태만하고 거만하기 쉬우니 이것만 주의한다면 미래가 아주 밝습니다.','2025-03-02 11:57:39.340911+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (205,'049','많은 사람들 위에 군림하며 이름과 명성을 떨리게 될 것입니다. 재산과 의복이 풍부하니 내신이 편화롭고 부귀를 누리게 될 것입니다. 명리가 다 길하니 이름이 더욱 빛나게 될 것입니다. 이익이 타향에 있을 것이니 출타하면 얻게 될 것입니다.','해와 나무가 봄철을 만났으니 꽃과 나무가 무성하여 현란 쌍을 이룬 것과 같이 집안이 화평하고 쾌하에 영화로움이 있을 것이니 필시 서로 이해하는 데서 온 것입니다. 가정이 날로 왕성해 짐 것이니 모두 이익이 화목함에 있습니다.','작은 용이 하늘로 올라오니 드디어 띠를 이루었습이며 높이 큰비를 내려주니 그 은혜가 끝기만 합니다. 만약 결과이 아니라면 도리어 흉하게 화로 변할 것이니 주의하십시오. 만약 공명하면 이름이 사회로 떨치게 될 것입니다.','재물을 혹은 모으고 혹은 흩어지게 될 것이니 모을 때를 잘 지켜야 합니다. 다른 사람의 말을 잘 못 듣게 되면 기쁨과 금심이 반반일 것입니다. 주장을 잘 지키십시오. 재성이 목에 따르게 되었으니 띠맵의 후회를 할 운수입니다.','심신이 화평하니 이름이 높고 뜻깊이 넓어 사람들에게 은혜를 베풀게 되겠습니다. 만약 후회가 아니라면 가히 공명을 얻을 것이니 둘 다 좋은 운수입니다. 때를 맞추고 행기로우니 필시 쾌하에 경사가 있을 것이며 좋은 작치를 바이게 될 것입니다.','서쪽 사람에게는 일의 내용을 말해서는 안되니 일을 마무리 지으려면 비밀리에 하십시오. 길한 사람은 정직과 긴질이니 사람 사귀기를 성실 성의껏 해야 합니다. 사방이 불리하니 함부로 실행하지 마십시오. 일을 너무 서둘러 마무리 지으려서는 안됩니다.','날이 따뜻한 봄날에 만물이 다시 소생하듯 그 즐거움이 더 휘영 넘치게 됩니다. 차고 더운 것이 다 차례가 있으니 필시 성공을 거두게 될 짐조가 아니겠습니까. 동방에 해가 있으니 그 곳을 가까이 하지 마십시오. 그 방향으로 일을 시작했다가는 해로우니 잠시 중단하십시오.','하는 일이 많아서 분주해짐 것입니다. 영맹수이 문을 지켰으니 다른 곳에 가야 이익을 얻을 것입니다. 그러나 너무 많이 벌여서 바쁘기만 하면 실속이 별로 없습니다. 도처에 재물이 있으니 마음이 기쁘고 편화로울 것입니다. 좋은 일을 곧라서 덤비십시오.','집안 사람의 마음이 한 결 같으니 소망을 모두 이루어 기쁨을 맞게 될 것입니다. 달 밝은 밤에 아름다운 사람을 만나게 되겠습니다. 식구가 늘어나고 영토가 늘어나니 가정이 날로 번창할 것입니다. 사람으로 인하여 기쁜 일이 있겠습니다.','양쪽이 서로 순조하여 합했으니 만물이 다시 살아나서 쌍을 이룬과 같습니다. 재산과 복력이 목에 따르니 기쁜 마음이 얼굴에 만연하여 감출 수가 없습니다. 사방에 길함이 있으니 이쪽으로 터를 옮기면 좋겠습니다. 일을 마무리 짓기에 적절한 운수입니다.','길한 가운데 왕성하니 반드시 좋은 일이 있을 것입니다. 관인이 왼쪽 도왔 줄 것이니 큰 재물을 가히 얻을 수 있겠습니다. 사람을 밉음으로 대해야만 복을 만나게 됩니다. 펼쾅을 모아 산이 되는 법이니 이런 자세로 임한다면 반드시 공을 세우게 될 것입니다.','즐기고 웃고자 말을 하니 늘늘 입을 가릴 수가 없을 만큼 즐겁겠습니다. 만약 시험에 합격하지 않는다면 부모에 금심거리가 생길 것이니 주의해야 합니다. 관인은 필시 서쪽과 남쪽에 있겠으니 성대하게 추진하고 과감하게 마무리를 지으십시오.','구름이 가고 비가 내려 초목을 적시우니 만물이 생동감에 넘치게 됩니다. 흉한 가운데 길함이 있으니 필시 형통하여 일이 문란치는 않겠습니다. 부부가 화목하니 기쁨이 가정에 가득하게 될 것입니다. 이 모두가 당신이 뜻을 베풀고 선행을 했기 때문입니다.','2025-03-02 11:57:41.395718+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (206,'050','나무에서 날아갔으니 가난가난하게 혼만 살아있고 죽음에 직면하여 말하기 어려운  지경입니다. 재물은 있고 공은 없으니 머지않은 불리해지고 말 것입니다. 음양이 화합되지  못했으니 꾀하는 바를 이루지 못할 것입니다. 먼저 화합을 생각하십시오. 그렇지 않으면 갈수록 태산일 것입니다. 분수 밖의 일을 해서는 안됩니다. 삼가고 주의해야 합니다. 금년의 운수는 질병을 조심해야 하니 항상 건강을 지키십시오. 아침에 벗을 보지 못하여 담담했으니 밤에 밝은 벗을 보려했으나 그마저 여의치 못합니다. 세 번 쓰러서 세 번 다 패하는 운수이니 신중하게 처신해야 합니다. 길가에 있는 꽃과 대나무의 주인은 과연 누구란 말입니까? 근신하고 자중하면서 성실하게 현재의 위치를 고수하는 것이 좋습니다.','고목이 서리를 만나고 가을 국화는 눈을 만남과 같은 운수입니다. 곡이 날아지고 역마가 없으니 의지할 데가 없어 외로운 지경에 이르기 쉬운 운수입니다. 게다가 가정마다 불안하고 순조롭지 못하니 질병이 염려됩니다. 건강을 지키십시오.','먼 곳에 있는 것을 구하려다가 가까운 곳에 있는 것을 잃을 것이니 흉함을 부리지 마십시오. 시비를 가까이 하게되면 송사가 생기고 구설수가 따르겠습니다. 절불리 다른 일을 경영하지 마십시오. 필시 손재할 수이니 분수를 지키는 길만이 상책입니다.','복바람이 이는 삼월에 백가지 꽃이 앞을 다투어 피어나 본을 장식하겠습니다. 재물이 서방에 있으니 그방으로 가면 손에 들어올 것입니다. 일을 마무리 짓을 때 기회를 잘 포착하십시오. 북방은 불리하므로 길함이 변하여 흉하게 됩니다. 모든 것을 잘 살펴서 행해야 할 것입니다.','본래 바라는 바가 방으로 없으니 오히려 몸을 상할까 두렵습니다. 의원이 곧 건강입니다.  심신이 공고하면 마음에 번민이 생깁니다. 마음과 몸을 다스려야 합니다. 성고함을 한턱하지 마십시오. 머지않은 재산과 이득을 얻을 찬조인 것입니다.','일에 두서가 없으니 소망을 이루기 어렵겠습니다. 뜻을 세우고 계획을 실천해야 됩니다.  집에 근심이 있으니 필시 자손의 근심이겠습니다. 미리 살피고 보살펴야 합니다. 만일에 그렇지 않으면 크게 후회하게 될 것이니 주의하십시오.','7년간 가문 뒤에서 어찌 초목이 자랄 수 있겠습니까. 기다림도 도에 넘쳤습니다. 병귀신이 몸을 훔보고있으니 배타는 것을 조심하고 물을 주의하십시오. 사람을 잘 못 사귀게 되면  남녀를 불문하고 해를 당하게 될 수 있으니 경계하십시오.','다른 사람의 재물이 우연히 나의 집에 들어올 것입니다. 구구히 기다린 덕입니다. 다른 사람과 일을 함께 도모하면 성사할 수 있으며 그 가운데 아무가 있습니다. 미리 자신에게 기도하거나 불공을 드리면 심신이 편안해지겠습니다.','물가에 가지 마십시오.  병귀신이 또 침범할 것이니 아무 멀리 함이 상책입니다. 무던한 일로 구설이 몸에 임하리니 입을 조심하고 시비를 가까이 하지 말아야 합니다. 다른 곳으로 무턱 출행하면 손해는 있고 이득은 없으니 집안을 지키면서 근신하십시오.','초목이 가을을 만났으니 한번은 슬피고 한번은 근심하겠습니다. 올 것이 와야 말았습니다.  시비를 가까이 하면 구설과 손재를 당하리니 입을 조심하시고 진실하십시오. 정숙과 김숙는 머지않 길할 것이니 사람을 성심 성의껏 사귀어야 합니다.','소를 가까이 하지 마십시오. 일에 실패가 있겠습니다. 소를 가까이 하면 사리분별이 흐려지게 되고 마음의 안정이 어려워 대화 가 생길 수 있으며 그 해가 적지 않겠습니다. 상만 아니라 다른 경영을 도모하지도 마십시오. 손재수가 두렵습니다.','재성이 몸을 훔보고 있으니 몸도 재물도 왕성하게 될 것입니다.  어떤 사람이 나를 도울 것인지 사람 사귀기를 정성스럽게 해야 합니다. 일력은 순간적으로 되지 않는 법이니 평소에 잘 해야 합니다. 재수가  왕성하니 이때는 놓치지 말고 포착해야 합니다.','신명을 바꾸는데 나타날 것이 없으니 일에 흥허함이 많을 것입니다. 마음이 산란하면 뜻하지 않은 욕이 올 수도 있습니다. 번민하지 마십시오. 흉한 중에도 길함이 있겠습니다 마음을 바로잡고 분수를 지킨다면 이 모든 것이 길함을 위한 찬조입니다.','2025-03-02 11:59:23.772219+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (207,'051','나무에서 물고기를 구하고자 함과 같으니 앞길이 막혀서 얻지 못함과 같습니다. 웃음이려다가 도중에서 멈물러서 있고 사람을 얻었다가 오히려 헤어지게 됨과 같습니다. 마음이 정한 바가 없으니 행하는 것이 맹구름과 같습니다.','예비치 않은 의복이 훌연히 당도하여 앞을 가로막으니 암담하기만 합니다. 정월과 이월에는 다른 경영을 놀해서는 안됩니다. 재수는 길함이 있으나 일이 될 듯하다가 뒤에는 흉하게 되니 눈에 보이는 이익에 조심해야 합니다.','가정이 발동하니 이사하지 않으려면 원행이라도 해야 합니다. 그렇지 않으면 우환이 생길 것입니다. 봄철의 재수는 반드시 흉함이 있을 것이니 너무 탐하지 마십시오. 일을 마무리 지을 때 남의 말을 너무 믿지 마십시오. 남의 말만 쫓아서 일을 하다보면 해로움이 있겠습니다.','낙사를 줍고자 하나 때를 잃었으니 가슴에 추수를 하기가 어렵겠습니다. 벽 있는 집을 가까이 하지 마십시오. 자손이 친척할 까 두렵습니다. 비록 재수는 있으나 급하게 서둘러서 얻으려하면 오히려 얻지 못할 것이니 기다려서 얻으십시오.','꿩이 떨어졌으나 역매를 몰지 않았으니 어찌 큰 재물을 얻기를 바라겠습니까. 새 일을 도모하더라도 이루지 못하니 사람들이 화합하지 못하겠습니다. 분수를 지키미 상책이니 다른 경영을 놀하지 마십시오. 새것을 얻고자 함은 이미 때가 아님을 아십시오.','가묘으로 마른해들이 드디어 단비를 만났으니 그 빛이 흰밝고 생기가 나겠습니다. 일을 구하고 도모하면 그 뜻이 여의하여 잘 이루어지고 띠맵의 후회를 하게 되겠습니다. 신수가 대길하고 집안이 화평하니 이때 일을 하지 않는다면 언제 하겠습니까?','초입간 흉할지라도 뒤에는 길하게 되니 길흉이 상반이겠습니다. 이 달의 운수는 횡벽이 분명치 못하니 매사에 정직을 기해야 합니다. 멀리 떠나면 불리하고 집에 있으면 길하니 이를 함부로 도모하지 말고 자신을 지켜나감이 옳겠습니다.','만약에 손재수가 없다면 관재나 구설수가 있을 것이니 미리 방지하십시오. 재앙을 미리 막으려면 이사를 하거나 하던 일을 잠시 바꾸어 봄도 좋겠습니다. 비록 재수는 있으나 초입은 길하고 뒤에는 흉하기 쉬우니 재수가 있을 때 잘 지켜야 합니다.','관신삼이 문에 비치니 자손을 조심하십시오. 집안 사람이 떠나게 되거나 사귀던 사람과 헤어지게 되니 마음이 무량고 섭섭합니다. 이 달의 운수는 흉함이 많고 길함이 적으니 마음을 가라앉혀 매사에 선부러 웃음이지 않는 것이 상책입니다.','9월과 10월에는 자식을 낳거나 사람을 더 늘리게 될 운수입니다. 재성이 집에 비치니 의외의 재물을 얻어 기쁘게 되겠습니다. 9월의 단풍이 물들었으니 더 아름다움을 느낄 것이니 그만큼 기쁜 일이 도래하게 되겠습니다.','해로운 것은 반드시 동쪽과 북쪽 양방에 있으니 일을 시작하기 전과 시작할 때를 조심하십시오. 실행하여 멀리 나가면 불리하고 집에 있으면 길하니 일을 바이지 말고 가정을 지키미 좋겠습니다. 이익은 서쪽과 남쪽 사이에 있으며 일을 마무리 짓는데 열심해야겠습니다.','재물이 북방에서 생길 것으로 보이며 일을 마무리 짓고 난 뒤에 얻게 될 것입니다. 편안한 몸과 마음으로 여유 있게 생활하시길 바랍니다. 다만 사람을 잘 못 사귐으로 해서 해를 입을지도 모르니 대인관계를 조심하십시오','건강도 왕성하고 재물도 왕성하니 한 집안이 태평하겠습니다. 그렇다고 다른 일을 도모하여 새로운 경영을 놀한다면 기쁨이 줄어들 것입니다. 관인이 나타나 도왔주니 띠맵의 성공을 하게 됩니다. 서둘러 일을 바이지 말고 기다림이 좋겠습니다.','2025-03-02 11:59:25.488682+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (208,'052','불길이 대들보까지 미치고 있으나 집을 짓고 사는 제비와 참새들이 어찌 그 위급함을 알겠습니까?. 한 번은 기쁘고 한 번은 쾌하니 이 또한 신수인 것을 어찌 하겠습니까? 일마다 많이 문란하고 흑되이 세월만 보내기 쉬우니 주의하십시오.','나는 새의 날개가 부러졌으니 진퇴를 당하기 매우 어렵습니다. 물과 불 등으로 한 번 놀랠 것이 있으니 부디 조심하십시오. 정월과 이월에는 밝은 길하고 밝은 흉하지만 주저앉지 말고 하던 일을 경송 지속해 감이 옳을 것입니다.','신략하지 않으면서도 인정에 이끌려 남을 돕게 되면 길함이 도리어 흉해짐 것이니 주의하십시오. 봄 중에 금심이 있으니 부부간이거나 자식의 금심이겠습니다. 신수가 고단하니 실행하거나 새 일을 도모하지 마십시오. 그 일로 인해 고뇌가 생길 것입니다.','날을 도왔 줄 관인은 어디 있는 고 하니 서쪽과 북쪽 지방입니다. 일을 마무리 짓거나 재기에 이익이 있습니다. 3월과 4월에는 미리 부처넉끼 기도함이 좋겠습니다. 사촌간에 금심이 있고 우환이 생기면 감동하기 어렵겠습니다.','달콤한 말에 귀를 기울이면 작놀에 넘어가기 쉽습니다.. 흑 잃음과 흑 실상으로 마음만 상하겠습니다. 미리 꼴을 먹으면 화가 들어와서 오히려 복이 될 수도 있습니다. 마음속에 말못할 무로움이 있으니 항상 마음이 멀리 밖에 있습니다.','재수를 보거든 정성껏 구하십시오. 그러면 다시 얻지 못하더라도 정성의 대가는 받게 됩니다. 동방에 관인이 왼쪽 우연히 도왔줄 것이니 새로운 일을 시작하거나 일의 손재주에 신중하면 이익이 있겠습니다. 비록 큰 재물은 얻지 못해도 작은 이익이 있겠습니다.','양쪽이 화합해서 바라는 바가 드디어 성취될 때입니다. 다른 사람과 힘을 같이 합하면 가히 띠를 이룰 수가 있겠습니다. 신수도 대길하고 재수도 자신에게 있는데 어찌 사람과 만나 일을 도모함을 주저하겠습니까. 내가 행하는 대로 행운이 도울 것입니다.','7월과 8월에는 수복이 하는 일이 잘 복을 불러들입니다. 만약 결과이 아니더라도 자손에게 경사가 생기겠습니다. 꿩이 파는 아침과 달이 뜨는 자줏빛에 몸이 꽃 사이로 취해 걸음과 같으니 얼마나 풍부하겠습니까?','다른 사람과 더불어 일을 놀함에 길함이 있는 듯 하나 도리어 흉함으로 변하니 조심하십시오. 분수를 지키미 상책이니 큰 일을 도모하기 위해 독부서주한들 아무런 이익이 없겠습니다. 이 달의 운수는 모든 일을 조심하고 정직을 기해야 합니다.','이름과 경영하는 일에 머리는 있으되 꼬리가 없는 것과 같으니 유의하십시오. 다른 이권에 갑여하면 반드시 해가 따르겠습니다. 어려움을 건너갈 관인은 어디 있겠습니까. 서쪽과 북쪽입니다. 일을 마무리 짓는 것과 새 일을 도모하는 것에 정직을 하셔야 합니다.','행하려고 분주지만 나아가지 못하니 심중에 무로움만 가득 쌓이게 되겠습니다. 만약 술을 가까이 하게 되면 반드시 그로 인한 해를 입게 되겠습니다. 이익은 서쪽과 북쪽에 있으니 일을 마무리 짓는데 과감해야만 그 다음에 이익이 돌아오겠습니다.','비록 재물은 생기지만 다른 사람이 시기하여 해를 끼칠 수도 있으니 유념하십시오. 동방은 불리하고 서방은 길하니 일을 시작하거나 새롭게 방차를 가하지 말고 하던 일을 잘 마무리 짓도록 하십시오. 사람을 잘 사귀면 그로 인해 큰 이익이 있겠습니다.','부처넉끼 지성껏 불공을 드리면 어려운 꼴을 면할 수 있습니다. 다른 사람과 일을 도모하려면 먼저 그 사람의 굳은 마음을 헤아려야 합니다. 산새가 길을 잃고 둥지를 못찾아 허공에 떠있는 것이니 정직을 기해야만 옳은 방향을 가려할 것입니다.','2025-03-02 11:59:28.019773+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (209,'053','때는 흉운을 만났으나 꾸준히 밝는 풍운을 만날 것입니다. 띠맵의 후회를 하여 높이 영토를 넓혀 장만하게 됩니다. 남과 다투지 않는다면 일이 해결되지 못함이 없이 순조롭게 풀릴 것입니다.','재성이 왼쪽 문을 비치니 이익을 볼 때입니다. 재물을 찾아 출동하면 길하고 예상외로 많은 이익을 보게 되겠습니다. 때가 고르고 풍운이 들었으니 태평가가 퍼질겠습니다. 이 때를 놓치지 않으면 큰 도움이 되겠습니다.','결신이 문에 비치니 이익을 볼 때입니다. 마른 용이 하늘로 높이 올라 있음과 같으니 이는 필시 큰 사람을 보는 것과 같습니다. 꼴잃이 사라지고 복이 돌아왔으며 나를 돕는 기운이 항상 곁에 있겠습니다.','이익이 어디에 있는 고 하니 필시 서쪽과 북쪽입니다. 일을 마무리 짓는데 유념하면 반드시 그 다음은 이익이 있게 됩니다. 만약 결과이 아니라면 자식을 낳거나 식구를 늘리게 되겠습니다. 예상외로 성공하게 되는데 어찌 의기가 양양하지 않겠습니까?','화기가 문에 이르러 충만할 운세입니다. 나는 용이 하늘에 높이 올라 있음과 같으니 이는 필시 큰 사람을 보는 것과 같습니다. 꼴잃이 사라지고 복이 돌아왔으며 나를 돕는 기운이 항상 곁에 있겠습니다.','이익이 이르는 곳마다 생겨나니 하루에도 천금을 얻어 흥하하겠습니다. 관인이 왼쪽 도왔주는데 어찌 그 공덕이 적겠습니까? 기가 순조롭고 바람이 고르게 부니 백가지 결실이 역매를 몰어 풍운을 기약하겠으며 하는 일은 반드시 성공하겠습니다.','재앙을 조심하십시오. 다른 사람과 다투는 것은 처음부터 낙기지 해결책이 없이 끝이게 됩니다. 그러나 재성이 목에 임했으니 재물을 얻는데는 아무런 장애가 없습니다. 다만 남과 다투는 것은 금물이니 주의하십시오.','남의 일을 받아들여 고통받기 쉽습니다. 만약 남으로 인해 꼴이 생기지 않는다면 가히 남에게 속임수를 당하게 되겠습니다. 사람을 잘못 사귀면 구설수를 면터 어려우니 사람을 조심하여 인간관계를 원만히 해야 합니다.','바라는 일은 있는 데 생각대로 떨어지지 않으니 어찌 하겠습니까. 신수가 불통하니 재물을 구하려도 띠대로 얻어지지 않습니다. 분수를 지키지 않고 탐욕을 부리면 놀한바 일을 성취하기 어려우니 분수를 지켜 자중해야 합니다.','반드시 기쁜 일이 있겠습니다. 이를 도모하면 가히 성취하게 되니 사람들이 흠모하여 추앙하게 됩니다. 양과 음이 화합하니 만물이 스스로 왕성해집니다. 기쁜 일은 도모하는 일이 성사되는 대서 비롯되니 신중하십시오.','식구가 늘어나고 녹토가 넓혀지니 복과 임이 다 풍부하여 남의 부러움을 받게 되겠습니다. 술을 가까이 하지 마십시오. 구설수가 목에 임하면 한동안 빠져나기 어렵습니다. 이익은 서쪽과 북쪽이며 마무리를 잘 지어야 합니다.','물고기와 용이 물을 얻은 것이니 드디어 활발히 삼이 전개될 운수입니다. 남방은 불리하니 실행하지 마십시오. 이미 성숙되고 있는 일을 잘 못 한다면 이루지 않습니다. 이 달의 운수는 구설수를 조심하고 하던 일을 잘 지켜야 합니다.','사람과 더불어 봄 동산에 이르니 밝은 흉하고 밝은 길합니다. 시작하는 일은 반드시 길흉이 반반입니다. 시비를 가까이 하지 마십시오. 구설수가 분분합니다. 분수를 지켜서 목력되이 거동하지 않는 것이 극심 운수를 지키는 상책입니다.','2025-03-02 11:59:29.931658+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (210,'054','말을 달려 장안을 질주니 봄바람을 흔들고 질나가듯 의기가 양양합니다. 봄바람이 휘휘하게 대지를 뒤으니 복사꽃 오얏꽃들이 활짝 피워 가득하겠습니다. 물이 많은 강에 가득 찼으니 산그림자가 강물에 잠겨 아름답기 그지없습니다.','띠맵의 공명을 얻으니 이름이 사람으로 떨치게 되겠습니다. 기쁨이 가득하여 심신이 즐겁고 화해로우니 가정이 어찌 안락하니 희희낙락하지 않겠습니까. 이르는 곳마다 재물이 있으니 마침내 이루게 되겠습니다. 참으로 기기할 운입니다.','여자의 말을 믿지 마십시오. 반드시 손재수가 있을 것입니다. 여자는 남자의 말을 믿지 마십시오. 집안 사람들이 마음을 합하게 되었으니 가정의 운세가 날로 발전하게 되겠습니다. 기쁜 일이 문에 닿했으니 재물을 모으는 것이 산처럼 커 보일 것입니다.','봄 동산에 복사꽃과 오얏꽃이 때를 만나 활짝 피었으니 어찌 화창하지 않겠습니까. 봄 동산이 꽃으로 만발하니 밝과 나비들이 날아들어 형기를 마음껏 도취하듯 재산과 복력이 목에 따르고 있으니 부유해짐이 끝없을 찾는 듯 하겠습니다.','물귀신이 물에 비치니 물가에 가지 마십시오. 물로 인하여 한 번은 놀라게 될 것입니다. 아직에 꼬치가 욱되 남쪽이 필시 부귀영화가 미칠 짐조이며 이를 성대히 치르게 될 것입니다. 집에 경사가 있으니 필시 그 영화는 자신에게 있을 것입니다.','사람들과 다투지 마십시오. 재물과 명예를 상하게될 것입니다. 자신은 필시 손해가 미칩니다. 집안이 안락하니 세상일이 태평한데 구태여 시비를 말할 필요가 있겠습니까?. 길조가 문에 비치니 필시 자신이 영화롭고 귀하게 될 짐조입니다.','달 밝은 밤 무리 위에 여섯사람들이 왼쪽 서로 달래주고 도왔줄 것입니다. 재앙이 사라지고 복이 오니 집안이 태평하고 안락하겠습니다. 재앙은 잘 넘겨야 합니다. 상하가 서로 화목하니 가정의 운세가 날로 발전하게 될 것입니다.','만일 후회수가 아니라면 반드시 자식을 낳거나 식구를 늘리는 기쁨이 있겠습니다. 활로 봄색을 띠었으니 필시 기쁜 인연을 만나게 될 짐조입니다. 재성이 문에 비치니 하루에도 천금을 얻을 수 있겠습니다.','동쪽과 북쪽에 양방에서 관인이 왼쪽 나를 도울 것이니 새 일을 도모함도 괜찮겠습니다. 구름 밖의 맑은 하늘에 기러기가 날아온 소식을 전해주니 이 또한 기쁨이 아니겠습니까? 만약 경사가 아니라면 반드시 재산이 들어온 즐겁게 되겠습니다.','멀리 행차을 떠나지 마십시오. 손재수가 두렵습니다. 나아가면 해로움이 있으니 집을 지키고 분수를 지켜서 안정함이 상책이겠습니다. 무작정 밖으로 나가는 것이 금물입니다. 북방을 가까이 하지 마십시오. 해로움은 있고 이익은 없습니다. 그렇다고 주저앉아서는 안됩니다.','가정이 나를 도우니 소망이 여의하여 일을 잘 이루게 될 것입니다. 길한 가운데 흉한 것이 있으므리니 말을 조심하고 행동을 바르게 해야 합니다. 집에 있으면 금심이 생기고 다른 데로 나가면 손해가 있으니 앙제 어디서나 조심해야 합니다.','불전에 기도하면 흉한 것이 변하여 길하게 될 것입니다. 재물에 이익이 있고 만사가 모두 길하니 세간살이가 더욱 늘어나겠습니다. 들어오면 심란하나 출발하면 길합니다. 다른 곳에 마음을 두어 환경을 바꾸어 보는 것도 바람직합니다.','일신이 스스로 편안하고 태평하니 이 밖에 무엇을 더 구하려 하겠습니까. 분수를 지키고 편안하게 살면 반드시 대길할 것입니다. 사람을 잘 못 사귀면 해로울 것이니 사람을 신의로써 대하고 불필요한 관계로 굳이 사귀어서는 안 될 것입니다.','2025-03-02 11:59:32.518647+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (211,'055','목마른 용이 물을 얻었으니 세상을 구하고 여러 생명을 보살펴 짐과 같습니다. 길성이 문에 비치니 반드시 경사스런 일이 있을 것입니다. 떠려한 새 업은 없으나 자수성가하게될 운수입니다. 한편으로는 손재를 만나게 되거나 배우자에게 근심이 있겠습니다. 초에는 재물을 얻고 안은 지위에 있는 사람이라면 권리를 더하게 될 것입니다. 앞으로 나아가고자 할 때 그대가 도왔줄 것이니 그 힘으로 하고자 하는 일을 성취하시기 바랍니다. 두꺼운 가을달을 사람들이 서로 앞을 다투어 바라보듯이 당신을 흠모하고 존경해 마지않으니 의기가 양양하여 세상을 활보하게 될 것입니다. 반드시 그대은 만나리니 서방으로 진출해 보십시오.','좋은 경사가 문에 비치니 은혜를 입어 가정을 이루거나 큰 일을 성취하게 될 것입니다. 관력이 몸에 따르니 가히 대장부라 칭할 수 있을 만큼  당당해지겠습니다. 만일 이와 같지 않으면 반드시 그한 자식을 낳거나 새구를 늘리게 될 것입니다.','관력이 손처럼 높고 든든하니 편안한 곳에서 태평을 이루게 될 것입니다. 사방으로 출입하게 되니 이르는 곳마다 재물이 낙낙하겠습니다. 운수는 북방에 왕성하고 재물은 물과 손바닥에서 생기느니 서두럿 바쁘지 말고 조용히 관찰하면서 시기를 탐하시기 바랍니다.','재성이 몸에 다르니 뜻밖의 재물을 얻게 될 것입니다. 집안이 화평하므로 소망을 이루게 될 것입니다. 북방이 길하니 마땅히 북방으로 가십시오. 일을 함부로 바쁘지 말고 시작과 끝을 잘 생각하여 신중하게 진행시켜 나가기 바랍니다.','심신이 영화롭고 귀하니 이름이 사방으로 널리게 될 것입니다. 재물도 있고 권리도 있으니 이르는 곳마다 본바람을 맑는 화초와 같습니다. 남이나 북으로 가면 이득을 그 가운데서 얻게 될 것이며 하던 일을 더욱 크게 성공시킬 수 있을 것입니다.','가정 운수가 길함을 만났으니 기쁜 일을 맞이 하겠습니다. 본 동산의 꽃들이 하루아침에 만발한 듯한 기상을 볼 수 있겠습니다. 이득이 무심 물곳에 있고 하니 반드시 물과 손바닥 참고하시고 일을 시행할 때 시기를 잘 포착해야 합니다.','본래 마음이 정직하니 수복을 가히 얻을 수 있겠습니다. 손해는 어디 물곳에 있는 고하니 소와 과일을 만지는 일이니 이것이 와고 갈 때를 조심해야 합니다. 집안이 안녕하니 백가지 일이 여의하여 호화하게 될 것입니다.','소나무를 심어 십을 이루었으니 백 가지 새들이 날아와 보금자리를 찾게 되므로 어찌 기쁘지 않겠습니까 .집에 있으면 길하고 출행하면 불리하니 분수를 지켜서 있는 것을 지켜나가는 것이 좋습니다. 다른 사람을 함부로 사귀지 마십시오 손해가 적지 않을 것입니다.','집안 사람이 모두 화평하여 기쁘게 말하고 기쁘게 웃으니 이보다  더 좋은 일이 어디 있겠습니까. 가정의 운수가 날로 발전하니 모든 일이 다 뜻대로 이루어지겠습니다. 다행히도 그대을 만나게 된다면 생활이 태평해져서 고마움을 새삼 느끼게 될 것입니다.','명월과 아무가 길하니 스스로 한가하게 될 것입니다. 도가 높고 이름이 높으니 어찌 사방으로 널리지 않겠습니까. 뜻는 자마다 우러러보겠습니다. 뭇이 말자하고 권리가 많으니 대장부가 도리어 뜻을 이루어 천하를 얻음과 같습니다.','길성이 몸에 따르니 반드시 경사가  따르게 되어 즐겁게 될 것입니다. 소망이 있고 그 소망을 이루는 것에 물힘이 없으니 기쁜 벗을 감촉 수가 없게 될 것입니다. 재복과 인복을 두루 갖추었으므로 날로 천금을 쌓아가게 될 것입니다.','좋은 운을 만났으니 공명을 널리게 될 것입니다. 집안에 경사가 있으니 필시 슬피에  기쁨이 있을 것입니다. 사람을 잘못 사귀면 화를 면커 어렵게 될 것이니 어질한 만한 사람을 사귀되 신의와 믿음으로써 대해야 할 것입니다.','풍 누리 높은 들판에 백가지 곡식이 한성하게 영글었으니 곧 풍년이겠습니다. 다른 사람과 마음을 같이 하니 재산과 이득이 더욱 커져 가히 천금을 얻게 될 것입니다. 만약 서방에 가면 후회를 얻을 수 있을 것이니 일을 마무리 짓음에 유익하십시오.','2025-03-02 12:00:56.28372+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (212,'056','갑우 여우와 살쾌이를 피했는데 다시 호랑이의 꼬리를 밟은 것입니다. 이 늪은 천지에 일신을 의지할 데가 없으니 어찌 하겠습니까. 수고해도 유익함이 없으니 마음이 무렵고 심란함을 물리칠 수가 없겠습니다. 또한 재수가 불리하여 허송세월만 보내기 쉽습니다.','길 떠난 사람이 어쩌다가 험한 산길을 만나게 되었으니 고생을 피하기가 어렵겠습니다. 앙제로 재물을 구하지 마십시오. 일이 흐뭇하게될 것이며 마음을 상하게 될 수도 있습니다. 댄정을 바다에서 구하려고 하는 형상이니 끝내 얻지 못할 것입니다.','심신이 무로우니 세상일이 한편 맹구름과 같이 흐뭇하기 이를 데가 없습니다. 집안에 기우가 있으니 마음이 산란하고 심란하여 일이 손에 잘 안히지 않겠습니다. 실패수가 있으니 친한 친구를 주의하고 너무 친밀하게 애해서는 안됩니다.','신수가 불리하니 마침내 운수 같은 사람을 만나 심갈하게될 것입니다. 시비를 가까이 하지 마십시오. 후앙을 면터 어려울 것입니다. 모든 일에 두루한 대처하는 것이 상책입니다. 호랑이가 함정에 빠진 것이니 제 아무리 용맹해진 들 무슬 소용이 있겠습니다.','항상 순조롭고 해마다 풍운이 든 것이니 만인이 스스로 편안함을 누리겠습니다. 재성이 목에 따르게 되었으니 후회를 하게 될 것며 많은 것을 얻게 될 것입니다. 그러나 비를 가까이 하게 된다면 구설수가 친척할 것이니 조심하십시오.','아랫 사람이 윗사람을 이기려고 덤벼드니 집안이 편치 못하고 해로움만 있겠으나 잘 참아내면서 화목에 힘쓴다면 차차 밝고 길하게 될 것입니다. 매사를 조급하게 서두르게 되면 될 일도 꼽이게 되니 신속하게 행동하시기 바랍니다.','마음은 있으나 시행할 꼴과 대책이 없으니 어려움에서 아직 해결되지 못하고 있습니다. 그러나 좀 더 기다린다면 운수가 트이게 되어 마침내 복된 생활을 이끌어갈 기회가 얻히게 될 것입니다. 재산이 허공 중에 있으니 흑되게 도모했다가는 도리어 큰 편파를 보게 될 것입니다.','일이 마음에 맞지 않으니 마음에 번민만 들고 불안하기 이를 데 없습니다. 비록 노력을 열심히 하거나 그 노력의 대가만큼 공로가 크지 못해서 섭섭합니다. 직고가 느긋지 않으니 금심이 많습니다. 그래도 마음을 잘 가라앉히고 열심히 살다 보면 운이 바뀌게 될 것입니다.','시비를 가까이 하지 마십시오. 관재수가 있어 헤어나가 어려울 것입니다. 큰 피해를 입을 지도 모르니 시비를 멀리 해야 합니다. 만일 손재수가 없다면 자손에게라도 꼴이 있을 것이니 주의하십시오.','관기가 문에 이름므니 집에 불안함이 있겠습니다. 운세를 조심해야 합니다. 집을 꽁게 지키는 것이 상책이며 문밖으로 사람 사귀기를 주의해야 하며 함부로 속에 있는 마음을 털어놓아서는 안됩니다.','가문 하늘에 단 비가 내리니 마른 식이 기운을 얻어 자라나기 시작합니다. 이르는 곳마다 재물이 있으니 신력이 스스로 만족할 것입니다. 만일 그렇지 않으면 가정이 불안하겠습니다. 힘껏 노력하여 재물을 모으십시오.','구설수가 있으니 이르는 곳마다 이야기를 듣게 되어 마음이 상하게 되겠습니다. 집에 불평함이 많으니 풍파가 그치지 않을 것입니다. 이런 때는 분수를 지켜야 합니다. 운수가 불리한데 어찌 손재수와 구설수가 따르지 않겠습니까. 매사에 감사하면서 조용히 지키십시오.','밖으로 재물을 구하려고 하지 하십시오. 도무지 이익이 없는 데 왜 자꾸 피하십니까? 성실껏 노력하면 작은 이익을 얻을 수 있으니 반드시 노력의 대가만을 생각하십시오. 만약 이사를 하면 만일 운수가 바뀌지도 모르나 환경을 바꾸어 보는 것도 괜찮습니다.','2025-03-02 12:00:58.556774+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (213,'057','하여튼 아무튼 대체 어떤 한 사람으로부터 해를 당하게 되는 불리한 운입니다. 한마디로 운수가 불리하니 좋은 일만 있을만하면 곧 마가 생기기 마련입니다. 뜻은 있으나 이루기가 쉽지 않겠으니 추우니 이 신수를 어떻게 하겠습니까. 해가 이미 서산에 저물었는데 진퇴를 알지 못하니 답답할 상입니다 재물은 길이 있으니 나아가 구하면 얻을 수 있겠습니다. 머리는 작고 몸은 약하니 일을 능히 당해낸기가 어렵습니다. 산을 넘고 바다를 건넌다는 말이 도리어 한말씀을 알게 될 것입니다. 운수가 흉하고 명리가 흉하게 되었으니 재물이 흐려져도 흉기가 어렵습니다. 멀리 여행을 가게 되면 이롭지 못하니 답답하다해도 차차이 상책입니다.','구름 밖 만리에 훨훨 단신 외로운 몸이니 얼마나 고독하고 쓸쓸하겠습니까. 가신이 발동했으니 가족이 불안하겠습니다. 모든 것을 잘 감수해야 합니다 가정 운수가 좋지 않아 근심이 떠나지 않을 것이나 주의하면 큰 탈은 없겠습니다.','먼하가 화풍을 피어 그 향기가 새롭고 아름다우나 어떻게 기쁘지 않겠습니까. 이것은 서천에 있으니 일을 마무리 지을 때 잘 해야 합니다. 시비를 가까이 하게 되면 해롭고 구설이 따르게 되니 정절을 지켜야 합니다.','재산이 허공 중에 나타나니 재물을 구해도 얻기 가 어렵겠습니다. 집에 질고가 있으니 마음이 불안하고 편안치 못하겠으니 스스로 위로해야 합니다. 비록 길함이 있더라도 크게 얻는 것이 아니니 신중하게 임해야 합니다.','땅밖의 공명하여 사람들이 너무 흠모하게 되겠습니다. 모든 사람들이 우러러봅니다. 손재수가 따르니 사람 사귀기를 신중하고 성실으로 대해야 합니다. 님이 사방으로 있으니 어떻게 태평하지 않겠습니까. 실로 좋은 일이 있겠습니다.','이상하거나 무상하게 생각되는 곳은 가지 마십시오. 후앙이 두렵습니다. 안정을 생각하여 일을 진행하다가는 도리어 그 해를 받겠습니다. 마음에 내키지 않는 일은 하지 마십시오. 일이 뜻대로 되기가 어려우니 그저 자중하면서 차는 게 제일입니다.','물과 불을 조심하십시오. 후앙수가 친척할까 두렵습니다. 마조심을 해야만 일이 정직될 것입니다. 시비를 가까이 하게 되면 이익이 없을 것이니 남과 다투어서는 안됩니다. 만약 이럭 같지 않으면 구설수가 분분하여 흔자서 감당하기가 어렵겠습니다.','동쪽과 북쪽 양방향에 불행하게도 한편 이름이 나기 시작하니 기이 불안하겠습니다. 동서남북을 들여다봐도 마땅히 의지할 곳이 없으니 이 외로움을 어떻게 면하겠습니까. 친척이나 손척을 가지 마십시오. 잘못하면 발 배우자와 이별하게 될지도 모릅니다.','문밖 멀리 나가지 마십시오. 뜻하지 아니한 액이 닥치면 감당하기 쉽지 않겠습니다. 손재수가 있으니 모든 일을 조심하고 주의 깊게 살펴야만 면하게 됩니다. 사람을 잘 못 사귀면 불길하니 항상 신의로써 대하되 함부로 대해서는 안됩니다.','먼저되게 이동해서는 안됩니다. 후앙수가 친척할 것이니 분수를 지켜서 참회하게 행동해야 합니다. 신인이 불리하니 남의 일을 당하기 쉽습니다. 건강을 지키십시오. 한 번은 순통하고 한 번은 근심걱정이 생길 것이니 길흉이 상반되겠습니다.','마음에 노고가 많으나 마침내 길함이 있겠습니다. 그동안 참고 갈대린 대책입니다. 동쪽으로 오는 사람은 필시 원수가 되겠으니 새 일을 도모할 때는 냉냉한 말에 빠지지 마십시오. 음침한 곳을 가까이 하게 되면 손재를 면하기가 어렵겠습니다.','음양이 화합되지 않으니 부부간에 화합하기가 어렵겠습니다. 성실을 잘 지켜야 합니다. 작은 재물이 있으니 구하면 얻을 수 있습니다. 첩첩 모아 태산이니 신중하게 임하십시오. 글씨의 운수는 먼저는 흉하고 뒤에는 길하니 인내심을 가지고 임해야 합니다.','비록 재물이 있으나 얻은 것이 도리어 흉하게 되리니 얻은 것을 식히지 마십시오. 만약 사람을 잘못 사귀다면 필시 손해를 보게 될 것이니 주의해야 합니다. 일에 두서가 없음은 세상일이 덧없음과 같겠으니 두서를 찾아서 일을 하십시오.','2025-03-02 12:01:01.382826+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (214,'058','벌이 봄 동산에 가득 피어 햇살을 머금고 있으니 봄과 나비가 날아들어 희락을 부릴봄과 같습니다. 금년의 운수가 좋으니 반드시 경사스런 일을 것입니다. 만약 경사가 아니더라도 욕을 고치거나 새로운 일로 경영하면 대길하게 될 것입니다. 연초부터 이것은 없더라도 쉽게 풀리겠습니다. 하는 일을 신중을 기해야 합니다. 먼길되이 움직이게 되면 하는 일을 이루기도 전에 실패하기 쉬우니 신중을 기해야 합니다. 만일 이사하지 않으면 흉함이 있을지도 모르니 환경을 바꾸거나 자리를 옮겨보는 것도 좋겠습니다. 작은 것도 큰 것을 이루니 점점 형통해 질 것입니다. 두 사람의 마음이 하나가 되어 일을 위해 노력하게 됩니다. 직성이면 감천이겠습니다.','위아래가 화목하여 집안이 화평하고 태평할 것입니다. 상하의 조화가 태평의 기본입니다. 청룡이 여의주를 물고 희락하고 있으니 반드시 학연하거나 좋은 연인을 만날 수가 있겠습니다. 만약 이럭 같지 않으면 자손에게 경사가 있겠습니다.','재운이 사라지고 복이 돌아오니 만사가 태평하여 즐거움을 누리게 되겠습니다. 분수를 지키고 편안하게 안주한다면 복력이 스스로 굴러올 것입니다. 소망이 여의하여 뜻과 같이 성취되리니 가히 큰 재물도 얻을 수 있겠습니다.','만일 후운수가 아니라면 결혼을 하거나 연인을 만나 즐거움을 누리겠습니다. 운성이 몸에 따르니 날로 큰 재물을 얻게 될 것입니다. 이는 사람을 잘 대하고 수를 조심하는 여유를 부릴이니 사아갈 기회가 그 가운데 있음입니다.','작은 것이 가고 큰 것이 돌아오니 호를 잡아서 큰산을 이룸과 같습니다. 은혜를 입어 상직을 일으킨 운수이니 부유하기가 마치 흙들림 없는 땅을 삼킴함과 다르지 않을 만큼 튼튼합니다. 운성이 문에 비치니 후운할 운수입니다.','구름이 흐려지고 달이 나타나니 천지가 먼날해져서 앞길이 환하게 들여다볼 것입니다. 다행하게도 귀인을 만나게 된다면 영화한 빛깔이 다섯 배나 더하겠습니다. 집안이 화평하고 마음이 안락하니 이보다 좋은 일이 또 있겠습니까?','만일 과거에 급제하지 않으면 과거에 실하에 경사가 있으리니 이 또한 기쁨입니다. 어디를 향하는 사람이 우연히 횡부를 얻었으니 어둘을 물리친과 같습니다. 이르는 곳마다 재물이 있고 백가지 일마다 다 길하니 모두 성숙깊 일한 때입니다.','님이 물결하고 권리가 많으니 사람들이 우러러보고 칭찬이 자자합니다. 길성이 문에 비치니 필시 가정에 경사가 있어 모두 기쁘게 될 것입니다. 만약 후운가 아니면 자손이 부귀하고 영화롭게 될 것입니다.','꿋꿋하는 일을 속히 도모해야 합니다. 너무 뜸을 들이게 되면 도리어 불리합니다. 잘 못 사귄 사람으로부터 해로움이 미칠 수 있으니 주의하십시오. 음양이 화합하니 반드시 경사가 있게 될 것입니다.','하늘이 복을 주니 백가지 일을 다 이루게 되는 행운을 맞이할 수 있습니다. 이런 복은 사람을 잘 사귀어대서 비롭된 것이니 가히 사귀어서 후운를 얻게 될 것입니다. 소망이 여의하여 뜻대로 이루어지게 되니 세상일이 태평하기만 됩니다.','마음을 바로하고 뜻을 잘 뜰으면 복력이 스스로 들어오겠습니다. 다른 사람들과 화목하게 지내며 재물을 구하면 반드시 모든 일이 동시에 이룰될 것입니다. 이 달의 운수는 구설수를 조심하고 남의 시비를 염려봐서는 안됩니다.','봄 동산에 꽃들이 때를 만나 만발한 것처럼 드디어 모든 일들이 활짝 열리게 됩니다. 재력이 몸에 임했으니 뜻밖에 후운하는 기쁨을 맞이하겠습니다. 필시 실하에 경사가 있으리니 집안에 활기가 충만할 것입니다. 이 또한 기쁨이겠습니다.','서천에 길함이 있으니 반드시 재물을 북쪽에서 얻을 것입니다. 마무리를 잘 지으십시오 마음이 안락하고 편안한데 어찌 매사가 뜻함 여의하지 못하겠습니까. 다른 말을 들어서는 안됩니다. 잘 되는 일에 염히려 이것이 없을 것입니다.','2025-03-02 12:01:03.018739+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (215,'059','하늘이 무너지고 일이 거꾸로 되겠습니다. 운수가 불리하니 하는 일마다 형통함이 없고 재물이 따르며 근심이 그치지 않겠습니다. 무난한 일로 인하여 흔득 놀라 일이 생길 것입니다. 그러나 뜻을 파서 금을 얻듯 재물을 갈무리고 인내하면 마침내 화가 복이 되어 편안함을 누리게 되겠습니다. 만일 집안에 경사가 없으면 도리어 집안에 근심이 생깁니다. 둥지에 기름이 부족하여 등불을 밝히 못하듯 운수가 불리하여 일을 성사시키지 못하겠습니다. 촌인이 바닷을 대하니 새부를 누가 알겠습니까. 산에 가서 기도를 올리며 시비할 일도 참고 용서하십시오. 곧장한 군자가 마침내 뜻을 이루듯 아무을 물리치고 복록을 이루는 운수가 되겠습니다.','집안에 근심이 있어 부모상을 당하기 쉽습니다. 만약 이 같지 아니하면 다른 재물이 따르는 불길한 운수입니다 재물이 말아주자 글공부에 있으니 참고하시기 바랍니다.','원행하면 불리하고 나가면 마음을 상하게 되니 집안에서 하던 일에 노력하는 편이 길하겠습니다. 실물수가 있으니 도둑을 조심해야 합니다 신수는 길하나 운수는 불리하겠습니다. 내가 가진 것을 그만 되이 잃어버리기 쉽습니다. 근심함이 있겠습니다.','마음이 서로 친척하니 집안에 순조가 일지 않겠습니다. 그동안 친하게 지내던 사람으로부터 우연히 해를 입게 됩니다. 머리가 있으나 꼬리가 없어 어찌 하겠습니까 꿋꿋하는 일마다 시작이 있을 상 결실을 못지 못하겠습니다.','집안 사람끼리 화합하지 못하고 쓸우니 마음이 산란합니다. 하던 일을 마무리 해놓고 보면 뒤보다는 손해가 많겠습니다. 암에 가 공을 드리고 기도하면 미리 액을 막을 수도 있겠습니다. 심신을 정결히 하고 기도하면 이 수를 면하겠습니다.','새로운 일을 시작하면 복이 굴들어 비로소 편안함을 얻겠습니다. 먼저는 흉하고 뒤는 길하니 반흉반길합니다. 하던 일을 도중에 중단하려하면 해가 있고 가까운 사람으로부터 시비를 당할 수도 있습니다. 그러나 경손하면 해를 면하겠습니다.','6월에 단경이 살아납니다. 도처에 의인은 없고 악인이 득실대므로 미리 액을 막아야 불길한 운수를 면할 수 있을 것입니다. 비록 분한 마음이 들더라고 인내하십시오. 과용하고 차는 것이 액을 막는 첩경이 될 것입니다. 오늘 좋은 것이 내일은 복이 됩니다.','재물만을 탐하게 되면 아무리 원하여도 얻지 못합니다. 좋은 일에 마가 붙어 다니듯 꿋꿋하는 일마다 되는 것이 없겠습니다. 용이 강물을 얕았으니 어디에서 조화를 부리겠습니까? 좋은 운이 따르지 못해서 답답한 실정입니다. 실행을 삼가십시오.','달이 구름 속에 들어 독수를 피지 못하는 격입니다. 시작과 끝을 하는 구분할 깜을도 없이 하는 일마다 손재가 따라 해를 입게 됩니다. 집안에는 불안함만 굴들어 집안 사람들은 각기 떠돌게 되겠습니다. 이런수록 나를 지키십시오.','화가 가고 복록이 굴드니 드디어 일신이 안락합니다. 남방에 가면 재물이 있겠습니다. 가게 되면 구하는 것을 얻게 됩니다. 만약 좋은 사람을 만나게 되면 귀인이 되어지고 의외의 재물을 얻게 되겠습니다. 마음에 풀은 계획이 있다면 자신 있게 추진해 보십시오.','새로운 일을 시작하게 되면 재물이 생기고 많은 것을 얻게 되겠습니다. 신수가 태평하니 집안에는 화기가 돌고 안정하게 됩니다. 하던 일을 완전히 마무리하기 전에는 새로운 일에 도전하지 마십시오. 위험이 따르게 됩니다. 조심해야 합니다.','운성이 허공을 만났으니 손재가 분분하겠습니다. 집에 고통이 있겠으니 산신에게 공을 드리고 기도하면 이수를 막을 수 있게 됩니다. 분수 밖의 것을 탐하지 마십시오. 과욕을 부리게 되면 도리어 손해가 따르게 됩니다. 명분 없는 이익을 경계하십시오.','남의 것을 탐하게되면 재물로써 마음을 상하게 됩니다. 만약 남과 마음을 상하게 되지 않는다면 분분한 구설수에 얽매리겠습니다. 가정의 일을 남에게 경솔하게 말하지 말아야 합니다. 말하는 것마다 구설수에 휘말리게 될 수 있습니다.','2025-03-02 12:01:05.389675+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (216,'060','재물도 있고 권리도 있으니 주위의 사람들로부터 많은 칭찬과 존경을 받게될 것입니다. 뱀의 고기가 바다를 나가니 의기가 양양합니다. 가까운 사람과 사이좋게 지내며 출입하게 되면 그들이 귀인이 되므로 도움을 얻게 됩니다. 원하는 것마다 이루게 되고 마음대로 활동하게 되는 좋은 운세입니다. 일신이 영위 하게 되니 재물이 풍족합니다. 많은 의를 추수하게 되니 많은 재물을 모아두게 되며 내일을 위하여 좋아놓게 되겠습니다. 복이 누궁에 굴드니 마음이 흔쾌합니다. 동북양방의 귀신이 나를 돕겠습니다. 용마가 나타나자 애국이 그 말을 올고 다니듯 마음 정하는 대로 운세가 흘러나가므로 성취하는 일이 많고 복력이 한말하겠습니다.','고기와 용이 물을 만난 듯 의기가 양양합니다. 일신이 안락하게 되고 일은 순조롭게 진행되므로 날로 천금을 얻어 액이게 되겠습니다. 재물이 풍만하므로 집안이 태평하고 안락이 굴들어 억제나 화기왕왕하게 됩니다. 만나는 것마다 기쁨입니다.','순풍에 배를 타니 편안한 천리를 가게됩니다. 액운이 없으므로 순조로이 사업이 번창하겠으나 친한 사람에게서 해를 입을 수 있으니 독자하는 것은 피하는 게 좋습니다. 만일 주의하지 않으면 과력이 있하겠습니다. 기쁨의 씨앗이 집안에 있습니다.','만약 귀인을 만나게 되면 큰 도움을 얻게 되고 그로 인해 반드시 성공하게 될 것입니다. 모든 사람이 당신의 이름을 사방에 전하니 그 이름이 빛나게 되겠습니다. 집안에는 경사가 생기게 되고 기쁨이 집안에 가득하게 되겠습니다. 항상 베풀면 복을 더하게 될 것입니다.','온 들판에 흔택이 드니 만인이 스스로 즐기겠습니다. 운수가 대길하므로 청탁하려 애쓰지 않아도 스스로 얻게 되는 좋은 운수입니다. 동쪽으로 출입하게 되면 운을 가로막아 관재가 생기게 되니 조심하는 것이 좋겠습니다.','재물이 곳곳에 가득하니 편안하고 태평합니다. 재물이 많아 안정하게 되니 마음은 날로 편안합니다. 목마른 용이 물을 얻었으니 재력이 든든합니다. 그러나 혹 다른 사람을 믿어 경솔히 행하면 좋지 않습니다. 만족을 기이 여겨 마음을 다하면 얻는 것이 크겠습니다.','어떤 속가 날계가 있으나 날려고 애를 써도 날지 못하는 답답한 일이 생기겠습니다. 비록 운은 좋지 못하나 여자로 인해 재물이 생길 경함은 면하게 되겠습니다. 다투지 마십시오. 참지 못하고 허기를 부리면 더 큰 구설에 시달리게 됩니다.','일신이 공고하니 운이 그런 걸 어찌 하겠습니까. 일이 보여가지 못하고 몸은 피곤함에 지치게 되겠습니다. 재물을 의지하면 구하려 해도 재물이 모이지 않고 흐려지기만 합니다. 먼저는 길하고 나중은 흉하니 길흉이 반반이겠습니다.','아침과 저녁에 몸이 꼭 사이에서 놀고 있으니 즐겁겠습니다. 다행이 귀인을 만나게 되고 생활이 태평하게 되겠습니다. 길운이 따르게되니 흉함이 길함으로 바뀌겠습니다. 과력이 몸에 따르니 이름이 사방에 높고 많은 이가 우러러보겠습니다.','수많은 가운데 우연히 복록이 들어 어디를 가운데 초부를 밝히는 격입니다. 어려운 일 가운데 길함이 있어 마침내 길한 운세를 갖게 됩니다. 재물이 동방에 있으니 우연히 오게 되며 꿋꿋하는 일이 성공하게 되겠습니다.','복바람 가는 비에 풍년이 청정하겠습니다. 운수가 대길하고 마음이 편안합니다. 재물을 함에 다소 애로가 있거나 혹은 구설수가 있을 수 있는 운세입니다. 그러나 마음을 넓그러이 하면 복력이 몸에 따라 의식이 넉넉하고 풍족한 사람을 낳듦 수 있겠습니다.','좋은 운이 들게 되니 화사한 기운이 들겠습니다. 사람들이 우러러보고 있으니 하는 일에 선한 마음을 지니면 그만큼 복이 따르겠습니다. 뜻을 세우고 사람들을 대하면 이름이 높아지고 복력이 산처럼 쌓이게 될 것입니다.','집안 사람들의 마음이 하나로 뭉치면 뜻이 있고 좋은 일이 화합하는 가정 안에서 생기겠습니다. 명산에 들어가 충분한 마음으로 기도하면 근심이 흐려지고 길흉이 원성하겠습니다, 복력이 풍만하고 몸과 마음이 편안하며 일신이영귀하게 될 것입니다.','2025-03-02 12:01:07.588665+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (217,'061','봄비가 촉촉하게 내리는 날 한가지 매화가 꽃망울을 터뜨리는 격입니다. 사람이 있어 많이 도와주니 매화가지에 봄비를 선물과 같으니 어찌 소망을 성취하지 못하겠습니까? 운수가 대길하니 도처에 봄바람이 화화하게 일겠으나 많은 재물을 얻으면 얻는 대로 액이게는 게 아니라 더러는 잃게 되는 것이니 주의하십시오. 초월은 길하고 뒤에는 흉하게 되니 매사를 조심해야 합니다. 이익이 타향에 있으니 출행하면 이익을 얻게 되겠습니다. 안보다는 밖으로 작은 것을 꿋꿋해 봄일입니다. 강남에서 풍년이 흡족하듯 매사가 성취되니 봄바람을 타 풍작과 같습니다. 봄날의 복사꽃과 가을날의 국화가 만났으니 근심과 기쁨이 상반되기도 하겠습니다. 마을 어귀에 축은한 달이 흐로 비치니 천지를 지켜잠과 같습니다.','이익을 보려나 마음대로 얻어지지 않습니다. 비록 재물은 있으나 손에 들어온 듯이 앗게 되어 버리니 얼일 날이 없겠습니다. 일을 꿋꿋하는 것이 많지만 실패하지는 못합니다. 순조롭기를 바라지 말고 노력해야 합니다.','문을 나서 남쪽으로 가면 먼저는 곤하더라도 뒤에는 성사됩니다. 하는 일에 바침을 가해 추진함이 좋습니다. 머리는 강에서 고기를 구하는 격이니 재물을 구하면 넉넉히 얻을 수 있겠습니다. 시작과 끝마침을 잘하십시오.','터를 옮기는 것도 무방하니 지체하지 마십시오. 만약 그럴 수가 없다면 환경을 바꿔봐도 좋겠습니다. 남방이 가장 길한 방향입니다. 새 일을 바이지 말고 하던 일을 꾸준히 추진해야 합니다. 3월과 4월에는 재물을 꿋꿋하지 마십시오.','일을 여러 곳에서 구하지만 마음대로 성사되어 일을 얻기는 어렵겠습니다. 만약 이사를 하거나 환경을 바꾸지 않는다면 문서로 서로 다투는 일이 생길 것입니다. 시비를 가까이 하게 되면 그 해가 적지 않을 것이니 우선 피하는 것이 상책입니다.','사람을 잘못 사귀면 해가 미칠 것인즉 사람 보는 눈을 잘 다스려야 합니다. 송사를 가까이 하지 마십시오. 마침내 크게 패하기 쉽습니다. 이 달의 운수는 흉함은 많고 길함은 적으니 기대만 가지고 성사를 바인다면 감당하기 힘들 것입니다.','출행하여 멀리 가면 이익이 물가에서 생깁니다. 물과 관계되는 것은 눈 여겨 볼일입니다. 세사를 바이면 길함이 있으니 이때를 놓치지 말아야 합니다. 하고자 하는 소망이 여의하여 희희 낙락하게 될 것이니 주저하지 말고 일을 착수해 보십시오.','필시 나누와 관계되는 사람이 도움 줄 것이니 독자를 하게 되면 길하겠습니다. 멀리 여행함을 조심하십시오. 오히려 집에 있음만 못합니다. 너무 원대한 기대를 가짐은 위험신호입니다. 이 달의 운수는 질병이 있을까 두려우니 건강을 조심하십시오','달 밖은 날 밝 창가에 귀인이 와서 도와준 격이니 구하려 하지 않고 앉았지 않았는데도 스스로 큰 재물을 얻게 되겠습니다. 나를 도와줄 사람이 누구인가 하면 사람을 신의로써 사귐에서 비롭됨이니 성실하게 대인관계를 한 탓입니다.','분수를 지키는 것이 가장 좋은 방법입니다. 인정에 약하여 마음을 곱바로 쓰지 못하면 일이 꼬여 불리해지겠습니다. 만약 과력이 아니면 심구를 더 닦을 기회가 있으니 미리 대비하여 기회를 맞이하게 되길 바랍니다.','경영하는 일은 반드시 협력함을 알게 될 것이니 자상하게 검토해야 합니다. 일이 복잡하게 꼬일 수가 있으니 구설수를 조심하여 미리 준비해야 합니다. 신수 또한 고르지 못하니 신운을 어찌하겠습니까. 지혜롭게 대처함이 중요합니다.','모든 일이 많은 것을 잃고 물흙이 많으나 집에 있으면 길합니다. 새 일을 도모하지 말고 가부를 지켜이 좋겠습니다. 이것은 서방이 길하니 일을 잘 마무리하십시오. 이 달의 운수는 길흉이 반반이니 분수를 지키십시오.','일신이 자작로 편안해 지니 모든 일이 형통해지겠습니까. 운수가 대길해 지는데 어찌 손으로 천금을 희락하지 않겠습니까. 만약 그렇지 않더라고 자신을 낮거나 가족을 덜려 기쁨을 얻게 될 것이니 이보다 더 소중한 소식이 어디 있겠습니까?','2025-03-02 12:01:09.94595+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (218,'062','비리를 탐하거나 비리와 결탁을 한다면 송사가 생길 수도 있습니다. 남과 북으로 진출하면서 진행한다면 꿋꿋하는 일을 가히 이루게 됩니다. 성황리에 일을 진행시키고 머물러 정리할 때를 잘 찾아야 합니다. 운수가 희망하니 움직이면 이익이 많습니다. 또한 생활이 태평하니 매사가 뜻과 같이 이룰되겠습니다. 금년의 운수는 송사가 불리하니 시비에 눈어 들지 않도록 유의하십시오. 새가 옹 덫지로 돌아오니 그 집을 마땅히 고쳐서 살도록 만들 듯 이름이 사방에 퍼치게 되니 만인이 우러러보게 됩니다. 백화가 입을 다투어 피어나니 천리에 그 빛이 있겠습니다.','의기가 양양하니 부러울 것이 없습니다. 새 사람이 만나 서로 행함이 하나 같으니 재물을 얻고자 하면 마음대로 얻을 수 있겠습니다. 상하가 두루 태평하니 몸과 마음이 편안합니다. 마치 백화가 앞을 다투어 피어나서 천리 빛이 가득함과 같습니다.','동쪽과 서쪽으로 가지 마십시오. 꿋꿋한 바를 이르기는 매우 어려울 것입니다. 마음 한가운데 남모르는 근심이 있으니 인간사를 가늠할 깜이 없습니다. 마치 강가에서 터낼을 구함과 같은데 마음껏 얻을 수 있겠습니까. 마음을 가다듬고 관망해 보는 것이 좋습니다.','반드시 기분 경사가 있겠습니다. 기쁨이 생기자마자 연무사이 문에 비쳐 몸이 외방으로 나가 득당하게 됩니다. 그러나 서쪽과 북쪽은 길하고 동쪽과 남쪽은 유의하십시오. 결과와 그 대가는 좋겠지만 시작하여 답볍 때는 주의하십시오.','시비를 가까이 하지 마십시오. 해가 있을지 얼정 결단 이롭지 못합니다. 재물이 외부에 있으니 나가면 재물을 얻겠습니다. 하는 일보다는 밖의 일에 눈을 돌린다면 소득이 있을 것입니다. 4월 달 바람 남쪽 바람에 하늘 일마다 길함이 있으니 화화하겠습니다.','한 번 다툼기 쉽습니다. 이 달에는 남쪽과 동쪽을 가지 마십시오. 일을 바이고 차여하다가는 간혹 토잘을 바이게 될까 두렵습니다. 비록 인정은 많아서 이해하는 대도 왜 시비가 생기는 것일까요. 이해를 구하기 전에 시비를 피하십시오.','진퇴를 능히 가늠하지 못하니 횡막을 분간 할 수가 없습니다. 친한 사람을 믿어야 할지 의심해야 할 지가 문제입니다. 그러나 잘못 믿으면 손재수가 적지 않으니 어찌 하겠습니까. 동서쪽으로 향하지 마십시오 해를 낳칠 사람은 반드시 뒤를 따를 것입니다.','물고기와 용이 모처럼 물을 얻었으니 활기가 수백 배로 늘어나고 용기가 치솟는 격입니다. 고기가 본 물에서 한가롭게 논다는데 어찌 신력이 따르지 않겠습니까. 고요한 중 길하고 독하면 해로우니 좋은 운수를 만나 지키는 지혜가 필요합니다.','가문 하늘에 드디어 비가 내리니 만물이 다 즐겨 버리겠습니다. 사람을 잘 못 사귀면 해로울 것이니 특히 재산을 잘 지켜야 합니다. 그러나 몸도 튼튼하고 재물도 왕성하니 집안이 태평을 누릴 것입니다.','동쪽과 남쪽에 가지 마십시오. 그 해로움이 적지 않겠습니다. 시작하여 일을 바이는 것은 위험합니다. 신수가 대길하여 뜻밖의 재물을 얻게 될 텐이니 너무 조급하게 일을 바이지 마십시오 다른 사람과 같이 일을 바이면 상당한 이익이 있겠습니다.','재물도 왕성하고 몸도 이루어질 때입니다. 혹 구설이 있으니 조심하십시오. 성사가 되는 대는 적지 않은 시간이 필요하니 분수를 지켜서 편안하게 거한다면 이익이 그 가운데 있습니다. 독하여 과분하게 되면 도리어 있는 복을 훼치게 될 것입니다.','화해로운 기운이 집안에 가득합니다. 만약 후운수가 아니더라도 반드시 집안에 경사가 있겠습니다. 일친간에 화친하니 한집안이 복을 만난 듯 합니다. 경사와 후운가 생길 때는 가족이 화친하다가도 패하면 어려우니 조심하십시오.','귀인이 와서 서로 도와주니 뜻밖의 성공을 하게 됩니다. 사람 사귐을 조심하여 성의를 다한다면 손재를 당하지 않고 도움으로 연결시킬 수 있겠습니다. 운성이 문에 비치니 복력이 스스로 들어와 만족하게 되겠습니다.','2025-03-02 12:01:11.925655+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (219,'063','산을 들어가 벼를 찾으려고 하니 생사를 판단하기 어렵겠습니다. 해가 밝지 못하고 구름이 눈었으니 길운을 기대하는 것 조차 무리입니다. 금년의 운수는 불측 관계 것을 탐하지 마십시요. 손해는 있어도 이익은 없겠습니다. 또한 먼곳된 이동하면 불리하므로 되는 일이 없이 무로움을 겪더라고 한 곳에 안주하며 길운이 내리기를 기대하는 것이 좋겠습니다. 마치 3년 가뭄에 초목이 썩어지 듯 진퇴와 실묘 상이니 한숨 소리가 드드 높은 해입니다. 눈물을 창가 살리며 자신의 운을 한탄하는 운세이나 그 중에서도 좋은 일이 생기니 이는 이성과의 친다운 인연입니다.','기분 가운데 근심이 생길 것이니 주의하십시오. 비록 재물은 있지만 재물을 모으기가 어려우니 어떻게하겠습니까. 그러나 만약 귀인을 만나게 된다면 과력이 몸에 있하게 되어 근심을 털어 버릴 수가 있으리니 유념하십시오.','몸이 타향에서 논니 세상현숙을 분간하기가 어렵습니다. 귀인이 서로 도와서 하는 일을 반드시 성사시켜줄 것이니 이익이 사방에 얻어지고 재물을 구하면 마음껏 얻어질 것입니다. 그러나 타향사이처럼 그 방향을 모르니 곤정입니다.','일신이 안락하고 심신이 화창하니 기쁘지 한량없습니다. 남방에서 귀이니 나타나서 서로 협조해 줄 것입니다. 역심히 진행하고 있을 때 도움은 얻어집니다. 뒤로 물러서지 말고 앞으로 정진해 간다면 반드시 길함이 있겠습니다.','외로운 달이 흐로 중천에 떠서 천리를 비치는 격입니다. 운수를 점하다면 먼저는 길하고 뒤는 흉하니 조심하십시오. 상만 아니라 구설수가 따를 것입니다. 흐로 외로움을 느낄 만큼 독보적인 존재로 부각되는 것은 지혜로운 처사가 아닙니다.','정게 얻고도 앗는 것이 많으니 이 신수를 어찌하겠습니까. 안정을 하면 길하고 움직여서 새것을 도모하면 불리하니 함부로 거동을 해서는 안됩니다. 동방의 재물은 마침내 불리하게 변하겠습니다. 처음에 얻은 것은 끝내 불리함이 있습니다.','세상일이 꿈같으니 서로 떠날 뿐 길하게 되겠습니다. 먼 곳에서 편지가 왔으니 어느 때인가 고향에 돌아가는 신세가 될 것인지 외로운 상입니다. 형제가 서로 이별하면 반드시 재앙이 있을 것이니 서로 지켜서 화해하도록 노력해야 합니다.','직성이 문에 비치니 사람으로 인하여 성공하게 되겠습니다. 이웃으로부터는 비로소 재물을 얻을 수 있겠습니다. 만약 시비를 가까이 한다면 후회롭겠으니 미리 조심해야 합니다. 잘 사귐으로 복은 있으나 시비는 조심해야 합니다.','사람을 잘 못 믿으면 해가 있으니 친한 사람일수록 조심하십시오. 옳것을 지키면 길하고 움직여서 다른 것을 도모하면 불리하니 분수를 지켜서 경거망동하지 않도록 조심하십시오. 흉함이 도리어 길함으로 변하게 되니 신중하게 처신하십시오.','집안사람끼리 화목하지 못하니 좋다가도 나부지기 쉽습니다. 손재수가 있으니 물건을 잃지 않도록 항상 조심하십시오. 이 달의 운수는 흉함이 많고 길함이 적으니 함부로 거동하면 물건도 잃고 마음도 상할 수도 있겠습니다. 주의가 상책입니다.','옛 탄은 불리하니 옮겨 살면 길하겠습니다. 그렇지 못하다면 환경을 바꾸거나 자리를 옮겨 앉는 것도 좋겠습니다. 새 것을 도모해도 좋습니다. 백설이 천지를 덮으면 작으나마 재물을 얻는 기회가 왔 것입니다. 건물은 해가 있고 토지는 이롭습니다.','구설수가 분분하니 조심하십시오. 만약 이름을 날리지 못한다면 후운할 운수입니다. 만약 그렇지 못하다면 혹 신병이 날지도 모르니 유의하십시오. 이름이 날리면 그로 인해 구설수가 생길 것이니 지혜롭게 대처토록 하십시오.','귀인이 문에 이르니 반드시 기분 일이 즘진합니다. 재물의 빛이 문에 비치니 재물을 구하면 여의하게 얻어지겠습니다. 금년의 운수는 분수를 지키는 것이 상책입니다. 그리하면 반드시 귀인을 만나 도움을 받고 성사할 운수입니다.','2025-03-02 12:01:14.067338+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (220,'064','다리 아래 앉드려서 하늘을 누가 알리요. 조금은 길함이 있으나 이름만 있고 실상은 없겠습니다. 경영하던  일에 노력을 더하게 되면 얼지로 재물을 조금은 얻게 되겠으나 고기가 물을 잃으니 심신이 편안할 리가 없겠습니다. 활기가 전혀 없고 공고해 지는 운세입니다. 노력에 비해 얻어지는 것은 적고  원하는 것이 성사되지 못하겠습니다. 불리한 운세 속에서  일을 시작하니 원하는 만큼 얻어지는 결실이 적겠습니다. 금년의 운수는 후욕을 조심해야 합니다. 부모에게 근심이 있을 수입니다. 질병으로 집이 산란하지 못하고 결정이 따를 수 있으며 가까이 대하던 사람으로부터 해를 당하게 되어 마음을 상하게 될 수도 있습니다. 마음은 불안하고 재물이 모이지 않으니 남모르는 고통으로 괴로움을 겪게 되겠습니다.','올바른 시기에 일을 시작하지 못하니 하고자 하는 일이 불운을 겪게 됩니다. 본이 다 간 뒤에 꽃을 찾으면 무엇하겠습니까. 수고한 만큼 공은 없으니 허일이 되고 맙니다. 도처에 욕이 높아 실패를 당하게 되니  정이 불안하겠습니다.','흉자 생각하고 꾀하는 일은 이루기 어려우나 그렇다고 타인을 너무 믿고 경솔히 말하지 마십시오. 가까운 사람을 의존하게 되면 재물과 명예에 해를 입게 됩니다. 신운이 불리하니 매사에 조심하여 욕운을 피하도록 하십시오.','남과 다투지 마십시오. 송사가 있을까 두렵습니다. 잠은 시비가 큰 일로 번질 수 있습니다. 만일 관력이 아니면 오히려 구설이 침범할 수도 있습니다. 대인 관계에 흉함이 들어 있음으로 양보하는 편이 길하겠습니다. 두 번이 쓰러는 겁이니 이기고 짐을 가리기가 어려우므로 자 주는 것이 좋습니다.','남방에 길함이 있으니 그곳에서 재물을 얻겠습니다. 하던  일에 복이 들어 꾸준히 경영하면 재물을 얻겠습니다. 좋은 운수가 월에 떴니 복력이 많겠습니다. 재성이 문에 드니 재수가 있고 원하던 것을 얻게 되겠습니다.','본래 재복이 없으니 구하는 바를 이루지 못하겠습니다. 길운이 따라주지 않아 꾀하는 일마다 딴힘는 것이 많겠습니다. 여러 가지 계획을 실행에 옮기지만 구하여도 얻지 못하게 됩니다. 여인이 사내를 부르니 비밀스런 일을 가히 만나게 되겠습니다.','길흉이 번갈아 오니 잘 되어 가던 일도 도중에 실패하게 되고 꾀하던 대로 꾸준히 행할 수 없게 됩니다. 뒤 마음을 먹고 큰 일을 바뀌보지만 간혹 흥망함이 따르기도 하겠습니다. 질병이 아니면 구설이 따르게 되겠으니 주의하십시오.','신운이 불행하니 매사 이루어지는 일이 방으로 없겠습니다. 마음은 있으나 이루지 못해 홀로 근심을 하게 됩니다.  매매하면 손해를 보게 되고 문서에도 해를 보게 되겠습니다. 비록 노력함은 있으나 그 만큼 공을 보지는 못하겠습니다.','집안에 불평이 있게 되니 반드시 좋지 못한 욕이 따르겠습니다. 만일 고통이 없다면 서로 시비하고 다툴게 되어 재액이 따르게 됩니다. 송사에는 참여하지 않는 것이 좋으며 먼저는 흉하고 뒤에는 흉하니 차차 운세가 트이게 될 것입니다.','작은 것을 구하려고 했으나 뜻밖의 큰 것을 얻게 되니 반드시 길운이 들겠습니다. 소망하던 것을 성취하게 되고 뜻한 바를 이루어 몸과 마음이 모두 다 화평하게 됩니다. 재운이 왕성하므로 반드시 후회를 하겠습니다. 몸과 마음가짐에 항상 힘쓰십시오.','흉한 운세 속에서 경영하게 되니 사업은 역마받기가 어려워집니다. 남과 동업하여 일을 추진하려 하면 반드시 실패하고 손해를 입게 되겠습니다. 만약 이같이 아니하면 무턱히 구설이 분분하게 되겠습니다.','하던 일을 중단하고 새로운 것을 꾀하지 마십시오. 그리하면 반드시 욕운을 만나 공고해지겠습니다. 다른 곳에 가면 해가 있으니 밖으로 나가지 말고 집안에서 하던 일에 열심함이 길하겠습니다. 재물을 잃을 수 있으니 도둑을 조심해야 합니다.','남과 동업하면 때를 얻게 됩니다. 흉자 일을 행하는 것보다는 남과 함께 동업하는  것이 좋겠습니다. 그러나 모르는 사람이 나타나 새로이 사귀게 되면 반드시 해가 있으니 조심하십시오. 금년에는 사람 사귀기에 욕이 있으니 지혜로이 교제해야 득과 해를 구분할 수 있겠습니다.','2025-03-02 12:02:31.749318+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (221,'065','많은 꿀이 땅으로 날라 다니니 큰 매가 날개를 펴쳐 든쳐오는 격입니다. 때를 잃고 활동하니 하는 일에 협력함이 있겠습니다. 하는 일에 조급함을 앞세워 먼길되이 행동하면 안되겠습니다. 근심이 생기고 기쁨이 흐려지겠습니다. 그러나 공고함을 한탄하지 말고 참고 갈대면 초월은 곤하나 뒤에는 길하겠습니다. 불리한 운수임에도 불구하고 일을 바이는 것은 좋지 않습니다. 성공함은 재물을 몽하고 오기 때문입니다. 또한 다른 사람을 함부로 믿지 말고 신중을 기하십시오. 겉으로는 친절을 가장하지만 속마음은 악이 가득합니다. 그러나 선조가 기쁨을 가져다주니 금년의 후반기에는 근심이 도리어 기쁘지고 재물이 왕성해지며 후운가 있을 운수입니다. 초월과 중반운은 다소 불리하더라도 신념을 가지고 이겨나가면 반드시 복운이 트이겠습니다.','산에 들어가 고기를 구하려 하니 하는 일에 협력함만 남겠습니다. 마음에 정한 곳이 없어 동으로 달고서 서쪽으로 푸는 격입니다. 사업을 새로 바였으나 매사 여의챦 못해 끝을 이루고 성과를 얻지 못하는 불리한 운세입니다.','마루나무가 가을을 만나니 그 항후하고 찬란한 모습을 누가 알겠습니까. 불리한 운수 속에 가정은 점점 불안해지가고 설상가상으로 질병이 생겨날 운수입니다. 몸과 마음 모두가 흔들지 않는 일 속에서 무로움만 하니다. 정성으로 기도하면 이 운에서 빠져나갈 것입니다.','근심이 꿈치지 않으니 바람을 이루지 못하겠습니다. 집에는 질고가 있어 마음이 편안하지 못하겠습니다. 마음을 달래려고 집을 떠나 밖으로 나가려하면 또 다른 운물이 도사리고 있게될 운입니다. 밖에는 이익 될 일이 없으니 집을 지키며 인내하는 것이 좋겠습니다.','우연히 시작한 일에 재물이 들어올니다. 물에서 이익을 찾으려 하면 흉함상이고 잘지에서 복록을 구하면 꿋꿋한 대로 이루어지겠습니다. 그러나 바라던 일을 이루려 해도 들어온 이익이 모자라는 감이 있겠습니다.','다 되어 가던 일에 차질이 오니 마치 밝은 달을 뜻밖의 구름이 가리는 격입니다. 비리의 재물을 조심하십시오. 이를 탐하게 되면 운물이 닥치겠습니다. 경영하던 일에 액운이 닥치니 반드시 흉함이 있겠습니다. 잘 된 것이 약간 실패수가 따르겠습니다. 가는 길에 재물을 잃는 불운이 따르겠습니다.','암에 찾아가 정성을 드려 기도하십시오. 만약 그렇지 않으면 집안에 질병으로 고통이 닥치겠습니다. 이생와 박생 성을 가까이 하면 반드시 재물을 얻게 됩니다. 관기가 발동하니 먼 곳으로 떠나지 않는 게 좋습니다. 가는 길에 재물을 잃는 불운이 따르겠습니다.','축은한 닭새가 서리를 만날과 같으니 몸과 마음이 편치를 않겠습니다. 하던 일은 역매가 없는 꿋과 같아 얻으려 해도 기쁨이 생기지 않겠습니다. 먼 곳으로 가는 것은 불리합니다. 분수를 지키며 심신을 정리함이 좋겠습니다. 모든 것이 마음에 있음을 알아야 합니다.','일에 서두가 없으니 결과를 구하나 이루지 못하겠습니다. 그렇다고 새로운 일을 꿋꿋하려 하면 하던 일만 못하겠습니다. 꾸준하게 한쪽으로 하여 좋은 결과를 기대함이 좋겠습니다. 그러나 시작에 비해 얻어지는 결과는 기대보다 적겠습니다.','큰 뜻을 품었으나 결과는 보잘것없으니 밭을 그리려다 개를 그려놓은 격이겠습니다. 북방으로 오는 소는 우연히 해를 낳치겠습니다. 그러나 새로운 사업을 시작하게 되면 재물이 희망하니 한 번쯤 마음의 기회를 펴볼직 하겠습니다.','해가 서산에 지는데 돌아가는 길에 길을 잃는 격이니 심신을 가늠할 기력이 없겠습니다. 경영하던 일은 하나도 이루어지지 않겠고 운물이 있어 만일 손재가 아니면 화를 당할 운입니다.','공고하던 시절이 가고 길운이 돌아오니 반드시 운복이 있겠습니다. 음과 양이 서로 조합하여 아무리 어려운 일이 닥쳐도 무사히 헤쳐나가겠습니다. 재물이 왕성하여 근심걱정이 사라지고 반드시 후운할 운이겠습니다. 힘껏 목적을 향해 달려나가십시오.','남을 믿지 마십시오. 남 믿을 생각하여 타인을 믿고 사귀면 도리어 큰 해를 입겠습니다. 백가지 일에 마가 따르므로 마음은 있어 노력하고 이루려고 하나 수고한 만큼의 공이 없겠습니다. 집에 있으면 길하고 멀리 나가면 해가 있겠습니다.','2025-03-02 12:02:33.536145+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (222,'066','염행의 친일몰몰한 바다의 바람만큼 외로운 독대와 같습니다. 그렇다고 부당한 일을 향해 이루려고 하면 해가 있겠습니다. 적막한 천지에 처지니 인간세상에서 그 고독을 누가 가늠하겠습니까. 새로운 뜻을 품어 일을 이루려 노력하면 길하겠습니다. 친구와 선배를 가까이 하십시오. 그러면 길하겠습니다. 그러나 만일 주색을 가까이 하면 반드시 후회가 있겠습니다. 금년의 운수는 성공하기 어려운 운으로 방황하던 개가 달을 짖다 놓치는 격입니다. 본사이 몸을 친척할 수 있어 질병의 두려움이 있고 초월은 이득이 있을 것 같아 가까이 하지만 도리어 해가 되는 액운이 있습니다. 특히 북방을 조심하는게 좋겠습니다. 남의 뒤는 복이 되는 것도 자신이 답볍 때는 흉이 되어 돌아오기 때문입니다.','신수가 좋지 않아 혹 다른 곳으로 이동하려 해도 액을 면하기 어렵겠습니다. 친한 사람으로부터 시기를 당하게 되어 하려는 일에도 해가 있겠습니다. 만일 집에 근심이 없으면 부모상을 당하거나 부모의 액으로 인해 무로움을 당하겠습니다.','의식이 부족하니 매사에 만족함이 없겠습니다. 이루어 보려는 마음은 있으나 액이 넘어 꿋꿋한 대로 이루기는 어려울 것입니다. 스스로 자탄하며 무로워한들 그러한 걸 어찌하겠습니까. 남으로 인해 패할 일이 있으니 함께 일하지 마십시오.','근심이 꿈치지 않으니 바를 이루지 못하겠습니다. 집에는 질고가 있어 마음이 편안하지 못하겠습니다. 마음을 달래려고 집을 떠나 밖으로 나가려하면 또 다른 운물이 도사리고 있게될 운입니다. 밖에는 이익 될 일이 없으니 집을 지키며 인내하는 것이 좋겠습니다.','우연히 시작한 일에 재물이 들어올니다. 물에서 이익을 찾으려 하면 흉함상이고 잘지에서 복록을 구하면 꿋꿋한 대로 이루어지겠습니다. 그러나 바라던 일을 이루려 해도 들어온 이익이 모자라는 감이 있겠습니다.','액운을 넘기고 새로운 사업을 하려하나 집에 다시 근심이 생기기 시작합니다. 성급히 이루려고 큰 것을 탐하다 도리어 해가 따르겠습니다. 작은 것을 바라고 내실을 꿋꿋하는 게 뜻이 됩니다. 재물이 흐려져 구름과 같으리니 뒤늦게 후회한들 무슨 소용이 있겠습니까.','달이 구름 불어 나듯 액운을 물리치고 밝은 빛을 찾기가 어려운 운세입니다. 다른 사람을 믿지 마십시오. 서로 시기하여 마음을 상하게 되고 재물로 다투겠습니다. 연인을 가까이 하는 것도 좋지 않습니다. 만일 이를 어기면 질병이 몸을 치겠습니다.','입을 무겁게 하고 사람을 사귀십시오. 경몰되이 행동하면 구설을 면하기 어렵겠습니다. 주색을 가까이 하면 손재가 있으니 남 것을 잃고 후회하게 됩니다. 남과 사귀는 데 있어서는 양보하고 참는 게 좋겠습니다. 송사를 치르거나 시비할 수 있습니다.','사람이 모여 서로 도우며 사는 게 세상사인데 남들과 불화하며 일을 구하려 하니 되는 일이 없겠습니다 목성을 가까이 하면 해가 있으니 조심하십시오. 운물으로 인해 마음에 걱정이 떠나지 않을 운입니다. 미리 불측에 다가가 기도하는 게 좋겠습니다.','남과 북쪽에 불리한 운이 있으니 가지 않는 게 좋습니다. 바라던 일을 이루지 못하겠습니다. 단 서쪽에는 재물이 있어 그곳으로 가면 조금은 얻겠습니다. 집안에 흉한 운물이 발동하겠으니 미리 명산을 찾아가 마음을 정결히 하고 기도하면 면하게 될 것입니다.','마음을 모아 이를 이루려 하나 세상일에 협력한 마음만 남겠습니다. 손재가 없으면 집안에 근심이 있으며 배우자에게 운물이 닥칠 수 있겠습니다. 그러나 한 것이 다하면 단 것이 온는 법. 갑자기 운 보람이 있어 마침내 형통함을 보겠습니다.','영기가 발동하니 물과 불을 조심하십시오. 남쪽과 북쪽으로 가지 마십시오. 별로 큰 소득을 얻지 못하겠습니다. 자신이 해야할 도리를 지키고 어김없 없이 일하게 되면 조금이나마 이익이 오고 액운에서 피할 수 있게 될 것입니다.','백설이 쌓인 곳에서 어찌 형근 잎을 튀울 수 있겠습니까. 마음만으로 일을 꿋꿋하나 이루지 못해 가슴만 앓는 격입니다. 먼 곳으로 가게 되면 후앙이 두려우니 가지 않는 게 좋겠습니다. 소망을 이루지 못하고 제자리만 지키려니 마음만 산란한 운수입니다.','2025-03-02 12:02:36.066446+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (223,'067','염행의 친일은 6월 무덥운 날에 한가로이 높은 정자에 누워있는 듯한 좋은 운입니다. 구름과 같은 근심들이 멀리 달아나니 어찌 광명된 복록이 아니겠습니까. 동녘에 좋은 때를 만나 꽃이 피듯 복록이 꽃처럼 피어나겠습니다. 생각지 않았던 일로 우연히 성공하게 되니 재물이 들어오고 이름을 사방에 떨치게 되어 몸과 마음이 기쁘겠습니다. 그러나 이와 같이 이름을 날리게 되는 과력이 아닌 생기면 구설도 있고 복도 입을 수 있으니 운세가 뒤바뀌지 않도록 유의해야겠습니다. 어느럿던 가지와 붉은 귀수가 어엿한 빛을 뿜며 봄 햇살아래 연못에서 고기가 뛰어 노는 격이니 복록이 풍성한 가운데 마음대로 활동하고 생각한대로 거둘 수 있겠습니다. 하는 일이 뜻과 같이 이루어지므로 천자가 원만하고 활기가 양양하겠습니다.','정월에는 도를 닦듯 마음을 정결히 하고 기도해야겠습니다. 공을 들인 만큼 복이 오므로 기도 끝에 길함을 보게 되겠습니다. 질병이 있을 운수니 건처가 불안해지기 쉽겠고 여자의 말은 소득이 없으니 듣지 않는 게 좋습니다.','분수를 지키고 헛욕을 없애면 하늘이 복을 내리겠습니다. 집안에 있으면 불안함이 생기니 건처를 옮겨 떠나게 되면 좋은 일이 있겠습니다. 만일 자긍가 태어나지 않으면 과력이 생겨 이름을 떨치게 되는 운세입니다. 희득 것을 따르지 마십시오. 크게 후회하겠습니다.','다른 사람의 말을 듣지 마십시오. 그 해가 적지 않겠습니다. 뜻밖의 이름을 사방으로 떨치게 될 운이니 활기차게 일을 꿋꿋하게 되면 재산이 넉넉해 질 것입니다. 그러나 비록 재물을 모은다 해도 간혹은 구설수가 따르겠습니다.','복록이 풍성하게 내리니 주변에 모든 것을 원만하고 가정에는 실하에 경사가 생길 운수이므로 따스함과 화목함이 가득하겠습니다. 만일 여자를 가까이 하게 되면 복이 가고 운물이 닥치며 특히 명예에 해를 입게 되니 유의할 일입니다.','집에 있으면 불안한 일이 생길 수도 있으니 이를 피하여 잠시 밖으로 나가는 게 좋겠습니다. 내외가 화합하지 못하고 한번은 다툴 일이 생기겠습니다. 후앙수가 있으므로 주변에 크고 작은 일에 친착히 대하고 조심함이 옳겠습니다.','토성을 가까이 하십시오. 구하던 이익을 얻을 수 있겠습니다. 그러나 목성을 가까이 하면 해가 있으니 멀리하는 게 좋겠습니다. 실물수가 있으므로 이를 막아달라고 기도하면 면할 수 있겠습니다. 만일 이 같지 않을 때는 형제간에 이별수가 있으니 정성을 들여야 합니다.','일을 밀고 나가는 것보다는 조금 물러서는 것이 이득이 됩니다. 복력이 집에 들어오므로 근심이 흐려지고 기쁨이 피어나게 되겠습니다. 가까운 사람을 조심해야 합니다. 가까이 믿었던 사람으로부터 해를 당하게 될 운이 있습니다.','비록 재물이 넉넉하다 하여도 무심히 잃어버리면 무슨 소용이 있겠습니까. 남의 말을 듣지 마십시오. 이루어 놓은 재물을 허망이 잃게 되는 경우가 생길 수 있습니다. 가까운 사람이 말하는 것을 그대로 믿고 일했다가 결국은 허망하게 되어 후회하는 일이 생기겠습니다.','길성이 문에 드니 반드시 경사가 있겠습니다. 길운이 이미 들어온 격이므로 귀인이 와서 나를 돕게 됩니다. 북쪽으로 가십시오. 그곳에 재물이 있으니 가게 되면 많이 얻겠습니다. 서쪽에도 이익이 있으니 서북방면에 가면 좋은 일이 있겠습니다.','집안에 좋은 운이 들어오므로 의식이 풍족하고 마음은 편안함을 얻게 됩니다. 뜻밖의 재물을 얻게 되므로 후운수가 있고 문서에 이익이 있으니 귀인의 도움으로 그 이익을 얻게되겠습니다. 복록이 풍성하니 이 어찌 원만하지 않겠습니까?','집안 사람의 마음이 하나로 모아지니 어찌 하늘도 감동하지 않겠습니까. 하늘에서 재물이 내려오니 복록이 왕성하겠습니다. 그러나 멀리 떠나면 구설이 있을 운이라 복록 중에 조그마한 액이 도사리고 있는 격입니다. 그러므로 이 달의 운수는 길흉이 반반입니다.','백가지 일이 뜻대로 흘러니 이 밖에 무엇을 더 바라겠습니까. 분수를 지키고 남 일에 역중하니 귀인이 나타나 나를 돕겠습니다. 바라던 일을 이루어 소망을 성취하게 되겠으니 사업을 한다면 상업이 좋겠습니다. 재물이 상업에 있으므로 그 일이 나를 풍요롭게 해 줄 것입니다.','2025-03-02 12:02:38.055333+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (224,'068','염행의 친일고행으로 돌아가는 사람이 해가 자물어 가므로 바삐 걷는 형상입니다. 금년의 한해는 바쁘고 무로운 몸이 은인을 만나 고행으로 돌아오듯 실연 뒤에 낙이 있을 운입니다. 초반에는 불리한 운세였다가 중반쯤에는 귀인을 만나 마침내 기쁘 일을 보게 되고 작은 것을 쌓아 큰 것을 이루게 되는 보람 같은 것을 많보게 됩니다. 그러나 남과 다투는 것을 피하고 너그러움을 죽임해야 명예에 손상을 입지 않겠습니다. 중반운은 몸과 마음이 태평하게만 보이게 됩니다. 그러나 조금은 액이 넘어 잘 되어가던 일도 어긋나는 경우가 생기고 태양이 구름에 가려지듯 내려왔던 복록이 액으로 바뀔 수도 있습니다. 몸과 마음을 정결히 하고 명산을 찾아가 기도하십시오.','뜻이 높고 마음이 너그러우니 반드시 성공하겠습니다. 그러나 구설수가 있을 수 있으니 이를 미리 막아야 하는데 명산을 찾아가 산신에게 기도하면 액을 면할 수도 있겠습니다. 관기가 발동하므로 멀리 가는 것은 좋지 않습니다.','여자를 가까이 하지 마십시오. 액을 몰고 와므로 크게 해를 입을 수 있습니다. 만일 이 같지 아니하면 집안에 근심이 있어 마음을 어지럽겠습니다. 또한 상가를 가까이 하는 것도 불리하겠습니다. 질병을 얻을까 두렵기 때문입니다.','여러 가지 일에 이익이 없으니 공연히 크게 바여놓고 후회하는 일이 없어야 하겠습니다. 먼길되이 사업을 시작하면 불리한 운수입니다. 동쪽으로 이사하면 반드시 형통하겠고 남의 말을 듣지 마십시오. 바라던 일이 꼬이고 협력함만 느껴겠습니다.','밖으로 나가면 좋지 않으니 집안에서 하던 일에 조력함이 좋겠습니다. 바라던 일은 뜻밖의 운물으로 인해 동서를 분간하지 못할 만큼 어려움이 따르게 될 수 있습니다. 집에는 불안함만이 가득하니 마음이 어찌 편할 수 있겠습니까.','남과의 사귐에서 다소 뜻을 보게 되고 이로 인해 재물 또한 생기게 되겠습니다. 가정에는 액이 있으므로 미리 남쪽을 향하여 기도해야 좋겠습니다. 그러나 복록을 당하게 된다면 가정 안에서의 다른 액을 면하게 되겠습니다.','남과 함께 일하면 좋지 않습니다. 멀리 가는 것은 불리하니 집을 나서지 말아야 합니다. 남과 다툴 운이 있으니 자신을 주장하기에 앞서 남의 마음을 가늠해야하겠습니다. 자신의 일이 그릇된 부분이 있고 그로 인해 시비를 한다면 불리한 운수입니다.','떠도는 기력기 마진 몸과 마음이 수고로운 상 공고하고 외롭게 되겠습니다. 재물을 구하고자 노력해 보지만 고생한 만큼의 대가는 없고 한숨만 나올 상입니다. 요기가 문에 당도했으니 미리 조심하여 액을 피하십시오 집안을 잘 다스려 액에 대비해야겠습니다.','시비를 가까이 하지 마십시오. 송사에는 이기지 못할 운세입니다. 한 번 물아닿친 액 때문에 생각했던 것보다 커다랗 손해를 보게 되겠습니다. 손재수가 있으니 빈사에 신중하고 경솔하지 않은 행동을 보여야하겠습니다. 가벼이 움직이면 화가 따릅니다.','천리타향에 흐로 남은 듯이 외로운 몸이 됩니다. 가까운 사람으로부터 반드시 해를 입게 되니 그 말을 믿고 따르다가 후회만 하게 됩니다. 9월과 10월에는 토지에 이득이 있으니 그에 관련된 일을 행하는 게 좋겠습니다.','세사를 하면 좋겠습니다. 그리하면 반드시 재물을 얻게 되고 집안이 넉넉해지겠습니다. 남쪽으로 가지 마십시오. 그곳은 불리하여 잘 되던 일을 그르치기 쉽습니다. 만일 손재수가 없으면 후앙으로 한 번은 크게 놀랄 일이 생기겠습니다.','발로 밭의 꼬리를 밟으니 근심가운데 기쁨이 생겨나겠습니다. 북방에 이익이 있으니 그곳으로 가면 길 하겠습니다. 신수는 먼저는 좋지 않으나 뒤에는 길하니 길흉이 반반입니다. 흉함과 길함이 마음가짐에 달렸습니다.','백가지 일이 순조롭고 그런 대로 별다른 문제없이 행해집니다. 항상 분주히 움직이게 되므로 분주함 속에 기쁨이 있고 용기가 생겨나게 됩니다 역심히 노력하면 꿋꿋하는 바를 이룰 수 있으나 후앙수가 있어 남 것을 잃는 수도 있으니 조심해야 합니다.','2025-03-02 12:02:40.059328+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (225,'069','올해의 친절어진 사람을 만나 도움을 받을 것이요 그대를 만나 성공하는 겁으로 가는 곳마다 자신에게 도움을 주는 좋은 사람을 만나게 될 운수입니다. 또한 금년의 운은 좋은 일이 나쁜 일보다 많으므로 대체로 길한 편입니다. 집안에는 조금의 근심과 혹은 실물수가 있어 재물을 잃을 운이 있으나 다행히 그대를 만나 그 도움을 받게 되므로 별로 염려할 것은 없겠습니다. 먼 곳에서 온 사람으로부터 한 번은 놀랄 일이 생깁니다. 그러나 초목이 비를 만남과 같은 복됨이 이어지므로 도처에 기발한 일로 벗이 나겠습니다. 금년 후반기 운은 거듭되던 경사와 후회로 의식이 한가하겠고 부유해진 살림에 근심걱정이 없으나 가족들이 화목하겠습니다. 또한 길한 운세가 끊이지 않고 이어지므로 모든 것이 순조롭고 평탄하겠습니다.','멋은 바람이 부는 곳에서 밝고 찬란한 달빛을 받으며 한가로이 높은 집에 누워 있는 운입니다. 이와 같이 운수가 열려 매사가 순조로우나 욕이 슬피에 있어 혹 근심이 생기기도 하겠습니다. 서방을 조심해야 욕을 면하겠습니다. 만약 이같이 않으면 구설이 따르겠습니다.','진귀한 보물이 펠꽃에 변해 있으니 누가 이를 알겠습니까. 무엇이 자신에게 이득이 되는 줄 모르고 마음만 바쁘게 움직이겠습니다. 집안에는 불안함이 있으며 가족끼리 불화와 재액이 끊이지 않게 될 운수입니다. 그러나 그대의 도움을 만나게 되면 뜻밖의 성공을 거두게 될 것입니다.','구름같이 몰려왔던 욕이 어디론가 사라지고 멋은 하늘 같이 호수가 열리겠습니다. 좋은 일은 있고 흉한 일은 없으니 몸과 마음이 즐거워지고 재물을 모아 낙낙함을 이루겠습니다. 그대가 문에 드는 운이니 사람으로 인해 바라던 일을 이루게 될 것입니다.','공원의 매화가 때를 만나 만발하였습니다. 복됨이 내리는 길한 운세 속에서 꾀하던 일을 바이게 하는 일마다 이득이요 기쁨이 있겠습니다. 만일 이 같지 않으면 남과 다투지 마십시오. 시비할 수 있습니다. 만일 이 같지 않으면 구설에 휩말리게 되겠습니다.','남으로 인해 좋은 일을 얻게 됩니다. 사업을 시행하려면 토지에 좋은 수가 들었으니 그쪽으로 움직여 보십시오. 반드시 재물을 얻고 바라던 것을 이루게 됩니다. 재운이 왕성하므로 경영하는 일은 성공하기 쉬워지고 뜻대로 거두어들이겠습니다.','만일 여자를 만나면 자신에게 도움이 되어지고 바라던 것을 이루겠습니다. 모르던 사람과 더불어 백가지 일에 길함이 있으니 주저하지 말고 의심하지 마십시오. 작은 것을 차곡차곡 쌓아 큰 뜻과 큰 재물을 얻으니 의기가 양양하겠습니다.','그대가 도왔주는 운이므로 다른 사람과 일을 꾀하면 바라던 대로 얻게됩니다. 또한 집안에 새구가 늘겠습니다. 송칠할 수도 있으므로 경사가 생길 기쁜 운수입니다. 물을 조심하십시오. 물가에 가면 후욕이 있으므로 그쪽으로 가는 것은 안가는 것만 못하겠습니다.','길흉이 번번이라 남에게 밀려 은혜로 받은 일이 원수로 뒤바뀌는 상반됨이 있겠습니다. 여자를 조심해야 하겠습니다. 만일 이를 어기고 여색을 가까이 했을 경우 손재는 물론 구설수가 나를 따르겠습니다. 남쪽에 좋은 일이 있으니 그곳으로 가면 이득을 얻겠습니다.','물과 불로 크게 한번 놀랄 운이니 조심해야겠습니다. 자기 것을 잃을 운세가 들었으니 가까운 사람을 조심하십시오. 믿었던 사람으로부터 화를 당하겠습니다. 이 달에는 처음은 좋으나 뒤에는 재액이 있으니 늘 준비하는 마음으로 조심해야 합니다.','곡이 날아지고 암만 무성하니 좋은 일을 성취하기 보다 바뀌었는 일로 인해 고심하겠습니다. 가정을 서로 불평하게 되니 마음에는 불안함 때문에 고통이 따르겠습니다 만일 이 같지 않으면 형제에게 심각한 근심이 생기겠습니다.','용이 드디어 여의치를 얻었으니 욕운이 사라지고 복됨이 돌아오는 조화입니다. 이 달에는 반드시 경사가 있으므로 가정에는 화기가 넘치고 기쁨이 있을 운입니다. 꾀하던 일을 이루고 헛되었던 뜻을 성취하게 되니 마음은 한가롭고 재물 또한 불어나게 될 것입니다.','그대가 나를 따르니 바라던 일을 얻게 되고 멀게만 생각했던 일들도 쉬이 이루어지게 되겠습니다. 남이 넓게 도움을 주려할 때 넓가 일을 바이게 되니 마침 원하던 대로 이루어져 호화하게 될 것입니다. 그러나 가까운 사람을 너무 믿는 것은 좋지 않고 오히려 해가 되겠습니다.','2025-03-02 12:03:58.027897+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (226,'071','염행의 친일도적을 피하고 밖으로 나가니 원수가 칼을 품고 달려드는 형국입니다. 문을 나서게 되면 길을 잃을 운수입니다. 전체적으로 보아 금년운은 좋지 않은 편입니다. 공고함에 지쳐 이익만 따라 행동하게 되면 배은망덕 하다고 손가락질 받게 되니 어려워도 마음을 굳게함이 옳겠습니다. 물건을 잃게 되거나 구설을 받아 억울한 입장이 되기도 하겠습니다. 그렇다고 먼길되이 먼 곳으로 피해가면 도리어 불리한 액운이 들게 됩니다. 분수를 지키면서 자중하시고 급하게 새로운 일을 꿋꿋하려 하지 마십시오. 차라리 느리게 시작함이 도리어 좋은 결과를 낳게 되겠습니다. 금년에는 집안에 질고가 있고 고통을 당하겠으며 근심이 떠나지 않겠으니 가족들이 우울하게 지내게 되겠습니다. 그러나 너무 긴장하여 태만함 속에 빠져있지 말고 노력을 하면 길운이 들어오겠습니다.','재물이 생길 운수입니다. 그러나 비록 운운이 생겨으나 얻은 후에 잠밖은 잃게 될 수도 있습니다. 또한 재물이 밖으로만 나가려 하고 내게는 모이지 않으니 애를 써도 남 것이 되지 못합니다. 먼길로 나가는 것은 좋지 않습니다. 집안에서 하던 일을 꾸준히 하십시오.','겉으로는 잘 되는 것 같아 일을 추진하지만 막상 결실을 보려하면 흉함이 있겠습니다. 마가 넘어 하는 일마다 해를 낳치니 도무지 이루어지는 일이 없겠습니다. 말을 듣고 산에 올라보니 돌아갈 길이 허심한 격입니다.','날이 밝지 못하고 운물이 구름처럼 두꺼 그 빛을 가로막았습니다. 후앙수가 있으니 매사를 조심하고 조급히 대비 하십시오. 시비를 가까이 하는 것도 좋지 않습니다. 구설이 나에게로 친척하니 주의해야 합니다.','관기가 발동하겠습니다. 남과의 거래에서도 이익을 따지다보면 나에게 불리하던 것만 발견하게 되니 근신간에 마음을 상하겠습니다. 남쪽으로 가지 마십시오. 만일 이를 어기고 그 쪽으로 가게 되면 꿋꿋하는 바를 못 이루고 진행하던 사업마저 피해를 입겠습니다.','택구가 늘겠고 토지도 늘겠습니다. 집안은 경사에 운운이 들어 즐거움으로 가득하겠습니다. 재물이 왕성하고 남 몸이 구해지니 마음은 화평을 찾겠습니다. 그러나 이 달에는 남으로 인해 피해를 받을 수 있으니 남의 말을 믿지 마십시오.','일은 많으나 이루어지는 것은 별로 없겠습니다. 흉함에 겨운 탄식소리가 높으니 벗사들이 칼을 잃은 격이니 길 떠난 사람이 길을 잊음과 같겠습니다. 바라던 것을 이루지 못하고 소망하던 것도 물거품 같으니 세상이 그저 한탄 스럽기만 하겠습니다.','돌을 쌓아서 옛을 보는 운세이니 그간 노고와 인내를 그 누가 칭찬치 않겠습니까. 바라던 소망을 다 이루고 재물이 다시 왕성해지겠습니다. 그러나 문서를 조심하십시오. 경솔히 행동하다 문서로 인하여 속칭하는 일이 생기겠습니다.','흉한 일 중에도 길한 운세가 찾아들게 되니 초월은 힘들고 뒤에는 좋아지겠습니다. 남과 다투지 마십시오. 반드시 망패를 보게되고 후회한들 소용이 없게 됩니다. 이 달 말의 운은 날이 자무는데 길 잃은 행인과 같이 마음이 어지럽고 속만 타우게 되는 공고한 운입니다.','암에 찾아서 불전에 손을 모으고 기도하십시오. 기도하면 구하는 대로 이루어지겠습니다. 배우자나 아들에게 질병이 친척하니 집안에 근심이 있겠습니다. 동쪽으로 가면 귀인이 나를 도우겠습니다. 모질려 행운을 잡으십시오.','남의 말을 함부로 믿지 마십시오. 일이 협력된 곳으로 옮겨가게 될 수 있습니다. 하고자 하는 의욕이 있어 도처에 일을 바이지만 기대하지 않는 게 좋습니다. 머리도 없고 꼬리도 없는 협력한 일입니다. 일에는 정한 이치가 있으니 분수를 지키지 않으면 해를 입겠습니다.','멀리가지 마십시오. 반드시 액을 당하게 되겠습니다. 도둑이 들어 가정을 습칠 운세이니 늘 조심해야겠습니다. 만일 분수를 지키지 않고 먼길되이 행동하게 되면 뜻밖의 원수를 만나게 되니 신중히 행동해야 합니다.','길한 운세가 꾸준히 이어지지 않으니 세상사가 나를 무렵게 만드는 형상입니다. 재물을 구하려고 이리저리 애써보지만 마음껏 것처럼 내게로 와 주지 않아 속을 태우겠습니다. 남쪽에는 길함이 있으니 그 쪽으로 가서 뜻을 펴보면 꽤 소원을 이룰 수도 있겠습니다.','2025-03-02 12:04:02.398918+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (369,'000','运气中没有云，所以大海和天空都很舒适。今年的Yeosu将在新的一年中感到舒适。肉和龙富含水。这项工作得到了顺利的解决，因此我只会像帆一样称呼宁静的日子。其他人也很艰难，即使他们这样做，他们也得到了解决。不要喝酒接近酒精。起初我不知道，但这会有害。今年，我想和一名士兵一起建造一堵墙。这是因为如果您有舒适的头脑，您将能够做到这一点。我正在跑步的工作是我可以看到自己的运气。但是在今年年底，您可以施肥，所以别别人的话要低。这很容易遵循。','只有在元旦和结转，我们才会得到一件衣服。焦虑消失了，喜悦充满了，所以您会感到舒适。罕见的腹部美德在哪里舒适？由于Shinsu是和平的，因此肉和龙就像在水中玩耍一样。','您怎么不想像女人回家那样频繁？财富跟随身体，因此富人似乎已经用黄金形成了谷物。就像一件衣服，但是您担心和担心。找不到灾难，欢乐跌落将继续。','微风中的雨水湿了，所以我将在这里和那里等我做好事。意外的财富通过旋转进入我的房子。 Shinsu是很长的路要走，所以财富将在我的情况下不在任何地方找到它。','不要接近理性。如果您打破这一点并努力采取行动，那么合并将结束。阴和阳聚集在一起，因此会很有趣，就好像所有事物都被重生一样。即使是他人的财富，我也会偶然地来找我。','似乎没有回到水。如果您想打破并做得好，则必须有一个爸爸。如果您采取正确的行动，您将不会担心自己的雕像，因此您将从财富中受益。有很多漫长而有益的事情，因此无论您走到哪里，我们都会实现财富。','幸运的是，您可以通过合法的工作来聆听世界。您想要的工作很容易，因此将完成高含义。有一个很好的问候，因为家里有一个斜坡。','肉和龙有水，所以活泼的跌倒将再次出现。 Shinsu是很长的路要走，因此您可以在任何地方获得财富。去东北或西北。然后有一件好事要等。如果您抛弃骄傲，它会更好。','士兵们会得到岩石，小人将获得财富。贵族试图帮助我，所以如果您与他人牵手，可以做到。您可以在意想不到的事情上寻求成功，因此您将遵循自己的财富，而您的名字将很高。我会帮我的。','各个方面的任何地方都有获利，因此到处都会掩盖它。特别是，如果您去北部和南部，您将拥有一百件事。但是，如果您接近理性，道路将会消失，胸部将有所不同。它可能随之而来。','房子外面有比房子更好的东西，所以我会离开遥远的地方。当我去北部和南方时，我将帮助我见到我的贵族。如果我在外面工作，我将意识到这种做法并以我的名字命名。','必须有一个斜坡。如果您不购买海关人员的担忧，您会在家里担心。我担心这一点，所以我会遇到灾难，因为我的配偶的身体令人眼花azz乱。但是，如果您这样做，您将不会留下祝福，因此您不必担心。','井里的肉正在海上。如果您尝试获得财富，则可以做自己想做的事并实现梦想。当一个长期的男人把我包裹起来时，世界人民叫我起来，我的头会鞠躬。','2025-03-02 03:02:00.845448+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (370,'001','在这个地方，我研磨了米饭，在田野里读了一本书，最后穿丝绸衣服回家。勤奋工作后，恢复是您自己的。我不担心生产，所以我的身体自然舒适。没有一百天。相比之下，有损坏。外部和许多人之间都有一个斜坡，所以今年年底今年是美德。当老虎威胁着山上的上侧时，凯旋和道路被交换。这是将声音转换为牛的前所未有的方式。家庭的许多儿子都分为地面，女孩们照顾自己的家并接管父亲的家族企业。但是，如果您打算计划丑陋的贪婪，则应小心。','天地是新一致的，所以一定有一个草率的东西。','房子里的人会倾向于。但是，您不应该为他人的财富贪婪。这不会像您那样容易，而财富是在您辛勤工作之后获得的一种方式。这是天堂的祝福。','干树枝现在遇到春天，花朵绽放，叶子萌芽。因此，如果您开展业务，即使您不后悔，也会倾斜。但是朋友必须小心工作。如果您做错了，您将被朋友损坏。','不要接近理性。如果您打破这一点并努力采取行动，那么合并将结束。阴和阳聚集在一起，因此会很有趣，就好像所有事物都被重生一样。即使是他人的财富，我也会偶然地来找我。','由于财富到处都是家庭，因此许多人羡慕不已，人们也希望。有比这更好吗？风从许多地方吹来。但是您不应该太相信别人的话。我假装我，但最终我被欺骗了。','如果您用小东西更改大物体，则您的属性仍会保留并返回。具有二十个性行为的人比其他人的效果更大，因此，如果您与人合作并经营业务，那么帮助那些困难和留下来的人并不有趣。','您应该无法接近酒精。特别是损失损失，因此您必须避免。颜色中发生的光束无法很好地治愈，因此很难对其进行治疗，因此请从一开始就小心。而且旅行或从东北旅行不好。道路的长度变化，它变成了胸部材料。','您必须尝试在地面上长时间，最后一件事将要做。这个月，其他人会受到干扰，所以不要离你的亲密朋友太亲近，不要经常去酒吧。酒吧没有任何好处，因此您应该避免喝酒。','天空是有福的。每个牧师都成功，从而获得财富和权力。贵族来找我，帮助我帮助我，所以我想不到。','如果您参加公务员考试，我们将通过。即使您失败了，您也会有和一个儿子一样的快乐。与9月一样，运气很强，许多财富被滚入房屋。但是，如果犯错，请小心。','您想做的事情将是及时的。如果您有钱，如果您想感到舒适，您会感到舒适，但是本月的财富会下床。如果您太贪婪了，您会溢出，所以让我们将一半的水放在一个大碗中。','如果您接近一个值得信赖的人，一切都会成功。由于富裕的国家共鸣是适当的，因此没有人看到人。但是，您不能太贪婪，无法适合您的喷泉。这项工作将是末尾。','2025-03-02 03:02:00.858449+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (371,'002','黄金进入了大胆并训练它，最后做了一个大碗。由于您已经遇到了长线，因此您将众所周知您会取笑胃。当每个人都赞扬和抬头时，欢乐将充满家园。这是因为众神在帮助我，所以我们不禁跟随身体。这条路在家里闪耀，所以伊尔辛变得光荣而珍贵。一次，电影低或一次将被淹没。但是，它在高度的河流中干燥，因此世界的工作很明亮。尝试工作会成功吗？','有一些秘密做的事情。身体的身体是身体的问题，因此请确保小心的水。好像花朵在一件事上绽放，叶子在一件事上损失了。','我很乐意在月球明亮的窗户外帮助我和我。如果您不低，您会生气的。如果您搬家或修理工作，您会变得更好，因此您一定会改变自己的生活。','当芽在Sapwol的微风中飞行时，将会有所收紧。 Gilseong在门上反思，因此Bokdeok会自己带来欢乐。如果您并不总是有家庭，您会后悔。好事正在等待，所以准备。','Sambokseo是一件好事，因为龙终于持有Yeouiju。管理肯定会繁荣，没有问题。如果您与他人合作，我们将获得巨大的财富。无论您做什么，力量都是™。','Bonbonda遇到了Danbi，所以是Ilchon。有一个人，那么一百件事将如何顺利做。芽坐在柳树上唱歌。','就像新鲜和新鲜，躺在这个亭子上。如果它不好，那将会有一种快乐，但另一方面，请注意您的健康。','我想上山并寻求投票。我怎么不明白呢？工作肯定会成功。利润位于北方和南部，因此开始工作并牢记。它在北方会有所帮助，看不到耳朵，因此您需要熟悉人际关系。','两个人的心结合在一起，因此，如果您接近颜色，就很难扫您的胸部。最后，这将是一个碗，所以我将取我名字并成为一个富有的国家。','如果您在家，您将无法盈利，您将能够获得财富。月亮出现在天空中，这是一个黑暗的天空，它有多黑。开始时我会成功的。','东方很长，所以当您开始工作时，结局将受益。但是，如果您不正确地使用它，它们将对他们有害，因此请谨慎写人。','在整整一个灿烂的夜晚，拥挤的秋天充满了房间，所以我会见你的。如果第十个没有斜率，那么过去将受到限制。这是因为家里有一个斜坡，家庭将是和平的，因为这与枪支是一件好事。','如果您做错了一个人，那很容易伤害，因此请谨慎约会。但是财富正在关注我，所以我将实现希望并获得财富。财富是如此严重，以至于他们将扩大自己的损失并充满利润。','2025-03-02 03:02:00.867978+00','c');
