INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (415,'046','耳朵就像在高峰中的情人的手臂一样。较弱的小藤在两个国家 /地区延伸。两个人有一颗心，所以我终于会得到财富。两国的藤制就像一个身体。我们将与Tigade和Shine产生共鸣。但是，如果您做错了一个人，您将亏钱，因此您应该很好地对待他们。这个家庭将是和平的，您将能够以舒适而舒适的头脑获得财富。小心，一个亲密的人会伤害。一切都与乐队相同，所以我会自己进来。如何在地面上的树上唱好歌没有好消息？','随着要求的变化，世界将意识到世界是和平的。如果您在家，您将很长，您将无法离开外面。我试图过河周围的河，但风再次开始。一定是诚实的。','两个人的心并不相同，因此很难实现他们的工作。有灵活性，因此请小心人们并结交新朋友。由于太阳降落在塞桑（Seosan），所以道路非常忙碌和急躁。','不要施肥。如果您有吸水水，将很难避免。幸运的是平坦而漫长的，但是您担心您的后代会成为亲戚。在春季，您想做的事情不会很成功。','春季花园中的红色拷贝花作为弓形，因此是一个爱情人的情人。如果您在家，有一个斜坡，因此您将有一个快乐的孩子生下孩子或增加家人。财富无处不在，所以当您去那里时，您可以做得很好。','太阳落在塞桑（Seosan），陌生人迷路了，被扔了。请谨慎对待所有事物，并保持平稳的关系。结转在北部。','像船一样，这是一个艰难而困难的国家，可以返回水。如果您向前走，那么您就有很多心脏，如果退后一步，就没有力量。如果您的父母没有很多心，请小心。','您将获得Titi地图的共鸣并获得名称。令人愉悦和充满财富有很长的路要走，因此您需要知道自己不听别人的话。 Gusul -Soo被分割了，所以我会很沮丧。','两个人的心是相同的，因此您将能够顺利进行并看到。如果没有，那一定会有一种生鱼片或结识情人的乐趣。如果您要进入并退出，如果您笑，您将继续前进。笑着看。','如果您立即扩大思想，那么您将团结起来并陷入其中的中间。双方都协调一致，因此会有斜坡。当您做一百件事时，您会感到舒适和享受。','不要着急。最后，如果您赶紧获得财富，您只会利用力量。','很遗憾，所以不要错过一个好机会。没有很多机会。如果您做错了一个人，那么您会有一种灵巧性，但是如果您建立良好的关系，就会发生性关系。脖子剧烈，财富很有活力，因此一切都会顺利释放。','财富很舒适，因此身心舒适。下雨和春天的微风就像一百个地方。房子很舒服，所以财富会充满活力。所有这些都是含义的含义的含义，因此您需要保留它。','2025-03-02 11:57:33.660651+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (416,'047','秘书已经死了，您是如何跟随背部的？极端运气必须有缺陷，因此请注意不要选择黑日。这是不利的，因为太阳向西走，开始在山上变黑。春季运输的收入不高，因此从一开始就快点赶紧是危险的。运气不利，所以我会看别人。但是，这里有一个天使，所以让我们再次看到希望。不要生气，对繁琐的世界生气。您可能处于令人失望或令人尴尬的位置。','一家人会被触发，因此，要建造房子或微笑是个好主意。尽管有努力，但很难成功地取得成功的价格。太阳在Seosan中，但是寂寞怎么样？你必须小心。','如果您没有建立含义，那么您的脖子将不足。注意不要成为一个好人。心脏不断产卵和懒惰，因此您必须用心脏仔细地处理它。','有些事情要小心，因为您应该小心外部人士。使其稳定。与他人一起玩必须失败，所以不要保证。当短暂的一天的荣耀反映在世界历史上时，您不应该想到一个梦想。','因为双方都不利，所以很难实现自己的工作。和谐是最重要的。您不应该开始两个西南。如果您赚到太多的工作或着急，没有什么好，所以您必须真诚，冷静地走。','有一个真实的数字，所以要小心道德。如果您的思想不稳定，则很难避免此数字。如果您不尝试，如何看到外面？如果您不节省辛勤的工作，那么您将倾向于在家中，您将在您的配偶中。','如果您不后悔，将会有一个乐趣。请避免上下摩克。请注意您的后代将是亲戚。由于结转位于东方和西部，因此您将擅长开始工作和这样做。','不要害怕理论。它将作为捷径向前携带，因此房屋会感到舒适。停止停止并稳定。如果您笑了，就无法受益。即使外面似乎很丰富，它也很繁荣。','我被那只鸟受伤了，所以回去并不难。你不能坐下吗？火神在漂浮，因此请注意不要被火损坏。其他人的工作将会造成灾难，因此不要陷入无用的事情。','如果您急忙赶紧，您将获得苛刻的状态，您将能够继续前进。如果您做错了一个人，那么您一开始就会很长，但是随后您会很丑陋。如果您与他们合作，您将不会有所不同。','最后，乌云和月亮出现了，因此天地将是明亮而美丽的。如果这不是结果的喜悦，我们将生育孩子或增加家庭。如果您听别人的话，恩典将改变并成为敌人，因此请注意不要被欺骗。','没有什么可确定的，因此很难回来。如果思想不稳定，一切都会受到干扰。幸运是非常不同的，很难做所有事情。不要着急。另外，还有一只手写的手，所以不要去北方。但是，这是敏捷的原因，而无需做任何事情。','不要垂涎喷泉结转。祝福是天空的下降。没有工作，所以它有头，没有尾巴。有一个真实的数字，所以要小心道德。成功的秘密是成功地工作的秘诀。','2025-03-02 11:57:37.027714+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (417,'048','国王和他的仆人在一个宁静的地方在哪里？幸运的是，很遗憾最初保留的疾病。身心彼此舒适，因此枪支出现在肾脏和溢出上。日本人将得到安慰和坚定，官员将在东部和西部的房间帮助我。','吉尔松在门口，祝福和恩典将跟随自己。家里的坡度可能是一个愉快的乐趣，每个人似乎都有一个家庭。一切都很漫长，所以世界是和平与有趣的。您还想要什么？','工资是明亮的，仆人是和平的，所以国王的恩典在人民身上。它将通过获得Titi Map的共鸣来取得成功，名字将在任何地方都颤抖。有财富和权利，因此人们将是可爱和尊敬的。','太阳和月亮明亮而明亮，所以我会提高自己的喜悦。如果您专注于自己的忠诚度，那么事情将得到充分解决，一天将发展，财富将像云一样积累。财富在外面，所以我们将不得不转向您的眼睛才能获得财富。如果看到它，请立即获取。','有很多好事，因此，如果您试图垂涎和节省您的财富，我会做的。乌云散布着，月亮出现，因此美丽的风景是新反映的，但是很幸运，但是由于有吸盘，您不应忽略人际关系。','春天像珠子一样明亮，所以我会用一百头发吵架。如果您不后悔，您一定会倾向于。在阶段时做好准备是正确的，并且力量将跟随脖子，因此它将在时间的安心中蓬勃发展。','最好是经营财富，因为财富反映在外国方面。当心。渴的龙得到了水，因此和谐将是无尽的。即使没有轻微的工作，结果也会遵循。','财富饿了，所以欢乐充满了家。您还想要什么，因为有财富和喜悦？财富和水果充满了地方，因此每个人都会受到尊敬。人们怎么会因为这个名字到处颤抖而受到尊敬？','好运的是，家庭将在他人的帮助下感到兴奋和发展。如果您遇到官员，您将能够提高自己的力量。由于肉类和精神浇水，它们将被逆转和活跃。','由于该官员在曼邦，我将在忙碌而活泼的过程中见面。您如何不偶然地帮助国王？官员肯定会出现并提供帮助，因此开始工作并在当天赚取巨额利润。','随着丹比（Danbi）的下降，将会有丰富的水果。 Sinsu将是如此强大，以至于财富将充满活力。财富像山一样积累，因此您不必担心生活。但是，这一优点也以通常的价格，因此您必须保持思想态度。','幸运的是在家中蓬勃发展，所以一定有一个斜坡。它将充满财富，您将获得一次好的药。但是，如果您是一个错误的人，您将是不祥的，因此请谨慎交易和关心人际关系。','房屋的斜率是增加家庭。小树是由乐队组成的，因此高兴的光满脸。 Shinsu就是这样，那么您还想要什么？但是，当它舒适和光滑时，它可以忽略不计，很容易感到不舒服。','2025-03-02 11:57:39.340911+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (418,'049','它将统治许多人，并成为名字和名望。丰富的财产和衣服将得到安慰，并将被享受。这个名字都很长，因此名称将更加闪耀。利润将是在另一个方面，因此您外出时会得到它。','由于阳光和树遇到了春季，花朵和树木茂盛，房子的两对将来自彼此了解。这个家庭每天都会充满活力，所以每个人都处于和解。','小龙升起天空，所以终于实现了，这是一个大雨。如果不是结果，请小心，它会引起愤怒。如果您引起共鸣，您的名字将被颤抖到社会中。','它将收集或收集财富或分散，因此您需要保留何时收集。如果您听不到别人的话，快乐和运气将是一半。保持您的主张。由于财富之后是脖子，很幸运的是后悔蒂蒂地图。','因为身心很安静，所以名字很高且非常有意义，因此我们将为人们提供恩典。如果您不后悔，您将会引起共鸣，因此两者都很好运。它将在当时倾斜，这将是个好时机。','它不应告诉西方人工作的内容，因此要秘密完成工作。一个人是诚实而漫长的，所以你必须诚意出去。不要运行各个方面，因此请勿运行。不要赶紧太多。','欢乐散发出溢出，好像在温暖的春天，所有事物都复活了。这是所有热热的，所以这不是成功的指南。东部有阳光，所以不要到达那里。停止它一会儿，因为您开始朝这个方向工作。','很忙，因为有很多工作。由于我们保留了这扇门，我们将不得不去其他地方受益。但是，如果您忙碌而忙碌，那就不多了。到处都有财富，因此您会感到快乐和舒适。对了好事。','家庭的心脏就像结果一样，因此我们很乐意实现我们所有的愿望。我将在一个明亮的夜晚遇到一个美丽的人。随着家庭的成长和领土的增加，家庭将日复一日地蓬勃发展。由于人而有一件好事。','双方彼此结合在一起，因此所有事物都得到了复兴和配对。由于属性和力量取决于脖子，因此欢乐在脸上广泛存在，因此您无法将其隐藏。到处都有一段长度，所以我想移动这个地方。完成工作是一个合适的运气。','在路中间，会有一件好事。官员将左边走，这样您就可以获得大财富。您只需要对待人们才能满足祝福。这是一种收集不富人并成为山上的方法。','我告诉你享受和笑，所以我不能总是遮住嘴。如果您不通过考试，则应具有线性范围。官员必须在西方和南部，因此将其宣传并大胆完成。','随着云层的下雨，植被被浸透了，所以万物都很活跃。丑陋的中间有很长的路要走，所以我不会被打扰。由于这对夫妇很和谐，欢乐将充满家园。因为所有这一切都是您的意思，并做了良好的行为。','2025-03-02 11:57:41.395718+00','c');
