INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (439,'071','Pro -Day Pro -Japanese也避开了敌人并出门，敌人用刀奔跑。如果您离开门，您将迷路。总体而言，今年不好。如果您只能根据利润而筋疲力尽，并采取行动，那么您将被视为一种美德。我会失去东西或获得良好的位置。但是，如果您避免遥远的情况，您将有厄运。在保留喷泉的同时，不要试图急忙做新事情。相反，慢慢开始会产生良好的结果。今年，家庭将感到沮丧，因为屋子里会有韧性，遭受痛苦，却不担心。但是，如果您如此紧张以至于不会陷入疏忽，但是如果尝试，您将进来。','这是一种将创造财富的运输工具。但是，即使发生运气，您也可能会在获得后睡觉。此外，财富只试图出去，而且没有收集到我身上，所以即使我尝试了也无法做到。走很长一段路不好。继续做您在家里做的事情。','似乎在外面很好，但是如果您尝试看到水果，您会很丑陋。一切都超越了马，因此不会完成。我听着山，爬上了山。','那天不是明亮的，水像云一样被阻塞。有一个黄花，所以要小心所有事情，然后急忙准备。接近受精是不好的。您应该小心，该机构是我的亲戚。','政府将激活。如果您在与他人的交易中获利，您将只会发现我不利的东西。不要向南走。如果您将其打破并去那里，您将无法实现该项目。','房屋将越来越多，土地将增加。由于坡上的运气，房子将充满欢乐。财富是有活力的，尸体得救了，所以我会寻求和平。但是这个月，您可能会受到他人的破坏，因此不要相信别人。','有很多工作，但这并不多。由于丑陋而产生了很高的哀叹，因此这些核失去了剑。这就像一个泡沫，我无法实现我想要的东西，所以世界只是在哀叹。','看到旧的石头是一件好意，那么谁不会赞美辛勤的工作和耐心呢？我将实现自己的愿望，我的财富将再次充满活力。但是要小心文档。我几乎没有采取行动。','即使在丑陋的工作中，漫长的财富也会到来，因此超越是困难的，它会更好。不要与他人争论。您必须看到漫画，不会后悔。本月底的运气是一个可靠的运气，那就是心脏头晕，只像失落的行人一样燃烧。','找到癌症并收集手祈祷。如果您祈祷，它将按照您的要求完成。我有一个与配偶或儿子的亲戚，所以我担心房子。如果您向东走，贵族会帮助我。祝你好运。','不要相信别人。您也许可以搬去合作工作。我有动力在任何地方做到这一点，但我不期望。这是一项没有头，没有尾巴的合作作品。有一个合理的工作原因，因此，如果您不保留喷泉，我们会伤害您。','不要走很远。您一定会得到液体。小偷是建立家庭的星座，所以要小心。如果您在不保留喷泉的情况下做了很长的路要走，您将遇到一个意想不到的敌人。','漫长的财富不会继续，因此世界的历史使我周围。我试图找到财富，但我不会尽可能多地来找我。南方还有很长的路要走，因此，如果您去那一边，您可以做出公平的愿望。','2025-03-02 12:04:02.398918+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (440,'000','幸運に雲がないので、海と空はすべて快適です。今年のYeosuは新年に快適になります。肉とドラゴンは水が豊富で豊富です。作業はスムーズに解決されているので、私は帆のように平和な一日だけを呼びます。他の人は厳しいです、たとえ彼らがそれをしても、彼らは解決されます。アルコールの近くで飲まないでください。私は最初はそれを知りませんでしたが、それは有害です。今年、私は兵士と一緒に壁を建てたいと思います。これは、あなたが快適な心を持っているなら、あなたがそれをそんなに作ることができるからです。私が走っていた仕事は、自分の運を見ることができるということでした。しかし、年の終わりには施肥することができるので、他の人の言葉では低くならないでください。フォローするのは簡単です。','元旦とキャリーオーバーでのみ、私たちは衣服を手に入れます。不安が消え、喜びがいっぱいになるので、あなたは快適になります。まれな腹部の美徳はどこに快適ですか？新島は平和なので、肉とドラゴンは水で遊んでいるようなものです。','女性が家に帰るのと同じくらい頻繁になりたくないのはどうしてですか？富は体に続くので、金持ちは金で穀物を形成したようです。それは服のようなものですが、あなたが心配して心配している場所です。災害は見つかりません、そして、喜びが続くでしょう。','この風に落ちる雨は渇きを濡らしたので、私はあちこちで良いことをするのを待ちます。予期せぬ富は、回転することで私の家に入ります。新島は長い道のりを持っているので、富はどこでもそれを見つけようとせずに私に従うでしょう。','理性に近づかないでください。これを壊して一生懸命行動すると、統合は終わります。陰と陽が集まっているので、すべてのものが再生されたかのように楽しいでしょう。それは他の人の富ですが、私は偶然私のところに来ます。','水に戻らないようです。あなたが壊れてうまくやりたいなら、あなたはパパを持っている必要があります。あなたが正しく行動する場合、あなたはあなたの像を心配することはないでしょうので、あなたは富から恩恵を受けるでしょう。長くて有益なものがたくさんあるので、どこへ行っても富を達成します。','正当な仕事をすることで世界に耳を傾けることができるのは運です。あなたが望む仕事は簡単なので、高い意味が行われます。家に斜面があるので、良い挨拶があります。','肉とドラゴンには水があるので、生き生きとした転倒が再び来るでしょう。忍は長い道のりですので、どこでも富を得ることができます。北東または北西に行きます。それから待つのは良いことがあります。あなたがプライドを捨てるなら、それはより良いでしょう。','兵士たちは岩を手に入れ、悪役は富を得るでしょう。貴族は私を助けようとしているので、あなたが他の人と手をつないでいるなら、あなたはそれをすることができます。あなたは予期せぬことで成功を求めることができるので、あなたはあなたの富に従うでしょう、そしてあなたの名前は高くなります。私は私を助けます。','あらゆる面のどこにでも利益があるので、どこでも不明瞭になります。特に、北と南に行くと、100のことでYeosuがあります。ただし、理由に近づくと、道路が消え、胸が異なります。それは続くかもしれません。','家の外には家よりも良いものがあるので、遠く離れます。私が北と南に行くとき、私は私の貴族に会うのを手伝います。私が外で働いていれば、私は練習に気づき、私の名前を作ります。','斜面が必要です。習慣を持つ人々の懸念を購入しない場合、あなたはあなたの家で心配するでしょう。私はそれを心配しているので、私の配偶者の体はまばゆいので災害があります。しかし、あなたがそれを共鳴するなら、あなたは祝福を残さないので、あなたはそれについて心配する必要はありません。','井戸の肉は海に行きます。あなたが富を得ようとするなら、あなたはあなたが望むことをしてあなたの夢を作ることができます。長い傑出した男が私を包み込むと、世界の人々が私を呼び出して、私の頭がお辞儀をします。','2025-03-02 03:02:00.845448+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (441,'001','その場所で、私はご飯を挽いて畑で本を読み、最終的に絹の服を着て家に帰ります。熱心に働いた後、修復は自分でやって来ます。私は生産について心配していないので、私の体は自然に快適です。百日はありません。対照的に、損傷があります。外と多くの間に斜面があるので、今年の今年の終わりは美徳です。トラが山の上部を脅かすと、勝利と道路が交換されます。これは、声を変換して牛に変える前例のない方法です。家族の息子の多くは地面に分かれており、少女たちは自分の家の世話をして父親の家族経営を引き継ぎます。ただし、醜い貪欲を計画する場合は、注意する必要があります。','天と地は新しく一貫しているので、ずさんなものがなければなりません。','家の中の人々は傾いています。しかし、あなたは他人の富に貪欲であってはなりません。あなたが持っているほど簡単ではなく、富はあなたがその大変な仕事をした後に得る方法です。これは天国の祝福です。','乾燥した木の枝が春に会い、花が咲き、葉が芽を出します。したがって、あなたがビジネスをするなら、あなたはそれを後悔することができなくても傾斜します。しかし、友達は仕事に注意する必要があります。間違っていると、友達に損傷を受けます。','理性に近づかないでください。これを壊して一生懸命行動すると、統合は終わります。陰と陽が集まっているので、すべてのものが再生されたかのように楽しいでしょう。それは他の人の富ですが、私は偶然私のところに来ます。','富は家庭でいっぱいであるため、多くの人々はうらやましく、人々も望んでいます。これよりも優れていますか？風は多くの場所から吹きます。しかし、あなたは他の誰かの言葉をあまり信じてはいけません。私は私のふりをしますが、最終的に私はだまされています。','小さなもので大きなオブジェクトを変更すると、あなたの財産は残り、戻ります。 20人のセックスを持つ人は他の人よりもさらに多くのものであるため、人と協力してビジネスを運営している場合、困難で留まる人を助けるのは楽しいことではありません。','あなたはアルコールに近づくことができないはずです。特に、損害の損失があるので、控える必要があります。色で発生するビームはよく癒されていないため、治療することは困難ですので、最初から注意してください。そして、旅行または北東部から出て行くことは良くありません。道路の長さは変化し、胸部材料になります。','あなたは長くなるために地面に行こうとする必要があり、最後のことは行われます。今月は、他の誰かからの干渉がありますので、親しい友人に近づきすぎず、頻繁にバーに行かないでください。バーにはメリットはないので、飲酒を控えるべきです。','空は祝福されています。それぞれの司祭は成功しており、富と権力をもたらします。貴族は私のところに来て、私が私を助けてくれるのを手伝ってくれるので、私はそれを考えることができません。','あなたが公務員試験を受けるならば、私たちは合格します。失敗したとしても、息子を獲得するのと同じ喜びがあります。 9月のように、運は強く、多くの富が家に集まっています。しかし、あなたが間違いを犯した場合は注意してください。','あなたがやりたいことはタイムリーになります。豊かさを得ると、快適になりたいなら快適になりますが、今月の富はベッドから外れます。あなたがあまりにも貪欲であれば、あなたはオーバーフローしますので、水の半分を大きなボウルに入れましょう。','信頼できる人に近づくと、すべてが成功します。裕福な国の共鳴が適切であるため、誰も人を見ることはありません。しかし、あなたはあなたの噴水に合うにはあまりにも貪欲ではありません。作業は終わりの終わりになります。','2025-03-02 03:02:00.858449+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (442,'002','金がやさしくて訓練し、最終的に大きなボウルを作ります。あなたは長いラインに会ったので、あなたは胃をからかうことが知られています。誰もが賞賛して見上げると、喜びは家でいっぱいになります。これは、神々が私を助けているからです。道は家で輝いているので、イルシンは栄光と貴重になります。一度、映画は低く、一度は水没します。しかし、それは高された川で乾燥しているので、世界の仕事は明るいです。仕事をしようとするのは成功しませんか？','密かにやるべきことがあります。それは体のための体にとって問題なので、水に注意してください。それはまるで花が一つのものに咲き、葉が一つのことで失われているかのようです。','月の明るい窓の外で私と私を助けてくれてうれしいです。あなたが低くないなら、あなたは怒っているでしょう。あなたがあなたの仕事を動かしたり修正した場合、あなたは良くなるので、あなたは間違いなくあなたの人生を変えるでしょう。','芽がSapwolの風に飛んでいるとき、締めがあります。ギルソングはドアを振り返るので、ボクデオクは自分自身に来て喜びを与えます。いつも家族がいない場合は、後悔することができます。良いことが待っているので、準備してください。','ドラゴンが最終的にヨウイジュを抱いているので、サンボクソは良いことです。経営陣はきっと繁栄し、問題はありません。あなたが他の人と仕事をするなら、私たちは大きな富を得ます。あなたが何をするにしても、パワーは™です。','ボンボンダはダンビに会うので、イルコンです。人がいるので、100のものがどのようにスムーズに作られるのか。芽は柳に座って歌っています。','このパビリオンの上に横たわって、新鮮で新鮮なようなものです。それが良くない場合、喜びがありますが、一方で、あなたの健康に注意してください。','私は山を上って投票を求めたいです。どうすればそれを手に入れることができませんか？仕事は確かに成功するでしょう。利益は北と南にあるので、働き始めて留意してください。イヤーズの見方がなく、北部では役に立つので、対人関係に精通する必要があります。','二人の心が1つのことを組み合わせているので、色に近づくと胸を一掃するのは難しいです。最後に、それはボウルになるので、私は自分の名前を作り、豊かな国を作ります。','あなたが家にいるなら、あなたは利益を得ることができず、富を得ることができます。月は空に現れます。それは暗い空であり、それがどれほど暗いかです。始めたら成功します。','東は長いので、仕事を始めると終わりが恩恵を受けるでしょう。しかし、あなたがそれを誤って使用する場合、それは彼らによって有害になるので、人々を書くことに注意してください。','明るい夜には、混雑した秋が部屋でいっぱいになるので、私はあなたに会います。 10番目に斜面がない場合、それは過去に抑制されます。これは、家に斜面があり、家族が平和になるからです。なぜなら、それは銃器に関係するのは良いことだからです。','あなたが間違った人を作るならば、それは害を及ぼすのが簡単ですので、人々と付き合うことに注意してください。しかし、富は私を追いかけているので、私は希望を達成し、豊かさを得るでしょう。富は非常に深刻であるため、彼らは彼らの犠牲者を拡大し、利益に満ちています。','2025-03-02 03:02:00.867978+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (443,'003','平らな波はこれらの人々に驚き、物的損害を被ります。使いやすさがなくても、人に一度驚かれることでしょう。終了しないでください。秘跡があるかもしれません。あまりにも多くの貪欲は不利です。器用さがあるので、旅行や他の利益を求めている場合、後悔するでしょう。秘跡があったとしても、それに参加しないでください。それは不利です。後悔に欠陥がない場合でも、病気は浸るので、健康に注意してください。あなたが親しい人であっても、あなたの耳が薄い場合、あなたは不幸をもたらします。','馬は山道に入ったので、私は外に出て退却することはできません。震えることができないので、どのようにイライラしていますか？それはまるで川が来たかのようですが、それは胃ではありません。さらに、ろうそくが暗い道に撮られるとすぐに、東、西、北、南を区別することは困難です。','高い山の骨を通過することは困難です。あなたは運ぶ方法を知りません。私は心に心配していますが、誰と一緒に遊ぶことができますか？あなたがそれを見つけても得るのは難しいです、そしてあなたは道路を見ないので、漠然とした行動を起こさないでください。','家の中にはwohがありますが、それは内側の背中です。魚とドラゴンは水のようなものなので、一度にイライラする必要があります。しかし、このこぶの後、すべてが解決され、平和になります。','それは歩行者が道を求めているようなものであり、彼の仕事を捨てて道をリードしようとしている人のようです。あなたが私に入ってくると、それを避けた場合に行く方法を見つけるのに役立ちます。ただし、他の人と良好な関係がない場合は有害です。','胸を使うのは難しいでしょう。政府は活性化されて以来、fistったり他の人の仕事に驚かされることもあります。モードの作業は他の人に任されているので、それを妨害しないでください。胸を持ち込むのは簡単です。','噴水を維持して安定させる方法がわかりません。どうすれば快適に感じることができますか？たとえあなたが働いていても、あなたはそれほど良くなく、不利です。今月のYeosuはすべてを達成するのが難しいので、最初に心を安定させる必要があります。','私が高い山に行って魚を捕まえたとき、それはどのように得られますか？最終的には空に戻ってきます。あなたが出て新しい場所を見つけた場合、それは楽しくなく、不利になります。他の人と戦うことは器用さをもたらすので、注意してください。','すべてが行われるのは難しいので、噴水を最初に保ち、噴水を切望しないでください。たとえあなたがたくさんの仕事をしていても、決定を下すことはできません。すべてが問題になっているので、あなたの心の心配を覆い、目をそらしてください。','明るい月は黒い雲の中にあり、良い月を見るのが難しくなります。統合の数は不快であり、多くの器用さがあるため、無私無欲であることは良いことです。あなたが手でなければ、あなたは他の人に低くなることができないかもしれません。','一方、霜が降りられたため、再び生き残ることは困難です。難しいですが、現実はありません。その上、あなたの配偶者は泣くかもしれないので、あなたは胸を止めるために不公平を得なければなりません。','最後に、私はしばらくの間噴水に追いつくことができてよく飲むことができたので、私は真ん中に平らになります。トレイルがついにトリガーされたので、私たちは思いやりや車を作るでしょう。','道路に行かないでください。不利な点を待っています。静かに作業しますが、使い果たした場合は簡単にヒットできます。南と北は外出すると有害になります。最初はあまりではありませんが、座って待つことはできません。静かに進むために急いではいけませんが、噴水を維持してください。','2025-03-02 03:02:00.876386+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (444,'004','植生は霜に合っているので、流fluentはありません。噴水を維持するために保持されていないため、継続的に起きるのは簡単です。富は活発ですが、東には損害がありますので、投資しないでください。移動したり、新しいことをしたりしないと、他の人と議論することができます。今年のYeosuは友好的な人に慎重になるので、デートに注意してください。さらに、あごは誰もいないので、恵みは敵になります。富が戻ってきて手が入ってくるので、あなたは死を奪うことができ、あなたの妹は落ち着くことができません。器用さがあるので、水と火に注意してください。','体は他の風味で遊んでいるので、私はいつも家に帰って快適さを楽しんでいます。議論する感覚がない場合は、髪を動かしたり動かしたりします。他の人を信じる親しい人のための泥棒になることに注意してください。','心配するのは難しいので、事前に準備してください。 ㄷは水を手に入れ、川から涙をなめるドラゴンです。あなたが腐敗を切望しているなら、空はあなたを祝福しないので、たとえそれが困難であっても。','頭を見て、何か他のものを見て、他の人は私を船から覆っています。他の人を超えて見ないでください。しかし、良い家を作るためのブースを作るのはブースです。噴水を飾らなければ、それは通常幸運です。','この風の中で柳に座っているそよ風なので、美しさはもっと語られます。噴水を維持し、快適に暮らすと、外側では悪く見えますが、内部で何かが起こります。他の人と仕事を求めるように注意してください。','尾根で雨が降り、家の農家で水が流れているので、これは何が起こっているのでしょうか？雨が休むことなく落ちるので、すべてが腐敗するのではないかと恐れています。受精せずに水に備えて肥料を避けなければなりません。','私はチョンリをさまよい、ついに故郷に会いました。貴族が現れて私を助けてくれるので、私は北と南に行かなければなりません。これを作り、それを宣伝するのはいいことです。','繁栄するのは簡単なので、それに集中する必要があります。しかし、他の人の富が突然帰宅したとき、これも残念ですが、あなたは何をしますか？あなたが間違った人を作るならば、あなたはすべてがそれに反対することに事前に注意する必要があります。','プロパティの器用さは狂っているので、他のことを実行したり投資したりしないでください。頭と尾がないので、それを捨てると、確実に失敗します。あなたが家にいて、あなたが貪欲であれば、新しい仕事に追いつく方が良いです。','どの利益が南にありますか。私がもっとやっていることをもっと追求する方が良いでしょう。外部の富がテキストに入ってくるので、今月のヨスは内部から呼び出されるべきです。危険の間は快適で困難な現実があります。','東には長期的で、ソーバン郡の敗北があります。仕事を捨てると有益であり、終了することは有害です。誰が私を助けてくれるのか、それは間違いなく便利な手や聖域ですが、誰かが利益から抜け出した場合、彼は器用さに従います。','あまりにも多くの仕事をするために行けば、確実に失敗します。心のない心があります。どうすればそれを達成できますか？最初にあなたの心を安定させます。同意があるので、富が入ってもすぐに消えてしまうので、噴水を維持する必要があります。','また、二人のうち2人を区別することも困難です。数は不吉で、器用さがたくさんあるので、物事を控えるべきです。あなたが家にいるなら、あなたは邪魔になります、そしてあなたが外に出た場合、あなたがいっぱいなら、あなたがしばらく何か他のものを気にしているなら、あなたはあなたの髪を洗うでしょう。','2025-03-02 03:02:00.88578+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (445,'005','それは青い空に浮かぶ雨のようなものです。富は東にあり、北には長さがありますので、あなたが働き始めたり、それより前にいるなら、あなたは助けを得ることができます。それはとても小さくて家で心配することができます。春の世話をしてください。春がすでに通過している場合、さようなら-chanを選ぶことは困難です。あなたは前進しているのでどうしますか？何かをしても達成するのは簡単ではありません。予想外に怒って、あなたはあなたの像を心配するでしょう。暗い部屋に甘くしたらすぐに、どうすればメガネをきれいに見ることができますか？一人がドアをブロックしたにもかかわらず、ドアを開けて頭を南東に置くことができませんでした。自尊心と安reliefであることは良いことです。','まず第一に、作品はブロックされていますが、金の豚はその後ろに帰ってきます。別の人がいるので、私は道を止めようとします。それはまるで月が明るく、月が雲に入っているかのようなので、予測を示す必要があります。','富は北東にあるので、それらを作ることで富を得ることができます。素晴らしい仕事のために人々に役立つでしょうが、shinsuは不吉なので、睡眠と健康の世話に注意してください。','まず第一に、たとえあなたが疲れていても、それは長くなります。急いでいなければ、自分でやるのは楽しいでしょう。あなたがノーブルに会うなら、あなたは意志を達成することができるでしょう。','ギルスンはドアにいるので、富と宝物が喜びの喜びをするためにドアに来ます。まず、その後醜いのは簡単ですので、すべてに注意してください。','酔っ払っている人は致命的な人を奪ったので、どうして十分ではないのですか？間違いを犯した場合、間違いなくダメージを失うことに注意してください。何百ものことがスムーズに行われ、あなたは喜んで自分自身を増やします。','あなたは他の人を信じるべきではありません。人々が間違っているので人々の損失があるので、彼らに耳を傾けたり聞いたりしないでください。その後、あなたはあなたの家族を後悔または追加します。','それは富を得るだけで、心の安らぎをもたらすでしょう。富は東にあり、たとえあなたがそれを手に入れたとしても、あなたは実際にそれを取り出します。物事を行うことや消化できることではできません。まず、私はそれを手に入れました、そしてそれは初めてではありません。','心に密かに問題があるので、あなたが世界について考えるなら、それはすべて夢のようです。そのような出口がない場合、器用さがあるかもしれません。','吸盤があります。さらに、あなたは厄介になります。あなたが私を失うなら、あなたは間違いになるでしょう。あなたが相互の人を作るつもりがないなら、あなたは処理が難しい変化を起こすかもしれません。','シンウーンは不利なので、すべてに多くの問題があります。明るすぎないで、リラックスする必要があります。願いは、たとえ彼らが昇進したとしても探偵であり、彼らはそれをあまり使う必要はありません。あなたが誘惑され、新しい仕事を宣伝しているなら、あなたは厄介でなければなりません。','火に気をつけてください。私の体と心が悪いことを恐れています。あなたがステータスを探しているなら、市長に行き、人々と顔を合わせてください。フィールドに行かなければなりません。','親しい人々の間で私を傷つけたい人がいるでしょう。あなたが休むなら、あなたはきっと太陽に従うでしょう。経営陣は、このように終わる良い方法です。北と南の両方で誰も私を助けてくれないことを知っておく必要があります。','2025-03-02 03:02:00.895174+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (446,'006','1つの肺は乾燥しており、もう1つの肺の花は血まみれです。あなたは春に出会った恐ろしいリスクを切望している真ん中で醜いと出会うでしょう。豊かになっても、収集するのは簡単ではありませんか？喜びと不安は反対であるため、黒人年を過ごすのは簡単です。遠く離れたり、何かをしたりしようとすると、不利になります。小さいことを始める方が良いです。私は良いことをしたいのですが、私は前の道をブロックしたいのですが、花は遅れていますが、香りはすでに与えられています。その日は凍っていて、春は消え、金の馬の意味は南に飛んだ。','喜びがあり、悲しいと、喜びは混ざり合っています。長さ、そしてugさは反対に反してきたので、それはどれほど幸せであり、一度悲しくないのでしょうか？心臓の困難のために胸を避けるのは難しいです。','月は夜の道路の雲から出てきて、天と地は明るく、長さが開いています。雪は溶けていないので、春が来ていますが、春はまだツールボックスのようなものなので、待つのは良い考えです。','分数が調和していないため、分数を保持することが最善です。新しい防御は両方です。あなたが仕事を始めてそれを恐れるならば、あなたはダメージを失うことができるでしょう。今月のYeosuは器用さを心配しているので、注意してください。','他の人を信じないで、信じないでください。模擬がボウルである場合、それは害になります。ゴールドスミスが心配しているのでどうしますか？心臓は重いですが、北と南には長い道のりがありますので、少し助けになります。','ウォッチャーがチャンスを持っているので、それは一日ですか、しかし利益はありませんか？たとえあなたが富を得たとしても、あなたが入ったらすぐに外に出ます。','出口は不利です。数がブロックされているため、寄付と受信に注意してください。そうでない場合は、補強が必要です。どこにも手を差し伸べることなく生きることができます。','それは岩の上で孤独な松の少女を切る菊です。どんなに一生懸命生きようとしても、根は跳ね返ることができず、隣人に隠すのは難しいです。家には斜面があるので、それは自分自身によって引き起こされる斜面です。','あなたが過去に傾いていなければ、あなたの家は幸せになります。他の人の言葉を聞くと、最初に良いように見えますが、背中はひどく変わります。あなたが生まれたとしても、家に座るのが最善なので、重い人を切望する必要があります。','富は人間のために発生します。あなたは人々に会うことを恐れてはいけません。そうでない場合、あなたは家で寝ています。ガウンは非常に強いので、月は雲から出て、天と地の上で明るく輝いています。','他の人よりも悪くはありませんが、あなたが働いている場合、それは多くの問題ですか？しかし、それはあなたが現れて富を得るのを助けるのに役立ちます。それはボールだったと言われています。','良いことが起こるでしょう。慣習的でない場合は、予期せぬ後悔が得られます。正しい果物を手に入れることができるという理由だけで、正しい果物を手に入れることができますので、利益はそこにあります。','雲が成長しており、月が出ているので、勝利した紙は徐々に素晴らしいようです。受精に近づかないでください。明るすぎるでしょう。私は10番目に心配しているので、あなたがそれを避けるならば、あなたは明るい道を歩むでしょう。','2025-03-02 03:02:00.903186+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (447,'007','時間があっても走らなければ、いつ時間を待つことができますか？与えられた機会を捉えることを躊躇しないでください。大きな富を得るのは難しいですが、小さな富がやってくるでしょう。ただし、時が来たことを知っていれば、遅滞なく迅速に宣伝することは長いです。良いチャンスをお見逃しなく。貴重な手は助けようとしますが、その後、それは害につながる可能性があります。噴水を維持するのが最善なので、警告されないでください。','秋の空に雲がなかったので、明るい月が再び光に戻ってきました。利益はどこにでもあるので、仕事を終えるときは注意してください。あなたがあなたの家族を増やさなければ、あなたは慣習的でなければなりません。','心は非常に広く、意志に満足しているので、あなたが富を見つけたら、私は間違いなくそれを手に入れます。今月の実生活に注意してください。 uiseongはドアに輝いているので、それは大きな富で満たされています。時間をお見逃しなく、あなたに挑戦してみてください。','あなたは正しい心にいたので、あなたの利益は真ん中になりますが、人々に注意するように注意してください。北には長い道のりがあり、あなたが終わる前や始める前にチャンスがあります。良い機会をお見逃しなく。 10番目に心配している場合は、南医学を使用してください。','邪悪な者に近づかない場合は、噴水を保持すると胸を避けることができます。月は空が明るいので、光は遠く離れています。それはすべて明るく、あなたはあなたの希望を達成することができるでしょう。','私は仕事ができないので、一度失うでしょう。それは人々に敗北するので、その年は眠りません。それは像だけではないので、飾ると不利です。新しいものを宣伝しないでください、人々を書くことに注意してください。','王と召使は出会い、怒りを生み出し、彼らを創造するので、彼は来て助けます。シルバーは東部のメンバーです。あなたは新しい風の中で恵みを与える人なので、それをよく受け入れてください。新しい場所を手に入れる小さなものを追いかけます。','梅の花は1つの家で美しく、隣人を明るくします。外国為替がなければ、友達がいるのではないかと心配しています。 20代と20代の人々が仕事を授与する必要があるため、デートを慎重に行う必要があります。','仕事が来てあなたを助けるので心配しないでください。しかし、富は活発であるにもかかわらず、それらは獲得され、睡眠は消えます。あなたが徹底しているなら、その年の狂気を忘れてはいけません。','あなたはついに他の誰かの言葉を信じることの欠点を知っているでしょう。他の人と仕事をすると、二人のそれぞれが異なるため、苦労するでしょう。それはボールになるので提供されません。','両方の南東で、貴族は私を助けてくれますので、あなたが働き始めて誠実さを持っているなら、あなたは他の人から助けを得るでしょう。利益は西側にあるので、仕事を見つけるには誠実でなければなりません。','頑丈な貪欲が再び活性化された後、害を避けることは困難です。他人の富を切望しないでください。醜い仕事を避けることはできません。あなたが間違った人を作るならば、害があるので、噴水を維持し、学位を取得してください。','利益は南にあるので、あなたがもっと積極的にしたことをすることをお勧めします。あなたがそうするなら、あなたは私を助けてくれる偶然のことになります。ダウーンは活発で、大きな金持ちがドアにやって来ます。本物の泥棒に注意してください。そうすれば、本物に注意して、すべてを無視しないでください。','2025-03-02 03:02:00.911735+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (448,'008','春のウサギは東に上昇するので、明確な光は澄んだようなものです。西に長さがあるので、良いニュースがあります。今年の運は私を助けて多くの仕事をするでしょう。幸せになるには良いことがなければなりません。それが神が私を守る理由です。また、すべてが私の心のようであるので、私はもっと祝福されます。今年、南と北に良い祝福があるので、私はそこに行きます。しかし、良いことについて良いことをするために多くのことがあります。 4月、大麦が南風に湧き出ると、経験と胸の後、彼らは腹部でいっぱいになります。すべてが私の意志に従って行われているので、思考と行動は同じであり、美徳は豊富であるため、空を宝物で見るようなものです。','それは月の明るい卒業生の梅と同じです。運が身体に続くと、運が良くなり、富の追加が拡大されます。今月は山のような富を集めるので、私たちは勝利を収めます。','高パビリオンでは月の音が高くなります。豊かな美徳の真っin中は、色はとても広まっているので、私は金持ちを描きます。良いことが起こり、あなたはあなたの財産を得るでしょう、そしてあなたが外出するとあなたはより大きな利益を得るでしょう。今月の場合、子孫には斜面があるので、それは良い例です。','長い道のりを歩かないでください。家にいて去るのは長いです。グレータードクデオクに行くのではなく、あなたの家で明日を静かに乾燥させることをお勧めします。南に行かないでください。醜い胸が潜んでいます。','芽が柳に座っていたので、どれほど美しいですか？すべての仕事は金になるので、世界の歴史が見られます。花が落ちて果物が獲得されると、富は豊富になり、もちろん人生は平和になります。親relativeをあなたの親relativeの近くに扱ってください。','狂犬病を集めて山のように長い道のりを歩むと、良いことだけが起こります。しかし、今月は多くの役人がいるので、注意してください。そうでない場合、建設が続きます。私はそれをあまり見ることができません。','あまり利益はありません。親しい人は他の人よりも悪いので、あなたは私を傷つけることができます。水に行かないでください、そして知っている人が私を出産するでしょう。他の人と辞めない場合は、秘跡が必要です。あなたの出口を控えて、自分自身を守ってください。','私は運に従います。利益はどこにでもあるので、どこへ行っても起こるでしょう。ダンビのような美徳が落ちるので、富は金持ちのように行われます。しかし、私は金持ちを持っているのではないかと心配しています。私をオーバーハックするので、すべてに注意してください','あなたが休憩なしで熱心に働くなら、空は感銘を受け、私に利益をもたらします。東と西に行くと、長くなります。あなたが貪欲で噴水から物を切望しているなら、それは災害になるので、怖くなく人間のドリを維持する方が良いです。','道路の脇に行くと器用さがあるので、仕事に行くのは良くありません。また、高い山にユリがいる所有者もいます。難しいことを果たすのは、フアン・ゴングでなければなりません。','あなたが何をするにしても、私の利益は他の人と比較して増加します。仕事の成功または失敗は時間に依存するため、利益は非常に収益性が高くなります。西に行くと富がありますので、外出するとそれが得られます。','のどが渇いたドラゴンは水を手に入れ、空腹の人々はPungyuに出会いました。私たちが望み、望むすべての夢を実現することは幸運です。冬至と新年を待っているので、私は腫れます。','不吉な運は逆転し、家族は喜びに満ちています。私はラッキーな光のように私に注ぎます。後悔します。ただし、10人の子供が作成されていない場合は、参照に従うことに留意する必要があります。','2025-03-02 03:02:00.920884+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (449,'009','私はハンバットでトラに会ったので、戻るのは難しいです。仕事をしたいとしても多くの問題があるので、1か月しかありません。新しいものを求めて、または不合理なことは不利です。私は私を助けずにそれをしようとしているので、私は心配して不快です。最初は、それは難しくて難しいですが、幸運を待っているので心配していません。たくさんのことがある場合は、軸について話し合ってください。リリースされます。今年の後半には、このドアで良い仕事をします。春には長い道のりがあるので、チャンスがないはずです。','私は再び貪欲になろうとしています。たとえあなたがそれを捨てて芽を出しても、乗るのは難しいです。しかし、ギルソンは良いことを喜んでいるでしょう。春には長い道のりがありますので、この機会は決してありません。たとえ難しいとしても、一生懸命頑張ってください。','春はついに春の庭に戻ってきました、そして、花は満開で埋もれましたか？どこにでも花があるので、春のそよ風はどこにでも吹き飛ばされます。あなたが面倒ではないなら、あなたは酔って疲れさせるかもしれません。','他の人に行く豊かさなので、あなたは何を後悔していますか？南東部の部屋の富は予想外にテキストに入っているので、彼らは仕事と犠牲を払っており、秘密の処理作業があります。','人々はそれに近づくべきではありません。また、あなたは酔っているのであなたの体に注意してください。注意してください。噴水を維持し、快適に宿ると、それを避け、予期せぬ成功を達成できます。','密かに進む作業は成功し、楽しむでしょう。長さの長さが体に来たので、良いことがあります。しかし、あなたはあなたの心の隅に注意しているのでどうしますか？安定すると問題ありません。','月は雲の上にあるので、再び良い月明かりを見るのは難しいです。南は不幸なので、旅行しないでください。明るすぎないで、リラックスする必要があります。願いは、たとえ彼らが昇進したとしても探偵であり、彼らはそれをあまり使う必要はありません。心の隅で注意してください、あなたは何をしますか？安定すると問題ありません。','恐ろしいリスクの中には長い道のりがあります。北と南には多くの方法があるので、余暇はありません。捨てられた仕事を達成し、終了しようとしていますか？名前の名前は茂みから出てきて、状況は自信があり、植生は落ちます。','私は怒って石になるので、心配はありません。陰はお互いに調和しましたが、どのように長いですか？それが慣習でない場合、それは子孫の勾配です。あなたがそれをするつもりなら、あなたは何をすることをheしますか？進歩は良いです。','2人のトラが互いに戦ってから、どのタイガーが勝ち、どのタイガーが勝つでしょうか？受精する場合、ガスールの数だけを増やします。そうでない場合、あなたはカンジェに会い、怒るでしょう。','出口の場合、それは不利であるため、욋を保ち、安定してください。しかし、自宅にwoh hwanがあると思われる場合は、事前にください。その後、その胸を避けます。最後に、私たちは욋を捨てて新しいものを見つけます。人々は従います。','間違った人のために害があるので、不公平な利益を得ようとしないでください。今月のYeosuには多くのugさと長さがほとんどありません。あなたが酔っすぎているなら、あなたは私のことを恐れます。','私は自分の体と家族を快適で心配しています。雲が散らばっており、月が出ているので、最終的に希望を達成します。仕事を修正しても、心を傷つけるだけなので、挑戦しないでください。','2025-03-02 03:02:00.93373+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (450,'010','高水のドラゴンはヨウイジュを得たので、なぜ変わらないのですか？私たちは高貴な人と会い、共鳴します。あなたが三次を持っているなら、日本人は硬くてふわふわになります。あなたが誤って信じて行動するならば、それは不利です。富はまれなので、百日ごとに何もすることはありません。貴族はあなたがあなたの成功を妨げるのを常に助けることができますか？良い雨が待って倒れるのを待っていますが、今年の今年の誓約はありませんか？私には5匹の子犬がいるので、南に大きな山がありますので、ドアを離れると、長くなり、予想外に豊かになります。','空と地球が互いに反応すると、すべてのものが彼らの前にあります。それは新年に復元され、持ち越されるので、私たちはお互いに応答します。貴族はいつもそばにいるので、私は難しいことを見て、偶然私を助けます。','これはできるだけ早く行われるので、利益を得ることができません。それは、戻ってきたガチョウが時間外に飛んだようなものです。名前を奪わないと、子孫の勾配が見えたり、家族を増やしたりします。','家の仕事はフンガンであり、ガウンは家族と土地を増やすことでより良いでしょう。管理が最初にリードする人になるので、私はリードします。','醜い幽霊がドアを見ているので、胸に注意してください。北は不吉なので、出てはいけません。','私は働き、仕事をしようとしていますが、それを害にすることができます。西洋人を閉じないでください。年は蓄積されないので、睡眠は仕事を終えるのに有害です。あなたが間違った人を作るならば、あなたは確かに器用さを経験するでしょう。','利益は南にあるので、南に行きます。それはどのように疑わしいですか？ 100日ごとに部屋があるので、人々は見上げます。しかし、もしあなたが苦労しているなら、害があるので、噴水を切望しないでください。','受精に近づかないでください。それは富になります。プロセスが自然な場合、他の人は話すことができません。後悔していない場合は、家に斜面があります。明確にしても、明確にすると役に立たないでしょう。','あなたが施肥されている場合、人々の数を作ることは困難です。利益は遠くから来るので、私は豊かになりますが、急いで見ないでください。名前はどこにでも奪われるので、人々は崇拝します。','頭に黄金の木のローレルを使用すると、ついに成功します。それは生きる方法で会うようなものなので、醜い長さを見るでしょう。子供は不吉で、大人はとても長いです。','ギルソングが来て、家の中に斜面があります。利益は南と北になければなりません。あなたはあなたの仕事をして、それをうまく終わらなければなりません。人が助けてくれるなら、あなたは予期せぬ富を得るでしょう。','幸せなものが体に来るでしょう。好きなものがありますが、心配しないでください。あなたの名前が遠くに奪われ、白い砂が簡単に行われるとき、あなたは何を心配しますか？','それは人間のために有害であるようであり、器用さは非常に大きい。あなたが間違った人を作るなら、あなたはきっと富を生むでしょう。これに注意している場合は、快適になります。','2025-03-02 03:02:00.942065+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (451,'011','東風がゆっくりと緩み、乾燥した木が春に出会うので、幸運が戻ってきました。富は活発で、それを管理することは成功します。それは小さくて大きいので、たとえ小さく始めたとしても、あなたは非常に成功するでしょう。 Myeongwolは世界の真ん中にあるので、天と地は明るく明確であるため、暗い角はなく、世界は快適になります。どうやって大きなことをすることをheしますか？遠くから貴族に会うと、あなたの体は栄光になり、あなたの家は快適になります。一度大きな変化を起こすことを意味するかもしれないので、多くの疑問や懸念がありますが、ためらうことなく進むとやりがいがあり、春にやや遅れますが、7月と8月頃に成功します。あなたが良い関係を満たしている場合、それはより簡単にリリースされます。','春の日が暖まると、近くのパビリオンに飛んで、巣の上に座って赤ちゃんにぶつかるので、すべての災害が消え、美徳が戻ってきます。','春の庭では、春の花とオヤットの花が春の庭で出会い、彼らは満開になります。しかし、友人や親relativeも家族の仕事によって傷つくかもしれません。','高山に行って、心を磨き、願いを唱えたり、神殿に行ったりすると、安定します。あなたが高いものを望むなら、あなたがフォローして走って走っていても、常に祈りを手放すとは限りません。私は自分の心を1つとして設定することはできず、揺れがたくさんあるので、忙しくて忙しいでしょう。','作業が成功する前に注意してください。したがって、注意してください。ドライバーに注意を払う場合は、ヨースが逆転し、すべてがスムーズに行われます。私はすでに険しいマウンテンロードを通過し、大きな道に入りました。何が心配ですか？未来は歩きます。','口に注意してください。どんなに正しく言っても、間違いを犯したら、あなたは枯渇します。あなたはあなたの口に耳を傾けず、それを見なかったかのようにしてください。他の場所で友人に会ったとしても、あなたが注意して地域で友達を作っても注意する必要があります。','理由に近い場合は、簡単に開発できます。あなたはサイドのように歩き回り、ガスルに着くために目を売らなければなりません。人々を作ろうとしないでください、去り、新しいことをしないでください。噴水を快適に保つための最良の方法です。','春の庭で咲いた花がついに時間と出会って実を結ぶ場合、成功の道が開かれておらず、成功の道が傾斜している場合、子孫または家族は傾いています。しかし、あなたは眠っているので、あなたのヘルスケアに注意を払ってください、そして静かに待って、それに賢く対処してください。','山はありますが、現実は見えたり捕まったりしていませんが、あなたは確かにひどいものを感じるでしょう。しかし、あなたが待つなら、富は入ってくるので、警告しないでください。最初は難しいようですが、後でリリースされ、後でリリースされ、難しい場合は貴族の助けになります。','富が時間の間に撤退し始めるので、秘跡を作ったり、他人の受精で低くなったりしないでください。あなたは手書きになります。 Sohn Jae -Sooは必然的に誤解によるものなので、彼が親しい人であれば、彼は警戒しませんが、人間を尊重する場合、彼はそれを避けます。','塩コットンが飛んだかどうかにかかわらず忙しいです。やることはたくさんありますが、shinsuは不利なので、睡眠に注意してください。','数は不利であり、心臓は快適ではないので、北東に移動しない方が良いです。あなたが家にいる間にあなたがしたことを維持することは有益ですが、噴水を維持せずに間違ったことを切望していれば、それは不利です。快適に感じるなら、噴水を維持し、出口を禁止することをお勧めします。','新しいものを捨てないでください。私は自分の心を書き、疲れます。体は元気で、意味は大きいですが、富はありませんので、長さとugさは半分です。私はたくさん送って少し来るので、私の手が無駄になっているとは思わない。急いではいけません。','2025-03-02 03:02:00.953234+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (452,'012','満月は再び失う方法です。まず、スムーズに成功しますが、満月はそのままそれを減らし始めます。あなたはそれを最初に手に入れて取り戻すために急いでいるべきではありません。誠実さを作ろうとすると、きっと繁栄するでしょう。最初に取得し、その背後に負けます。どうしますか？ガウンがそれほど滑らかでなくても、ショッピングモールを控えると醜い抑制を防ぐことができます。春には、偽の運は聖なるので、時間を見逃さないでください。','最初は、仕事は長く、醜い後ろはそれを待っています。あなたが山に行って肉を救うので、どうしてあなたの願いを成功させることができますか？家族経営を維持すれば、新しいビジネスを見つけることができますが、それを達成することはできません。','富は東と北からやって来ます。小さなもので大きなものを手に入れて幸せですか？私は運になりたくなかったとしても、私は予想外の運に会うでしょう。','あなたがxを信じないなら、あなたはそれを心配するかもしれません。親しい友達がいなくても、親友を獲得することはできません。他の人の仕事にすべてが簡単に関与することができるので、統治に注意してください。他の人の受精は低く、あなたの心を傷つけません。','良い数はありますが、レベルは取得されます。あなたが間違った人を作るなら、あなたは器用さを恐れています。富を得たとしても、手には何も残っていないので、繁栄を見てみましょう。ただし、Ku Seol -Sooを気にかけて人々を上手にすると、富を得ることができます。','私が手に入れたいことはたくさんありますが、私はそれをしません。あなたがガスルに着くので、あなたが穏やかで悲しいことになるのは多くのことです - 間違ったことのために。パートナーを探しているか、親しい友達を獲得している場合は、常に太陽を稼ぐように注意する必要があります。能力を見ずに急いでいると、それは不利になります。','私は家にいます、そして私は外に出て外に出ます。南は不利なので、計画せずに旅行しないでください。あたかも多くの仕事をせずに多くの仕事をしたかのように、中傷するのは簡単です。あなたがあなたの心を安定させ、あなた自身の噴水を維持するならば、私はお金を失うことはありません。','彫刻は海に浮かんでいるので、風なしで危険です。あなたが祈りの人生を送るなら、空はあなたを祝福します。あなたが危険にさらされて危険な態度にあるなら、私たちは固まり、成功します。','プロパティがありますが、金持ちになる必要がありますが、酔って使用する必要があります。分数の外で作業を切望している場合、あなたは繁栄するでしょうので、あなたはあなたの判断を修正する必要があります。キャリアを受け取ったり、他の受精に関与したりするのは簡単です。そのため、噴水を保ち、健康に害を及ぼさないようにしてください。','深い肺には手紙があります。仕事を扱うのは珍しいことであり、日の心配をする余裕があるのは難しいです。あなたが他の人の受精が少ない場合、あなたの体は損傷します。注意してください。','私は自分の体に炎があるので、同じようにします。あなたが家にいるなら、あなたの利益を維持するためにあなたの利益を維持することをより良いです。私は自分の仕事を減らすために知恵が必要です。','噴水を維持することほど良い方法はありません。あなたが何かをしたり、貪欲になったら、後悔するでしょう。北は不利なので、旅行しないでください。 Yeosuがブロックされたら、しばらく休んで、掃除して強さを蓄積して、Destinyのドアを再び押します。','私は何かをしようとしていますが、簡単には解決しません。新しい友達を作ったり、話し合ったりしないでください。被害は増加し、利益はありませんので、注意してください、富はなくなりますが、体は快適で、勇気はいっぱいです。急いでいなければ、有害なことは何もありません。','2025-03-02 03:02:00.962515+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (453,'013','芽の芽は柳に金色です。それは空と地の光に満ちた運です。さらに、ボスのドラゴンが戻ってくるので、貴族に役立ちます。富がなければ、ひねりを加えた映画があります。美徳に蓄積し、言い訳をするのは難しいですが、それは満たされなければなりません。春には多くの喜びがありますが、動かないか、変わらないように注意するよう注意することができます。あなたはあなたの対人関係に特に注意を払うべきです。成功と仕事の計画があります。家は平和ですが、それは快適ではなく、起こらないかもしれません。家族の和解に焦点を合わせるなら、私たちは一人一人が出会い、後悔に会うのを助けます。','富は雨に合った春などの富に満ちており、水は青くなり、成長します。このヨスへの戻りは、春に合った植生のようなものなので、家には快適な斜面があります。時間を維持すれば、何が起こっているのか成功します。','あなたはこれよりも楽しいでしょうか？私は自分の体を改善し、予期せぬ後悔に会います。すべてがスムーズに行われるので、やりたいことを大胆に行うことができます。','家に斜面があるので、私は幸せで快適です。あなたは結婚しているか、子孫になるかもしれません。難しいことでは、収益が来て助けてくれるので、私はそれを促進することはできません。自分や家に斜面があるので、多くの喜びがあり、人々のせいで楽しいものがあります。','水が流れて東海に入ると、河川のエネルギーが長くなる可能性があります。それは小さなことであるが、一晩で行われていないことに留意してください。他人の言葉が間違っていると信じるなら、利益を見るのは難しく、お金を失う可能性があります。あなたがうまくいけば、あなたは富を持ち、あなたの体は快適になります。','代数は長いので、予期せぬ富が得られます。睡眠があったとしても、誠実に治療されている場合は、道路があり、すべての胸を避けます。あなたが祝福されていなければ、あなたは火を恐れるでしょう。私は予期せぬ富であなたに挨拶しますが、あなたが警告されている場合、あなたはフォローされます。','食べられた雨の風は止められ、空は晴れ、月と太陽は明るく輝いています。富は体に来るので、それは小さなものであり、大きなものです。あなたが富に貪欲でない場合、それは家族生活と矛盾しているため、賢明に賢明に受け入れなければならないことがあります。','私はそれを後悔し、後悔します。財産や税関の不足はありませんが、安心しないでください。他の人の助けを得ると、驚くほど簡単になります。眠ることは目の乗り物です。','貴族が私を助けてくれると、習慣は体に来ます。 1つの体は快適で、心配はありませんので、家族を増やすことができます。それは私が暗い夜に手に入れたろうそくなので、私は今までであった暗い道を軽く輝かせる喜びを味わいます。','雨が降ると、ホワイトチョーは再強化され、活力を獲得します。自分で人を扱うと、利益は築かれません。そうでない場合、長さは醜くなります。','腕の仕事で成功するのは簡単です。私は自分の体を心配する必要はないので、心の隅には常に問題がありますか？あなたが心配していないなら、あなたはお互いに議論することができるでしょう。スキームの成功には、そのような痛みと苦難があることを知ることが重要です。','ドアの上に長いヨーシュがあるので、私はあなたに遅れて仕えます。胸に注意してください。金を手に入れるのは黄金の美徳なので、試してみると貴重なものになります。サービスへの扉は、美徳によって蓄積された金のようなものであるため、努力の達人です。','1つの家が和解しているため、利益は真ん中にあります。私はあなたが東と西の両方から来るのを手伝います。あなたが試験に合格することを光栄に思っていないなら、あなたは左または良い人を持っていることを喜んでいるでしょう。人のせいで楽しいことがあるので、人に心を込めてください。','2025-03-02 03:02:00.970929+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (454,'014','月は西の窓から夢を作るだけです。闇が閉じられると、ビモンタモンと交差することがよくあります。お互いをコントロールするためにお互いを責めると、灰が得られるかもしれません。テクノロジーが完全にない場合は、再び取得することができます。数は不利なので、私は少なくなり、多くを散らします。噴水を切望しないでください。それは安定性と警告です。吸盤があるので、他の人と格闘したり、他の人に低くなったりしないでください。今年の新しい水は、水と火に注意する必要があります。体が罰に戻ってくると、私は傷が遅くなるのを見るでしょう。富が漏れるのは簡単なので、他のことに投資したり、新しいものを促進するべきではありません。','私は心に悲しみと不安を持っているので、秘跡を分けます。まず、理解する態度が必要です。私の心は正直ですが、いくつかのことは蓄積されません。あなたがあなたの親友に近づくならば、それは良いことですが、実際にはそれはひどいでしょう。','足が足を踏み入れた言葉は道を傾けて、何を外に出すべきかを知るのが難しくなりました。あなたは働いている間それをすることはできません。さらに、私が親しい友人になるとすぐに、私はそれを遠ざけますので、人のために害を与えても同情はありません。','噴水を維持し、家にいる場合、過失はありません。そうでなければ、失敗するのは簡単です。私は自分の心についてあまり心配していませんが、私はそれが得意ではありません。その人は心配しており、不安であるため安定して不安定になることはできません。','あなたがあなたの体をきちんとして心を磨くならば、失敗は関係しません。心がつまずき、色が近い場合、ガスルから抜け出すことは困難です。友達はどうして私の手でひどく扱われることができますが、私はパビリオンを持っていますか？','あなたは富を得ることができますが、ガエの数が続き、人々は受精します。あなたは自分の心と体に心配しているので、あなたは受精から背を向けて自分自身を安定させるだけです。間違った人を作ると、すべてが終わることに注意してください。','Yongju -MokはPungnyeoに会ったので、彼は多くの人生と心を持っています。名前がどこにでも吹き飛ばされているので、一人一人が崇拝し賞賛することはどうして良いことですか？仕事についていくのは良いことです。','それは新しくて座席に座っているので、それは落ち着きのなさです。北と南から東と西に行かないでください。仕事は忠実に良い結果を達成します。実行されているように見えますが、達成することは困難です。','それは小さなもののようなものであり、海に流れるすべての日時のすべての水のようなものです。あなたは富を得ていますが、それの説明はどうですか？水と火に驚くかもしれないので、注意して心配してください。','体は長い中央にあるので、遠くに移動する必要があります。あなたは人々に注意する必要があります。私は自分の心が心配ですが、誰がナメクジをリリースしようとしていますか？患者はそれを処理する必要があります。','山は水に沈んでおり、100の宝物が水に閉じ込められているので、ゴーゴーは海です。あなたが殺されなければ、あなたは眠ることを恐れます。ギルは気を散らしているので、私はそれを手に入れて来ます。来るでしょう。','水の幽霊は水の中に残っているので、水に近づいたり、水によって引き起こされたことをしないでください。そうでない場合は、すぐに驚くかもしれません。あなたが秘跡でないなら、注意してください。','春は春の庭に戻ってきたので、なぜあなたは幸せになりませんか？ラッキーは家でいっぱいなので、ハウスキーピングが活発で不足していることを知ることはできません。他の人と協力することは正しくないので、パートナーを探すときは注意してください。','2025-03-02 03:02:00.980168+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (455,'015','老人の墓では、それは現在の男のビジネスです。二人は異なっていますが、私は不利になりません。悪や耳に合わないように注意してください。衝突しないようにしてください。あなたが近くにいない場合、あなたはあなたの家を心配しているかもしれないので、あなたは留意してください。あなたがそれを動かしてそれを動かすならば、あなたは噴水の世話をするのが難しいでしょう。最初は難しく、後ろで繁栄するので、長い道のりがあります。作業はスムーズにリリースされます。しかし、あなたはあなたの個人的なイメージを心配しているので、あなたは何をしますか？隣の隣人は春になりますが、西の隣人は早くありません。敷物がある場合でも、修正された場合は価値があります。あなたの目は仕事や話すのを止めることができないので注意する必要があります。','Yeosuは不吉なので、あなたの家族に問題があるかもしれないので注意してください。作業を行うことができますが、触れません。東部の非lawは、新しい仕事を手に入れるのに役立ちます。','仕事で働くために長い道のりがあり、あなたは仕事を見つけるために誠実でなければなりません。私は自分の身元が心配ですが、数は長いです。春の風の春には、絵画は満開になっているので、勝つのはとても楽しいです。','信者は、心が安定しておらず、特定の主張をしないため、夢の中に住んでいます。ただし、ugさは変わり、長くなり、名前は利益になります。先祖がドアの上にいるとき、どのようにして富は自分自身に来ることができますか？','富は山に蓄積されているので、見て快適です。どこにでも長さがあるので、富を得る必要があります。特に仕事を終えたら、チャンスをつかんでください。それは不吉で毎日ばかげていることが簡単ですが、あなたがこれをするならば、あなたは平らになります。','地面がトリガーされているため、髪を動かしたり動かしたりして新しいものを動かしても大丈夫です。新しい家を設置したり、新しい家を見つけて実行すると、ugいが変わります。しかし、行かないでください。あなたが経験でビジネスを捨てるならば、あなたは大いに失敗するかもしれません。','受精がない場合、吸盤があるので、他の人と干渉しないでください。なじみがなればなるほど、失敗します。年をとるほど、安全になります。あなたが心を落ち着かせて一生懸命働くなら、あなたは長くなり、害は害です。','ナブから肉の味を得ることとどう違うのですか？体は道路にあるので、私はどこにでも私の家になります。これはどんな感じですか？利益は南にあるので、そこにはやりがいのある素晴らしい発展があるので、私たちはそれを促進します。','心に欲望があるので、すぐにそれを手に入れようとすると、それを手に入れます。最終的に服に富を得ることはできないでしょうか？運の希望は簡単に成功するでしょう。東と西の両方から予期せぬ富が得られるので、最初から始まりを強調してください。','スーツの数は良いですが、それより先です。このため、人が料理できる方が良いかもしれません。検察は不吉であるため、他の富を切望しないでください。私はそれをそんなに手に入れようとします。','あなたは青い川に高い詩を投げるので、あなたは大きな肉を手に入れることができるでしょう。ただし、ウォーターゴーストは名前をぼかしているので、水と火に注意してください。あなたは女性かもしれません。私は賞賛の方法があるかもしれないことを願っています。','それは小さな牛のようなので、道路に行くのは難しいです。同じ月と毎月すべてを達成することは困難ですので、重く購入しないように注意してください。あなたが利益を得るならば、あなたが他の場所に行くならあなたは不利になるでしょうので、それを外で切望しないでください。','彫像には危険があるため、行動に注意してください。事前にトリミングせずに持ち運ぶのは簡単です。些細なこととしてグスルスを乗ることで怪我をするのは簡単ですので、あなたはそれに対処する必要があります。事前に胸をブロックすると、醜いものが変わり、長くなります。','2025-03-02 03:02:00.991521+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (456,'016','月は西の窓から夢を作るだけです。闇が閉じられると、ビモンタモンと交差することがよくあります。お互いをコントロールするためにお互いを責めると、灰が得られるかもしれません。テクノロジーが完全にない場合は、再び取得することができます。数は不利なので、私は少なくなり、多くを散らします。噴水を切望しないでください。それは安定性と警告です。吸盤があるので、他の人と格闘したり、他の人に低くなったりしないでください。今年の新しい水は、水と火に注意する必要があります。体が罰に戻ってくると、私は傷が遅くなるのを見るでしょう。富が漏れるのは簡単なので、他のことに投資したり、新しいものを促進するべきではありません。','私は心に悲しみと不安を持っているので、秘跡を分けます。まず、理解する態度が必要です。私の心は正直ですが、いくつかのことは蓄積されません。あなたがあなたの親友に近づくならば、それは良いことですが、実際にはそれはひどいでしょう。','足が足を踏み入れた言葉は道を傾けて、何を外に出すべきかを知るのが難しくなりました。あなたは働いている間それをすることはできません。さらに、私が親しい友人になるとすぐに、私はそれを遠ざけますので、人のために害を与えても同情はありません。','噴水を維持し、家にいる場合、過失はありません。そうでなければ、失敗するのは簡単です。私は自分の心についてあまり心配していませんが、私はそれが得意ではありません。その人は心配しており、不安であるため安定して不安定になることはできません。','あなたがあなたの体をきちんとして心を磨くならば、失敗は関係しません。心がつまずき、色が近い場合、ガスルから抜け出すことは困難です。友達はどうして私の手でひどく扱われることができますが、私はパビリオンを持っていますか？','あなたは富を得ることができますが、ガエの数が続き、人々は受精します。あなたは自分の心と体に心配しているので、あなたは受精から背を向けて自分自身を安定させるだけです。間違った人を作ると、すべてが終わることに注意してください。','Yongju -MokはPungnyeoに会ったので、彼は多くの人生と心を持っています。名前がどこにでも吹き飛ばされているので、一人一人が崇拝し賞賛することはどうして良いことですか？仕事についていくのは良いことです。','それは新しくて座席に座っているので、それは落ち着きのなさです。北と南から東と西に行かないでください。仕事は忠実に良い結果を達成します。実行されているように見えますが、達成することは困難です。','それは小さなもののようなものであり、海に流れるすべての日時のすべての水のようなものです。あなたは富を得ていますが、それの説明はどうですか？水と火に驚くかもしれないので、注意して心配してください。','体は長い中央にあるので、遠くに移動する必要があります。あなたは人々に注意する必要があります。私は自分の心が心配ですが、誰がナメクジをリリースしようとしていますか？患者はそれを処理する必要があります。','山は水に沈んでおり、100の宝物が水に閉じ込められているので、ゴーゴーは海です。あなたが殺されなければ、あなたは眠ることを恐れます。ギルは気を散らしているので、私はそれを手に入れて来ます。来るでしょう。','水の幽霊は水の中に残っているので、水に近づいたり、水によって引き起こされたことをしないでください。そうでない場合は、すぐに驚くかもしれません。あなたが秘跡でないなら、注意してください。','春は春の庭に戻ってきたので、なぜあなたは幸せになりませんか？ラッキーは家でいっぱいなので、ハウスキーピングが活発で不足していることを知ることはできません。他の人と協力することは正しくないので、パートナーを探すときは注意してください。','2025-03-02 03:02:01.001051+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (457,'017','私は山に上がろうとしました。あなたが他の人の助けに会ったら、あなたはそれを後悔することができます。しかし、あなたが許可されていない経験を持っているなら、あなたは確かに失敗するでしょう。他の人の助けを得るためには、朝に行われないインデンティブを常に拭く必要があります。他人の言葉を信じないでください。大変な仕事は、最初から秘跡がないということです。あなたがそれを動かすなら、あなたはそれを後悔するのが難しいでしょう。私の兄弟は北の隆起のようで、私の兄弟は西への侵略のようです。しかし、あなたが正しく見えることができないなら、私はエキサイティングになるだけです。すべてに害があるので、Jeonamをやったかのように注意してください。','あなたはそれをしないかもしれないので、それを手に入れるのは難しいです。それを見るのは明るくないので、サリーを分割することは困難です。多くのre責があるので、たとえあなたがそれをしたとしても、あなたはすぐに敗北します。','あなたが海の真ん中に出かけるので、良い宝物を得ることは非常に困難です。仕事は良くないので、たとえあなたが誓ったとしても、所有者は窒息するでしょう。近くの人々を信じないでください、そうすれば胸が作られます。','あなたはドアから出ることができないので、あなたは円筒形で誓いますが、後で来るでしょう。家には小さな不安があるので、体と心は快適ではありません。','大人は長いヨーシュと子供を持っているので、彼らは彼らの心をうまく数えることができなければなりません。どこにでも富があるので、人々は来て助けます。このような良い機会があれば、再び会うのは簡単ではありません。あなたはそれを捕まえなければなりません。','あなたが家にいるなら、外出するのは長くて有害です。あなたがしていることを維持し、新しいことを宣伝すると、それは利益を得ません。カルマを動かしたり変更したりすると、ugさは変わり、道になります。パークの息子が助けます。','あなたがそれを捨てる方法を知っていれば、あなたはそれで大きなことを取ります。しかし、それは有害だからどうしますか？二人の心は落胆します。他の人と一緒に仕事をするなら、それは一年で難しいでしょう。','私たちには富がありますが、私たちは眠りから抜け出します。秘跡は短くなく、器用さが続きます。あなたがあなたの近くにいるものを垣間見るなら、たとえあなたが遠くに何かをしても、それは簡単に失敗して失敗することができます。','美徳を蓄積し、金を獲得するのは破滅です。他の人に戻った富が後悔しているのは何ですか？名前が作成され、あなたの健康はより良いので、あなたは真ん中に富を得るでしょう。','植生は秋にあるので、私は心に多くの問題を抱えています。他の何かを動かしたり実行したりすると、長くなります。しかし、アイデンティティは不利なので、家には正しいことや祝福があります。これもYeosuです。','二人の心は同じなので、あなたは彼らの意志を達成することができます。人々は人々をうまく作ることができないので、人々に注意してください。しかし、人々は人々の数を増やし、家族経営を作るので、どのようにしてデートを止めることができますか？','検察は不吉であるため、他のことを管理しないでください。他人の言葉を信じれば、欲求不満があります。他人のscりに取り組むことができないように注意してください。 100日ごとに多くの問題があるので、あなたは家にいるでしょう。','収集することは困難ですが、豊かになったとしても、私は何ができますか？その人が偶然南であなたを助けるなら、あなたが仕事を加速すればそれは成功するでしょう。あなたが家で心を維持するなら、あなたは長くなり、あなたがドアを離れると醜くなります。','2025-03-02 03:02:01.01002+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (458,'018','家やすべてのものを手に入れる人はいません。イライラするので、この時間を過ごすのは簡単です。あなたはそれを避けなければならないので、あなたはそれを避けなければなりません。なぜあなたはこれをしたいのですか？家に心配はないので、最初に家の小さな不安を解決する必要があります。最初は、前後にブロックされますが、最終的に繁栄します。泥だらけではありません。あなたが出生している習慣と考えてください。 1つの家には2つの城があるため、調和していません。それはまるで2人のタイガーが互いに議論しているかのように、利益と何かをすることはありません。','自宅に財産がないため、それだけでは不十分なので、悲しくて不幸なことはありません。太陽は西の窓の上に落ちたので、私は曲がりくねっていた風を枯らしました。あなたがトリガーされている場合、あなたが西洋の富を見つけた場合、あなたは不利になります。','私は高い精子に横たわっていたので、どのようにして喜びも音もありませんか？人々はどこからでもそれをどのように見ていますか？キャラクターの2人のキャラクターが一緒になっているので、富は巻き込まれます。','上下は不安定であるため、アーキテクチャはねじれず、尾がひっくり返ります。長さは醜いので、これはひねりによるものでもあります。あなたがウーワンではない場合、あなたは酔っ払った壁であることを恐れています。','ランプを持ってドアから出るとき、私は東、西、南の周りで忙しく忙しいです。しかし、噴水を保持し、それを手に入れることができれば、それは長くなり、あなたはそれを手に入れることができません。 Gusul -SOOは分割されているので、見ることができません。','それは距離の増加から増加した廃inであるため、富はねじれ、生計を立てるために再び去らなければなりません。体は同じようにあるので、しばらく休むことはありません。私は一生懸命働いて試してみましたが、そんなにボールを手に入れるのは難しいです。','お互いに議論しないでください。建設を避けるのは難しいでしょう。装飾がたくさんある場合、何を止めることができますか？','政府が引き起こされると、胸に注意してください。警告されないでください。ヘルパーがある場合、あなたは忍耐強くなり、良好な関係があります。それが病気でない場合、秘跡があるかもしれません。','あなたが走っていることにあまり期待しないでください。確かにイライラするでしょう。長いものが変わり、私たちは醜くなります。東に行くと、それは不利であり、器用さは困難です。','文書があるので、それはきっと豊かになります。反対側に宿屋を取り、窓の外を見ると、愛する幸せな友人に会います。噴水の外にあるものを切望していなければ、私は成功した夢を見ません。','小さな富を得ることができるので、急いで急いではいけません。ただし、庭師やガスンがいる場合があるため、注意して周囲に注意してください。そのため、簡単に変更できます。','Yongjukmokの人々はご飯を持っているので、金とビーズは家に帰るようです。プロパティは後悔し、豊富になります。私の心だけが明確になります。私は緑豊かな休息でパビリオンでノーブルに会いました。','壁を構築した場合、残りの勾配に会うことができます。どうすれば自分でブロックできますか、あなたの心は快適であり、あなたの美徳はそれによって引き起こされますか？一部の人々は私を助けなければならないので、それはおそらく独立です。','2025-03-02 03:02:01.018433+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (459,'019','今年のシンウーンは春の庭に城を蓄積しました。すべての枝は日当たりの良い調和のようなものです。新島は平和であるため、長さはどこにいても成功します。ギルは私を助けてくれるので、私は男と会い、助けを得ます。ただし、色に近づくと、それを取り除く必要があります。家族の人々は調和がとれて平和であるため、習慣は身体に従います。これが同じでない場合、Shinsuは不利になります。口にはヨンビオンや東、西、南、上下の多くの国々を通じて多くのグループがあるため、問題はありません。悪役のドーリーは姿を消して軍人になるので、人々は並んで支配したいという願いを叶えます。 。','大人に会ったので、晴れた春の日に咲く花のようなものです。北と南の両方で良い仕事をしてください。それが習慣でない場合、あなたはあなたの家族を傾けるか、あなたの家族を増やします。','私は美しい人のために扱われてきたので、私は関係を築くことができてうれしいです。富は東と南の両方で活発になるので、成功します。','銃器はドアで名前が付けられているので、すべてのものが互いに生き残り始めます。彼らは明るいドラゴンを持っているので、どうして調和は無限になることができますか。私は何でもしました。春の風に咲くような多くのものを手に入れることをためらうことをheしますか？','私たちはPuddy Blue Riverから雨に会い、人々と会い、助けを得ます。ただし、実行する場合、それは不利であり、家にいる場合は、外で利益を追求すべきではありません。ドラゴンがスカイドアを開けたので、私は豊かな映画を楽しみます。','ヨースは不幸なので、家族は平和で、テピュンが歌われているのを楽しんでいます。富は一般的ですが、利益はジョンソンとキム・ソンから豊富になります。あなたがメインの色に近い場合、あなたはあなたの体に酔ってしまうでしょう。','私は最初に木を壊したので、一人一人が口論してそれを見ます。これは予想外の映画なので、貴族はあなたを助けます。あなたは両韓国の両方から大きな富を得なければならないので、あなたがすることは激しく押されます。','運は非常に強いので、あなたはきっと富を得るでしょう。しかし、意味が高すぎると、長さが変化し、醜いので、噴水を維持し、慎重に来なければなりません。そうでない場合は、10番目に驚いたものがあるので注意してください。','ハイボディハウスでは、ノニニのさまようことは、ハウスディレクターの天気です。一人の家族が平和なので、それはどのように美しいですか？上部と下部と下部が調和しています。西方向と北方向の両方で走る場合は、仕事を終えるために最善を尽くさなければなりません。','私は月の明るい夜のパビリオンに横になり、飲んで楽しんでいます。家に斜面がある頃には、私は自分自身を低くしますか、私は家族を増やします。西と南の両方でたくさんのお金を維持してください。そうすれば、多くの仕事を続けます。','ダークナイトロードではライトがオフになっているため、東、西、南を区別するのは困難です。富と意志が必要なので、道徳を気にしないと傷つくでしょう。利益はよく知られています。','Yeosuは繁栄しており、問題はありませんので、私は誇りに思って誇りに思っています。あなたがこの良い数字を持っていないなら、あなたは味わわれるかもしれません、そしてあなたはそれを処理するのに苦労するかもしれません。予想外の高貴な人に会い、助けを得ることを楽しみにしています。','家庭の人々は心を組み合わせているので、興味はそこから来るでしょう。利益はあなたの手からですので、見回してください。私は豊かさを得ましたが、私はそれを持っているよりもそれを使用しなければならないので、私はそれをすることができません。これも何ですか？','2025-03-02 03:02:01.030508+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (460,'020','私たちの他のフレーバーの歴史を満たすためにあなたはどれほど幸せですか？苦労しないでください。最終的に快適になります。新しいイメージには多くの努力がありますが、それは良い考えになるでしょう。あなたの心に多くのトラブルがあったとしても、あなたはあなたが得るのと同じくらい自分自身を落ち着かなければなりません。私はあなたに会い、共鳴して他の人の名前を奪います。春には、家族は必然的に増加するため、傾向はありません。多くの親relativeが私に復元されているので、私は大きなアイデアを持っています。太陽は低空と低い空に戻り、世界は初めてよく確立されているので、雨が降ります。あなたが人々を作るために一生懸命働いているなら、これは多くの利益を得るでしょう。','まず、寒くなり、後ろで良いでしょう。戻ってきます。家族が増加し、土地が増加しているにつれて、喜びはいっぱいになり、善は去りません。あなたが忙しいなら、あなたはそれほど多くのメリットを得ることができるでしょう。','他の人が私の困難を聞いて救うので、それは必然的にまれです。あなたは春の土壌になった雨に出会うので、修復が取り入れられます。変化するのは幸せではなく、どのように家庭が増加しませんか？','彫像は不安定であるため、検察の数は軽視されず、遅く議論されます。一生懸命努力しても、すぐに価格を取得することはできません。あなたが正しいことを保ち、それを安定させるならば、それは人々を助けるので、噴水を維持するのは良いことです。','陰と陽は調和が取れているので、斜面があります。あなたがスピーチでない場合、あなたは斜面と家族のランプや家族を増やします。家に入ることは控えてください。真実は親切になります。あなたが外部で給付を追求するなら、あなたはあなたの仕事が成功せず、あなたが悩むだけであることを恐れています。','政府はトリガーされているので、それを描いて描かないでください。あなたは見るでしょう。 2つが一緒にいる場合、それは難しいので、最初にハーモニーについて考えてください。その後、家の中に斜面があり、利益が守られます。','東と西の方法があるので、私は別の方法に出かけます。私は仕事の終わりにそれを達成することができます。他の言葉を聞かないでください。利益はありません。怒りと暗いので、誰があなたの心を教えてもらえますか？','それは東部のフアに蓄積され、lyreに乗っているので孤独です。疲れた後、長さが来るので、利益は秋に戻ります。どこからでもそれを助け、最初に、それは長く、有益ではないでしょう。明日の準備をしなければなりません。','あなたがあなたの仕事を迅速にプッシュすれば、あなたは長くなり、達成されます。外を置きます。あなたが左に来たら、あなたは大きな富を得るでしょう。あなたは関係とみなされなければなりません。スプリングチップスは春に出会うので、葉が咲き、大したことをします。','すぐにそれを行うのに長い道のりです。 Shinsuが長いので、100日ごとに長い時間がかかります。それまでの間、ハードワークは報われました。古い富は活発であり、彼らの意志を達成し、故郷に戻ってきて、彼らは飛んでいます。','南と北に行くと、埋葬されて迷子になります。富は北にあるので、他の人が終わったら他の人に加わりたいと思います。しかし、間違った人を作る場合は注意してください。','すべてが繁栄しているので、困難はありません。それは人々によって達成されるので、あなたが良い関係を持っていることを確認してください。春は庭に戻り、画像は再び到達しました。まず第一に、富は硬くて活気があるため、北と南の両方にあります。','利益は遠く離れているので、急いで急いではいけません。あなたがそれを実行すると、あなたは利益を得ることができます。あなたが会うなら、あなたは大きな富を得ることができるでしょう。しかし、北西に行かないでください。それは富を得ることなく不利です。','2025-03-02 03:02:01.03935+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (461,'021','床はよく洗浄されています。井戸で演奏した肉はついに海に向かっていますが、欲望はどのように定量的になりますか？家庭の人々はお互いに調和しているので、家族は平和になります。左側でお互いを助けるのを手伝います。春には心配はありませんが、夏のシーズンに入ると、私の仕事はやや迷惑ですが、春の庭の弱さに出会う時間に会います。雲はしばらく散らばっており、明るい月が再び現れるので、天国は陽気です。不安や心配はなく、家は和解します。','明るいエネルギーが家にやって来て、力を見せびらかすので、心配することなく楽しんでください。上部と下部が和解するにつれて、賞賛の声が近所でどのように聞こえるでしょうか。 Bokdeokは体の中にいたので、私は世界について心配しません。','井戸の肉は高い場所に達したので、それは勝利で活気に満ちたより広い運です。家族は家族の増加に追加されるので、富は活発になります。桃の花が春に会うので、ついに誠実な果物を耐えます。','喜びと良いものは外の空を満たしますが、あなたは心配して心配するでしょう。この月には多くのugさと長さがほとんどないので、あなたは慎重に失明に対処しなければなりません。','行くには長い道のりがありますが、あなたの前に山があり、行く道があります。あなたが間違っているか施肥した場合、あなたは引き継ぐことができます。春には少し迷惑に思えましたが、夏が始まると絞り始めます。','すぐに作業はありませんので、他の管理を行うためにそれを想像したり追い越したりしないでください。夏の主要な夏は、明るい人にとって道徳的であることです。','あなたが長い道のりを歩んだり、素晴らしい計画を立てたりすると、道徳を簡単に食べることができます。家にウーワンがいる場合は、家を出ないでください。体が道路や旅の上にある場合、それは長くなります。一度移動する時が来ました。','私たちは他の州から富を持っているので、私たちは故郷を誇りに思っており、故郷を誇りに思っています。あなたが人々が得意でないなら、取引に注意してください。その年は必然的に人間によるものです。','空と地球はお互いに調和し、1つに1つを持っています。多くの統合があるので、小さなことが蓄積し、大きなことを達成するでしょう。今月の主要な水は不利なので、方向に注意して作業を終了するように注意する必要があります。','7月、8月、9月の3か月間の主要な水には富がありますが、それは大きなことではありません。しかし、人々は周りの周りに互いに助け合うので、私は平和で平和になります。ゲインはここにあるので、それは利益を得ます。その側に興味がありたいです。','祝福された星明かりがドアにあります。これを照らしないでください。そのために起こるグスルスを食べることは困難です。経営陣は尾と尾のない状態であるため、開始したら終わりを確認してみてください。','人々と付き合っていることに注意してください。一人一人がすべてが良いわけではないことを知っています。しかし、それが人々を作ることから来るので、賢く生きましょう。あなたが会ったら、あなたはたくさんの努力をして喜んでいるでしょう。','一方向では、西と南の2つの方向が繁栄するときに仕上げることから利益を得ることができます。どうすればあなたが去るのを手伝うことができますか？あなたがすべてを気にするなら、あなたはあなたの手を返済することができるでしょう。','2025-03-02 03:02:01.050431+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (462,'022','私はぼやけた名前を描きましたが、私は間違っていて、ギャングの絵になりました。あなたがやりたいたびに、あなたは災害と怒りかもしれません。移動して移動すると、達成することは困難です。あなたが移動したり、新しい仕事を求めたりすると、あなたはあなたの家を心配するでしょう。仕事には多くの忠誠心があるので、あらゆる種類の努力を無駄にし、意味を達成できないことは簡単です。怠zyな数の著作が動くと、難しいでしょう。たとえあなたがお金を失ったとしても、あなたはそれを後で手に入れるので、あなたはそれに対処する必要があります。秋は秋に行われます。あなたが少し普通に行くなら、あなたはできる限りになります。権力が反映されるため、富はしばらくブロックされますが、富とともに眠らなければ、あなたは大いに傷つきます。','虚栄心は正面をブロックしているので、たとえあなたが働いていても、ついに無駄になります。閉塞のために達成することは困難です。できる限り職場から逃げるのが最善です。私はたくさんの仕事をしていますが、それはできません。急いではいけません。','真実は親切になるのは簡単なので、病気に火をつけないように注意してください。肥料が軽い場合でも、それは心の病気のようなものです。雲と雨が空で満たされているので、それはどれほど難しいかですが、雨が降るとは思いません。しかし、雲はきっと雨に変わります。','幼虫は仕事を始めたときに秘跡になるでしょう。世帯の中心は一つの方法で調和しているため、家族は平和で平和になります。東と南には長い列があるので、秘跡を作り始めます。','仕事は多くのブロックされており、家族の人々はそれに反対しやすいです。夏のリーダーは、おめでとうございます。おめでとうございます。あなたが山に行って祈るなら、あなたはこの数を避けます。祈りで盲人を考えると、大きな怒りを避けることができます。','私は富が私の手に来たと思ったが、人々は私を去った。今月の主要な水は最初に良いもので、それぞれが悲しみです。体は不平を言っていて、心が散らばっているので、座ったり我慢したりすることはできません。','あなたが他の人の助けを得るならば、富は最終的に引きずられます。雨の後の川の光はさらに進む可能性が高くなります。あなたはすべてをすることができ、富を得ることができます。それは友好的な準備ですので、急いではいけません。','貴重な人に会い、最終的に意志を達成する喜びがあります。災害と真実は消え、何かが確実に起こるでしょう。安定して分数を保持すると、引きずられて祝福されます。何をためらいますか？噴水を維持することは、すぐに福音を知っている必要があります。','人々と付き合っていることに注意してください。貧しい人々のために直面するのは難しいです。家には不安定なものがあり、東、西、南に不安があるので、周りを見回す必要があります。そうでない場合、真実は恐れています。真の人生だけがこれを避けることができます。','軽く受精しないでください。 Koo Seol -sooは彼の体に親切であるので、彼は彼の体と心を傷つけます。政府は引き金を誘導され、coがあるかもしれないので、すべての色や文書に注意してください。私は良い活気に満ちていなかったので、強制的に働いていれば、心を悩ませます。','土地を購入し、その中に金の鉱山を見つけて金を見つけるために、収入はないようです。私を傷つける人がいるので、人には注意してください。すべての作品には名前があり、現実はないので、心だけを無駄にするのは簡単です。','良い先頭の水が来て私を助けてくれるので、私は犠牲にすることができます。あなたが私を賢く傷つける人を避けるなら、それは長くなるでしょう。利益はどこにありますか、西と北の両方にいることを確認してください。作業を終えた後、あなたは利益を得ることができます。','記事の運は突然3ヶ月になるので、あなたはそれをうまく保つ必要があります。家族は家庭の中心と組み合わされなければなりません。すべてに気をつけて、噴水を維持してください、パワーが来ます。チャンスを逃した場合、それは非常に難しいので、注意してください。','2025-03-02 03:02:01.061014+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (463,'023','雨の中で新しい栄光があっても、新しい生活があります。なぜあなたは席を維持しているのですか？何か間違ったことをすることを控えることは正しいです。あなたが心を持っているなら、あなたはそれを達成することができません。君主が分離され、タスクに忠実である場合、それは有益です。あなたが盲目に仕事をしていない場合、あなたは最終的に失敗するので、明るい脚を交差させて交差させるように注意する必要があります。記事の主要な人は、右を見捨てなければならず、新しいものを見つけなければなりません。ただし、不明確な場所に足を踏み入れた場合、親密な人による裏切りや期待を簡単に破るのは簡単です。あなたが知らないことはあなたの目の前で立ち上がって苦しむかもしれないことに注意してください。また、受精に注意を払わない場合は、色がかかり、グスルルスで乾燥させます。','忍は不利なので、ウーワンが来るのではないかと心配しています。数は自由に機能しないため、富を救おうとしても簡単に取得できません。新年の主要な水は急いで急いでいますが、遺言に従って行われません。','それは雪を覆っており、その上に霜を見るのは困難でした。そうでない場合、人々は確かに従うでしょう。 Gusulsuに注意してください。間違っている場合、商品を失い、他の人からのresりを聞くことができます。','古い木は春に会い、雨は雨が降っています。北部が慎重または漸進的な場合は、達成できます。おめでとうございますので、道徳に注意してください。あなたが噴水を保持しているなら、私は私が待っていた良いニュースを得るでしょう。','それは人々と一緒に登られた後、楽しくて楽しい日です。噴水以外のものは何も切望していない場合は、必要なものを手に入れることができます。他の人の言葉を軽く受け入れると、それを避けることはできません。','シンウーンは長くないので、たとえ富を見つけようとしたとしても、それを手に入れることは困難です。それは静かで生まれていません、どうして簡単にできるのでしょうか？あなたが手でなければ、あなたはグスルスーに腹を立てるでしょう。','多くの主要なストリームのためにそれほど滑らかではないため、失敗するのは簡単です。私は私の友人を信じて、一緒に働いて一緒に働きます。失敗したい場合は、すべてに注意しないでください。','それは、権利を放棄し、新しいものを見つけるための主要な方法です。春の土壌はついに雨に出会い、毎日より多く育ちます。ユスは平らな道路を見つけ、シン・ソーはまるで彼がテピョン・ダイロで走っているかのように激しく行進するつもりです。','富は東または南に作成されなければならないようです。最初の作業を開始する瞬間にプッシュすると、利益が得られます。どうして春に平和ではないのでしょうか？しかし、これを照らしないでください。そのため、ガスル-soに直面することは困難です。','それまでの間、ジンによって駆動される嵐、月は山の小川に反映されています。あなたが火と水を気にし、人々の世話をするなら、あなたはきっと暗い夜の後の明るい一日を過ごすでしょう。あなたの信念をトリミングして、物事をしてください。やりがいがあります。','人の関係を考える場合、関係のある人を得る必要があります。利益は西側であり、仕事を終えることの利点です。怒りに引きずられるのは祝福です。したがって、たとえギルが対立していても、喜びは大きくなります。','今月の主要な水は不吉であるため、見つけて仕事をしても達成することは困難です。私は山を上って魚を救うので、すぐにそれを見ることができます。色をしないでください。破損する必要があります。私はただ対立することはできません。','官庁に行かないでください。ソンはドアを待っています。日当たりの良い家でさえ光を灯さないでください。私は真実が私の体に親切になるのではないかと心配しています。あなたが注意するならば、最初の月の主要な水は幸せになります。最後に、私たちは意志を達成し、一緒に喜びを共有します。','2025-03-02 03:02:01.072477+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (464,'024','Hongにはたくさんのことがあるので、直接的な残りの音があります。勉強して一生懸命働くことに嘆きないでください。遅いだけで幸運を得ることができます。たとえあなたが疲れていても、あなたは後ろで繁栄し、時間に会うでしょう。座って閉鎖が戻ってくるので、成功することは成功です。すぐにあなたがやりたいことは彼らの意志に従って満たされるので、彼らはついに繁栄を経験します。 Myeongsan daecheonで祈ると、あなたの家での余波と平和を逃れるでしょう。明るい山の明るい山である月は不十分であるため、多くの人が喜んで手を挙げます。しかし、月が倒れ、深い叫び声が叫ぶと、嘆きが出てきます。あなたが動いたり、何か他のことをした場合、私はこの液体を避けます。','しっかりした硬さがあるので、不安は平和ではありません。噴水を切望しないでください。醜い秘密はダンスになることですので、それを見てみましょう。私は座って閉じているので、ついに成功しますが、遅れます。','あなたが間違った人を作るなら、あなたはそれを見るでしょう。それがffinでない場合、多くの真実や真実があります。サンピには不安がありますが、それは大きな損傷を引き起こすことはありません。','確かな運があるので、真実に注意してください。スポーンがあればなるほど、健康に注意を払う必要があります。あなたが困っているとしても、あなたはあなたが心配していないことを確認する必要があります。','私はすぐに働いていましたが、富を得るのは簡単ではありません。収入はありません。あなたがそれをするならば、それは間違いなく不利なので、あなたの計画を変更したり、正直に言うと計画しないでください。胃を水に戻すのは難しいでしょうか？サリは不公平ではないはずです。','暗い夜になったらすぐに出かけたので、東、西、南を区別できませんでした。あなたがアルコールに軽い場合、鼻の前で奇妙なものを避けることは困難です。利益は東にあるので、あなたはきっと富を得るでしょう。番号を見てください。','道路の前で水平方向の待機があるので、実行しても達成されません。遠くからのメリットを追求しないでください。仕事を管理するために他の人と話をすると、あなたは大きな方法で着るでしょう。フレーズがない場合、ffinや胸は親切になる可能性があります。','それは私がそれを見たとしても信じられない写真の夢です。太陽と月は明るくないので、アイデンティティに重要なことがあります。あなたはあなたの体の世話をする必要があります。あなたの心にそれを知らない厄介な人々がいるので、誰がこれを知っていますか？イライラします。','軽く受精しないでください。施設に直面することは困難です。受精を避けるのが最善です。 Gilgeum Ghost Springが戻ってきたので、植生はついに快適になります。他の人の富は偶然帰宅しました。','他の何かを実行するために無理をしないでください。一方、あなたはそれを受け取るので、噴水を保管してください。良い活気が戻ってき始めたので、百日ごとに長くなるでしょう。それ以来、すべてが繁栄するので、落ち着かなければなりません。','胸に向かうことが難しいので、それが真実であることは事実です。正しいものを維持し、安定性を促進すると、この液体をほとんど避けます。西に行くと、手と理論があります。急いで決定を保持します。','ドンヤングダルの主要な水は失われず、ギルは利益なしに矛盾します。富は東にあるので、あなたはそれを手に入れることができます。すぐに作業する場合は、その効果を見てみましょう。利益は建物とブラシの大部分でなければならず、あなたは良い関係を築かなければなりません。','繁栄がなければなりません。この機会を逃した場合、後悔することができます。 Myeongsan Daecheonで祈ると、家族は平和になります。胸が多いので、体を走らせずに祈りの位置に保つ必要があります。','2025-03-02 03:02:01.080985+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (465,'025','遠い運は、明るい月明かりの下で土を積み重ねる長子と同じ運です。失明はあなたの意図に従って行われていないので、嘆きませんか。陰と陽は調和しているので、すべてのものが生き残り始めます。ドラゴンの汚れた海水を見ることができてうれしいです。しかし、最初は良く、背中は不吉であるため、家を出た人のようなものです。これをしないと心配があります。あなたが笑顔を植えるならば、あなたは笑顔を得て、あなたは血を得るために血を持っているので、あなたは明確な関係を作らなければなりません。前に高い山があり、後ろに高いレベルがあることを知ることが重要です。空に大きな雨が降るので、時間を満たすのは暖かくなります。','ハッスンには仕事がなく、ビジネスは難しいので、疲れていてもボールを達成することは困難です。博物館に仕事がない場合、家には真実があるので、事前に通知を防ぐ必要があります。あなたがあなたに会えば、あなたの個人的なイメージに平和があります。','家には斜面があるので、斜面と家族を確実に増やすでしょう。富は北にあるので、それを手に入れると手に入れることができます。作業の仕上げに焦点を当てます。南部ではしないでください。長さは変化し、醜くなります。風を大いに見るのは不利です。','西と南にいるので、注意してください。穴をサポートしたり決定したりしないでください。あなたが人々が得意でない場合は注意してください。あなたが互いに戦わないなら、あなたは所有権を避けることができるでしょう。','私は自分の体の中で自分自身を見ることができませんが、私は軽かったです。または、分割されているので注意して注意する必要があります。斜面がある場合、この運は消えますが、私は非常に悲痛なことを恐れています。','南に行かないでください。長さは変化し、醜くなります。風はとても悪いので、あまりにも不利です。あなたがあなたに会うなら、あなたは予想外の犠牲に会うでしょう。あなたの手が続くかもしれないので、すべてを処理するように注意してください。','西に行かないでください。長さは変化し、醜くなります。急いで仕事を終えるのは危険です。作業が困難であるため、作業が困難であるため注意してください。意味がありますが、意志に従って達成することは困難です。それは頭と尾のないようなものです。','盲人に注意してください。私の手が続くのではないかと心配しています。主要な著作についての心配に注意する必要があります。東と北の軽く、あなたは受精します。仕事、議論、または開始を気にしないと、難しいでしょう。','飛ぶ翼がないので、あなたは何をしますか？ Ilwolが翼を手に入れることができない時代の1つです。 SOIを実行することは無駄なので、さらに進んだり停止することはできません。主要な水は不吉であるため、計画を考えたり注ぎ込むべきではありません。','私は深みに満ちているので、家にいるだけではできません。外出したり、仕事を提供したりしないでください。色をして受精を提供する場合、結果として生じる水を見ることは困難です。富のために収集することは困難ですが、事前に注意してください。','それはたくさんの色のようなものなので、あなたがそれに頼っているときに座る場所はありません。胸でない場合は、手を避けるのは難しいので、他の人に注意してください。あなたが貪欲であれば、あなたは失敗するでしょうので、あなたが噴水を保持するなら、あなたはこの運を避けることができるでしょう。','小さな富さでさえ入ってくるので、北に行きます。私は私の前で正しいものを捨てて新しいものを見つけるのを待っています。これが挑戦です。','私は心の主張なしに揺さぶられるので、私は幸せで悲しいでしょう。仕事が良くないので、すぐに機能しないでください。うまくいかなければ、着るでしょう。主な役割は突然の役割だったので、それは小さくても大きくありません。あなたは時間をうまく保つ必要があります。','2025-03-02 03:02:01.089982+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (466,'026','ゲストが川に戻るとき、胃はありません。上部と下部は後ろに座っているので、川に来たとしても胃がありません。あなたがあなたの名前を傷つけないなら、あなたは疲れて誓うかもしれません。渇きはより困難なので、川を渡る必要はありません。川を渡ろうとすると、たくさんの手があります。やりたいことはたくさんありますが、それを達成するのは難しいです。どれだけ飲ませても、どうすれば腫れますか？私は空から夢を持っているので、見る場所はありません。時間を待たないで、外出しない方が良いです。','誰がその心を知っているでしょうか？他の人と仕事をすると、損傷があります。あなたが富を得たいなら、北はこの方向に出かけます。','あなたは何もしないであなたの手に触れるべきではありません。動かないと、3回の仕事に驚くでしょう。暗い夜には、荷物を知らずに稲妻を見るのは非常に困難です。','あなたはきっと富を得ることができるでしょう。正直なところ、作業は満たされます。自宅に斜面があるので、斜面があります。あなたは一緒に喜びを共有します。','別の人に行かないでください。私は親切になります。他の人の仕事に触れると、信じがたいです。富がないことを嘆く必要はありません。すぐに機能します。 4月と5月に液体があるので、私は控えて祈りたいです。','魚とドラゴンは水を得るので、最初と終わりは非常に不利です。あなたが不吉であれば、あなたが良くないならあなたは非常に怒っているかもしれません。事前に準備する必要があります。私はソルガイを避け、ぼやけに会うつもりです。','政府が活性化されているため、失明を構築することは困難です。 2つの心が異なるため、施肥しないでください。あなたが口論をもらったら、あなたは間違いなく持ち込みます。あなたが動かなければ、あなたはサンピに驚くかもしれません。','利点は北と南にあり、壮大で確かに仕事をすることが重要です。秋の最初の月には、液体を避けることができるように噴水を維持する必要があります。それは避けられないので、無駄に見えないでください。','貪欲な貪欲を固めないでください。始まりと終わりは不利なので、利点はありません。あなたが家にいるなら、あなたはあなたがしたことをするのを手伝うことができます。数はすでに戻っているので、利点は米を食べることであり、貧困は着実に試みています。','あなたがあなたの手にないなら、あなたはあなたの子孫を心配しているので、あなたは家の内側と外側の世話をする必要があります。この番号を渡すと、利益はどこでも発生するため、準備する必要があります。今月、活気のある真実は親切なので、注意すればとても良いでしょう。','硬い山の小さなウサギはどうやってぼやけたことを理解することができますか？人々の言葉をかわいい尺度として信じるのは簡単であり、グスルスーで別れることはできません。南に行くのではなく、南に行きます。あなたは静かでなければなりませんが、あなたはより大きくないことを控えるべきです。','南部には多くの運があるので、胸に注意してください。これをとることは心配しています。噴水を維持し、平和に生きると、この怒りを避けることに注意してください。数は不吉であるため、たとえそれを手に入れても手に入れるのは難しいです。使用せずに待つことをお勧めします。','それは小さなもので大きなことに利益をもたらすので、あなたは幸せにならないのですか？どこからでも来るのはたくさんの豊かさです。東と西の両方で正直にならないでください。シミュレーションを飾らないでください。','2025-03-02 03:02:01.102677+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (467,'027','華麗な鳥はどのようにしてニュースに会うことができますか？シムホンを走らせてきたハードワークは、1日映画になります。幸運がすでに戻ってきているので、1日でシムホンのすべての価格を取ります。あなたがこれを左に助けるならば、それはそれがそうするように行われます。他の人の助けがあれば、パルスまたは良いご飯ができます。主要な数の記事は幸せでなければなりません。魚がドラゴンをジャンプした場合、あなたは祝福を探しています。名前は1つの世界で奪われるので、あなたは話すことによって駆り立てられます。水の真ん中に、月が見られ、私が続きます。','知性はドアに反映されているので、私はあなたをお互いに扱います。家には斜面があるので、美しい人がカップを勧めるようなものです。恋人に会うことは夢です。家族を増やしたり、家を増やしたりすることで、家族に挨拶します。','私は3時に斜面を持っていることを嬉しく思います、そして、私は金とjaの倉庫でいっぱいになります。名前は軽く、遠くに飛ぶので、それぞれの人がそれを見るでしょう。今月の主要な水はスプリングチップのようなもので、チップは満開です。','たぶん真実があるかもしれないので、私は事前にミョンサン・ダエチョンに行きたいです。真実がある場合は、診療所で明るく走っていると尋ねてください。液体から逃げます。ギル・ソンはドアに反映されているので、私は死の土地を生き延びた人に会います。','最初と終わりは同じなので、きっと嬉しくて貴重です。あなたが人々が得意でないなら、あなたはあなたの年齢を妨げるでしょう。あなたが犠牲にならなければ、真実は圧倒されるはずです。','さまざまな活気のある水が入ってくるので、力は力の左側を享受します。ギルソングはドアに反映されているので、あなたは大人になるか、家族を追加します。まず第一に、あなたは大きな利益を得て、それはその背後に安定しています。','家には斜面があるので、あなたはきっと犠牲に会い、あなたの富を増やすでしょう。どうすれば成功できますか？そうでなければなりません。他の人と戦わないでください。あなたは有益なものによって損傷を受けているかもしれません。','財産がドアに来ると、私たちは犠牲になり、喜ぶでしょう。富は身体の中にあるので、名前は他のものよりも広がり、利益はより大きくなります。高い音を聞くのは良い家ですが、なぜあなたは喜びに満ちていないのですか？','失明が長いので、富はドアに来ます。左側のお互いを助けてくれるので、利益が真ん中にあることを知り、真のデートをする必要があります。富はどこにでもあるので、あなたがそれをうまく仕上げたいなら、私たちは予想外の犠牲を払うでしょう。','道路は堅実な山で失われているため、道路が非常に困難になると言うことは不可能です。他の人が私を打ち負かすので、希望を達成することは困難です。あなたが家にいるなら、それは長くなるでしょう。','明るい夜の窓のそばに座ると、大きな仕事をすることができます。文書には長さがあるため、土地を拡大することから利益が得られます。','去らないでください。不利な点が私を待っています。私はそれを維持することはできません。盲人に急いで急いで急いで、大きな富がドアに来ましたか？少年は意味を獲得したので、楽器は定量化され、ためらうことはありません。','人が助けてくれるなら、良いことがあることを確認してください。あなたがあなたの心に急いでそれを落ち着かせるならば、あなたはそれを避けることができます。仕事が良好であって仕事が良くないとしても、ますます努力してみてください。','2025-03-02 03:02:01.11462+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (468,'028','気を散らす仕事がたくさんあるので、ゴブリンは劇に登場するので、どうしたらいいかわかりません。風が孤独になったとき、火は消え、暗闇だけが一緒になりました。太陽と月は明るくないので、東と西を区別するのは簡単ではありません。あなたが親しい人を信じないなら、それは甘いですが、それはそれを壊すでしょう。あなたが家にいるなら、それは長いです、そしてあなたがそれを実行する場合、それは不利です。月が乗るとき、それは遠すぎて終わったときです。ベックベースの葉は暗くはありませんし、絹を着ているので、明るい道を歩いています。','あなたが冷静に動くと、あなたは仕事を得るでしょう、そしてあなたが働いているなら、あなたは多くの利益を得るでしょう。あなたがあなたの手にないなら、真実はあなたの体に親切になるので、あなたの健康に注意してください。喜びと不安は一緒に混ざり合っているので、一度良くなり、一度それを作るでしょう。','世界は夢の雲のようなものなので、最初は長いですが、後で変化します。あなたが吸盤でない場合、あなたは道徳を食べます。外に出ようとしても外出しようとしても、外出するのは簡単ではありません。あなたはそれに集中する必要があります。','あなたが家をうまく保つならば、あなたはついに戻ってきます。あなたが不吉であれば、あなたが真実を気にし、あなたの健康を気にするなら、あなたはこの液体を避けることができるでしょう。','太陽は雲の真ん中に入ったので、雲は太陽を暗くしました。出入りした場合、害がありますので、手を稼がなければ、入ることを控えて注意する必要があります。人としての損害賠償があるので、人とデートすることに注意してください。','個人的なイメージには長い道のりがあるので、困難はありません。運が家族に来て以来、家族は平和で活発であるため、vy望はありません。あなたが家にいるなら、利益は真ん中にあります。噴水を維持する必要があります。','私は小さなもので大きなものを見たいので、私は多くの利点があります。しかし、他人の富を切望しないでください。対照的に、それはお金を失います。受精時に光がある場合は、Gusul -Sooに従います。','鳥は負傷しているので、飛ぶことができません。確かに、それは残念です。仕事をする方法があるので、急いで追いつかないでください。正直ではないことを控えてください。','もう一方の月が再び現れたので、あなたはあなたが疑ったことを知っているでしょう。胸を避けたい場合は、事前に南に行きます。仕事を進めたいです。球根と喜びは多くの時間ですので、一度あなたが素晴らしく、大声で泣きます。','月はソチョンに落ちるので、明るいです。あなたは道徳と富を失うことへの恐怖を恐れていますか？私はそれを保持するのが心配です。それにもかかわらず、予期しないことのために手が大きくなる可能性があるため、事前に注意することができます。','文書には害があるので、誰にも話さないように注意してください。予期せぬ富は偶然にやってくるでしょう、それらはすべて良い関係を持っています。私はどこからでも利益を得るので、私は大きな富を得ます。','私は川を渡らなければなりませんが、川のそばにボートはありません。長い道のりを歩かないでください。それは害であるに違いありません。行く方法はありません。あなたがすべての家の苦情に出かけると、あなたは不幸になるでしょう。','真実がなければ、あなたの両親は心配するでしょうので、あなたの健康を保ち、周りを見回してください。大きなものが行き、小さなものが戻ってくるので、お金を失ったり、富を失ったりするかもしれません。毎日滑らかではありませんが、なぜ世界は夢のようではないのですか？','2025-03-02 03:02:01.123344+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (469,'029','太陽の下で大きな壊れた場所をどのように修正できますか？心臓が引き起こされると、家族は心配しており、仕事はためらっています。水と火に気をつけてください。あなたはすぐに驚くでしょう。あなたが数字に専念しているなら、それを手に入れるのは醜いでしょう。年の初めから手があるので、最初から最初から落ちないように注意する必要があります。新年の半ばには、あなたの家族を増やすための斜面があります。心はすでに準備ができており、意味はいっぱいですが、ビームが取得され、ビームのみが取得されます。それは小さくて大きいので、軍の道は輝き始めます。','適切な土地がトリガーされるため、吸盤が必要です。あなたはbarえるために正しいものを維持する必要があります。あなたは正しいものを維持するために行ったことがあるので、新しいことをしない、または管理を促進しないでください。他の人の富を切望している場合、逃げることは困難です。','動かない場合は、妻が心配になるので、環境を変更したり、座席を修理したりできます。達成するのは難しいですが、達成するのは難しいので、ボールを持っているのは難しいです。あなたがさらに進むと、あなたはリラックスします、そしてあなたが入って来たら、あなたは何をしますか？','ムクモクの人々は食べ物を手に入れましたが、食べるものはありません。空中に浮かんでいるので、それは犠牲ですが、反応しません。あなたが軽く受精している場合、あなたは水に苦しむかもしれません、そしてあなたは非常に悲痛なかもしれません。','月は雲に入り、光を見ることができませんでした。私は他の人と仕事をすることができず、成功しません。ただそれを取らないでください。その結果、彼らはお互いに苦労します。','左と南部で作業すると役立つので、仕事を助け、促進する時が来ました。自宅にはwoh hwanがいるので、その年はあまりありません。それは可能なはずです。噴水からうまくいかない場合でも、これは簡単に失敗することに注意してください。','富は道路の脇に散らばっているので、見つけようとすると、いくつかを手に入れることができます。 6月と7月には、失明が引き起こされたようですが、障害があります。たくさんの仕事があるので、他の人を信じて、自分の犬を飼ってください。','私にはそれをする方法がないので、あなたは何をしますか？胸があるので、液体を避けてください。ミオンサン・ダエチョンに行き、祈りや儀式を作りたいです。多くの作業があるので、処理され、問題は解決策よりも先にあります。','他の人の言葉を聞くことは、よりねじれて無駄です。アルコールを灯さないでください。これが、手の手を避けるのが難しい理由です。あなたがイライラしているなら、真実はあなたの体に親切になるので、噴水を守ってください。','なじみのない人と遊んだり集まったりすると、たくさんの古い水があります。動かない場合は、それを避けるのは難しいので、環境を修正したり、しばらく旅行することをお勧めします。ただし、西と北は不利なので、出口を控えてください。','多くの希望がありますが、何も何もありません。あなたが人々が得意でないなら、グスルルスと別れることは容易ではありません。君主制は非常に強力なので、自分を判断することで仕事を捧げません。','主要なネクタイは生きているので、うまく仕上げてみてください。誰も有益ではありません。たとえ吸盤ラインがあっても、あなたはそれを批判する能力を持っている必要があります。自宅に斜面があるので、それは子孫の斜面です。','富がやって来て喜びの世話をするので、それに貢献されます。あなたがあなたを助けるなら、犠牲は大きなことではありません。東と西の部屋は、たとえそれを手に入れても手に入れるのが難しいです。','2025-03-02 03:02:01.134496+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (470,'030','暑い月には、強さが落ち、逆境が果物を見るために押されます。干ばつの間にダンビに直面して幸せになりませんか？雲が散らばっており、月が出てきて、景色は新しくて美しいです。草は川で緑に育ったので、牛は牛と同じくらい食べることができました。作家の運は、斜面に満足するか、家族を増やします。これが同じでない場合、あなたは楽しいか良いでしょう。風は水中にあるので、8つのニュースがあるときはニュースをします。身体と心は平和なので、百のものは長くなります。 Cheongpungに戻ってくる心と体が新しいスタイルを変えるように見えたので、これは喜びではありませんか？','心と体は調和がとれているので、私たちは上下に調和する喜びを持っています。世界はドアの上にあるので、あなたはあなたの家族を増やす可能性があります。どうすれば他の人を助けることができますが、富はありませんか？','あなたが奉仕しない場合は、災害に会う必要があるので、事前に注意してください。何百ものことがスムーズに動き回るので、1日で現金を得ることができます。あなたは長い道のりの真ん中に戻ってきますか、そしてあなたの体はしっかりし、あなたの富は浸水しますか？','あなたがあなたの正しい心で仕事をしようとするならば、あなたは前進する力なしに成功するでしょう。あなたが議論を使わないなら、あなたは祝福されることを心配するでしょう。あなたが低い場合、あなたの家族は増加し、含めます。','人々が私と東の私を助けてくれると推測されるので、新しい仕事を始めるのは長い間あります。 10,000がんが破壊されたため、体は持続し、富が浸水します。今のように夏を教えると、それは不利になります。休憩を取りたい場合は、不利になります。','富はドアにあるので、富は東で変動します。作業を開始する前に開始する前に。ただし、兄弟を動かすと、有害である方が良いです。富は身体に従っているので、私は大きな富を得るでしょう。','春は山と畑に戻っているので、光はより新しくなります。私は新しいCheonjiに会ったような気がします。富がなければ、多くの喜びがあります。まず、後ろの長さに会います。','Gusulsuに注意してください。他の人の仕事を保持すると、説明があります。水と火は非常に高く、彼らは互いに議論しています。利益はありません。東または西に向かってください。仕事を始めることと終了から恩恵を受けるでしょう。','貴族が来て助けてくれると、富は育ち、体は変動します。 Myeongwolは高く、名前は有益であるため、貴族が来て助けます。失明は困っておらず、繁栄しているので、像は平和になり、家族は平和になります。','小さなものが行き、大きなものは確かに新しい家族になります。他の人から強さを得ている場合は、自己メイドではなく、Daesungを見てみましょう。同時に、走るのは長いので、盲人は繁栄します。','受精を捨てると、ソク・ジェエを避けることは困難です。他人の仕事に立ってはいけません。そうでない場合は、逃げるのが難しいでしょう。心が怪我で困っていることを誰が知っていますか？自分自身を慰め、自分自身を慰めるのが最善です。','太陽と月はいつも明るいので、家族に喜びが満たされます。 만약에이름을이름을날치지반드시재물을얻을。 집안이화목하게화목하게살어나가고식구들이융성하게되니이기쁨을。','受精を指摘しないでください。 Gusul -soが体に友好的であるため、流れるのは難しいでしょう。チョジュは困っていないので、それはますます繁栄するので、像は平和になり、家族は平和になります。','2025-03-02 03:02:01.144488+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (471,'031','太陽が途中でよく昇ると、それはそれを傾け始め、月が始まります。村人は傑作であるため、処理するのは困難です。動くと、遅い場合でも光が表示されます。新年がない場合は望ましいです。これが同じでない場合、私は自分がしたことを修正する必要があります。春の運は、他の管理をすべきではない車です。夏には、ガスル水は分割しやすいです。貪欲であることは危険であり、楽しい仕事なしで行くことは危険です。上部を刺すと、古いものを修正して新しいものを開始または変更できます。分数からうまくいかない場合、新しいことをすることができず、有益ではありません。','残りの雪は消えていないため、何百もの興奮はまだ利用できません。体は山にあるので、心はとても孤独で疲れています。お互いに調和がつくのは簡単で、お互いに害を及ぼすのは簡単です。','私はYoungmokの体にいたので、遠くに旅行に行きましたが、他に何もしません。たとえあなたが働いていても利益を得ることは困難です。とにかく有害ではないことをありがとう。経営陣は、頭だけで尾がないため、醜いです。','それは予想外に成功しており、名前が近くまたは遠くにあることは広く知られています。所有者が来て助けてくれるので、あなたは確かに成功するでしょう。今月の運は東と南にあるので、彼に注意し、始まりと放棄を強調してください。','春の日に霜が降りられているので、成長するのは難しいです。たとえそれが成長しても、ヒートマッチはありません。そうでない場合は、配布されていない場合は注意してください。 Sonasは失われ、方向を区別することはできませんが、注意する必要があります。','私は人々と遊ぶので、長さと醜いは半分です。ピークで口を遅らせると、決定を下すことができなくなります。あなたが家にいるなら、あなたは有益で急いでいることができるので、失敗を避けたり、内部の利益を捨てたりするために邪魔にならないでください。','名前がチョンリーナ・マンリに夢中であることを知っている人はいませんが、それは無駄であり、失速はありません。 shinsuはギアをすることができないので、あなたはあなたの体とあなたの心を持つ必要があります。兄弟がいても、心の中で話さないでください。','ガンナムに戻るガチョウは手紙を受け取るために伝えられているので、彼らはすべてに長い時間を過ごし、過度に力を与えています。軽く浮いて地面に移動した場合は、注意してください。','静かに座って噴水を維持すると、働いて仕事をしていると不利になります。あなたがあなたのオフィスを維持しながら快適に住んでいるなら、あなたは誤って富を得るでしょうが、あなたがそれを見つけた場合、あなたは誰かを恋しく思います。美しいスタッフを歓迎するのは簡単ではありません。','すべての谷から降りてくる水が互いに結合しているので、私はついに海を形成します。それが外にあるのでそれを知っている人はいません、そして、空の人は誰もいません。しかし、新しい水が快適で長いので、来ない富を嘆かないでください。最後に、海は満たされます。','高い窓を開けて空を見るので、良い月を見るのは困難です。利益を上げるためには、東に行き、開始に注意するのは良いことです。しかし、あなたが人々を発疹させるなら、太陽をするのは難しいでしょう。','今月の運は比較的難しいですが、それほどメリットを得るのは難しいです。あなたが花嫁を維持し、正しい心で試してみると、醜いものが変わり、長くなります。特に、月の運は水と火に注意する必要があります。周りを見回らない場合は、後悔する必要があります。','貴族はあなたのすぐ隣にあるので、運と利益を見てみましょう。秋の雨のようなので、穀物でいっぱいの倉庫になるでしょう。最初の月の運には多くの長くugさがあるので、リスクが待っており、孤独の孤独が流れます。','2025-03-02 11:48:40.410386+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (472,'032','名前プレートの名前が毎日昔に成長すると、家に火がありました。家族は平和で、斜面は悩まされているに違いありませんが、長い道のりがあっても、小さな不安を残しません。欠陥を克服すれば、常に喜びを味わうでしょう。','新しいボールの数が増加し、その日が拡大し、家が増加します。古いものが行き、新しいものが戻ってくるので、大きなものを満たすのは怖いです。運が良くなるとすぐに、私はまるで本当の名前で昼食をとったかのように、心の平和の平和と平和を享受します。','本名は晴れているので、春の花はそれらの前に咲くのが怖いです。 Saeguは元気で幸運になるので、ドラゴンが水を手に入れたかのように変化は珍しいです。これに基づいてやりたいことをするつもりなら、あなたはそれを達成することができます。','それは予想外に成功し、名前はどこにでも広がります。私はあなたが来てお互いに助けてくれて助けたいと思います。時間と組み合わせて、名前は高くなり、家族は他の人のvy望を自由に買うことができます。','非側面は不利なので、ガスルスに注意してください。作業を終了する過程で、自分で終了するのは簡単です。それは自分自身を忘れて手放すプロセスですので、あなたはたくさんの斜面を持っています。','あなたが何をしても、あなたはまるであなたが女性を持っているかのようになります。これは測定値の間の方向です。そのため、前に実装された時期に注意を識別する必要があります。そうでない場合、私は思いがけず後悔します。','あなたが美しい景色を恐れて友人と一緒に楽しんでいるなら、あなたはあなたの友達と恐れています。','幸運になりたいです。月は隠された空に現れ、世界は東と西に良くなるので、それを参照してください。','私はお金をつかみましたが、私はビーズを見るのを恐れていたので、寄付は入ってきました。そうでなければ、それは子供の喜びです。配偶者には斜面があるので、私は1つの家で祝福と戦います。障害のない月です。','Myeongwol SanghyunのLyreに座るのが怖いので、家を維持して後悔してうれしいです。まるで雨が降り、風が吹き、目が自分自身を消えるかのように働く方が簡単になります。手がかりは、あなたがやりたいことで明らかにされます。','あなたが東から浮かぶなら、あなたは来て助けます。本名の草が日々雨が降るようなものです。ガルマックの運は豊かになるのに長い時間になるでしょう。','あなたが仕事をしようとしているかのように、それはスムーズに満たすことができます。屋上はゆっくりと恐れており、私は馬になることを恐れています。運があれば、ためらうことなくやりたいことをプッシュできるようになります。警戒してください。','受精の近くで飲みます。 Ku Seol -sooは分割されます。ただし、実行すると、長くて幸運なので、屋外でのメリットを見つけるのは良いことです。輸送は繁栄し、心と体は快適になるので、与えられた輸送を変えたり止めたりしないでください。','2025-03-02 11:53:34.658015+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (473,'034','矢印はありませんが矢印はありません。どうすればこの利点を見ることができますか？富と意味があるので、成功は難しくありません。成功の根拠は、それが富と意味から始まるということです。しかし、他の人の話をよく聴かなければ、あなたは良いことになります。動くと、富が得られるので、環境を変える必要があります。君主には注意してください。乱暴な障害が未来を待っていることを知ることが重要です。通知を嘆かないでください。長いに違いない。あなたが幸せで、一度悲しいと、それはうまくオフになっていないことから来ます。南西部の部屋に器用さがあるので、走るのは良くありません。あなたが最善を尽くしていなくても、あなたが柔らかくすることができるので注意してください。','流れがとてもエネルギーが走っていたとどう言いたいですか？それは残念だ。ランニングは長いので、南東に行きます。それは仕事を促進する強力な方法ですが、著者の運は静かに休むべきです。','管理は始まりに過ぎず、終わりはありません。したがって、集中しすぎると、エネルギーを無駄にします。統治には注意してください。事前に残してください。 2月と3月には、毎日迷惑になります。','障害がない場合は、自分自身を低く見ることができます。個人的なイメージには危険があるので、人々は多くの場所を避けるべきです。これが同じでない場合、扱うのは簡単ではありません。','それは失敗する可能性があるため、道を作ることは困難であり、収益性はありません。東は長く、南部は有害なので、最初のステップに置こうとしないでください。噴水を保ち、生きてください。このように行動しないと、失敗を避けることができます。','sinsuは不利なので、ヒットに注意してください。あなたはあなたの体を事前に保つことができます。害を生むのは間違いなので、一緒に働かないでください。何か他のものを実行したり、新しいものを始めようとしないでください。それが機能するでしょう。','私は盲人に問題があるので、私はとても悲しくて生み出しています。運が良ければ、器用さがあるので、事前に防止しないと、それを行うのは難しいでしょう。','干ばつは干ばつの空に落ちますが、それは豊かで熟します。新しいイメージには長い道のりがあるので、貴族は来てお互いを助けます。私はとても幸せです。仕事に噴水を維持し、外部の富を切望しない場合、失敗を避けます。','障害がない場合は、大きな不安を抱くことができます。念頭に置いている申し立ては立っていないので、あなたは予期せぬ仕事に会うことをためらうでしょう。受精しないでください。陸生から逃れるのは難しいでしょう。注意する必要があります。','西には長い道のりがあるので、それは理由によって行われます。あなたの仕事を終えるためにあなたの目を開けてください。利益は北にあるので、外出するときにそれを手に入れます。フィニッシュ後に利益が見つかります。密かに進むことは不明であるため、機会を見なければなりません。','手に入れるのは簡単ではないので、家にいることはできません。外出するときは有益ではありません。災害は消え、祝福が戻ってきたので、あなたは別のものを作ることができます。外側は豊かであるように見えますが、内側は同じではありません。','あなたが静かであれば、それは長く、あなたが有害であれば、あなたの仕事をうまく維持し、働かない。嘆き悲しむ人生をしないでください。それは映画のようなものです。噴水から何かをすることは不可能なので、噴水を維持するのが最善です。','多くの成功があるので、あなたは何をしますか？あなたがあなたの祝福を失わないなら、あなたはそれを心配するでしょう。敗北は幸運なボスなので、あなたはあなたの心を維持しなければなりません。事実として利益はなく、建設は友好的である可能性があるため、長くないかのように行う必要があります。','2025-03-02 11:53:42.182887+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (474,'035','北山の下の新しい家は鳥のようなものです。家族は不安になり、産卵します。しかし、それは変化し、それは長くなるので、あなたがそれを祈るかするならば、それは同じになります。作家は不利なので、100日ごとに心を使うことはできません。あなたが醜い場合、それは再び長くなるので、最初はレイになります。慎重になるので、事前に準備する必要があります。どんなにメリットを作っても、輝くのは難しいです。上下に調和することはできませんでした。利益は南部にあるため、シミュレーションが最終的に達成されます。','太陽と月は見られないので、心配は暗いので、落ち着く時間はありません。そうでない場合、家には不安定なものがあります。間違った人を作ると、器用さを避けることは困難です。','家を出ると、あなたが行くところに素晴らしいでしょう。体は街の通りでビンビングのようにさまよう。家に苦情があるので、同時に上下に分割されるのが心配されます。他の人をうまく押すことができない場合、あなたは最初に良いでしょうが、あなたは醜いです。','私の心は心配しているので、たとえ豊かになってもそれを手に入れません。あなたが奉仕するなら、とにかく退却するのは簡単で、あなたの人生やあなたの人生を維持することは有益ではありませんか？幸いなことに、あなたが貴族に会うなら、あなたは彼女の相続人を避けることができるでしょう。','あなたが家にいるなら、あなたは深く心配し、あなたが他の場所に出かけるとき、あなたはリラックスするでしょう。あなたが東に行くなら、それはあなたがあなたを助けるのに役立ちます。事前に仏に祈ると、災害に直面して戻ってくるでしょう。','利益は文書にあるので、土地が調達されるか、会社が成長すると思います。幽霊が私を助けてくれるので、醜いものは自然に消え、祝福が戻ってきます。運は浸水しているので、財産と絹は豊富ですので、なぜあなたは幸せにならないのですか？','障害がない場合はフレンドリーになるので、健康に注意して注意してください。貪欲で取得しないでください。あなたは怒って、あなたは祝福されます。このように行動しないと、時が来ます。','あなたが祈りで残りの凍結を倒すことができるので、あなたの心を安定させます。ソーサがあるので、他の人と口論したり、他の人に立ったりしないでください。さらに、メリットがなく、他の人の言葉を推し進めるのはばかげているかもしれないことに注意する必要があります。','仕事はうまく解決されませんが、それは頭のようなものですが、尾はありません。どうして動揺しないの？仕事には多くの問題があり、海が続くので、このひねりを避けるにはどうすればよいですか？実際、それは凍結されているので、あなたがあなたの先祖の世話をするなら、あなたはこの運を避けることができるでしょう。','うまく達成するのは百のことですので、喜びはいっぱいになります。確かに、平和的であることの運として、名前は浸水し、富は救われます。他に何が欲しいですか？いっぱいの運です。','あなたが近づいていない場合、多くの仕事があります。あなたが間違った人を作るなら、あなたは有害になるので、あなたは取引すべきではありません。時間を待って、安定性を取ります。仕事の後、喜びがなければなりません。','ギルを区別することは困難であるため、ギルは逆になります。事前に注意しないと、長さは変化し、醜くなります。あなたはあなたが他の人と仕事をするつもりであることを知っていることに注意する必要があります。','私は東に新しいものを湾にしたいです。シンウーンは不利なので、障害があるのではないかと心配しています。あなたの健康に注意してください。あなたが間違いを犯した場合、あなたは確かに災害をもたらすでしょう。','2025-03-02 11:53:47.163879+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (475,'033','心臓は炎に出会ったので、それは矢の端のようなものです。それは白い雪でいっぱいの畑に一人で立っている孤独な松の木のようなものですが、hatch化がありますが、心は快適です。途中で黄色くなりますので、新しいイメージには喜びがあります。あなたはあなたの富に触れることができますが、あなたがあなたの手に入ったらすぐにあなたは何を姿を消したいですか？周りに櫛はなく、それに頼る時間はありません。','私は厚い山で迷子になり、東、西、南をさまようのが怖いです。新しい方向は南部なので、すでに変化したものを促進するために注意する必要があります。家を家に置いて走らせると、それは不利です。','人々は私を押してくれないので私を押しません。  幸いなことに、あなたがあなたに会ったら、古いものが戻って、お菓子が戻ってきます。炉は炉に入ったので、大きな変換を伴う大きなグループを作ります。','天と地の反対側で孤独を和らげなければならないので、少しはないはずです。シンウーンは不利なので、多くの器用さがあります。 3月と4月には吸盤がありますので、注意しなければ、伝えられます。','私の運が平らではないので、私は良いことで鷹を持っているのではないかと心配しています。受精に近づくと、きっと欲望に従うでしょう。  それが公式でない場合は、事前に注意する必要があります。起業家精神に到達するのは簡単ですので、必ず残してください。','ギルスンは家で輝いているので、幸いなことに、私はあなたに会い、助けを得ます。  今月の幸運は、すべてが繁栄に開かれている幸運なので、ツアーの価値があります。運が繁栄しているので、富が入ることを意味するとはどういう意味ですか？それを一生懸命にしてください。','あなたが他の誰かの助けに従うと、あなたは立ち往生するかもしれません。そうでなければ、それは不可能です。主張は彼らの心に立っていなかったので、マッサはさらに空腹です。しかし、活発な運があるので、家族は平和になり、新しいボールが増加します。','器用さが得られない場合、遠くに不安があります。あなたがそれを家に置いておくなら、あなたは何でもして何か他のものを見つけることができます。それは秋の月の厚い上昇のようなものです。','あなたは多くのトラブルであなたに会い、あなたの喜びを増やします。理由に近い場合は、器用さに従うことができます。スタートがあり、終わりがないので、仕事には良いことがありますが、デートの人々で最善を尽くすなら、あなたは確かに良いことになるでしょう。','9月から10月の間に1回、あなたは一度誓うことができません。あなたのオフィスを維持することが最高の予定であることを知ってください。この病気は遠くまで侵略されているので、南部の議員を訪問して癒してください。あなたがすでに成熟していても、それは有益ですので、あなたが行く問題に注意してください。','風が大きな海に吹いて浮かんだ場合、どうすればスムーズに行くことができますか？あなたが友人を信じなかったなら、現実は完全にそれほど興奮していませんでした。新しい水が平らで、運は良いので、それは幸運です。','私は小さなものを手に入れて大きなものを手に入れているので、私の希望はスムーズに作られます。私は後悔し、倒れたので、家族は平和を楽しんでいます。あなたがじっとしていても、あなたは新しい仕事を達成して作ることができるでしょう。','あなたがいるとしても、言葉だけがあり、現実はありませんので、あまり依存してはいけません。あなたが良いゲストなら、あなたはそれを買う余裕がない庭を持っているかもしれません。すべてを慎重に扱うと、長い道のりがありますので、急いで慎重に昇進しないようにしてください。','2025-03-02 11:55:11.357968+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (476,'036','それは青い海の風と同じくらい孤独な灯台のようなものです。ただし、不公平な仕事から利益を得ようとすると、それは有害です。誰が人間の世界で孤独を比較検討するでしょう。新しい意志で仕事を達成しようとするなら、私たちは長くなります。友達と先輩を閉じてください。それから私はそれを長くします。しかし、メイン色に近づくと、後悔するでしょう。著者の幸運は、成功するのが難しい運をさまよっていた月を見逃すことです。それは怖い体に精通している可能性があるため、障害への恐怖があり、最初はそれは有益であるようです。北に注意するのは特に良いことです。他人の背後にある祝福は、彼らが終わったときに徹底的に戻ってくるからです。','新しい水は良くないので、別の場所に移動しようとしたとしても、それを避けることは困難です。また、親しい人からうらやましいことは有害です。あなたが家で心配していないなら、あなたはあなたの親や親の耳に熱心になります。','疑いがないので、盲人に満足することはありません。私は達成したいと思っていますが、達成することは困難です。あなたが自分自身に不満を抱いていたらどうしますか？他の人のために失うものがあるので、一緒に働かないでください。','心配していないので、夜は眠れません。家で眠っているので、私は平和になれません。あなたが家を出て、あなたの心を落ち着かせるために出かけると、別の災害が潜んでいます。外部から利益を得るものは何もないので、あなたの家を維持する方が良いです。','富は偶然に起こったことに来ます。水中で利益を見つけようとすると、できる限り良いものになります。ただし、あなたが望むものに富を集めようとしたとしても、利益が不足している可能性があります。','私は新しいビジネスをしようとし、再びそれを心配しようとしています。私は達成するために大きなことを切望します。それはあなたが小さなものを持ち、しっかりしたものを作ろうとしたいということを意味します。富が散らばっていて雲のようになっているので、後悔の使用は何ですか？','明るい光を見つけるのが難しい大金です。他の人を信じないでください。私たちはお互いにうらやましくなり、心を傷つけ、富で口論します。女性の近くにいるのは良くありません。あなたがそれを壊すと、障害は苦労します。','口を重くして人を作ってください。あなたが冷静に行動する場合、建設を避けることは困難です。メインの色に近づくと、器用さがあるので、遅れて後悔するでしょう。デートするときは譲歩し、耐える方が良いです。あなたはあなたの手を遊んだり受精させたりすることができます。','人々が互いに助け合うために集まるのは世界の生活ですが、彼らは他の人と仕事を見つけようとしていません。災害のため、ti病と心配は去りません。事前にアプローチして祈ることをお勧めします。','南と北には欠点があるので、行かないでください。私は自分が欲しかったことを達成できません。しかし、西側には富があるので、そこに行くと少し手に入れるでしょう。家にはugい災害が発生するので、事前にミオンサンに行って心をきれいにして祈ると、それを避けます。','私はこれを達成しようとしますが、私は世界を去るだけです。器用さがなければ、あなたは家を心配しているかもしれず、あなたの配偶者の災害かもしれません。しかし、それがすべてなら、それは甘いものです。突然宝物があるので、繁栄を見てみましょう。','武器はトリガーされているので、水と火に注意してください。南と北に行かないでください。私はあまり収入を得ません。自分で仕事をして仕事をしていると、少し利益を得て避けることができます。','雪が積まれている場所に緑の葉をどうやって手に入れることができますか？私は自分の心で仕事を達成することはできませんが、私は自分の心に苦しんでいます。あなたが遠い場所に行くならば、あなたはフッサイを恐れるべきです。希望なしに所定の位置に保つことは幸運なことです。','2025-03-02 11:55:55.03997+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (477,'037','私の夫が流れを追いかけるとき、5つのユニットはすべて正しいです。誠実になろうとすると、たとえ増加しても光が見えます。最初は、愚かなことがありますが、映画は狂っています。障害に慣れていない場合は、少なくとも一度はお互いを傷つけることができます。盲人は遺言に従って行われるため、管理はどこでも実行され、伝えられません。時間を待っていれば、成功することは間違いありません。私は空にいるので、歩き回ることができるので、ついに作られたと思います。それが現れると、それが都市に入るとき、それは政治になります。貴族は東で会合し、利益は西から得られます。','乾いたシャベルは雨に会い、ついに水を手に入れました。心と体は互いに介して行われるので、名前は獲得して広がります。どのようにリスクはどこよりも少なくなるでしょうか？盲目はあふれています。','太陽と月は明るくなるので、あなたは喜んで家を明るい笑顔で満たします。家は傾向があるので、注意するのは良いことでなければなりません。 7年間干ばつになったことはどれほど幸せですか？','ドラゴンには長い川と高い海があるので、調和は無限になります。他の人の豊かさは、繰り返しを実現するためにドアに来るでしょう。交通機関は長く会っているので、私たちは喜んで願い事を達成します。','兵士たちは仕え、悪役は富を得るので、あなたはそれを後悔することができます。富が市場にある場合、それは得られ、有益になります。','あなたは物事を手に入れることができます。盲人に注意しない場合、実数の数を回避することは困難です。北を信じないでください。何もすることがない人の言葉を聞くと、お金が失われます。旅行しないと、障害は友好的になります。','あなたが奉仕しなければ、あなたは富を得て喜びを楽しむことができるでしょう。デートの人々のおかげで、偶然助けたいと思います。あなたは同じ心を持っていて、あなたのメリットのために認識されなければなりません。','肉とドラゴンは水を得るので、圧倒されます。あなたが良いことを持っているなら、あなたは心配するでしょう。噴水を保持し、このように動かない場合、あなたは間違いなく大きなことを達成するでしょう。','ダンビは時間を設定し始めたので、あなたは良い収穫をすることができます。両方の西部で、貴族は仕事をうまく終え、注意するのに役立ちます。通常、よく結びつく人はどんな人ですか。','月が個々の空で上昇するにつれて、景色はとても美しくゆっくりです。あなたの心と体が平和であるため、成功するのは何が難しいのですか？それは平和の強さの方法です。支援する収益は北西でなければならないので、仕事を終えて面倒を見てください。','他の場所から富を見つけることを切望しないでください。あなたはそれがそれが意味することを意味することを確かに知っているでしょう。秋のロータスリーフが出会って話したので、道を止めましょう。後でなければ、自分自身を増やすか、方法を増やす喜びがあります。','あなたは波に肉を手に入れることができるので、あなたは肉を手に入れることができます。忍耐が必要です。新日はとても幸せであるので、あなたがそれをしなければ、あなたがそれをしなければあなたは幸せになるでしょう。','詩を閉じないでください。 Gusulsuに着くと、それを処理するのは簡単ではありません。 2つの間で散らばっている間に小さな材料は簡単ではなく、水は最終的に海に届きます。','2025-03-02 11:55:57.025655+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (478,'038','あなたは男になるために長い道のりを歩かなければなりませんが、高い山がブロックされているのは怖いです。意志に従って仕事をするのは簡単ではないので、仕事を変えます。心臓はメインオフィスで生まれているので、私はあざを作ることができません。それまでの間、お互いに議論した場合、ガスルを避けることは困難です。事前に決定されていないことがたくさんあるので、心は簡単に安定して生み出されません。深さは離れないので、実行するとそれが良くなります。ポールオーウンが去るとすぐに、私はそれを握ることができません。月明かりは、砂のある白い砂浜の小川で輝き始めます。','孤独な松の木は厚い山の中に一人で立っており、彫刻は大きな海に浮かんでいます。あなたの運が多くのことを経験するので、あなたはあなたが損傷を受けることに注意する必要があります。注意している場合、作業の決定的な理由は変わりますので、心配しないでください。','私は恐れることを恐れているので、事前に誓うことを避けたいなら、お風呂に行って不公平にしてください。上部と下部は団結しており、それぞれが満たされていません。  あなたが間違った人を作るなら、あなたはそれのために傷つきます。','場所の場所では、部屋に収入がなく、夏に来るようになります。部門側に行くと失敗するので、何もしないことは禁じられています。あなたが一生懸命働きようとしたとしても、あなたは一生懸命働かなければなりません。','ミツバチははるかに高く、桃の花は赤いので、私はメインブリッジのエネルギーに出会いました。体と心には平和があるので、家の斜面があるので、これよりも良いものはありますか？富は外にあるので、あなたが降りてそれを手に入れようとするなら、あなたはそれを手に入れます。','深さは壊れず、水は最後まで続いているので、心を決めることはできません。  向きを変えないでください。些細なことで議論すると、それはガスルにつながります。男性には注意してください。しかし、銀は敵に変わります。','あなたがあなたを助けるのでどうやって現れませんか？歌が飛んでいて、馬に劣らない場合、なぜ爆発するのですか？ shinsuはこの運のみを持っていますか？耐える以外に選択肢はありません。','月はとても悲しいので、鳥は険しい山で泣いています。東に行かないでください。損失があり、新しい仕事を求めるのは楽しいことではありません。私は富を得ましたが、私は半分を得て半分を失います。事前に準備してください。','努力は難しいほど難しくありませんが、どうやってそれをしますか？器用さが得られない場合、あなたは間違いなくあなたの配偶者を失うか戦うでしょう。あなたが器用さをしている場合、あなたの体はあなたの体に侵入するので、明日の健康に注意してください。','仕事が意図したとおりであることは容易ではないので、私の心が悩まされているとは信じられません。歌は一晩の光のタイプで飛んだ、そして私は空だった。  家族は不安で危険なので、祈り、祈るのは良いことです。','努力をspareしみ、激しく挑戦しないでください。近い将来、大きな富を得ることができます。しばらく壊れてお互いに走ることなく、忙しいことをどうやってやるのですか？太い山が落ちるので、未来は良いでしょう。','雲は散らばっており、月は月の側面から突き出ているので、景色は美しく、新しいです。これは、このプールが出会って再び成長するのと同じです。あなたがそれを実行すると、それは利益を得て、何かが良いでしょう。','日付をよくキャプチャして挑戦すると、わずかな富を得ることができます。あなたが受精の近くにいるなら、あなたは歌を恐れているので、あなたの口に注意してください。この王はキム・スークとリー・スークによって与えられます。','2025-03-02 11:57:15.368032+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (479,'039','私はまだ若いですが、忙しくて忙しいです。家族の財産は長くなるので、子孫は栄光で貴重になります。綿は流れて現れ、その力はどこにでも示されており、多くの権利があります。ダンビが間に合うように、それは白い歌のようなものです。それがスピーチではない場合、ダウーンは後で会うのを待っています。シンスが良くて繁栄しているとは知らないので、力は無限です。春が空と地球を覆うように、子孫は拡大して発達します。富と祝福は壊れることなく続くので、あなたは自分自身を得ることができるでしょう。それぞれに所有者がいるので、お互いをうまく維持しないように注意してください。','どこに行っても長さがありますので、この機会をキャプチャすれば、あなたは大いに達成できるでしょう。さらに、最終的に取得されます。あらゆる種類の富と家族で何をしたいですか？','別の例にならない場合は、変更します。あなたが貴族に会って助けを得るなら、あなたは確実に大きな富を得るでしょう。ラッキーは確かに大いに栄えます。','家には斜面があるので、誰かが家族を歓迎したり増やしたりする喜びがあります。ギルソングは家にいるので、家族は家族に満たされます。また、山のように蓄積する喜びを見るでしょう。','私はあなたがあなたが来てあなたを助けてくれるのを手伝ってくれます。希望は遺言に従って行われるので、1つのことは損傷しません。あなたは富を得ることができませんが、あなたは自然に得られます。','長いものやずさんなものがない場合は、祝福を着ることができます。私はそれが好きですが、私は富を得るでしょうが、私はもっと出かけます。無制限の数で枯渇している場合は、慎重かもしれないので注意してください。','あなたがそれを持ち上げれば、あなたはめまいになり、あなたはそれを感じることができません。最初は難しいでしょう、そしてそれは次のものに変わるので、私は大きな富を得ると思います。春のそよ風で雨が降っているので、すべての植生で春の出会いと同じです。','あなたが間違った人を作るなら、それは不利なので、誰とでも働かないでください。西に来る貴族は偶然私を助けますが、仕事をうまく終わらなければなりません。今月の幸運は道路の半分の混合物です。したがって、注意深く、伯爵から逃げるでしょう。','干ばつは干ばつの空に落ち始めたので、すべての乾燥した木が芽を出します。月は春の日に吐き出されたので、あなたは確かに自分自身を成長させるでしょう。口論しないでください。欲望が続く可能性があり、沈黙している心が損傷している可能性があります。','富がドアの上にある場合、それが動くと富が得られます。すぐに正しいと思います。富は浸水していますが、体はとても自由であるため、最初は良くても後で醜くなります。あなたが間違った人を作るならば、それは有害であるので、人々に対処するように注意してください。','それは富を持っているので、一人一人が見上げるでしょう。豊かで貴重さは朝の部屋ではありません。 coに行くと、探偵は友好的になるので、常に個性を修復する必要があります。とにかく他の人と一緒に失敗することに注意してください。','すべてのものは繁栄し、スムーズになります。後でない場合は、斜面が必要です。私たちが常に従うように、心と体は常に平和になります。','他に何を手に入れたいですか？著者の運は、噴水を維持することよりも良いことです。最初の月の幸運は幸運なことに、名前がどこにでもあるので、この機会を維持する必要があります。','2025-03-02 11:57:17.878823+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (480,'040','乾いたドラゴンはついに水を得るので、運は無限であり、問題なく尊敬されます。ただし、どの場所にも飛び込まないでください。山道や炎を歩かなければならないことを忘れないでください。たくさんのアイデアがあるので、誰が次々と内なる心を知るでしょうか？しかし、最初は難しいので、あなたは後ろで繁栄するので、たとえあなたが増えても富を得るでしょう。喜びと不安は上半分なので、ギルも上半分です。笑いと泣き声は人生です。時折統治と統合があるので、これは醜いでしょう。 grみや他のグループのgrみをどうやって我慢しますか？道路は山道なので、誰があなたに道を教えてくれますか、誰があなたと一緒に近づくことができますか？','希望がまだ解決されていないという疑いは何ですか。山道に乗る道はどれほど厳しく、困難です。私が若いときに再び多くを失うので、できません。でも道路を終えるべきではありませんか？','私は歩き回って空を見るので、最後の方法で豊かになります。後でない場合は、祝福を着用します。富は道にいるので、あなたはそれを手に入れることができます。あなたがそれを見たら、遠慮なく行ってそれを手に入れてください。','私はチョンリ・タ・ファンで孤独で孤独だったので、杖になりたいです。しかし、他の誰かを信じないでください。それどころか、あなたは幸せな夢を見るでしょう。東と西を閉じないでください。損失は損失から始まり、終わりに注意してください。','月は黒い雲に入り、東、西、南を区別することが困難になりました。あなたが個人的でない場合は、注意してください。あなたの健康に注意して、あなたの家をよく見てください。人々が私の仕事に嫉妬するので、怪我をしないように注意してください。','西と北の両側はugいなければならないので、作業を終えるときは注意してください。東と西の部屋は良いので、仕事を始めて最後を見る必要があります。水の肉は海から出ているので、尾はヤンヤンで楽しいものになります。','私が山に行って道を拭いたとき、私の人生はこのように見えました。南東部の部屋は長いので、始めて捨てるときに拍車をかける必要があります。しかし、あなたの後継者に注意してください。怖いのはドアの外で垣間見ることです。慎重に避けることができます。','他の人と一緒に仕事をすると、失敗します。仕事には多くの摩擦があるので、モリーを離れたり、素晴らしい計画を立てるのは不利です。元の富がなければ、あなたは体の周りにいます、そしてあなたはそれを知る必要があります。','悪い結果の結果として人々はお金を失うことに注意してください。それにもかかわらず、利益は人間関係も人間関係であることを知る必要があります。あなたが他の人に助けられれば、あなたは異なる賞品を得ることができるでしょう。','外に出ないで、外で仕事をしようとしないでください。損害があり、利益はありません。喜びと不安が混ざり合っているので、お尻は長く醜いです。あなたはうまく働かなければなりません。イルシンは悪名が高く、心臓に非常に悩まされていますが、外で表現せず、他の人と一緒に働いていません。','秋の春に、私は私の家のことを考えて、それについて考えます。噴水を維持せずにそうする場合は、噴水を平和ではなく維持すると、この数を避けることができます。東に来るゲストは必然的に邪悪な人々なので、一緒に働かないでください。','太陽はソーサンにあるので、道に戻る方法が明らかになります。あなたは急いでいる必要があります。失明を達成するのは簡単ではないので、噴水を維持するのに最適な目的地になります。それが水でない場合、建設は壊れないので、噴水を維持する必要があります。','あなたが富を得ようとするなら、あなたはそれを得ることができます。著者の運は非常に忙しいので、利益を得ることは困難ですので、あなたは誓約され、満足する必要があります。家に苦情があり、手書きでなければならないので、私はそれを祈りとして避けなければなりません。','2025-03-02 11:57:20.396773+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (481,'041','それは遠い海、適切な嵐の上の船です。どんなに難しいかに関係なく、富は外国の防衛にあるので、外出すると確実に入ってくるでしょう。体は道路の真ん中にあるので、一度出る新しい水です。あなたが家で心配していないなら、とにかく吸盤を持っているかもしれません。私は遠い遠い硫黄でプレーしているので、利益を得ても大きな収入にはなりません。著者の運は受精に近づくべきではありません。秋の雨の春の風は咲きませんが、花だけが馬です。私は市場から出てそれをしたいので、頭よりも尾を見ることができません。 1人が犯罪者と農業を粉砕するので、10人がそれを共有します。','あなたが親の兄弟の苦難に苦しんでいないなら、あなたは慎重かもしれません。たとえあなたがそれをしたいとしても、最初は長く、背中は醜いです。私は行くところに家を出ます。私は利益が他の硫黄にあることを知っていたので、困難を抱えて行くことをお勧めします。','ギルは矛盾しているので、一度私は幸せで、一度悲しくなります。私は体の中にいるのですでに農業をしています、そして、百のものの使用は何ですか？私は自分がしたことをすることができません。あなたの家を達成して維持する仕事に専念することをお勧めします。','運がありますが、私は被害を受け、損傷を受けることができるのではないかと心配しています。今月の運は醜く、犯罪者は長いです。あなたが損害に苦しんでいない場合、あなたはあなたの仕事を変えて損失を見るでしょう。','私は自分の手を心配していて、東と西をさまよっています。肥料に近づくと、最終的に廃棄物の数が得られます。今月の運はガスルに注意しなければなりません。 Gusulsuで受精を受けた場合、あなたは統治に呼ばれます。','あなたが大人なら、それは長くなり、あなたが子供なら、それは醜いでしょう。幸いなことに、私は長い運に出会うので、すべてを達成します。これ以上に幸せなものはありますか？','あなたが家にいるなら、それは不利であり、あなたがそれを走らせるならば、あなたがしたことではなく、新しいことを試すのは長い時間です。 5月と6月には、利益は他の場所または他の場所にあります。山も主要な水ですが、体は他の硫黄で遊んでいますが、利益はそこにあるので注意してください。','初めては長く、ugいのにいているので、ハードワークの後、あなたはボールを手に入れます。すべてに注意すると、長さになります。心と体を決定するのは難しく、心は面倒で無制限になります。','新しいものを宣伝する場合、それは不利なので、別の経験を急いではいけません。今月の運は、オフィスを維持して現象を維持するのに最適です。物事を取り除くのは簡単です。そのため、噴水の外で物事を切望している場合は、苦労するでしょう。他の経験を体験しようとしないでください。','魚とドラゴンが形成されているので、私は活気が恋しいです。体は体に精通している可能性があるため、事前に避けるように注意してください。今月の運は小さな富によって得ることができますが、大きなことを宣伝すると新しいものになります。','川を渡りたいのですが、ボートはありません。言う人を信じないでください。名前がありますが、現実はありません。今月の運は行くつもりですが、私は行くことができないので、私はしばらく滞在する次の機会を待ちます。','sinsuは不利なので、ヒットに注意してください。他の富を切望している場合、利益はなく、有害になります。これは、この富を維持するための最良の方法であり、ドアを閉めることで外側を切望しないでください。','私は自分の力で仕事を救いますが、頭はありますが、尾はありません。あなたは他の人と仕事をしようとしているので急いではいけませんが、それを作ることは困難です。些細なものに分けられたり、グスルで枯渇したりするのは簡単です。ソロに注意してください。','2025-03-02 11:57:22.542682+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (482,'042','100人の人々が一緒に農場であるため、海は理解しています。 7歳の干ばつであった土地よりも幸せなことはありますか？あなたが長い寿命を持っているなら、あなたは共鳴することができるでしょう。小さな金持ちがいるか内部がいるので、あまりにもあまりないように注意してください。人々がいるので、それは大いに役立つので、利益が入ります。平和を得るのは難しいとしても、予期せぬ富を引き起こす可能性があります。富が発生するドリは、説明と文書として作られています。海でのドラゴンの意志をあえて見てもらえますか？春が今月戻ってきたので、すべてのものが最終的に再生されます。それは海の残りの残りのような休息のようになければなりません。','古代から付き合ってきた親しい人、利益はどこにありますか。さらに、私たちはあなたを助けたり、そのような人を見せたりするので、予期せぬ富を得るでしょう。春のそよ風は暖かく吹きます、すべてのものはどのように再び再生されますか？ついに来ました。','幸運なことは良いことですが、損失も彼に続きますので、注意してください。 Myeongwolには長い道のりがあるので、他の人に賞賛されていますが、富を引き起こしません。とにかく、あなたはそれを心配しているかもしれないので、あなたは利益を得たいときに新しい建設を構築する必要があります。','自分がしていることをやり続けると、何か他のことをしようとすると不利です。今月の運はガスルに注意しなければなりません。春には、ギルは矛盾しているため、必ずしもそうではありません。ただし、意味が簡単に解決されるため、簡単に進めることができます。','春に桃とエンバクの木が会うとき、それらは強力であり、逆境を促進することを推測します。そうでない場合、それは自分自身によって引き起こされる斜面です。今月の運は傾斜している必要があるので、事前にもっと楽しくする必要があります。','外に富を見つけたり、他の人を切望したりしないでください。建設は分割されます。 5月と6月には、それを手に入れようとする必要がありますが、とにかくそれを失うはずです。二人の心は同じではなく、お互いに立ち向かうので、それを達成することは非常に困難です。','sinsuは平らで長いですが、運は完全ではないので、富に注意してください。あなたが噴水を切望しているなら、あなたは息子のジェを待っているので、それを最初に保つことを考えてください。あなたがチャンスがないか、そのような機会があれば、私は施肥することを恐れています。','幸いなことに、あなたは高貴な人に会い、予期しない数があります。 7月と8月には、おなかがすいたご飯を食べているので、私は彼の相続人を避けます。雲の外に斜面があるので、困難に耐えれば幸運に会います。','私は春の庭の芽に忙しく、喜びは忠実です。私は遠い場所から良い手紙を持っているので、法律を推測しなければなりません。何人かの人がお互いを助けてくれるので、運が命を吹き込みます。良い法律と幸運がありますが、もっと願っています。','Gilseongは名前に固執しており、名前はどこにでも表示されます。今月の幸運は、秋の菊が一晩開花したので、それは満たされることです。作家では、多くの予期せぬことが支援するために作成されています。','秋の夜に孤独だったガチョウは、チャンキョンが飛ぶ。両親の心配がなければ、あなたはたくさんの珍しいことをするでしょう。今月の運が多くのことをしてたくさん出て行くので、どうしてシンズは強くなることができますか？','私は小さなものを手に入れようとしましたが、とにかく大きなものを手に入れたので、すべてがうまくいきました。世帯はたくさんの平和で楽しいものになります。私は幸せですが、どうして私は平和を感じることができませんか？これをしようとするのは幸運です。','人を作ることを怠ると、あなたが持っている人によって成功するでしょう。特定の土地に滞在している場合、利益のみをしたいだけであることも不利です。ただし、噴水から物事を切望している場合は、大いに失敗する可能性があります。たとえそれが不利であっても、私はそれを保つことができません。','2025-03-02 11:57:24.642627+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (483,'043','著作の数は終わりました。まず第一に、それは難しく、背中に長いので、著者の運を通り抜けるべきではありません。喜びができたら、悲しい涙を振りかけたら、施設に注意してください。ヨマエは1か所で決定しない運であるため、答えるのが難しい大変な仕事があります。しかし、私は自分が得るものを手に入れることができて幸運だったので、試してみるときにやります。後でそれをしなければ、あなたの祝福は災害に変わりますので、兄弟がいます。さらに、私は毎年myhersに注意する必要があり、魚のターメリックでボートに乗っているので、醜いものがたくさんあります。しかし、年末には災害が消え、予想される富が蓄積されました。','芽は春に霜が降りられたため、成長することは困難です。あなたが家に年をとっているなら、あなたは外に出るか、新しいものを作ろうとすることができます。実行は不利なので、古いものを維持し、注意してください。','ネットワークはありません。フッサイは恐れています。他の人の言葉を簡単に信じて従うなら、あなたは害を受けます。二人は異なりますが、どうやってそれをしますか？注意して注意してください。','火を避けるのは難しいので、あなたはあなたの家族の仕事とあなた自身の世話をしなければなりません。新しい隆起とお互いに合わないので、悲しいことが起こり、涙が吹き付けられます。お互いに対処しない場合は、失敗が発生するため、他の人との失敗に注意してください。','心の中で言うべき貧弱さがあり、毎日たくさんのことがあります。 ugさと長さがたくさんあるので、この運はどうですか？あなたの花は最も長い理由ですので、あなたが理性に恋をしているなら、あなたは凍りつくでしょう。','安定している場合は、家を出て仕事をするのは長い時間です。幸運があるので、良い機会をお見逃しなく。したがって、ギルは半分と半分です。','障害でない場合、ガスールを避けることは困難です。受精に近づかないでください。進歩は不利です。南東部の部屋で開始して働くことが新しい場合を除き、後悔することは困難です。東と南に行くものがある場合は注意してください。','ヒットに注意してください。秋の雨の春の風は、まるで青い葉がより賞賛されているかのように逆になり始めます。幸いなことに、古いネクタイに会った場合、あなたの利益は私の家に来て助けます。','あなたが家を出てモリーを走らせると、怒りはそれほど多くありません、そしてあなたがあなたがしたことをやめて新しいことをしようとするなら、それは不利です。あなたが西と北に走るなら、それは不利なので、新しい仕事を求めたいときは特に注意してください。 Shin -Sooが不利な場合、私は注意してすべてを待ちます。','9月と10月には、後悔することができます。最後に、喜びの扉が開きます。しかし、他の管理をしようとしないでください。富はそれ自体で浸水するので、風はすでに風にさらされています。','上部と下部は不均一なので、ギルは上半分です。あなたは心を1か所に置くことなくさまようので、それは簡単に失敗します。作家の輸送は、彼が動くときは不利なので、彼は彼らの家を守ってきた人々のグループです。上下を一緒に組み合わせてみてください。','財産と公共の力はそれ自体によって変動します。あなたがそれを生成しないなら、あなたは祝福を着ることができます。牛や木は不利なので、注意してください。しかし、財産と政府は荷物を無視して運を受け入れるべきではありません。','あなたが東に行く場合、それは不利であり、あなたがそれを所定の位置に保持するならば、あなたは新しいものを切望せずに古いものを維持する必要があります。あなたが人々が得意でない場合は注意してください。しかし、それは人々を作ることから来るので、どのようにして人々のデートを無視することができますか？','2025-03-02 11:57:26.742862+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (484,'044','まだ農村地域を楽しむために結婚していない処女として成熟した成熟したものを持つことは不公平です。上下は彼らがいるので、年は小さくありません。時間を破らずにこれを行うと、不利な点を打ち負かすことができます。このように行動してこのように考えると、それは不利です。必要性はそれ自体で提供されているので、あなたがあなたの心と意志を安定させるならば、それは長くなるでしょう。家には斜面があるので、利益は上がります。まるでそれが恥ずべき鳥であるかのように、それは兄弟と仕事をします。通知を嘆かないでください。これには映画が必要です。あなたがいつも祈り、あなたの祈りに耐えるなら、あなたの祝福は戻ってきます。','風と雨は不均一であるため、100の穀物は簡単ではありません。どうやってこれをしますか？畑に滑らかになった孤独な松の木は、滑らかになった場所を見つけることができないため、困っています。','私は外に微笑んでいますが、私は中に眉をひそめているので、私は頭を持っていて尾がありません。他の人の言葉を信じるなら、あなたは幸せに感じるでしょう。家は平坦ではなく、災害は遮断されていません。','ラッキーは好ましくないので、あなたは確かに実生活にいるでしょう。事前に知る必要があります。酔っぱらいから切望するものは何もないことに注意してください。そして、多くの負けがあることに注意してください。希望はないことに注意してください。','小さなドラゴンは空に登る力がありませんでしたが、力が進むにつれて、害は雲に入り、東と西を区別することが困難になります。受精に近づき、グスルスーに一掃された場合、心から抜け出すことは困難です。','器用さがあるので、人々を間違えたり、新しいものを手に入れたりしてはいけません。水に戻るのはどれほど難しいか。あなたが家にいる場合、あなたは醜く、あなたが地面を動かすなら、あなたは前進するしかありません。','家族は平和だったので、富がやって来て、ついにしばらく休んだ。後の数があるので、あなたは黒であることの喜びを楽しむでしょう。そうでない場合、Gusul -Sooは友好的になるので、貪欲でそれらを保存しようとしないでください。','あなたが動かない場合、あなたはあなたのビジネスを変えます。それがそのような状況でなければ、環境を変更する方が良いです。私は家族のことを心配しているので、著者はそれほど簡単に解決されません。他の人と敵の関係がある場合は、それを残します。','器用さに会わなければ、物事を失うので、それが得意でなければなりません。月が雲の中で光を失うと、中世が困難になるか、あなたがそれを心配するでしょう。','ギルソングはドアにいるので、新しい貴族であなたを助けることができます。 2つのフローが議論しているため、渋谷を知ることは非常に困難です。現時点では、家に意見の相違があったので、どのように友好的ですか？あなたの健康に注意してください。','脈動の力の1つは光から離れているので、それがどれだけ消えていても、逆境を駆り立てるためにそれを失います。あなたがそれを祝福しなければ、あなたは有害になります。あなたが彼らと良い関係を築くなら、それは彼らの助けを借りて方法になるので、意味を忘れてください。','私が古いものを放棄して新しいものを見つけると、春はついに高いフィールドに戻ります。私は記事をBrazierに入れたので、私は大きなものを作ると思います。しかし、たとえあなたが飛んでいたとしても、まだ翼はありませんので、急いで噴水を保ち、時間を待ってください。','春は麺を引きずり、卵を吐き出したので、きっと青い夢を持っています。ゲートは開いているので、利益は土地を保護し、育てることです。富はどこにでも蓄積されているため、これらすべてがメリットを蓄積しているため、平和的にアプローチされます。','2025-03-02 11:57:28.858059+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (485,'045','雲が空に上がると、雲が揺れ、雨が降ります。あなたは土地から先に進み、ついに縁起の良い仕事に会います。春の運は良いことなので、その機会を利用する必要があります。ただし、水の中で水に浮かぶ場合は、空のように見えますが、内部には良いものがあります。不安はこの首に従います。それが同じでない場合、私はそれを後悔します。春のそよ風は目を隠して出てこないようなものであるため、急いで急いでいません。急いで急いで急いで急いでいるのはまだ難しいです。発疹の木がない場合は、終わりが得られます。','金の下に果物を建てて、樽を設置し、風と同じようにすることを嬉しく思います。あなたが銀の人に変身しているなら、あなたは自分自身を告白しません。名前はどこにでも飛ぶ。','王と召使は互いに繁栄し、賞はすべてのものの平和を授与されます。あなたが結婚しなければ、あなたは必ず子供を持っているか、あなたの恋人に会うでしょう。それが結果でなければ、私はそれを後悔します。','富は素晴らしいので、私は富を得るでしょう。これが表示されている場合は、行ってください。富と力があるので、力はあちこちにそう遠くありません。あなたが人々のために間違っているなら、あなたはお金を失うでしょう。','南は長いですが、富は北にあります。あなたが性的魅力を持っているなら、それはあなたが終わってから長くなるでしょう。今月の幸運は外側では空のようですが、それはいっぱいで豊かになります。あなたが人々が得意でないなら、あなたはそれを聞くことができません。','富がドアに入ると、あなたはあなたの手で天の金に触れる運に出会うでしょう。それは100日ごとにうまく解決されます。後悔していない場合、結果はこの首に従います。','Kwan -inは左に役立つので、米の測定値を考えます。車で驚くべきことです。ハウスキーピングは増加し、活発であるため、斜面があります。他の人と遊ぶことは確かに成功し、良いことがあります。','7月に風が吹く頃には、発疹の木を使用することは幸運です。ティティマップの成功は喜びに満ちており、空はあふれています。小さな持ち上げがあるかもしれませんが、最終的に繁栄するので、心配することは何もありません。','富と権利は一緒になっているので、春のそよ風はどこにでも吹いています。高い詩は海に投げ込まれているので、ついに大きな肉を手に入れます。イライラする必要はありません。他に何をしたいですか？','月は大きな空に空腹だったので、景色は車の中で美しくなるしかありません。キャリーオーバーは東と北にあるので、仕事を始めるときは注意してください。あなたの願いを満たし、富を得るので、あなたは願いとして救われます。','私がマンギオンチャンで船に会ってから困難は過ぎました。ギルソングはドアにいるので、斜面がある必要があります。価格を稼ぎます。あなたは豊かになりますが、あなたはあなたの首に少量のお金を持っているので、事前に注意してください。','ドラゴンには明確なヨンジュがあるので、調和は無限です。 Kwan -inに会うと、良い価格を得ることができます。富が蓄積され実現されているので、他に何をしたいですか？','春には、月は空気に満ちているので、輝きは5回明るく見えます。他の人と関係するのは豊かなことなので、一人で仕事をしたいなら、それを一人で扱うのは正しいことです。他の人と議論しないでください。受精がある場合、それに従います。','2025-03-02 11:57:31.609633+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (486,'046','耳は、高いピークの中の恋人の腕のようなものです。弱いラタンが両国に広がっています。二人は心を持っているので、私はついに富を得るでしょう。両国のラタンは体のようなものです。私たちはTigadeとShineに共鳴します。しかし、あなたが間違った人を作るなら、あなたはお金を失うので、あなたはそれらをうまく扱うべきです。家族は平和になり、あなたは快適で快適な心で富を得ることができます。親しい人が害を及ぼす可能性があることに注意してください。すべてがバンドと同じなので、私は自分自身に来ます。地面の木で良い歌を歌う良いニュースはどうしてですか？','要件が変わるにつれて、世界は世界が平和であることを認識します。あなたが家にいるなら、あなたは長くなり、外から出ることができません。私は川の周りの川を渡ろうとしていますが、風が再び始まっています。それは正直になければなりません。','二人の心は同じではないので、彼らがしていることを達成するのは難しいです。器用さがあるので、人々に注意して新しい人を作ってください。太陽がソーサンに降るので、道路はとても忙しくて焦ります。','受精しないでください。吸盤の水があれば避けるのは難しいでしょう。ラッキーはフラットで長いですが、あなたの子孫が親relativeになるのではないかと心配しています。春には、やりたいことはあまり成功しません。','春の庭の赤いコピーの花は弓のように春の色を持っているので、恋人に会うのは恋人です。あなたが家にいるなら、斜面があるので、あなたは子供を産んだり、家族を増やしたりする喜びがあります。富はどこにでもあるので、そこに行って行くとうまく手に入れることができます。','太陽はソーサンに落ち、見知らぬ人は失われ、投げられました。すべてのことに注意し、あなたの関係をスムーズに保ちます。キャリーオーバーは北にあります。','それは水に戻るボートのような困難で困難な国です。あなたが前進するなら、あなたは多くの心を持っています、そしてあなたが後退するなら、あなたは力を持っていません。あなたの両親が心をあまり持っていないなら、注意してください。','Titiマップの共鳴を取得し、名前を取得します。快適で富に満ちていることには長い道のりがありますので、他の人の話を聞かないことを知る必要があります。 Gusul -SOOは分割されているので、私は動揺します。','二人の心は同じなので、スムーズに作業して持ち越しを見ることができます。そうでない場合は、刺身を持っていることや恋人に会う喜びがあるに違いありません。あなたが入って出て行くつもりなら、あなたが笑うならあなたは持ち越します。笑ってそれを見てください。','すぐに心を拡大すると、あなたは団結してその真ん中に運ばれます。両側は調和して一緒になっているので、斜面があります。あなたが百のことをするとき、あなたは快適で楽しむでしょう。','急いではいけません。最後に、あなたが得る富を急いでいるなら、あなたは強さのみを使用します。','後悔があるので、良い機会をお見逃しなく。多くの機会はありません。あなたが間違った人を作るなら、あなたは器用さを持っていますが、あなたが良い関係を作るなら、あなたはセックスを得るでしょう。首は活発で、富は活発であるため、すべてがスムーズにリリースされます。','富は快適なので、心と体は快適です。雨と春のそよ風は100か所のようなものです。家は快適なので、富は活発になります。これはすべて意味の意味の意味であるため、それを維持する必要があります。','2025-03-02 11:57:33.660651+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (487,'047','秘書はすでに死んでいますが、どのようにして背中を追いましたか？極端な運が欠陥がなければならないので、黒人 - 日本を選択しないように注意してください。太陽が西に行き、山で暗くなり始めるので、それは不利です。春の輸送はそれほど収入ではないので、最初から急いで行くのは危険です。運は不利なので、他の人を見ます。しかし、天使の一人がいるので、もう一度希望を見てみましょう。怒って、面倒な世界に腹を立てないでください。あなたは大きな失望や恥ずかしい立場にいるかもしれません。','家族はトリガーされるので、家を設置したり、笑顔をとったりすることをお勧めします。努力はありますが、その努力の価格と同じくらい成功することは困難です。太陽はソーサンにありますが、孤独はどうですか？注意する必要があります。','意味を構築しないと、首に不足しています。良い人を作らないように注意してください。心臓は産卵と怠dolを維持し続けるので、心臓で慎重に処理する必要があります。','外部の人々に注意する必要があるため、注意すべきことがあります。安定させます。他の人と遊ぶことは失敗しなければならないので、約束しないでください。短い日の栄光が世界史に反映されているとき、あなたは夢のようなものを考えるべきではありません。','双方は不利であるため、彼らがしていることを達成することは困難です。ハーモニーが最も重要です。両方の南西を始めるべきではありません。あまりにも多くの仕事を稼いだり、急いでいる場合は、何も良いことはありませんので、心からそして冷静に行かなければなりません。','実数があるので、道徳に注意してください。あなたの心が安定していない場合、この数を避けることは困難です。試してみなければ、どのようにして外を見ることができますか？あなたがハードワークをspareしまなければ、あなたは家に傾いて、あなたはあなたの配偶者にいるでしょう。','後悔できない場合は、喜びに斜面があります。 mok -dong and dongを控えてください。あなたの子孫が親relativeになるように注意してください。キャリーオーバーは東と西にあるため、仕事を始めるのが得意です。','理論を恐れないでください。それはショートカットとして繰り越されるので、家は快適になります。停止して安定しています。あなたが笑うなら、あなたは利益を得ることができません。外側が豊かであると思われたとしても、それはただ繁栄しています。','私は鳥に負傷したので、戻るのは難しくありません。座れませんか？火の神は浮いているので、火によって損傷を受けないように注意してください。他の人の仕事には災害が発生するので、役に立たないことに飛びつきないでください。','急いで急いで行くと、過酷さが得られ、持ち越すことができます。あなたが間違った人を作るなら、あなたは最初に長くなりますが、あなたはその後醜くなります。あなたが彼らと仕事をしているなら、あなたは違いはありません。','最後に、雲と月が現れたので、天と地は明るく美しくなります。それが結果の喜びでなければ、私たちは子供を産むか、家族を増やします。他の人の言葉を聞いた場合、恵みは変わり、敵になりますので、だまされないように注意してください。','決定するものは何もないので、戻ることは困難です。心が安定していない場合、すべてが邪魔されます。ラッキーは非常に異なっており、すべてをするのは難しいでしょう。急いではいけません。また、手書きの手があるので、北に行かないでください。しかし、それは何もせずに器用さの原因です。','噴水のキャリーオーバーを切望しないでください。祝福は、空がどのように落ちるかです。仕事には頭がないので、頭があり、尾はありません。実数があるので、道徳に注意してください。快適な心とリラックスして仕事をすることは成功の秘密です。','2025-03-02 11:57:37.027714+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (488,'048','王と彼の召使は平和な場所にどこにいますか？元々飼育されていた病気を後悔するのは運です。体と心は互いに快適であるため、銃器が腎臓とオーバーフローに現れます。日本人は慰められ、しっかりしており、当局者は東と西の部屋で私を助けてくれます。','ギルソンはドアにいます、そして、祝福と恵みは自分自身に従います。家の斜面はおそらく快適になる喜びであり、誰もが家族を持っているようです。すべてが長いので、世界は平和で楽しいです。これ以上は何が欲しいですか？','賃金は明るく、召使は平和であるため、王の恵みは人々にあります。 Titiマップの共鳴を取得することで成功し、名前はどこでも震えます。富と権利があるので、人々は愛らしいと尊敬されます。','太陽と月は明るく明るいので、喜びを改善します。忠誠心に焦点を当てると、物事はうまく解決され、日が発展し、富が雲のように蓄積されます。富は外にあるので、富を得るために目を後ろに向ける必要があります。あなたがそれを見たら、今すぐ入手してください。','たくさんの良いことがあるので、あなたがあなたの富を切望して外に救おうとするなら、私はそれをします。雲が散らばっているので、月が現れたので、美しい景色が新しく反映されていますが、幸運なことは良いことですが、吸盤があるので、対人関係を無視すべきではありません。','春はビーズのような明るい露ですので、100頭の毛で口論します。あなたがそれを後悔しないなら、あなたは確かに傾くでしょう。段階の時点で準備されるのは正しいことであり、力は首に続くので、時代の安らぎの中で繁栄します。','富は外国の側に反映されているため、富を走らせる方が良いです。気をつけて。のどが渇いたドラゴンは水を得るので、調和は無限になります。わずかな作業がなくても、結果に従います。','富は空腹なので、喜びは家でいっぱいです。富と喜びがあるので、あなたはさらに何が欲しいですか？富と果物は場所でいっぱいなので、誰もが尊敬されます。名前がいたるところに震えているので、どうしてそんなに尊敬されるのでしょうか？','家族が他の人の助けを借りて興奮し、発展するのは幸運です。あなたが職員に会った場合、あなたはあなたの力を向上させることができます。肉と精神は水に水をまくので、それらは逆転し、すべての空に活動します。','役人はマンバンにいるので、私は忙しくて活気のある手続きで会います。どうして偶然王を助けることに成功しませんか？役人は確かに現れて助けてくれるので、その日に働き始めて大きな利益を上げてください。','ダンビが倒れると、豊富な果物があります。 sinsuは非常に強いので、富は活発になります。富は山のように蓄積されているので、あなたは生きることを心配することはありません。ただし、このメリットも通常の価格であるため、心の態度を維持する必要があります。','ラッキーは家で活発であるので、斜面がなければなりません。それは富に満ちており、あなたは一度良い薬を手に入れるでしょう。ただし、間違った人を作ると不吉になるので、取引と関係のケアに注意してください。','家の斜面は家族を増やすことです。小さな木はバンドで構成されているので、嬉しい光は顔でいっぱいです。 shinsuはこんな感じなので、他に何が欲しいですか？ただし、快適で滑らかな場合は、無視でき、不快になりやすくなります。','2025-03-02 11:57:39.340911+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (489,'049','それは多くの人々を支配し、名前と名声になります。財産と衣類が豊富に快適になり、楽しまれます。名前はすべて長いので、名前はさらに輝きます。利益はもう一方になるので、外出するとそれを手に入れます。','太陽と木が春の季節に会ったので、花と木は青々としており、家のペアのペアはお互いを理解することから来ます。家族は日々激しくなるので、誰もが和解しています。','小さなドラゴンが空に近づいているので、ついに達成され、大きな雨です。それが結果でない場合は、注意してください、それは怒りになります。共鳴すると、あなたの名前は社会に踏みにじられます。','それは富を収集または収集するか、散らばるので、いつ収集するかを維持する必要があります。他の人の言葉を聞くことができない場合、喜びと運は半分と半分になります。あなたの主張をうまく保ちます。富が首に続いているので、ティティマップを後悔することは幸運です。','心と体は平和であるため、名前は高く、非常に意味があるので、私たちは人々に恵みを与えます。あなたがそれを後悔しないなら、あなたは共鳴するので、両方とも幸運です。それは時代に傾斜し、良い時期になります。','それは西洋人に仕事の内容について話すべきではないので、仕事を終えるために密かにしてください。一人は正直で長いので、誠実に外出しなければなりません。すべての側面を走らないでください。そうすれば、実行しないでください。急いではいけません。','暖かい春の日にすべてのものが復活するかのように、喜びはあふれています。それはすべて熱くて暑いものなので、成功するためのガイドではありません。東に太陽があるので、そこにたどらないでください。あなたがその方向に作業を開始するので、しばらくそれを止めてください。','たくさんの仕事があるので忙しいです。私たちはこのドアを保管しているので、私たちは利益を得るために他の場所に行かなければなりません。ただし、忙しくて忙しい場合は、あまり失速しません。どこにでも富があるので、あなたは幸せで快適になります。良いことです。','世帯の中心は結果のようなものなので、私たちはすべての願いを満たして喜んでいます。明るい夜に美しい人に会います。家族が成長し、領土が増加するにつれて、家族は日々繁栄します。人のせいで良いことがあります。','両側は互いに組み合わされていたので、すべてのものが復活し、ペアになりました。プロパティとパワーは首に依存しているため、喜びは顔に広がっているので、隠すことはできません。どこにでも長さがあるので、この場所を移動したいと思います。仕事を終えるのは適切な運です。','道路の真ん中に、良いことがあります。役人は左に来るので、あなたは大きな富を得ることができます。あなたは祝福を満たすためだけに人々を扱わなければなりません。それは、Unfanesを集めて山になる方法です。','私はあなたに楽しんで笑うように言ったので、私はいつも口を覆うことはできません。試験に合格しない場合は、線形範囲が必要です。役人は西と南にいる必要があるので、それを宣伝して大胆に仕上げてください。','雲が出て雨が降ると、植生は浸されているので、すべてのものが活気があります。醜い真ん中に長い道のりがあるので、私は邪魔されません。カップルは調和がとれているので、喜びは家でいっぱいになります。これらすべてが意味し、善行をしたからです。','2025-03-02 11:57:41.395718+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (490,'050','木から飛んで、それは貧困の中ではあまり生きていません、そして、死について話すことは困難です。富とボールがないので、それは不注意に不利になります。 yin -yangは調和が取れていないので、達成することはできません。まず、調和について考えてください。それ以外の場合は、ますます増えます。予期せず働くべきではありません。あなたは控えて注意する必要があります。今年の運はこの病気に注意しなければならないので、常にあなたの健康を維持してください。朝は友達に会えなかったので、夜に明るい友達に会おうとしましたが、できません。それは3回落ちて3回すべてを失う運です。道路の脇にある花と竹の所有者は誰ですか？あなたの現在の場所に誠実かつ忠実に固執することをお勧めします。','古い木は霜に出会い、秋の菊は目と同じ輸送と同じです。歌は飛んでいて、逆馬がないので、孤独な土地に到達するのは簡単です。さらに、すべての家族は心配しており、滑らかではないため、この病気は懸念しています。あなたの健康を維持してください。','あなたが近くにいるものを失うので、醜いではありません。受精に近づくと、歌があり、続きます。他のことを管理しないでください。それは明確なので、噴水を維持するための最良の方法にすぎません。','Bokbwindは、その前に100個の花を咲かせ、骨を飾ります。富は西にありますので、部屋に行くと手にあります。仕事を終えたら機会を捉えてください。北は不利なので、長さは変化し、醜くなります。あなたはすべてを見てそれをする必要があります。','バーがないので怪我をするのではないかと心配しています。議員は健康です。  心と体に通知された場合、彼らは心に悩まされています。あなたはあなたの心と体をコントロールする必要があります。良い気持ちはありません。最も近い富と利益を得るチャンスです。','仕事には仕事がないので、希望を達成することは困難です。あなたは意味を作り、計画を練習する必要があります。  私は家で心配しているので、私は子孫が心配です。事前に見て、世話をする必要があります。そうでない場合、あなたはそれを後悔するでしょう。','どのようにして植生は7年間家族の後ろに成長することができますか？待っているのはあふれていた。病気は体を盗んでいるので、排他的に注意し、水に注意してください。あなたが人々が得意でないなら、あなたは男性と女性に関係なく害を受けるかもしれません。','他の人の富は誤って私の家に入ります。待っていた。他の人と一緒に仕事をするなら、あなたはそれを作ることができ、それらのいずれかがあります。あなたが事前にあなたに祈るか、不公平を与えるなら、あなたの心と体は快適になります。','水に行かないでください。  病気は再び侵略されるので、遠く離れた人は最高です。事実は体に来るので、あなたの口に注意して、受精の近くではありません。他の場所を出ると、損失があり、利益はありません。','植生は秋に会ったので、私は悲しくなり、一度心配します。私は来なければなりませんでした。  受精に近づくと、通知され、器用されます。 Jung -SukとKim Sookは長くなるので、誠実でなければなりません。','牛を閉じないでください。仕事に失敗があります。牛に近づくと、識別力がぼやけ、心の安定性が会話につながる可能性があり、その年は小さくなりません。他の経営陣だけでなく、他の経営陣も求めないでください。私は器用さを恐れています。','城が体を盗んでいると、体と富が活発になります。  私を助けてくれるデートの人々を慎重に作る必要があります。作業は瞬時ではないので、通常はうまくいくはずです。運はとても強いので、見逃してはいけません。','The Godsの変化には何も現れるものは何もないので、多くの空腹があります。心が生まれた場合、予期せぬ誓いが来るかもしれません。苦しんではいけません。醜いには長い道のりがあります。','2025-03-02 11:59:23.772219+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (491,'051','木から魚を手に入れたいのと同じので、道路がブロックされているため、取得されません。それは笑って、途中で立ち止まって、人を獲得し、別れたようなものです。心がないので、それは雲の雲のようなものです。','前例のない服は正面に浸され、ブロックされています。新年とキャリーオーバーで他の管理をプレイしないでください。ラッキーは長いですが、それは仕事のようですが、その後、目に見える利点に注意する必要があります。','家族はトリガーされているので、動きたくない場合は走らなければなりません。それ以外の場合は、開発できるようになります。春の運は醜いので、あまり切望しないでください。仕事を終えたら、他の人をあまり信じないでください。他の人を追いかけた後に働くことは有害です。','私は転倒を拾うために一度失ったので、胸で収穫することは困難です。壁の壁を閉じないでください。子孫が親relativeになるのではないかと心配しています。あなたが急いでいるとしても、あなたが急いで行きたいなら、あなたはそれを手に入れません。','キジは倒れましたが、漏れを駆り立てませんでしたが、どうやって大きな富を得たいですか？たとえあなたが新しいことをしたとしても、人々は調和することはできません。噴水で優れているため、他の管理をプレイしないでください。すでに新しいものを手に入れたいことを知ってください。','スキニー年はついにダンビに会ったので、光は白くて活気があります。仕事を求めて宣伝すると、意味がうまく行われ、Tigadeマップを後悔します。シンが長く、家が平和であるとき、あなたが働いていなければいつそれをしますか？','最初は醜いとしても、それはその背後に長くなります。今月の運は明確ではないので、あなたはすべてに正直でなければなりません。遠く離れている場合、それは不利であり、あなたが家にいる場合、あなたはそれをすることができません。','器用さがない場合、老人や吸盤があります。事前に災害を防ぐために、あなたが動いていたことやしばらくの間何をしていたかを変えるのはいいことです。幸運ですが、入り口は長く、後ろにいます。','ガンマンがドアにいるので、あなたの子孫に注意してください。私は家族を気の毒に思います。なぜなら、私は去ったり勃発したりする人と別れます。今月の運には多くのugさと長さがほとんどないので、すべてを笑わないことが最善です。','9月と10月には、子供がいるか、人を増やします。富が家にいるので、私は予想外の富を得ることができてうれしいです。 9月の秋の葉が色付けされているので、私はもっと美しいと感じます。','有害なものは東と北の両方にある必要がありますので、開始して開始する前と開始時に注意してください。あなたが走って遠くに行くなら、それは不利であり、あなたが家にいるなら、それは長くなるでしょう。利益は西と南の間であり、私たちは仕事を終えるために熱心でなければなりません。','富は北部で発生し、作業を終えた後に得られるようです。リラックスした体と心と一緒に暮らすことを願っています。ただし、交わりが得意ではないので、人々を傷つけている可能性があるため、対人関係に注意してください。','健康は活発で、富は強いので、家族は平和になります。ただし、他のことを促進することで新しい管理を行うと、喜びが減ります。クワンが現れて彼を助けました。できるだけ早く待ちたいです。','2025-03-02 11:59:25.488682+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (492,'052','家に住んでいるツバメやスズメが狂っていることをどうやって知っていますか？あなたが幸せで、一度快適になったら、あなたはこれをどのようにしますか？毎日多くの妨害と黒い時間に注意してください。','私は壊れた鳥の翼を持っているので、戻るのは非常に難しいです。水と火に驚かされるものがあるので注意してください。元旦と持ち運びには、それは正しくて明るくなりますが、それは明るくて醜いが座っていないので正しいでしょう。','あなたが前例のないが、あなたが認識に惹かれ、他の人を助けるならば、注意してください。春には多くの心があるので、カップルまたは子供です。ぐらつきは難しいので、走ったり、新しいことをしたりしないでください。それは苦悩につながります。','その日を助ける役人は、彼が西と北にいる場所です。作業を終了したり回復したりする利益があります。 3月と4月には、事前に祈るのは良いことです。あなたがあなたのいとこの間に多くの心を持っていて、あなたがウーワンを持っているなら、それは感動するのが難しいでしょう。','甘い言葉を聞くと、小さなNOLに移動するのは簡単です。事前に食べると、怒って祝福されます。心の中で言うべき貧弱さがあるので、私はいつも私の心の外にいます。','あなたがそれを見るならば、慎重に取得してください。それから、たとえあなたがそれを二度と手に入れなくても、あなたは誠実さの価格を受け取るでしょう。東部では、役人は偶然に来るので、新しい仕事を始めたり、仕事の器用さに注意したりすると、あなたは利益を上げるでしょう。あなたが大きな富を得ていなくても、あなたは小さな利益を得るでしょう。','両側が調和し、バーが最終的に満たされるときです。自分の強さを他の人と組み合わせると、バンドを達成できます。忍は長い道のりであり、私は自分自身に幸運です。どうすれば人々と会うことをheすることができますか？私と同じように幸運が役立ちます。','7月と8月には、仕事の回復は非常に恵まれています。結果でない場合、子孫は傾斜します。キジが売って月が花を酔っている朝、体は花に酔っているので、それはどれほど金持ちですか。','他の人と遊ぶのは長いと思われるので注意してください。しかし、それはugいに変わります。噴水は最高なので、大きなものを促進するために有毒な政党に利益はありません。今月の運は注意し、正直でなければなりません。','あなたの名前と管理に頭がありますが、それは尾のようなものであることに注意してください。あなたが別の興味を持っているなら、それはきっと太陽に従うでしょう。困難を乗り越えるのは誰ですか？西と北です。仕事を終えて新しいことを宣伝することについて正直でなければなりません。','やりたいのですが、行けないので、心だけを蓄積します。近づくと、きっと結果になります。利益は西と北にあるので、作業を終了する必要があります。','富は起こりますが、他の人はjeして害を及ぼすかもしれません。東は不利であり、西は長いので、新しい休憩を取得するために働き始めないでください。あなたが人々をうまく作るなら、あなたは大きな利益を得るでしょう。','あなたが知性にあるならば、仏は避けることができます。他の人との仕事を促進するには、まず人のしっかりした心を数えなければなりません。山の鳥は失われ、彼らは巣を見つけることができないので、彼らは正しい方向に行くために正直でなければなりません。','2025-03-02 11:59:28.019773+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (493,'053','当時、私たちは醜いと出会いましたが、明るい風に会います。 Tigadeマップを後悔することで、領土の高さを拡大します。他の人と議論しない場合、それは仕事なしでスムーズに解決されます。','左のドアのために利益を見る時が来ました。富を見つけて派遣すると、多くの利益が予想外に表示されます。時間が選ばれ、運の運が広まります。今回お見逃しなく、それはあなたを助けます。','ドアで利益を見る時が来ました。乾いたドラゴンが空に高く上昇するようなものなので、大きな人を見るようなものです。損失は消え、祝福は戻ってきて、私を助けるためのエネルギーはいつも私のそばにあります。','利益はどこですか、それは西と北でなければなりません。あなたがあなたの仕事を終えるために心に留めておくなら、あなたは利益を上げるでしょう。結果でない場合は、子供がいるか、家族を増やします。予想外に成功しています。','銃器でいっぱいになるのは幸運です。私は空が高いドラゴンのようですので、大きな人を見るようなものです。損失は消え、祝福は戻ってきて、私を助けるためのエネルギーはいつも私のそばにあります。','利益がどこにも来ても、私たちは一日にたくさんのお金を得るでしょう。役人は私を去るのをどのようにして助けてくれますか？それは滑らかで風が強いので、100の果物が漏れと運の運の誓いになります。','災害に注意してください。他の人と議論することは、最初から発生する解決策なしに終わるでしょう。しかし、富は首の周りにあるため、富を得ることに障害はありません。ただし、他の人と戦わないように注意してください。','他人の仕事を受け入れて苦しむのは簡単です。他の人のために機能しない場合、あなたは他の人にだまされます。あなたが間違った人を作るならば、あなたは人々と良い関係を作ることができるはずです。','やりたいのですが、思ったように落ちません。新しい水は不快なので、富を救いたいとしても、ベルトとしては得られません。噴水を維持せずに貪欲なら、あなたがプレイした仕事を達成することは困難です。','あなたは幸せでなければなりません。これを行うと、達成できます。羊と音が調和しているので、すべてのものが活発になります。あなたが幸せになるので注意してください。','家族が成長し、錆が拡大するにつれて、祝福とリムは金持ちになるので、私たちは他の人のvy望を受け取ります。アルコールの近くで飲まないでください。 Gusul -Sooが首の周りに来る場合、しばらく逃げることは困難です。利益は西と北にあり、うまく終了する必要があります。','魚とドラゴンは水を手に入れているので、ついに積極的に開発されたことは幸運です。南は不利なので、走らないでください。あなたが成熟した仕事が得意でない場合、それは達成されません。今月の幸運は、Gusul -Sooに注意する方法に注意しなければなりません。','春の庭のある明るく明るい道です。開始作業は半分と半分でなければなりません。受精に近づかないでください。 Gusulsuは分割されています。画分を維持し、群衆を維持するのが最善です。','2025-03-02 11:59:29.931658+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (494,'054','章に走ると、春の風が春のそよ風を揺さぶります。春の風が地球上にあるので、放射された花は花で満たされます。たくさんの水がある水でいっぱいなので、山のグラインダーはとても美しいので美しいです。','ティティマップの共鳴を得ると、私の名前は人として揺さぶります。それは喜びに満ちているので、心と体は楽しくて和解しています。どこにいても富があるので、私たちはついにそれを達成します。私はデバイスに本当に幸運です。','女性の言葉を信じないでください。器用さがなければなりません。女性は男性の言葉を信じていません。家族の人々が集まっているので、家族の財産は毎日発展します。楽しいものがドアに到達したので、富を集めるのは山のように見えます。','春の庭で花とオヤットの花をコピーして咲いて咲いています。春の庭園が満開になると、明るさと蝶が形を変えたり、形を外れたりしています。','ウォーターゴーストは水中にあるので、水に行かないでください。水のために、あなたはすぐに驚くでしょう。まだ串がありますが、南は豊かな映画に夢中になるガイドです。自宅に斜面があるので、映画はそこにあります。','人々と議論しないでください。それは富と名誉によって損なわれます。損害賠償が必要です。家は快適なので、世界は平和です。ギルホはドアにいるので、輝かしい貴重なガイドです。','6人が明るい夜に彼らがお互いを落ち着かせるのを助けます。災害が消えて祝福が消えると、家族は平和で快適になります。災害は引き渡されるべきです。上部と下部が互いに和解するにつれて、家族の財産は毎日発展します。','あなたが後悔していないなら、あなたは必ず子供を持っているか、あなたの家族を増やすでしょう。弓のような春の色を持っているので、それは快適な関係を満たすための愚かなガイドです。富はドアの上にあるので、あなたは一日にお金を得ることができます。','東と北の両方で、役人は左側に私を助けてくれるので、新しい仕事を求めても大丈夫です。グースが雲の外の澄んだ空を飛んだとき、この喜びもそうではありませんか？斜面でなければ、財産を持つのは楽しいでしょう。','遠く離れないでください。私は器用さを恐れています。有害であることは有害なので、家を維持し、噴水を維持してください。外に出ることは禁じられています。北に近い。害も利益もありません。しかし、座ってはいけません。','家族が私を助けてくれるので、私の希望はうまく働くことができます。道路の真ん中に醜い何かがあるので、注意して、あなたがしていることをしてください。あなたが家にいるなら、あなたは心がたくさんあり、あなたが他の場所に出かけるならば、あなたはどこにでも注意する必要があります。','仏教戦争で祈ると、ugい変化し、長くなります。富から利益があり、それらはすべて長いので、人生はさらに増加します。入ったら、それを始めることができます。また、あなたの心を他の場所に置くことで環境を変えることが望ましいです。','他に何を見つけたいですか？噴水を維持し、快適に暮らすなら、あなたは確かです。あなたが人々が得意でないなら、それは有害であるので、あなたは信仰と不必要な関係として人々に対処することができないはずです。','2025-03-02 11:59:32.518647+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (495,'055','のどが渇いたドラゴンは水を得るので、それは世界を救い、さまざまな生活を気遣うようなものです。道路はドアにあるので、ずさんな仕事がなければなりません。私が浮かせたいと思った新しいカルマはありませんが、それは自己作品になる運です。一方、あなたは器用さに出会うか、あなたの配偶者を心配するかもしれません。数秒であれば、ステータスにある場合は正しいことを得ることができます。あなたが前進したいとき、あなたはあなたを助けますので、あなたがその力でやりたいことを達成してください。厚い秋の月に人々がお互いに苦労するにつれて、彼らはあなたを愛し、尊敬するでしょう。必ずお会いして西に行きましょう。','良い斜面がドアの上にあるので、あなたは家族を達成したり、素晴らしい仕事を達成したりすることに恵まれます。政府は、コロンと呼ばれるほど自信があります。これが同じでない場合、あなたはきっとその子供を産むか、新しいボールを増やします。','政府は手と同じくらい高くなるので、あなたは快適な場所で平和を作ることができるでしょう。どこにでも入って出口を出しますので、どこにでも所定の位置に落ちます。北は幸運であり、富は忙しくありませんが、忙しくなく、静かに観察します。','富は体が異なるため、予期せぬ富を得るでしょう。家族は平和になるので、それは実現します。北は長いので、北に行きます。仕事で忙しくしないでくださいが、最初と終わりについて考えてください。','心と体は喜んで、あなたは広まってしまうでしょう。富と権利があるので、それはあなたが見ることができる明確な花のようなものです。北または南に行くと、真ん中に利益が得られ、仕事をより成功させることができます。','私は家の運に会ったので喜びに会います。この庭の花が一晩満開になっているように見える天気を見ることができます。利点は水の中にあるので、必ず水と手のひらを参照してください。','もともと、心は正直なので、回復を得ることができます。ダメージはあなたが牛や果物に触れる水の中にあるので、それに注意してください。家に別れを告げて、100のことは豪華になります。','松の木を植えたので、何百もの鳥が飛んで家を見つけるので、私たちは幸せになります。他の人に大きなダメージを与えないでください。','家の中のすべての人々は平和で幸せで幸せです。家族の運が日々発展するにつれて、それに応じてすべてが行われます。幸いなことに、あなたがあなたに会えば、あなたの人生は平和になり、あなたは感謝するでしょう。','Myeongwolと誰もが長いので、彼らは自由になります。どうしてそんなに高く、名前が高いのですか？私は一人一人を見上げます。それは多くの権利と多くの権利のようなものです。','ギルソングが体を追いかけるので、勾配が守られます。希望があり、その希望を達成するための水がないので、あなたは幸せを感じることができません。再会と運が装備されているので、ゴールデンゴールドを蓄積します。','あなたは幸運に出会い、広く共鳴するでしょう。家には斜面があるので、悲しみに喜びがあります。あなたが間違った人を作るならば、怒るのは難しいでしょうので、あなたは退屈な人を作り、信仰と信仰によってそれを扱わなければなりません。','Wind Nuriの高畑に200の穀物があるので、それは良い収穫になります。あなたが他の人と心を持っているので、あなたの財産と利益は大きくなり、あなたはたくさんのお金を得るでしょう。西に行くと、後悔することができるので、仕事を終えるのに良いことをしてください。','2025-03-02 12:00:56.28372+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (496,'056','私はGapwoo Foxを避け、Tigerの尾を再び踏みました。この沼地は、天と地の腎に頼ることではありません。あなたが一生懸命働いていても、気分が良くなるにつれて心を倒すことはできません。さらに、不利であるため、運のだけで過ごすのは簡単です。','道を去った人は荒れた山道に会うことだったので、苦しみを避けることは困難です。怒りで富を得ないでください。仕事は幸せであり、気分を害するかもしれません。それはダンジョンを海から救おうとするイメージなので、あなたはそれを手に入れることができません。','心と体はとても自由であるため、世界は雲ほど幸せではありません。家の中に傾きがあるので、私は散らばっていて、うまくいきません。失敗する可能性があるので、親しい友人に注意してください。','忍は不利なので、最終的に交通機関のような人々に会うでしょう。受精に近づかないでください。 Huangを見るのは難しいでしょう。すべてに対処することが最善です。虎はtrapにいるので、それがどれほど勇気があっても。','それは常に滑らかで、毎年風が強いので、すべての人が自分の快適さを楽しむでしょう。富の後に首が続いているので、あなたはそれを後悔し、あなたは多くを得るでしょう。しかし、雨の近くにいる場合、あなたは比較的親relativeになります。','低い人が上司を克服することである場合、家は不快で有害になりますが、あなたがうまく耐えて調和しようとすると、それは明るく長くなります。急いでいる場合は、迅速に行動することができます。','私には心がありますが、それを実装する方法はないので、まだ困難で解決されていません。しかし、もう少し長く待つなら、あなたは運の機会があり、最終的に祝福された人生を送ることができます。プロパティは空中にあるため、大きなバイアスが表示されます。','仕事が合わないので、私は心配して心配することはできません。私は一生懸命働いているか、努力の価格ほどではありませんが、ごめんなさい。うまくいかないので心がたくさんあります。それでも、あなたがあなたの心を落ち着かせて一生懸命生きるなら、あなたはあなたの運を変えるでしょう。','受精に近づかないでください。三次数があるため、脱出することは困難です。あなたは多くのダメージを与えることができるかもしれないので、あなたはそれから離れる必要があります。器用さがない場合は、注意してください。','必須はドアの名前なので、家には不安があります。あなたの財産に注意してください。家を維持することが最善です。ドアの外の人々に注意する必要があります。心を伝えてはいけません。','空で雨が降ると、乾燥した食べ物とともに成長し始めます。どこにいても富があるので、あなたのスキルは満足します。そうでない場合、家族は心配します。富を集めるために一生懸命働きます。','Gusulsuがあるので、私はどこでも話を聞くでしょう。家には多くの苦情があるので、風は止まらない。この場合、分数を維持する必要があります。どうして息子のジェとガスルをフォローしないのですか？すべてに感謝し、静かに保管してください。','富を外に救おうとしないでください。なぜあなたは避け続けるのですか？心から試してみると、わずかな利益を得ることができます。動くと運が変わるかもしれませんが、環境を変えても大丈夫です。','2025-03-02 12:00:58.556774+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (497,'057','とにかく、とにかく、それは人に傷つけられている不利な運です。一言で言えば、運は不利なので、良いことがあればすぐに馬を手に入れるでしょう。意味がありますが、達成するのは簡単ではないので、これをどのように行いますか？太陽はすでにソーサンにありますが、私はステップがわからないので、イライラします。頭は小さく、体は弱いので、手に入れるのは難しいです。山を渡って海を渡るために、あなたはあなたの言うことを知るでしょう。ラッキーは醜く、名前は醜いので、富がぼやけていても、武器は困難です。あなたが遠くに行くなら、それは利益を得ないので、それはそれに最適な場所です。','それは雲の外側の孤独な体だからです。家族はトリガーされているので、家族は心配します。あなたはすべてをうまく取らなければなりません。','遠い男が咲き、香りは新しくて美しいですが、どうして幸せではないのですか？これはソチョンにあるので、仕事を終えるときはうまくやらなければなりません。受精に近づくと、それは有害になり、従います。','プロパティは空中に表示されるため、豊かになっても手に入れることは困難です。家にはタフネスがあるので、あなたは心配して不幸なので、自分を慰めなければなりません。長い場合でも、それを手に入れるのに大きな方法ではありません。','生地の共鳴は、人々がそれをあまりにも崇拝します。誰もがそれを見ます。 Son Jae -Sooは、人々のデートを慎重で誠実に追いかけます。あなたはどこにでもいるので、どうして平和ではないでしょうか？確かに、良いことがあります。','奇妙な場所や自由な場所に行かないでください。ハンは恐れています。私は安定性について考えるのに一年かかります。嫌いなことをしないでください。仕事がそのままやるのは難しいので、蹴るのが最善です。','水と火に気をつけてください。私は黄suが親relativeであるのではないかと心配しています。正直に言うとそれをしなければなりません。受精に近づいた場合、あなたは利益を上げないので、他の人と戦わないでください。このようでない場合、分割されているため、処理することは困難です。','残念ながら、東方向と北方向の両方で、名前が名前が付けられ始めるのは心配です。東、西、南を見ると、この孤独に頼る場所はありません。親relativeや手がいない。間違っている場合は、足を分けられる可能性があります。','ドアの外に出ないでください。予期しない液体が来れば、扱うのは簡単ではありません。器用さがあるので、すべてに注意し、慎重に見てください。あなたが人々が得意でないなら、あなたは不吉であるので、あなたは常に信仰として扱われるべきではありません。','最初に移動しないでください。 Huangは比較的親relativeになるので、噴水を維持し、受動的に行動する必要があります。ルーキーは好ましくないので、他の人の仕事を簡単に手に入れるのは簡単です。あなたの健康を維持してください。一度、私は一度心配するので、ギルに反します。','心には多くの大変な仕事がありますが、長い道のりがあります。それまでの間、それはリードの尺度です。あなたが東に来たら、あなたは敵になりますので、新しいことをしようとしているときは寒い言葉に陥らないでください。悲惨なものに近づくと、器用さを避けることは困難です。','陰陽は調和していないため、カップル間で調和することは困難です。あなたはあなたの誠実さをうまく保つ必要があります。小さな富があるので、あなたはそれを手に入れることができます。スパイ行為を収集してくださいので、注意してください。手紙の運は最初は醜く、その後もずっとそうですので、我慢する必要があります。','富はありますが、得られたものは醜いので、あなたが得たものを冷やさないでください。あなたが人を間違っているなら、あなたは間違いなくお金を失うでしょう。仕事には仕事がないので、世界はつかの間と同じです。','2025-03-02 12:01:01.382826+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (498,'058','ミツバチは春の庭の日差しで満たされているので、春と蝶は春のようなものです。今年の運は良いので、傾斜します。傾向がない場合は、宣誓を修正したり、新しいことを実行したりすることができます。今年の初めから、これなしでは簡単に解決されます。あなたは自分がしていることに注意する必要があります。長い道のりを動かすと、自分がすることをする前に失敗するのは簡単です。動かなければ、醜いかもしれないので、環境を変えたり、座席を動かしたりすることをお勧めします。小さなものは大きくなるので、ますます繁栄します。二人の心が一人になり、仕事をしようとします。それがポジションである場合、それはGamcheonになります。','上下は和解し、家は平和で平和になります。上下の調和はTaepyeongの基礎です。ブルードラゴンはヨウイジュを噛んでいるので、あなたは良い恋人や良い恋人を学ぶことができます。このようでなければ、子孫は傾いています。','運が消え、祝福が戻ってくると、すべてのものが楽しむのが楽しいでしょう。噴水を維持し、快適に落ち着くと、力は自分で転がります。希望はそのまま満たされるので、あなたは大きな富を得ることができます。','それがReacefでない場合、私は結婚するか、恋人に会います。団結はあなたの体に従うので、あなたは大きな富を得るでしょう。これは、人をよく購入し、その数に注意するチャンスです。','小さなものが行き、大きなものが戻ってくるので、私は弧を描きました、そして、大きな山は部屋のようです。それは恵みを引き起こし、商業的な位置を引き起こす運であるため、金持ちは地球のない土地を飲み込むことと変わりません。 Unsungがドアにいるので、それは運です。','雲がぼやけて月が現れると、天と地は遠く離れているので、道路は明るく見えます。幸いなことに、あなたがノーブルに出会えば、映画はそれ以上の5倍になります。家は平和で快適なので、これより良いものはありますか？','過去に支払わないと、過去に斜面があります。どこにいても、誤ってトランスミッションを取得するので、それは敗北のようなものです。どこにでも富があり、100日ごとに長いです。','あなたには多くの権利があるので、人々は見上げて賞賛しています。道はドアにあるので、家に斜面があるので喜んで喜んでいます。そうでない場合、子孫は金持ちで喜んでいます。','できるだけ早く仕事を宣伝する必要があります。あなたが多すぎると、あなたは不利です。それが得意ではない人からは有害である可能性があるため、注意してください。陰と陽はきっと傾いているでしょう。','空は祝福されているので、あなたは幸運にも100のことを達成することができます。この祝福は人々を上手にするのに良いことなので、あなたは集まって巨大になります。希望は希望によって行われるので、世界は平和です。','あなたがあなたの心を正しくして、あなたがそれが得意であるならば、あなたの力は入ります。あなたが他の人と調和して生きて富を得るならば、すべてが同時に行われます。今月の運は、ガスルに注意して、他人の受精について心配するべきではありません。','まるで春の庭で花が満開になっているかのように、すべてが最終的に開いています。私は予想外の喜びを持っています。下に斜面があるので、家は活力に満ちています。これも喜びです。','ソチョンには長さがあるので、北から豊かさを確実に得るでしょう。良い仕上げをしてください。私の心は快適で快適です。他の言葉を聞かないでください。これは物事を行うために行われません。','2025-03-02 12:01:03.018739+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (499,'059','空は崩壊し、仕事は逆さまになります。輸送は不利なので、毎日繁栄はなく、富が続きます。私は心配するのを止めません。良いことのために、事態は起こります。しかし、あなたが自分の意味を掘って金を手に入れるならば、あなたはついに怒って快適さを楽しむでしょう。家に斜面がない場合、あなたは家で心配するでしょう。巣にオイルがなく、ランプを明らかにできないように、運は不利であり、私は仕事をすることができません。村人が海を扱うので、誰が新しいパートナーを知っていますか？山に行き、祈ってあなたを許してください。兵士が最終的に意味を達成するとすぐに、それは誰を倒して生地を形成する運になります。','家には不安があるので、親を獲得するのは簡単です。これが同じでなければ、それは他の富に続く不吉な運です。','あなたが道に行くと、あなたは不利になるので、あなたは怪我をします。実数があるので、泥棒に注意してください。私が持っているものを止めるのは簡単です。不安があります。','私の心は親relativeなので、私は家にいません。それまでの間、私は誤って近くにいる人を傷つけます。私は頭を持っていますが、私は尾を持っているので、あなたは何をしますか？','私は家の人々と調和することはできないので、私は心を過ごします。仕事を終えると、背中以上のものが失われます。癌に行って祈ると、事前に液体を止めることができます。あなたがあなたの心と体をきれいにして祈るならば、この数は避けられます。','新しい仕事を始めるとき、私は快適になり、快適になります。第一に、それは醜く、背中は長いです。途中で作業をやめようとすると、害があり、近くの人に受精する可能性があります。しかし、あなたがそれを取るなら、私は害を逃れます。','6月、ダンキュンは生き残ります。どこにも正しい人はいません。そして、邪悪な者は不吉な運を避けるために事前に液体を防ぐのに良い場所です。あなたは心からの心を持っていますが、忍耐強いです。過剰摂取と蹴りは、液体を防ぐクリープになります。今日の良いことは明日祝福されます。','あなたが富を切望しているなら、あなたがどんなに望んでもそれを手に入れることはありません。それが良いことであるかのように起こることは何もありません。ドラゴンは川の浅いので、どこで調和がつくでしょうか？幸運をフォローできないのでイライラします。走ることは控えてください。','月は雲の中にあり、ワシを吸うことができません。器用さは、スタートと終了なしで毎日有害になります。家では、不安だけが家にいるので、家の人々が浮かぶでしょう。これ以上、私を守ってください。','私は怒っていて、ついに快適です。南に行くと、富があります。あなたが行くなら、あなたはあなたが得るものを手に入れます。あなたが良い人に会うなら、あなたは高貴になり、予期せぬ富を得るでしょう。完全に計画がある場合は、自信を持って追求してみてください。','あなたが新しい仕事を始めるとき、あなたは富を持ち、あなたはたくさん得るでしょう。忍は平和なので、銃器は振り向いて家の中で安定します。作業を完了する前に、新しいことに挑戦しないでください。リスクがあります。気をつけて。','Unsungは空気に出会ったので、Sonjaeは分割されます。家に痛みがあるかもしれないので、ボールを与えてサンシンに祈ると、完成を止めることができます。噴水を切望しないでください。あなたが圧倒されている場合、あなたは損傷を受けます。正当化ではないことを警戒してください。','あなたが他の人のことを切望しているなら、あなたはあなたの心を傷つけるでしょう。あなたが他の人や心を傷つけないなら、私たちは部門に縛られます。あなたの家の仕事を他の人に話さないでください。誰もがガスルスーに巻き込まれることができます。','2025-03-02 12:01:05.389675+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (500,'060','富と権利があるので、あなたはあなたの周りの人々から賞賛され、尊敬されます。ヘビの肉が海から出ると、楽器は陽です。あなたが親しい人と仲良くするなら、あなたは彼らが貴族になるので助けられます。それは、すべての望ましいもので達成され、自由に働くことが幸運です。義は豊かであるため、富は豊富です。私たちが多くの正義を収穫するので、私たちは多くの富を集め、明日には良いでしょう。祝福されて、私はこれに満足しています。北東の部屋の幽霊が私を助けてくれます。馬が現れると、愛国心が愛国的なものが言葉に来ているかのように流れるので、私は多くの成果を上げて話します。','まるで肉とドラゴンが水に出会ったかのように。太陽が慰められ、仕事がスムーズに進行するにつれて、その日までに支払われます。富がいっぱいであるため、家は平和であり、慰めは継承されており、抑制されているか、蜂蜜の王です。あなたが出会うすべてのものは喜びです。','純粋な風でボートを手に入れると、快適な千人に行きます。運がないので、このビジネスは繁栄しますが、親しい人に害を及ぼす可能性があるので、読むことは避けてください。そうでない場合、それは圧倒的です。喜びの種は家にあります。','あなたがノーブルに会うなら、あなたは大きな助けを得るでしょう、そしてそれは確かに成功するでしょう。誰もがどこでもあなたの名前を伝え、名前は輝きます。家は傾斜し、喜びは家で満たされます。あなたがいつも祝福を与えるなら、あなたは祝福を加えます。','私は畑で自分自身を楽しんでいます。尋ねるように頼むことなく、あなたがあなたに手に入れるのは幸運です。あなたが東に入って出口を出て、あなたは慎重になります。','富がいっぱいなので、それは快適で平和です。多くの富があるので、心は毎日快適です。のどが渇いたドラゴンは水を得るので、それは強いです。しかし、他の誰かを信じて、発疹をするのは良くありません。あなたが満足しているなら、それを手に入れるのは素晴らしいことです。','イライラする息苦しいものがありますが、飛んでも飛ぶことができないことはイライラします。ラッキーは良くありませんが、富の濡れは避けられます。口論しないでください。あなたがそれを我慢できないなら、あなたはより大きなポイントに苦しむでしょう。','あなたの人生はしっかりしているので、あなたは何をしたいですか？私は自分の仕事を見せられず、私の体は疲れます。あなたが富に頼っていれば、たとえそれを手に入れようとしたとしても、それはぼやけてしまうだけです。まず、それは長く、私たちは醜いです。','体が朝と夕方の間に遊んでいるので楽しいでしょう。幸いなことに、私は高貴な人に会い、私の人生は平和になります。道路が守られるので、醜いものが変更されます。体が体に続くと、名前はどこでも高く、多くの人が見上げます。','多くの点で、それは中央の中央の真ん中を明らかにするルールです。困難なことには長い時間があるので、ついに長い大金があります。富は東にあるので、彼らは偶然来て、仕事は成功します。','豊富さは雨の中できれいになります。ラッキーは快適で、私は快適です。それは富でやるのがやや難しいかもしれない財産です。しかし、あなたがあなたの心を作るなら、あなたはあなたの体に寛大で豊富な人を持つことができます。','私は明るいことを幸運に思うでしょう。人々は見上げているので、あなたがあなたがしていることに良い心を持っているなら、あなたは祝福されます。あなたが意味を作り、人々と対処すれば、あなたの名前は高くなり、あなたの力は山のように蓄積します。','家庭の心が一緒に団結している場合、それは意味のあるものであり、良いことが調和のとれた家族に良いことがもたらされます。 Myeongsanに行って、十分な心で祈ると、あなたはぼやけて、道がぼやけます。','2025-03-02 12:01:07.588665+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (501,'061','1つの梅の花が花芽に爆発しました。あなたを大いに助ける人々がいるので、あなたはあなたの願いを満たすことができません。運は遠いので、春の風はどこでも調和しますが、多くの富を得れば、あなたが得るほどではなく、それを失うでしょう。超越は長く、後ろで醜いので、すべてに注意してください。利益は反対側にあるので、旅行すると利益が得られます。春で、外は小さいです。 PungnyeonはGangnamで喜んでいるので、すべてが満たされているので、春のそよ風は同じです。春に花をコピーし、秋には菊が出会ったので、不安と喜びは逆です。村の口の軸は月であり、睡眠のようなものです。','それは自由または自由に取得されていません。富はありますが、まるで手にあるかのようになるので、日はありません。やることはたくさんありますが、失敗しません。スムーズになりたくない。','ドアを南に出た場合、疲れていても成功します。あなたがしていることにそれを適用することで宣伝することは良いことです。頭は川からの川なので、たくさんの豊かさを得ることができます。良いスタートと終わり。','地面を動かすのは安全なので、遅らせないでください。できない場合は、環境を変更できます。南は最も長い方向です。あなたはあなたが新しいことをしなかったことを続けているべきです。 3月と4月に富を保持しないでください。','多くの場所で仕事を得ることは困難ですが、それを達成することは困難です。環境を動かしたり変更したりしない場合は、お互いに議論します。受精に近づくと、年はそれほど多くないので、最初に避けることが最善です。','間違った人を作ると、太陽は狂ってしまいます。曲を閉じないでください。最後に、負けるのは簡単です。今月の運には多くのugさと長さがほとんどないので、秘跡をとると扱うのは難しいでしょう。','あなたが離れて遠くに行くと、利益は水から来ます。水に関連するのは目です。あなたが周りにいるなら長い時間があるので、今回は見逃してはいけません。あなたがやりたい希望は脱落し、落ちるでしょう。','それは共有に関係している人々を助けるので、読者を読むなら、それは長くなるでしょう。遠くまで旅行するように注意してください。むしろ、私はただ家にいることはできません。期待が多すぎると危険なシグナルです。あなたは病気があることを恐れているので、あなたの健康に注意してください。','月の外では、収益は明るい窓に来て私を助けてくれたので、救おうとせずに座っていなくても、私は自分の大きな富を得るでしょう。あなたが私を助けてくれる人なら、それは人々と忠実な関係のためです。','噴水を維持するための最良の方法です。あなたが認識が弱く、あなたの心を書くことができない場合、あなたの仕事はねじれます。あなたが圧倒されていないなら、あなたはあなたの心をきれいにする機会があります。','あなたが一緒に働いていることを知ることができます。作業は複雑な場合があるため、Gusulに注意する必要があります。忍も不均一ですが、シンウーンはどうですか？賢明に対処することが重要です。','すべてが多くのものを失い、たくさんの水を持っていますが、あなたが家にいるなら、それは長いです。新しい仕事を求めずに大通りを維持したいと思います。これは西側なので、作業をうまく終えてください。今月の幸運は半分ですので、噴水を維持してください。','Ilshinは彼自身に満足しているので、それはすべて繁栄するものになるでしょうか？どうやって手でお金を覚ますのですか？そうでない場合、あなたは自分の家族によって下がる可能性が低くなります。','2025-03-02 12:01:09.94595+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (502,'062','腐敗を切望したり、腐敗と調整したりすると、歌を開発できる場合があります。北朝鮮と韓国に行くと、あなたがしていることをすることができます。仕事に行って大成功を収めたときを知る必要があります。ラッキーは希望に満ちているので、あなたが動くなら、あなたは多くの利益を持っています。さらに、人生は平和であるため、すべてが達成されます。今年の交通機関は不利なので、目を引くことはないように注意してください。鳥がONGトラップに戻ると、名前は家を修理する方法であるかのようにどこにでも広がっています。白い絵が咲くので、千人に光があります。','楽器はヤンヤンだからうらやましいことはありません。新しい人は出会い、互いに働きますので、富を手に入れたいなら、それを手に入れることができます。上部と下部が平和であるため、身体と心は快適です。まるで白い花が彼らの前に咲いたかのようです。','東と西に行かないでください。それを言うのは非常に難しいでしょう。心の真ん中にわからないという不安があるので、人類の歴史を見ることができません。川から休憩を求めるようなものです。あなたの心を洗練し、それを認識することをお勧めします。','ムードスロープが必要です。喜びが発生するとすぐに、体はヨークのドアに反射され、体は消えます。ただし、西と北は長く、東と南は長いことに注意してください。結果と価格は良好になりますが、開始して回答するときは注意してください。','受精に近づかないでください。太陽があるかどうかを判断することはできません。富は外にあるので、外出すると富が得られます。あなたが外で働くために目を向けると、あなたは収入を得るでしょう。エイプリルムーンは風の南で風が吹いているので、空には長い道のりがあります。','一度戦うのは簡単です。今月は南と東に行かないでください。私は湾になるのではないかと心配しています。多くの認識がありますが、なぜあなたは理解していますか？理解を求める前に受精を避けてください。','進捗を測定できないため、エピソードを区別することはできません。問題は、親しい人を信じるかどうかです。しかし、あなたがそれを間違っていると信じているなら、器用さはあまりありません。東と西に向かわないでください。','魚とドラゴンは水を得るので、活気は何百倍も増加し、勇気は急上昇しています。どうして水の中で肉をたどらないのですか？あなたが静かに長くて強いなら、あなたは幸運を維持するために会って維持するために知恵が必要です。','家族はついに空にいるので、すべてのものが楽しむでしょう。あなたが人々が得意でないなら、それは有害です。しかし、体は強く、富は強いので、家族はテピュオンを楽しむでしょう。','東と南に行かないでください。その害はそれほどではありません。開始して働くのは危険です。 Shin -sooが予期しない10であるため、急いで仕事をしすぎないようにしてください。','それは富が活発で、体が満たされるときです。統合があるので注意してください。秘跡には多くの時間が必要なので、分数を維持し、快適に暮らすと利益が得られます。あなたが不当になる準備ができていれば、あなたはあなたの祝福を傷つけることができるでしょう。','和解エネルギーは世帯でいっぱいです。あなたが後部でなければ、あなたは確かに家に傾いているでしょう。それは調和がとれているので、1つの家が祝福に出会うようです。斜面と傷が作られると、家族が調和している場合は困難ですが、注意してください。','貴族は来て、お互いを助けてくれるので、あなたは予想外の成功を収めるでしょう。人類に注意している場合は、器用されずにヘルプに接続できます。 Unsungがドアの上にあるので、力が入り、満足します。','2025-03-02 12:01:11.925655+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (503,'063','私たちは米を見つけようとしているので、生と死を判断することは困難です。太陽は明るくなく、雲は注目に値したため、長い運を期待することは不可能です。今年の運を切望しないでください。損傷しているにもかかわらず、損失はありません。さらに、1つの場所に移動し、恵まれないことなく離れることをお待ちしております。それは、干ばつの中で3年間揺れ動くかのように、衰退と途方もない墓のようなものです。涙を嘆き、彼らのルッキングを嘆き、良いことが起こるという幸運なので、これは異性との友好的な関係です。','気分が心配になるので注意してください。富はありますが、富を集めることは困難です。しかし、あなたが貴族に会った場合、あなたは覆われる可能性があり、あなたはあなたの心配を振り払うことができます。','体が他方の世界のヒョンスクを区別することは困難です。貴族は互いに助け合い、利益がどこでも得られることを確認し、彼らが彼らの富を見つけた場合、彼らは得られます。しかし、他のように、私は方向性を知りません。','私の体は快適で、私の心と体が晴れているので、私は幸せではありません。それは南部に現れ、互いに現れて協力します。私たちが一生懸命進んでいるときに助けが得られます。あなたが後退して自分自身を捧げないなら、それは長いに違いありません。','孤独な月はハァッの真ん中に浮かび、千を反映しています。あなたが運が良ければ、最初に、そして醜いので、注意してください。彫像だけでなく、それが続きます。孤独を非常に認識することは賢明ではありません。','それを手に入れた後でさえ得ることがたくさんあるので、これはどうですか。安定すると、新しいものに移ることができるので、振る舞うべきではありません。東部の富は最終的に不利益を変えます。私が最初に得たのは無限です。','世界は夢のようなものなので、私はお互いを去ります。手紙は遠い場所から来て、それは孤独な賞であり、慎重に家に戻ることになります。兄弟がお互いに別れた場合、災害が発生するので、私たちはお互いを和解させようとしなければなりません。','その位置はドアにあるため、人間のために成功します。隣人からのみ富を得ることができます。あなたが受精に近づいているなら、あなたはそれを後悔するでしょうので、事前に注意してください。良い関係には祝福がありますが、注意する必要があります。','あなたが人々を信じないなら、害があるので、注意してください。あなたが正しいことを維持すれば、あなたは移動して何か他のことをすることができます。 ugさは長さに変わるので注意してください。','世帯が和解していないので、それは良いことであっても、降りるのは簡単です。器用さがあるので、物事を失わないように常に注意してください。今月の運には多くのugさと長さがほとんどないので、先に進むと、物事と心を失うかもしれません。注意が最高です。','古い弾丸は不利なので、あなたが住んでいるなら、それは長くなります。それ以外の場合は、環境を変更したり、所定の位置に移動したりする場合があります。新しいものを探すこともできます。白雪姫が天と地を覆っている場合、それは小さいですが、富を得る機会があります。建物には太陽があり、土地は有益です。','ガスルスーは分割されているので注意してください。あなたが名前を持っていないなら、それは大きな運です。そうでない場合は、新しいリクルートがいる可能性があることに注意してください。あなたの名前が吹き飛ばされた場合、あなたはそれに賢く対処することができます。','貴族がドアに来るとき、それは気分でなければなりません。富の光はドアにあるので、富を見つけた場合、それは得られます。今年の運は噴水を維持するのが最善です。それからあなたは貴族に会い、助けを得なければなりません。','2025-03-02 12:01:14.067338+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (504,'064','空を伝えるために橋の下に座ってください。もう少し長くなりますが、名前だけがあり、現実はありません。仕事に努力を加えると、豊かさが得られますが、肉が水を失うので肉は快適になります。それはまったくアクティブではない財産です。努力と比較して得られる小さなものがあり、私が望むものは作られません。私は不利な財産で働き始めて以来、私は望むだけ少ない果物を持っています。今年の運はあなたの欲望に注意しなければなりません。あなたはあなたの両親を心配しているかもしれません。病気は産卵しないかもしれず、決定に従うことができ、その人の近くにいる人は傷つけられて傷ついているかもしれません。私の心は不安で、富はありませんので、私は知らない痛みに苦しむでしょう。','私は適切なタイミングで働き始めることができないので、不運を経験したいです。ボンの後に花を見つけたらどうしますか？私たちが働いていたほどボールはないので、それはハァッです。私は高い宣誓書を持っていて失敗するので、私は心配します。','考えて考えようとすることは達成するのが難しいですが、他の人をあまりにも一生懸命信じないでください。あなたが親しい人に依存しているなら、あなたはあなたの富と名誉を傷つけるでしょう。シンウーンは不利なので、誓うことを避けるためにすべてに注意してください。','他の人と議論しないでください。歌があるのではないかと心配しています。睡眠は大きなものに広がる可能性があります。そうでない場合、ポイントが侵略される可能性があります。それは対人関係にugいを含んでいるので、譲歩するのは長いです。 2回勝つことを恐れているので、勝つことは荷物を獲得してカバーするのが難しいので、勝つのは良いことです。','南には長さがあるので、そこで豊かになります。私は自分の仕事に恵まれますので、豊かになります。幸運が月になったので、私は多くの力を持っています。富がドアの上にあるので、私は幸運になり、私が望んでいたものを手に入れたいと思います。','元の回復はないので、達成することはできません。ギルンは続かないので、それをやろうとするたびに多くの力があります。さまざまな計画が実行されますが、それらは取得されません。女性が男性を呼ぶとき、彼は秘密の仕事に会うでしょう。','ギルは交互にあり、うまくいく仕事は途中で失敗し、あなたはあなたがしたようにそれをすることができません。私は自分の心を変えて大きなことを変えることにしましたが、時々私は興奮します。あなたが病気でない場合、あなたは追跡されます。','シンウーンは不幸なので、すべての余地はありません。私には心がありますが、一人で達成することはできません。  あなたがそれを売るならば、あなたはお金を失い、文書に害を及ぼすでしょう。努力がありますが、ボールはそれほど見ません。','家に苦情があるので、私は確かに悪い宣誓に従います。痛みがない場合、それらは受精し、互いに口論され、再フォローされます。曲に参加しない方が良いです。最初に、それは醜くて醜いです。','私は小さなものを見つけようとしましたが、私は予想外の大きなことを得ました。それは私たちが望んでいて意味のあるものを作ったことで達成され、私たちの体と心の両方が平和でした。運が強いので後悔します。常にあなたの体と心のために努力してください。','それはugい占いで管理されているため、ビジネスを受け取ることは困難です。他の人と仕事をしようとすると、確実に失敗してお金を失います。同じでない場合、施設は分割されます。','あなたがしていることをやめて、何か新しいことをしようとしないでください。それから私はSwearwordsに会います。あなたが他の場所に行くなら、太陽があるので、外に出て家でやったことをやろうと熱心にしないでください。あなたはあなたの富を失う可能性があるので、泥棒に注意してください。','他の人と仕事をすると、時間がかかります。醜い仕事をするよりも、他の人と協力する方が良いです。ただし、人々が現れて新しい関係を築くことを知らない場合は、注意してください。今年、人々を作るための誓いの言葉があるので、私たちは利益と害を区別することができます。','2025-03-02 12:02:31.749318+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (505,'065','たくさんの蜂蜜が地面に飛んでおり、大きな鷹が翼にあります。時間を失う仕事には協力があります。私は自分の仕事の前で長い道のりを歩むべきではありません。私たちは心配し、喜びはぼやけます。ただし、通知を嘆かないでください。しかし、もしあなたがそれをリードするなら、超越は難しいですが、それは長く遅れています。不利であるにもかかわらず、仕事は良くありません。これは、成功が繰り返されているからです。また、他の人を信じないでください。外側では、彼らは親切ですが、内なる心は悪に満ちています。しかし、先祖は喜びをもたらしたので、今年の後半には不安が喜んでおり、富は活発であり、ハリケーンがあります。超越と中ラックがやや不利であっても、信念を克服すれば、確かに運がよければ。','私は山に行き、肉を探します。決定される場所はないので、西に解決できる場合です。それは新しいビジネスであった不利な財産ですが、それはどこでも終わりではなく、結果を達成していません。','マルナの木が秋に出会うことを誰が知っていますか？不利な輸送では、家族はますます不安定になり、病気を作るためには、それが発生する輸送です。体と心の両方が揺れていないことは無関心です。あなたが誠実に祈るなら、あなたはこの運から抜け出すでしょう。','心配する必要はないので、風を達成できません。家にはタフネスがあるので、私は快適に感じることができません。あなたが家を出て、あなたの心を落ち着かせるために出かけると、別の水が潜んでいます。外部から利益を得るものは何もないので、あなたの家を維持する方が良いです。','富は偶然に起こったことに来ます。水中で利益を見つけようとすると、醜いでしょう。しかし、あなたが望むことを達成しようとしたとしても、あなたは利益が不足しているかもしれません。','それは仕事の混乱であり、明るい月は予想外です。腐敗の豊富なことに気をつけてください。あなたがそれを切望しているなら、あなたは水に来るでしょう。仕事には不運があります。良いことはちょっとした失敗です。途中で、私は富を失う不運に従います。','癌に行き、ケアを祈ります。そうでなければ、私は家の中で病気に苦しむでしょう。この命を閉じて駐車した城を駐車すると、きっと富を得るでしょう。政府が活性化されているため、遠い場所に出発しない方が良いです。途中で、私は富を失う不運に従います。','軸は鶏の鳥が霜に出会うようなものなので、私は自分の体と心に満足していません。私がしたことは肝臓のようではありませんが、私は喜びに満ちていません。遠い場所に行くのは不利です。噴水を維持し、心と体を整理するのは良いことです。あなたはすべてがあなたの心の中にあることを知っている必要があります。','急いで仕事をすることはないので、結果を達成できません。しかし、あなたが新しいことをしようとするなら、私はそれをすることはできません。良い結果を片側に期待するのは良いことです。しかし、結果は最初と比較して予想よりも少ないです。','それは素晴らしい意味を持っていますが、結果は良くないので、私は犬を描いてフィールドを描きます。北に来る牛は偶然に起こります。しかし、新しいビジネスを始めるとき、私たちは富が希望に満ちていることを願っています。','太陽はソーサンで失われるので、帰り道で失われます。仕事がなく、水がないので、あなたが器用さでなければ、あなたは怒っているでしょう。','発表の日が過ぎて道路が戻ってきたとき、制服がなければなりません。陰と量は互いに組み合わされています。それがどんなに困難になっても、私たちは安全に通過します。富は非常に強いので心配が消えてしまいます。私は確かに幸運です。あなたの目的のために走ってください。','他人を信じないでください。あなたが他の人を信じて他の人を信じるなら、あなたは非常に有害になります。それは百のことなので、私は心を持っているので、私はそれを試して達成しますが、私は一生懸命働いたほど持っていません。あなたが家にいるなら、それは長くなり、あなたは有害になります。','2025-03-02 12:02:33.536145+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (506,'066','それは海の風と同じくらい孤独な孤独な毒のようなものです。しかし、不公平なことのためにそれを達成しようとすると、それは有害です。それが静かな天と地で垂れ下がっているので、誰が人間の世界でその孤独の重さを量るでしょうか？新しい意志で仕事を達成しようとするなら、私たちは長くなります。友達と先輩を閉じてください。それから私はそれを長くします。しかし、メイン色に近づくと、後悔するでしょう。今年の運は大変な成功した運であり、犬がさまよう犬は月を逃しています。病気は比較的親relativeである可能性があり、超越が有益であるため、この病気への恐怖があります。北に注意するのは特に良いことです。他の人の背後にある祝福は、彼らが答えるときに胸のように戻ってくるからです。','新しい水が良くないため、他の場所に移動しようとしても、液体を避けることは困難です。また、親しい人からうらやましいことは有害です。あなたが家で心配していないなら、あなたはあなたの親やあなたの両親の液体に熱心になります。','十分な意識がないので、すべてに満足することはありません。私は達成したいと思っていますが、液体を超えているので、達成することは困難です。あなたは何をしたいですか？他の人のために失うものがあるので、一緒に働かないでください。','心配する必要はないので、バーを達成できません。家にはタフネスがあるので、私は快適に感じることができません。あなたが家を出て、あなたの心を落ち着かせるために出かけると、別の水が潜んでいます。外部から利益を得るものは何もないので、あなたの家を維持する方が良いです。','富は偶然に起こったことに来ます。水中で利益を見つけようとすると、醜いでしょう。しかし、あなたが望むことを達成しようとしたとしても、あなたは利益が不足しているかもしれません。','私は幸運を抱えて新しいビジネスをしようとしていますが、私は再びそれを心配しています。私は達成するために大きなことを切望します。それはあなたが小さなことをして、あなた自身の部屋を作りたいことを意味します。富はぼやけて雲のようになっているので、後悔の使用は何ですか？','それは、月が吹くにつれて運を打ち負かし、明るい光を見つけるのが難しい幸運です。他の人を信じないでください。私たちはお互いにうらやましくなり、心を傷つけ、富で口論します。あなたの恋人に近づくのは良くありません。あなたがそれを壊すと、病気はあなたの体にぶつかります。','口を重くして人を作ってください。これを行うと、建設を避けることは困難です。メイン色に近づくと、器用さがあるので、他の人を失い、後悔します。譲歩し、デートに耐える方が良いです。プレイまたは施肥することができます。','人々が集まり、お互いを助けるために集まっているのは世界の歴史です。水のために心配しません。事前にアプローチして祈る方が良いです。','南と北には欠点があるので、行かないでください。私は自分が欲しかったことを達成できません。しかし、西側には富があるので、そこに行くと少し手に入れるでしょう。家には醜い水があるので、事前にミオンサンに行くと、それを避けることができます。','私はそれを達成するために私の心を思いつきますが、私は世界でのみ一緒に働きます。器用さがなければ、あなたは家を心配しており、あなたの配偶者が来ることができます。しかし、もしあなたがそれをするなら、それは来るのは甘いことです。突然報酬があるので、ついに繁栄を見てみましょう。','精神が活性化されるので、水と火に注意してください。南と北に行かないでください。私はあまり収入を得ません。自分で仕事をして仕事をしていると、少し利益を得て避けることができます。','雪が積まれている場所で葉をどのように揚げることができますか？私は自分の心だけで自分の仕事を達成することはできません。あなたが遠い場所に行くならば、あなたはハンを恐れるべきではありません。希望なしに所定の位置に保つことは幸運なことです。','2025-03-02 12:02:36.066446+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (507,'067','Pro -Day Pro -Dayは、6月の暑い日に高い精子に横たわっているように見える幸運です。雲のような懸念が逃げるので、それはどのように必須の生地ですか？私は東で楽しい時間に会い、花のように咲きます。私は考えていなかったので成功していたので成功するので、私はどこでも私の富と私の名前を見てうれしいです。ただし、このように電力を供給していない場合は、それを見ることができ、廊下を着ることができます。ナスと赤い耳のいずれかが光を吐き出し、肉が春の日差しの下で池で遊んでいます。仕事が意味されているように、天のキャラクターは滑らかで活気に満ちています。','新年には、道を拭いているかのように心を清め、祈らなければなりません。ボールがあるので、祈りの長さが見えます。病気があるので、不安を得るのは簡単で、女性の言葉には収入がないので、聞かないでください。','噴水を保ち、欲望を取り除くと、空はあなたを祝福します。あなたが家にいるなら、不安があるので、あなたが動き回るなら、あなたは良いかもしれません。あなたが生まれていない場合、あなたは過剰生産され、あなたは名前になります。珍しいことに従わないでください。私は大いに後悔します。','他の人の話を聞かないでください。その年はあまりありません。あなたは予想外に名前になるので、あなたが一生懸命働くなら、あなたの財産は寛大になります。しかし、たとえあなたが富を集めても、時にはあなたが従うでしょう。','豊富な布地は豊富であるため、家庭での良い交通機関であり、家族は実生活の下で傾斜しているため、暖かさと和解に満ちています。あなたが女性に近づくならば、あなたは祝福され、水が来るでしょう、そしてあなたは名誉によって傷つけられます。','あなたが家にいるなら、不安があるかもしれないので、それを避けてしばらく出かけてください。私は自分の内部と外部のものを調和させることはできません、そして私は仕事をするでしょう。 huangsuがあるので、周りの大小のことに注意し、注意することは正しいです。','土星を閉じてください。あなたが節約した利益を得ることができます。しかし、あなたが木星に近い場合は害があるので、留まる方が良いです。実数があるので、祈るなら、それを避けることができます。これが同じでない場合は、兄弟から分離する必要があります。','仕事をプッシュするのではなく、少し戻ることは有益です。力が家に入ると、心配がぼやけ、喜びが咲きます。親しい人には注意してください。私が信じていた誰かに害を受けることができて幸運です。','たとえあなたが十分な富を持っているとしても、あなたが不注意にそれを失った場合、何の用途は何ですか？他の人の話を聞かないでください。あなたはあなたの富を失うことができるかもしれません。親しい人は、そのまま働き、仕事をし、それから後悔することだと思います。','ギルソングはドアにいるので、斜面がある必要があります。ギルンはすでに入ってきたので、彼は私を助けてくれます。北に行く。そこには富があるので、もしあなたが行くなら、私はたくさん得るでしょう。西側にも利益があるので、北西に行くのに良いことがあります。','家で幸運を祈りますので、意識は豊富で、あなたの心は快適です。予期せぬ富を得るにつれて、私たちは巨大で文書を持っているので、私たちは貴族の助けから利益を得ます。豊かな再開が豊富であるため、これはどのようにスムーズになりますか？','家庭の中心が集まっているので、どうして私たちは感銘を受けませんか？富は空から降りてくるので、富は激しくなります。ただし、遠く離れた場合、不足が発生するため、少量の液体が潜んでいます。したがって、この月の運は半分です。','100のことが彼らのように行くならば、あなたは他に何をしたいですか？私は噴水を保ち、私は一日の真ん中にいるので、私は現れて私を助けます。私は自分の願いを達成し、私の願いを達成します。富は商取引であるため、それは私を豊かにします。','2025-03-02 12:02:38.055333+00','j');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (508,'068','プロ日本の昇天に戻ってくる人は太陽だからです。今年は、忙しくて背の高い体がウンインと出会うので、壊れた物語の後、私は喜びになります。初期の頃、それは不利な財産であり、真ん中の真ん中で、私は高貴な人に会い、ついに幸せなものを見て、大きなことを達成するために小さなことを蓄積しました。しかし、他の人との闘いや寛大さを殺すことを避けることは、損傷することはありません。ミッドラックは体と心のように見えます。しかし、液体をはるかに超えて進行している作業は間違っている可能性があり、太陽が雲によって隠されているかのように登場したことが液体に変わる可能性があります。あなたの体と心をきれいにして、ミョンサンに行き、祈ります。','私はそれが高く、私の心が寛大だから成功します。ただし、多くの水がある可能性があるため、事前に停止する必要があります。政府が活性化されているため、遠くに行くのは良くありません。','女性を閉じないでください。液体を駆動することで傷つけることができます。これが同じでなければ、私は家の中でめまいになります。また、モールに近づくことは不利です。私は病気になるのが怖いからです。','さまざまなことから利益はないので、後悔するべきではありません。あなたがビジネスを始めるなら、それは不利な運です。あなたが東に移動すると、あなたは繁栄し、他の人の話を聞かないでしょう。私が望んでいたのはねじれていることを願っています、そして、私は協力だけを感じるでしょう。','外出するのは良くないので、あなたの家であなたを助けたいです。私が望んでいたものは、予期しない水のために東と西を区別するのが難しいかもしれません。私は家に不安しかないので、どうすれば快適に感じることができますか？','それは他者の関係においてやや意味があり、それが富につながります。家には液体があるので、南に祈る必要があります。ただし、beatられている場合は、家の他の液体を避けます。','他の人と仕事をするのは良くありません。遠くに行くのは不利なので、家を出ないでください。他の人と話すことができて幸運なので、自分自身を主張する前に他の人の心を測定する必要があります。あなたがあなたの仕事の間違った部分を持っているなら、あなたが受精しているならあなたは不利です。','さまようエネルギーマージンの体と心は堅実で孤独になります。富を救おうとしていますが、苦労するようなものはありません。ヨギがドアに到達したので、事前に注意して液体を避けてください。','受精に近づかないでください。曲で勝つことができない大金です。思っていたよりも大きな損失を失います。器用さがあるので、空室に慎重で軽薄な行動を示す必要があります。光を動かすと怒ってしまいます。','それはまるで船体に残されているかのように孤独な体になります。あなたは近くの人から傷つけられなければならないので、あなたはそれを後悔するだけです。 9月と10月には、土地は有益であるため、それに関連することをすることをお勧めします。','私は3つのことをしたいと思っています。そうすれば、あなたはきっと豊かになり、あなたの家族は寛大になります。南に行かないでください。それは不利であり、それが機能したことを簡単に行うことができます。手書き番号がない場合は、Huangで一度驚かれることになります。','私は自分の足で畑の尾を踏んで、心配に喜びを感じるでしょう。北部には利益があるので、そこに行くと長くなります。忍は最初は良くありませんが、背中に長いです。 UGと長さはあなたの心に依存します。','何百ものことはスムーズで、問題なく行います。あなたはいつも忙しいので、忙しい船に喜びと勇気があります。','2025-03-02 12:02:40.059328+00','j');
